var book = {
	"name": "မၭၥုၫ",
	"numChapters": 28,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> လံၬယ့ၫရှူၬဎရံၬ အဆၨၩအထံၭ, စဒၫဝံၭအဖိၪ",
			"2": "<sup>2</sup> ခွၫ,စအၫဘြဟၫ့ အဖိၪခွၫလီၫ.- စအၫဘြဟၫ့ ထၪ့ ဖိၪစအံစၭတၭ, စအံစၭနီၪ ထၪ့ဖိၪစယၫကူၭတၭ, စယၫကူၭနီၪ ထၪ့ဖိၪစယုဒၫ ဒဲအထၧၫ့ဖုဝဲလဖၪး",
			"3": "<sup>3</sup> စယုဒၫနီၪထၪ့ဖိၪ စဖၫရ့ၭ ဒဲစဇၫရၫ လၧနးတၫမၫတၭး စဖၫရ့ၭနီၪထၪ့ဖိၪစဟ့ၭဇရၧၫ့တၭ, စဟ့ၭဇ",
			"4": "<sup>4</sup> ရၧၫ့နီၪထၪ့ဖိၪစရၫ့တၭ,- စရၫ့နီၪ ထၪ့ဖိၪ စအမံနဒၭ တၭးစအမံနဒၭ နီၪထၪ့ဖိၪစနၫၡိၫ့တၭ, စနၫၡိၫ့နီၪထၪ့",
			"5": "<sup>5</sup> ဖိၪစစၫလမၧၫ့ တၭ,- စစၫလမၧၫ့ နီၪထၪ့ဖိၪစဘိအၭ လၧနးရၫဟၭတၭ, စဘိအၭနီၪထၪ့ဖိၪ စအိဘ့ၭလၧ",
			"6": "<sup>6</sup> နးရုၥၭတၭ,- စအိဘ့ၭနီၪထၪ့ဖိၪ စယ့ၭစံၫတၭ, စယ့ၭစံၫနီၪထၪ့ဖိၪစဒၫဝံၭစဎွၩလဂၩနီၪလီၫ. စဒၫ ဝံၭနီၪထၪ့ဖိၪစစီလမၧၫ့ လၧစယုၫရဲအၫ အမၫ",
			"7": "<sup>7</sup> နီၪ,- စစီလမၧၫ့နီၪထၪ့ဖိၪစရံဟဘိအၫ့တၭ,စရံဟ ဘိအၫ့နီၪထၪ့ဖိၪစအဘဲယၫတၭ,စအဘဲယၫနီၪထၪ့",
			"8": "<sup>8</sup> ဖိၪစအၫစၫတၭ,- စအၫစၫနီၪထၪ့ဖိၪ စယဟီၡဖၭတၭ, စယဟီၡဖၭနီၪထၪ့ဖိၪစယိရၫ့တၭ, စယိရၫ့နီၪထၪ့ဖိၪ",
			"9": "<sup>9</sup> စအၧၭဇဲအၫတၭ,-စအၧၭဇဲအၫနီၪ ထၪ့ဖိၪ စယိ ၥၫ့တၭ,စယိၥၫ့နီၪထၪ့ဖိၪစအၫဟဇၭတၭ,စအၫဟ",
			"10": "<sup>10</sup> ဇၭနီၪထၪ့ဖိၪစဟ့ၭစကဲအၫတၭ,-စဟ့ၭစကဲအၫနီၪ ထၪ့ဖိၪစမနၭစ့ၫတၭ, စမနၭစ့ၫနီၪထၪ့ဖိၪစအၫမၧၫ့",
			"11": "<sup>11</sup> တၭ,စအၫမၧၫ့နီၪထၪ့ဖိၪစယိၫစဲအၫတၭ,- စယိၫစဲအၫ နီၪထီးဆၧထဲၩ့ဆိၬ လၧဘၭဘလၧၫ့ အထီနီၪ,",
			"12": "<sup>12</sup> ထၪ့ဖိၪစယ့ၫကနဲအၫ ဒဲအထၧၫ့ဖုဝဲၥံၪလီၫ.- ဆၧထဲၩ့ ဆိၬလၧဘၭဘလၧၫ့ အလးခဲၫ့နီၪ, စယ့ၫကနဲအၫ ထၪ့ဖိၪစလၫၥအ့လၭတၭ,စလၫၥအ့လၭနီၪထၪ့ဖိၪ",
			"13": "<sup>13</sup> ဇရၧၭဘၫဘ့လၭတၭ,- စရၧၭဘၫဘ့လၭနီၪထၪ့ဖိၪ စအဘဲဟၧၭတၭ, စအဘဲဟၧၭနီၪထၪ့ဖိၪ စအံၫလဲအ ကံၫ့တၭ, စအံၫလဲအကံၫ့နီၪထၪ့ဖိၪ စအၫဇီၫတၭ,",
			"14": "<sup>14</sup> စအၫဇီၫနီၪ ထၪ့ဖိၪစဇၫဒီၭ တၭ, စဇၫဒီၭနီၪထၪ့ဖိၪ စအၫကံၫ့တၭ, စအၫကံၫ့နီၪထၪ့ဖိၪစအံၫလဲအၧၭတၭ,",
			"15": "<sup>15</sup> စအံၫလဲအၧၭနီၪထၪ့ဖိၪ စအံၫလအ့ဇၫတၭ, စအံၫလ အ့ဇၫနီၪထၪ့ဖိၪစမၭၥၫ့တၭ, စမၭၥၫ့နီၪထၪ့ဖိၪ စယၫ",
			"16": "<sup>16</sup> ကူၭတၭ,-စယၫကူၭနီၪထၪ့ဖိၪစယိၥၭ,နးမၫရံၫအ ဝၩ,ၦမုၪလၧအအီၪဖျဲၪန့ ယ့ၫရှူၬ, လၧဆၧကိၭဝ့ၫ ဎရံၬ လီၫ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭ, လၧစအၫဘြဟၫ့ထီၩ့လၩ့လၧ စဒၫဝံၭနီၪအဆိၩအကၠၪထီးအလူၬ အီၪဝ့ၫလဆံၫ လံ ဆိၩး လၧစဒၫဝံၭနီၪထီၩ့လၩ့ လၧဆၧထဲၩ့ဆိၬဝ့ၫလၧ ဘၭဘလၧၫ့, အီၪဝ့ၫ လဆံၫလံဆိၩး လၧဆၧထဲၩ့ဆိၬ ဝ့ၫလၧ ဘၭဘလၧၫ့ထီၩ့လၩ့လၧ ဎရံၬနီၪအီၪဝ့ၫလဆံၫ လံဆိၩ လီၫ.",
			"18": "<sup>18</sup> ယ့ၫရှူၬဎရံၬအီၪဖျဲၪဝ့ၫနီၪမၩအၥၭဘဲၫယီၩ,အမိ နးမၫရံၫ ဘၪအဲၪတၩ့လိၬယူၭအၥၭ လၧစယိၥၭတၭ, ဘိၩ့အလချႃၭ အီၪဎုၬဒံၭဘၪနီၪ, ဆၧဖျီၪထၪ့ လၧအ",
			"19": "<sup>19</sup> ဒၧၩ့ထၪ့ဝ့ၫလၧၥၭမုဆံၫ့ဎံၪလီၫ.- အဝၩစယိၥၭနီၪမွဲၦ အတီၩအလီၩ့တၭ, မိမၩဂၭဂီၩ့ဖျီၪဘၪအၥၭလၧ အလၩအဖၩ့အ့ၬ. အၥၭအီၪလၧ အမိမၩလၩ့ၡၪ ၥူၪဝ့ၫလီၫ.",
			"20": "<sup>20</sup> အဝ့ၫဒၪကိၪ့ထၪ့ဖၭလၩ့ ဆၧနီၪလဖၪ အဘိၩ့ဘၭ တၭ,ယိခွါ,ကဆါအၥီၫ့လဂၩမၩဖျီၪထၪ့အၥၭလၧ အမ့ၬယၫ လၧဆၧမံၫမးအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, စဒၫ ဝံၭအဖိၪခွၫစယိၥၭဧ့,နမၩန့နမၫနးမၫရံၫနီၪ,ထီးအၪ့ ယိၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩဆၧလၧအဒၧၩ့ထၪ့န့ဝ့ၫ",
			"21": "<sup>21</sup> နီၪ, မွဲအအီၪထၪ့လၧၥၭမုဆံၫ့ဎံၪလီၫ.- အဝ့ၫဒၪမိအီၪ ဖျဲၪန့အဖိၪခွၫတၭ, နမိဘၪဖျိၬအမံၩ့ ယ့ၫရှူၬလီၫ. အဂဲးဘဲၫယီၩ မွဲအမိမၩဖီၩ့ မၩဖျ့ၭအခ့ၫအၡၩၥံၪလၧ အဆၧဒဲၭဘၭလီၫ.",
			"22": "<sup>22</sup> ဆၧနီၪလဖၪထီးအလူၬ မၩအၥၭဘဲၫၥိၭ ကဆါအ လူအထၫ လၧမီၪလဂၩနီၪ, မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ.",
			"23": "<sup>23</sup> စံၭဝ့ၫဒၪ, ယိခွါ,ၦမုၪနၩ့နးဂၩမိဒၧၩ့ထၪ့, ဒဲမိအီၪဖျဲၪန့အဖိၪခွၫတၭ, ဆၧမိဖျိၬအမံၩ့အမၫ့နုၫအ့လၭ, ဘဲၫပစံၭဆၧအၥိၭ, ယွၩအီၪလၧပၥိၭ လီၫ.",
			"24": "<sup>24</sup> စယိၥၭမံၫဝ့ၫနၪ့ထၪ့အၥၭတၭ, မၩဝ့ၫဘဲၫကဆါအ",
			"25": "<sup>25</sup> ၥီၫ့မၪလူၬဝဲၩဝ့ၫအၥိၭတၭ, မၩန့အမၫလီၫ.- ဘိၩ့အ လချႃၭအီၪဖျဲၪန့ဒံၭဘၪအဖိၪခွၫဝဲၡါနီၪ လၥ့ၪယၫဘၪ ဝ့ၫတၭး ဖျိၬဝ့ၫအမံၩ့ ယ့ၫရှူၬ နီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ယ့ၫရှူၬအီၪဖျဲၪဝ့ၫ လၧဘ့ၭၥလံၫဟံၫ့ လၧခးယုဒၫ အဖၧၩ့နီၪ, လၧစဎွၩဟ့ရၧၭအမုနံၩလဖၪတၭ, ယိခွါ, ၦမၫကူၭၥံၪအီၪ လၧမုထၪ့လခီၫဂဲၫထီၩ့လၧယရုစ",
			"2": "<sup>2</sup> လံၫ့တၭ,-စံၭဝ့ၫဒၪ,ၦအီၪဖျဲၪဝ့ၫ, ၦယုဒၫဖိၪ အစဎွၩ လဂၩနီၪ, မွဲအအီၪခီၫခီၫလဲၪ. အဂဲးဘဲၫယီၩပအီၪလၧ မုထၪ့လခီၫနီၪပဒၪဘၪယူၭ အၡၪ လဖျိၪ့တၭ, ပဂဲၫ",
			"3": "<sup>3</sup> ယူၭ ဘဲၫပမိဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫ အၥိၭနီၪလီၫ.- စဎွၩ ဟ့ရၧၭနါဂၧၫ့ဝ့ၫတၭ, အၥုၪ့ခိအၥၭခိဒဲၦ ယရုစလံၫ့",
			"4": "<sup>4</sup> ဖိၪထၧၫ့ဒိၩ့ယၫ အၥၭခိဆ့လီၫ.- အဝ့ၫနီၪ ဒုၭအီၪ ကိၩ့အီၪကီၪ့ၦလုဆၧအဒိၪ ဒဲၦခမျၧး အၡၩကွ့ၭလံၬ ၥံၪတၭ,အၪ့စၪ့ဝ့ၫ, ဆၧလၧဎရံၬနီၪ မွဲအအီၪဖျဲၪဝ့ၫ",
			"5": "<sup>5</sup> ခီၫခီၫလဲၪ.- အဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫ, လၧဒိၩ့ဘ့ၭၥလံၫ ဟံၫ့လၧခးယုဒၫအဖၧၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩဆၧ ကွ့ၭအၥၭလၧမီၪလဂၩဘဲၫယီၩ,",
			"6": "<sup>6</sup> တၭနဝ့ၫဒၪ, ဘ့ၭၥလံၫဟံၫ့,ခးယုဒၫဧ့, နမွဲလၩလါအဆံၭထုၬ လၧခးယုဒၫအခိၪလဖၪအ ကျၩနီၪအ့ၬ. အဂဲးဘဲၫယီၩဆၧအခိၪ,လၧအမိယိ ယၡၩခမျၧး အံၫစရ့လၭနီၪ,မိဂဲၫထၪ့လၧနဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> ထီးနီၪလဖၧၫ့စဟ့ရၧၭကိၭၥူၪၦမၫကူၭၥံၪတၭ,ၡၪ နီၪမွဲအအီၪဖျီၪဝ့ၫ ဆံၭယံၬယူၭလဲၪနီၪ, အၪ့စၪ့ဝ့ၫလၩ့",
			"8": "<sup>8</sup> ထံးလၩ့ဆ့ၭတၭ,- အၪ့မၧၫ့အလ့ၩထီၩ့လၧ ဘ့ၭၥလံၫ ဟံၫ့အဖၧၩ့နီၪ, စံၭဝ့ၫဒၪ, လ့ၩအၪ့စၪ့ဆၧလၩ့ထံးလၩ့ ဆ့ၭလၧဖိၪၥၪနီၪအဂဲးဆံၭး နၥံၪအ့ၪဒၪဘၪဝ့ၫနီၪ, ဘဲၫ ယမိလ့ၩဆ့ဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫအၥိၭတၭ, ဂဲၫထဲၩ့",
			"9": "<sup>9</sup> လီၩဘၪယၧၩဆံၭ.- အဝ့ၫၥံၪနါဂၧၫ့စဎွၩ အလူနီၪ, စဲၪ့ ထၪ့ခွံၬဝ့ၫဒၪလီၫ. ယိခွါ,ၡၪလၧအဒၪဘၪဝ့ၫလၧမု ထၪ့လခီၫလဖျိၪ့နီၪ, လ့ၩဝ့ၫလၧအမ့ၬယၫထီးအဂဲၫအီၪ",
			"10": "<sup>10</sup> ပထုၬထီးဖိၪၥၪအီၪဝ့ၫ အလးအဖၫ့ခိၪနီၪလီၫ.-အဝ့ၫ ၥံၪဒၪဘၪၡၪလဖျိၪ့နီၪ, အၥုၪ့ထိၬအၥၭထိၬလၧဆၧၥၭ",
			"11": "<sup>11</sup> ထိၬဒိၪဒိၪလ့ၬလီၫ.- အဝ့ၫၥံၪ လ့ၩနုၬဝ့ၫလၧဂံၪ့ဖၧၩ့နီၪ, ဒၪဘၪဖိၪၥၪဒဲအမိနးမၫရံၫတၭ, ထွံၩလၩ့ဘၩထၪ့ဖိၪ ၥၪနီၪ,ဝဲထၪ့အဆၧလူဒိၪဎွ့ၩဒိၪတၭ,မၩဘိၪ့ဖိၪၥၪ",
			"12": "<sup>12</sup> လၧထီၫ့ဒဲလီဘၫ့ဒဲမူရၫ့လီၫ.- ဆၧၥီၪ့ထဲၩ့အဝ့ၫၥံၪလၧ ဆၧမံၫမးအဖၧၩ့ ဘဲၫၥိၭအထီးထဲၩ့ကဒၩထဲၩ့လၧ စဟ့ရၧၭအအီၪလဂ့ၩတၭ, မွဲအထဲၩ့ထဲၩ့ဝ့ၫ လၧအ ထံၫအခး လၧဖၧၩ့ၥၭအဂူၫဂၩလဘီၩ့လီၫ.",
			"13": "<sup>13</sup> ထီးၦလဖၪနီၪထဲၩ့ထဲၩ့ဝ့ၫတၭ,ယိခွါ,ကဆါအၥီၫ့ လဂၩမၩဖျီၪထၪ့အၥၭလၧ စယိၥၭ အမ့ၬယၫလၧဆၧ မံၫမးအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ဂဲထုၪ့မၩန့ဖိၪၥၪဒဲအမိ တၭ,စဲၪ့ထၪ့လ့ၩနုၬလၧခးအံဇံၭအဖၧၩ့ တၭ, အီၪထီး နီၪထီးယလီၩဘၪနၧၩ ဆံၭ. အဂဲးဘဲၫယီၩ စဟ့ရၧၭ",
			"14": "<sup>14</sup> မိအၪ့ဎၬဖိၪၥၪနီၪ ဘဲၫအမိမၩၥံၫဝ့ၫ အၥိၭနီၪလီၫ.- အ ဝ့ၫဒၪဂဲထုၪ့မၩန့ဖိၪၥၪဒဲအမိ လၧမုနၩလခီၫတၭ, လ့ၩ",
			"15": "<sup>15</sup> ဝ့ၫထီၩ့လၧခးအံဇံၭအဖၧၩ့နီၪ,- အီၪဝ့ၫထီးနီၪထီးစ ဟ့ရၧၭၥံၫဝ့ၫလီၫ. ဘဲၫယွၩအလူ လၧမီၪလဂၩလီၩ ဘၪဝ့ၫနီၪ, မိလၧၫ့ထၪ့ ဎွ့ၩထၪ့ဝ့ၫအၥိၭတၭ, စံၭဝ့ၫ ဒၪယကိၭန့ယူၭ ယဖိၪခွၫလၧ ခးအံဇံၭအဖၧၩ့ယူၭ.",
			"16": "<sup>16</sup> ထီးနီၪလဖၧၫ့ထီးစဟ့ရၧၭ ဒၪဘၪလၧၦမၫကူၭၥံၪ အၪ့လီၫန့ဆၧနီၪ, အၥၭထၪ့ဝ့ၫ ဒိၪဒိၪလ့ၬတၭ, ဘဲၫ အမုအလၩဘၪ လၧအအၪ့စၪ့ ၦမၫကူၭၥံၪအဆၧလၩ့ ထံးလၩ့ဆ့ၭအၥိၭနီၪ, အၪ့မၧၫ့ၦမၩၥံၫခွံၬကယဲဖိၪၥၪ အခွၫလၧအၥၭနံၫနံၪ့ဒဲနံၫနံၪ့ အဖၫ့လၬထီးအလူၬလၧ ဘ့ၭၥလံၫဟံၫ့အဖၧၩ့, ဒဲလၧအနဲၩ့ထံၭဝၬဝၬကိၭစီၪ့",
			"17": "<sup>17</sup> ဒ့ၭအဖၧၩ့ နီၪလီၫ.- ထီးနီၪလဖၧၫ့ မီၪစယ့ၫရမဲအၫ",
			"18": "<sup>18</sup> အလူလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫတၭ,- စံၭဝ့ၫဒၪ,ဆၧအလူၥီၫ လၧရၫမၫအဖၧၩ့ဂၧၫ့ထၪ့ယူၭ, ဂၪ့ဆၧယၧၩ့ဆၧဒဲဂၪ့ကိၭၡၭ, ဒဲဂၪ့ခံးဂၪ့ကိၭအၪမၬလီၫ. နးရၫခ့လၭဂၪ့ဝ့ၫလၧအဖိၪလဖၪအကၠီၩ့, ဒိၭဆၧမၩမုၬထၪ့ထဲၩ့ဝ့ၫနီၪအၥၭလအီၪဘၪ, မွဲအဖိၪလအီၪလၧၩ့ဘၪအဂဲးလီၫ.",
			"19": "<sup>19</sup> ထီးစဟ့ရၧၭၥံၫဝ့ၫတၭ, ယိခွါ, ကဆါအၥီၫ့ လဂၩ မၩဖျီၪထၪ့အၥၭလၧ စယိၥၭအမ့ၬယၫ, လၧဆၧမံၫမး",
			"20": "<sup>20</sup> အဖၧၩ့, လၧခးအံဇံၭအဖၧၩ့နီၪ,- စံၭဝ့ၫဒၪ, ဂဲထုၪ့မၩ န့ဖိၪၥၪဒဲအမိတၭ, ထဲၩ့နုၬထဲၩ့ လၧခးအံၫစရ့လၭအ ဖၧၩ့ဆံၭး အဂဲးဘဲၫယီၩ ၦလၧအအၪ့ဎၬဖိၪၥၪအၥၭ",
			"21": "<sup>21</sup> မၧၫ့လဖၪနီၪ,ၥံၫယူၭဝ့ၫယူၭ.- အဝ့ၫဒၪဂဲထုၪ့မၩန့ ဖိၪၥၪဒဲအမိတၭ, ဂဲၫထဲၩ့ထီၩ့လၧ ခးအံၫစရ့လၭအ",
			"22": "<sup>22</sup> ဖၧၩ့နီၪလီၫ.- မွဲလါနၫ့ဘိၩ ထီးအနါဂၧၫ့လၧစအၫခံၫ လ့အၧၭပၧၩ့ဘၪဆၧ လၧခးယုဒၫအဖၧၩ့ လၧအဖါစ ဟ့ရၧၭအလးတၭ, လ့ၩစိၩဝ့ၫထီးနီၪဘုၪ့အ့ၬ, ယွၩၥီၪ့ ထဲၩ့ယူၭအဝ့ၫနီၪ လၧဆၧမံၫမးအဖၧၩ့တၭ, စဲၪ့ထၪ့",
			"23": "<sup>23</sup> ဝ့ၫထီၩ့လၧခးဂၫလလံၫအဖၧၩ့တၭ,- ဂဲၫထဲၩ့အီၪ ဝ့ၫလၧဒိၩ့ ကိၭဝ့ၫအမံၩ့နၭဇရ့ၭး ဘဲၫၥိၭမီၪလဖၪ အလူမိလၧၫ့ထၪ့ ဎွ့ၩထၪ့ဝ့ၫနီၪ,စံၭဝ့ၫဒၪ, ဆၧမိကိၭ ဝ့ၫလၧၦနၭဇရ့ၭဖိၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> မုနံၩလဖၪနီၪ, ၦဘၭတံၫဇၫ့ဆၧစယီဟၫ့လဂၩ ဂဲၫလီၩလၩ့လၬလၩ့ဆၧ လၧခးယုဒၫအမံၩ့လၬကျၩနီၪ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,နီၫ့ယါလၩ့ထဲၩ့နၥံၪအၥၭဆံၭး အဂဲးဘဲၫ",
			"3": "<sup>3</sup> ယီၩမူၭခိၪအဘၩ့အမုးနီၪဘူၭထၪ့ယူၭလီၫ.-အဂဲး ဘဲၫယီၩၦလဂၩယီၩမွဲၦလၧမီၪစအဲၫစ့ယၫချဲၩ့ဆၧ လၧအဂဲးတၭ, စံၭဝ့ၫဒၪ, ဆၧအလူၥီၫထၪ့လၧမံၩ့လၬကျၩ, တဲၩ့ဝဲၩကဆါအဖၧၩ့ၥၭနီၪဆံၭ, မၩလီၩ့အဖၧၩ့မုလဖၪနီၪဆံၭ.",
			"4": "<sup>4</sup> အဝ့ၫဒၪ,စယီဟၫ့, အကီၩ့အၥိၭ မွဲကလအူၭအ ဆီၪ့တၭ, ခဲးထူၬအယးဒံၩ့လၧခၧၩ့ယးဆၧဖံၭတၭ, အဝ့ၫဒၪအဆၧအၪ့ဆၧအီၩနီၪ, မွဲထွ့,ဒဲန့ၫမံၩ့အစၩ့ လီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ၦယရုစလံၫ့ဖိၪ ဒဲခးယုဒၫဖိၪထၧၫ့ခး ယၫ,ဒဲၦအီၪလၧယီၫဒၫ့အနဲၩ့ ထီးအလူၬနီၪ, ဂဲၫဝ့ၫ",
			"6": "<sup>6</sup> လၧအအီၪတၭ,- လီၩလၩ့အဆၧဒဲၩဘၭတၭ, ဒိၭဘၭ တံၫဇၫ့အၥၭ လၧအစူၪဖၧၩ့ ထီးယီၫဒၫ့အဖၧၩ့နီၪ",
			"7": "<sup>7</sup> လီၫ.- ထီးအဒၪဘၪ ၦဖၫရစံၫဒဲၦစၭဒုၫစံၫၥံၪ ဂဲၫဝ့ၫ အၪဂၩဘဲၫၥိၭအမိ ဒိၭဘၭတံၫဇၫ့အၥၭတၭ, အဝ့ၫနီၪ စံၭအဝ့ၫၥံၪ,ဂူအၧၩ့အဆၨၩအဆၬၥံၪဧ့, မွဲပလၫၥီၪ့ ထဲၩ့နၥံၪဘဲၫၥိၭနၥံၪမိစဲၪ့ဒၪ ဆၧၥၭထၪ့လၧအမိဂဲၫ",
			"8": "<sup>8</sup> နီၪလဂၩလဲၪ.- ဆၧနီၫ့ယါလၩ့ထဲၩ့အၥၭအဆၧၥၪ",
			"9": "<sup>9</sup> ဂ့ၩနီၪ,ၥၪဒၪခလူၬနၥံၪဝ့ၫဆံၭ.- ထီးဆီၫ့မီၪ့စံၭလၧန ၥံၪအၥၭဖၧၩ့နီၪ, စအၫဘြဟၫ့ မွဲပဖါနီၪလဂ့ၩ. အဂဲး ဘဲၫယီၩ ယစံၭနၥံၪ လၧလိးလဖၪယီၩအကျၩ,ယွၩဒုၭ",
			"10": "<sup>10</sup> ကဲၪထၪ့ဖိၪလဖၪလၧ စအၫဘြဟၫ့အဂးၥ့ၪလီၫ.- ဘိၩ့ နဲၪ့ယီၩဒၪလ့ၬ ကွၩဘၪဆၧအီၪက့ၪလၩ့ယူၭ ဝ့ၫလၧ ၥံၪ့အခၪ့ထံၭယူၭ, မၩအၥၭဘဲၫနီၪတၭ, ကယဲၥံၪ့လၧ အလၥၪဘၪလၧအဂ့ၩ ကိၭထံၭဒ့ၭနီၪ, မိဘၪဆၧခူၬ ခွံၬဝ့ၫတၭ, မိဘၪဆၧဖျႃၭလၩ့ ခွံၬဝ့ၫလၧမ့ၪဖၧၩ့လီၫ.",
			"11": "<sup>11</sup> ယဝ့ၫဒၪယီၩ, ယဘၭတံၫဇၫ့ နၥံၪလၧထံၫကျၩလၧ ဆၧနီၫ့ယါလၩ့ထဲၩ့ ၥၭအဂဲးလီၫ. အ့ၪမွဲၦဂဲၫဝ့ၫလၧ ယလးခဲၫ့လဂၩနီၪၥ့ၪနဲၪ့ယၧၩဒံၭတၭ, န့ၫယဆိၬအ ခၪ့ဖံၬနီၪယကြၨၭအ့ၬး အဝ့ၫနီၪလဂၩမိဘၭတံၫဇၫ့",
			"12": "<sup>12</sup> နၥံၪလၧၥၭမုဆံၫ့ဎံၪ, ဒဲလၧမ့ၪအဖၧၩ့လီၫ.- အ ချဲၩအီၪဝ့ၫလၧအစူၪဖၧၩ့တၭ,မိမၩဆံၫ့ခွံၬအခရဲးဂ့ၩဘၪစဲၪတၭ, မိအီၪက့ၪကီၪ့ထဲၩ့ အဘုၪၥံၪဂူၫၥံၪ လၧဖၫ့ဖၧၩ့တၭး အ့ၪမွဲလီခၫ့နီၪ, မိဆူၭထၪ့ခွံၬဝ့ၫ လၧ မ့ၪလၩ့ဖံၬလၥ့ၪဘၪလီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ယ့ၫရှူၬစဲၪ့ထၪ့ခွံၬလၧဂၫလလံၫဂဲၫ ထီၩ့လၧစယီဟၫ့အအီၪ ထီးယီၫဒၫ့အနဲၩ့, ဘဲၫၥိၭအ",
			"14": "<sup>14</sup> မိဒိၭဘၭတံၫဇၫ့ဘၪ အၥၭလၧအစူၪဖၧၩ့လီၫ.- အ့ၪမွဲ စယီဟၫ့ ချဲၩ့ထၬဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယဝ့ၫဒၪယီၩ, ယဒိၭဘၭတံၫဇၫ့ ယၥၭလၧနစူၪဖၧၩ့အလးအီၪတၭ,",
			"15": "<sup>15</sup> မွဲနဂဲၫနဝ့ၫလၧယအီၪဧၪ.- ယ့ၫရှူၬချဲၩ့ထၪ့စံၭဆၧၫ့ဝ့ၫ, ဘိၩ့နဲၪ့ယီၩ ဖ့ၪလၫ့ယၧၩဆံၭ. အဂဲးဘဲၫယီၩ ဂ့ၩပမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့ ကယဲဆၧတီၩဆၧလီၩ့ ဘဲၫနီၪအၥိၭ",
			"16": "<sup>16</sup> ထီးအလူၬလီၫ.- ထီးနီၪလဖၧၫ့တၭ,အဝ့ၫဒၪဖ့ၪ လၫ့ဝ့ၫလီၫ. ယ့ၬရှူၬဒိၭဘၭတံၫဇၫ့အၥၭဂီၩ့, စဲၪ့ထၪ့ ခွံၬလၧထံၫကျၩချဲၫ့မၬတၭ, ယိခွါ, မူၭခိၪဝဲထၪ့အ ၥၭလၧအကၠီၩ့တၭ, အဝ့ၫဒၪဘၪယွၩအၥၭမုဂဲၫ လၩ့ဘဲၫထိၪလွံအၥိၭတၭ, ဆီးလၩ့လၧအလီၩ့နီၪလီၫ.",
			"17": "<sup>17</sup> ယိခွါ,ဆၧၥီၫလၩ့လၧမူၭခိၪစံၭဝ့ၫဒၪ, အဝ့ၫဒၪလ ဂၩယီၩ,မွဲယဖိၪခွၫၥၭဘီၩ့လဂၩတၭ, မုၬယၥၭ လၧအဝ့ၫဒၪလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ၥၭမုနီၪလ့ၩၥိၫ့နုၬ ယ့ၫရှူၬလၧမံၩ့ လၬကျၩဘဲၫၥိၭအမိဘၪ ဆၧကျဲၩ့ဖစီၩ့ လၧမုၪခီၩလဲး",
			"2": "<sup>2</sup> လီၫ.- ဒုၪဆၧအၪ့ဆၧအီၩ အနံၩလံဆံၫအနၩလံဆံၫ",
			"3": "<sup>3</sup> တၭ,လၧခဲၫ့ထဲၩ့ၥၭဝံအၥၭလီၫ.- ၦကျဲၩ့ဖစီၩ့ဆၧ လဂၩဂဲၫလၧအအီၪတၭ, စံၭဝ့ၫဒၪ, နအ့ၪမွဲယွၩအ ဖိၪခွၫတၭ, ဘဲၫၥိၭ လိးလဖၪယီၩ မိကဲၪထၪ့ ကိၪအလီၪ့",
			"4": "<sup>4</sup> ၥံၪ, ချဲၩ့ထၪ့ဘီၪ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဆၧကွ့ၭအၥၭ,ၦၡၩမိမၧၫ့ဝ့ၫန့ၫလၧကိၪလမံၩ့မွဲ အ့ၬ, မွဲထီးဒၪဆၧချဲၩ့လၧအဂဲၫထၪ့ လၧယွၩအနိၭ ဖၧၩ့ကိၭထံၪဒ့ၭလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ မုၪခီၩလဲးလ့ၩၥိၫ့ဝ့ၫလၧဒိၩ့ဆံၫ့ဎံၪ အဖၧၩ့တၭ, အီၪက့ၪထၪ့ဝ့ၫ လၧဆၧလုဂံၪ့အခိၪစီၪ့နီၪ",
			"6": "<sup>6</sup> လီၫ.- စံၭဝ့ၫဒၪ, နအ့ၪမွဲယွၩအဖိၪခွၫတၭ, ခွံၬလၩ့နၥၭ ဘီၪ. အဂဲးဘဲၫယီၩ, ဆၧကွ့ၭအၥၭ, လၧဆၧမိမၪလူၬအၥီၫ့ၥံၪလၧနဂဲး, ဒဲအဝ့ၫၥံၪမိဆိၬ နၧၩလၧအစူၪလီၩ့, ဘဲၫၥိၭနခၪ့ထီးဘၪထံၭလၧလိးလဂ့ၩလီၫ.",
			"7": "<sup>7</sup> ယ့ၫရှူၬ စံၭအဝ့ၫဒၪ, ဆၧကွ့ၭဒီၭအၥၭ, ယွၩနကဆါ နီၪ, ထီးကျဲၩ့ဖစီၩ့ဘၪအဝ့ၫလဂ့ၩ.",
			"8": "<sup>8</sup> မၩဒီၭလဖၧၫ့ မုၪခီၩလဲးလ့ၩၥိၫ့ထၪ့ဝ့ၫလၧခိၪလီၩ့ ထီၫထီၫ လ့ၬလဖျိၪ့အလီၩ့တၭ, ဒုၭနဲၪဘၪဝ့ၫလၧ ကယဲဘၩ့ၥံၪမုးၥံၪလၧဂၪ့ခိၪချိၫ့ယီၩ, ဒဲအလၩအဖၩ့",
			"9": "<sup>9</sup> နီၪ,- စံၭဝ့ၫဒၪ, နအ့ၪထွံၩလၩ့ဘိၪ့ထၪ့ဘၩထၪ့ယၧၩ တၭ,ယမိဖ့ၪလၫ့နၧၩကယဲဆၧနီၪလဖၪ ထီးအလူၬ",
			"10": "<sup>10</sup> လီၫ.- ထီးနီၪလဖၧၫ့ ယ့ၫရှူၬစံၭဝ့ၫဒၪ, မုၪခီၩလဲးဧ့, စဲၪ့ထၪ့ခွံၬလၧယလးခဲၫ့ဆံၭ. အဂဲးဘဲၫယီၩ ဆၧ ကွ့ၭအၥၭ,ယွၩနကဆါနီၪ, နဘၪဘိၪ့ထၪ့ဘၩထၪ့ အဝ့ၫတၭ ,န ဘၪ မၩ န့ၫ အ ဝ့ၫ နီၪ လ ဂၩအ",
			"11": "<sup>11</sup> ဆၧလီၫ.- ထီးနီၪလဖၧၫ့ မုၪခီၩလဲးစဲၪ့ဒၪခွံၬဝ့ၫတၭး ယိခွါ, အၥီၫ့ၥံၪဂဲၫမၩအခ့ၫအၡၩအဆၧမၩလၧအဂးလီၫ.",
			"12": "<sup>12</sup> ထီးယ့ၫရှူၬနါဂၧၫ့ လၧစယီဟၫ့လၩ့ဘၪဝ့ၫလၧ ထီၫ့ဖၧၩ့တၭ,ထဲၩ့ထဲၩ့ဝ့ၫလၧဂၫလလံၫအဖၧၩ့နီၪ",
			"13": "<sup>13</sup> လီၫ.-စဲၪ့ထၪ့ခွံၬလၧနၭဇရ့ၭနီၪ, လ့ၩအီၪဝ့ၫလၧ ကပၧ နအၫ့အဖၧၩ့အီၪဘူၭလၧကွံၩ, လၧခးဇ့ၭဘလၧၫ့ဒဲခး",
			"14": "<sup>14</sup> နၭၥလဲၫအနဲၩ့ထံၭ,- ဘဲၫမီၪစအဲၫစ့ယၫအလူနီၪမိလၧၫ့",
			"15": "<sup>15</sup> ထၪ့ဎွ့ၩထၪ့ဝ့ၫအၥိၭ,- အလူနီၪစံၭဝ့ၫဒၪ. ခးဇ့ၭဘလၧၫ့, ဒဲခးနၭၥလဲၫ, လၧကွံၩနဲၩ့ထံၭ, လၧယီၫဒၫ့ဝါလခီၫ, ဂၫလလံၫဘၪဆဲၫ့ လၧၦဆၨၩလဖၪး",
			"16": "<sup>16</sup> ၦခမျၧးၥံၪလၧအဆၧၫ့နၩ့လၧဆၧခံၭကျၩနီၪ, ဒၪဘၪဝ့ၫလၧဆၧဖၩ့ဖၭဒိၪ, ဒဲၦဆၧၫ့နၩ့ လၧဆၧၥံၫအခးအလၩၡုၪအဖၧၩ့လ ဖၪနီၪ, ဆၧဖၩ့ဂဲၫထၪ့ လၧအဝ့ၫၥံၪအဂးလီၫ.",
			"17": "<sup>17</sup> လၧအဆၧၫ့အထီနီၪယ့ၫရှူၬလီၩလၩ့လၬလၩ့ ဆိၫဆၧတၭ, စံၭဝ့ၫဒၪ, နီၫ့ယါလၩ့ထဲၩ့ နၥံၪအၥၭဆံၭ. အဂဲးဘဲၫယီၩ မူၭခိၪအဘၩ့အမုးနီၪ ဘူၭထၪ့ယူၭလီၫ.",
			"18": "<sup>18</sup> ယ့ၫရှူၬလ့ၩဝ့ၫလၧကွံၩဂၫလလံၫအနဲၩ့ထံၭတၭ, ဒၪဘၪၦထၧၫ့ဖုဝဲနံၫဂၩ, စစဲမၧၫ့ကိၭဝ့ၫစပံတၧၫ ဒဲအထၧၫ့ဖုဝဲစအၫ့ဒူၫ,ခွံၬၡၬလၧကွံၩဖၧၩ့နီၪး အဂဲး",
			"19": "<sup>19</sup> ဘဲၫယီၩမွဲၦၡၩမၩယၪလီၫ.- ယ့ၫရှူၬစံၭအဝ့ၫၥံၪ, ဂဲၫဖိၬယခဲၫ့ဆံၭ, ယမိအၪ့မၧၫ့နၥံၪခွံၬၡၬ န့ၦၡၩ",
			"20": "<sup>20</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ဒၪခွံၬအၡၬချဲၫ့မၬတၭ,ဖိၬထၪ့အ",
			"21": "<sup>21</sup> ခဲၫ့လီၫ.- လ့ၩဝ့ၫဖီၩ့ခွံၬထီးနီၪတၭ,ဒၪဘၪၦထၧၫ့ ဖုဝဲအဂူၫဂၩနံၫဂၩ, စဇ့ၭဘဒံၫအဖိၪခွၫစယ့မံၭ, ဒဲအ ထၧၫ့ဖုဝဲစယီဟၫ့ အီၪလၧအဖါ စဇ့ၭဘဒံၫအၥိၭလၧ ချံၫဖၧၩ့ဆၭထဲၩ့အၡၬနီၪတၭ, အဝ့ၫဒၪကိၭန့အဝ့ၫၥံၪ",
			"22": "<sup>22</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ဒၪခွံၬအၡၬဒဲအဖါချဲၫ့မၬတၭ,ဖိၬ ထၪ့ဝ့ၫအခဲၫ့လီၫ.",
			"23": "<sup>23</sup> ယ့ၫၡုၬစဲၪ့ဝံၩ့ဝၩ့လၧဂၫလလံၫထၧၫ့ခးယၫတၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ လၧၥရိၬဖၧၩ့,ဒဲလီၩ့လၩ့လၬလၩ့ ဘၩ့မုးအဆၧၥၭထိၬအပရၧၫ့ဒဲမၩဘျၪထဲၩ့ ကယဲ ဆၧစူၭဆၧဆၫဒဲကယဲဆၧဆီၫ့ခိၬဆီၫ့ကဲၩ့ လၧၦခမျၧး",
			"24": "<sup>24</sup> အကျၩထီးအလူၬလီၫ.- အမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့လၧ စံရအၫထၧၫ့ခးယၫတၭ, ၦဂဲၫဆိၬကယဲၦလၧအမၩ လကဲၪဘၪ,ဒဲၦလၧအဘၪဆၧစူၭဆၧဆၫ, ဒဲဆၧဆီၫ့ ခိၬဆီၫ့ကဲၩ့လမံၩ့မံၩ့, ဒဲၦလၧဆၧနၪအီၪလၧအလီၩ့, ၦအဖျႃ,ဒဲၦအၥံၫလခီၫဖၩၥံၪတၭ, အဝ့ၫဒၪမၩဘျၪ",
			"25": "<sup>25</sup> ထဲၩ့အဝ့ၫၥံၪလီၫ.- ၦခမျၧးဖၭဒိၪလၧဂၫလလံၫ,ဒဲလၧ ဒကၭပိၫလံၭ, ဒဲလၧယရုစလံၫ့,ဒဲလၧယုဒၫ,ဒဲလၧယီၫ ဒၫ့ဝါလခီၫၥံၪနီၪဖိၬထၪ့အခဲၫ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ဒၪဘၪဝ့ၫလၧၦခမျၧးနီၪ, အဝ့ၫဒၪလ့ၩထၪ့ဝ့ၫလၧ ခိၪလီၩ့လဖျိၪ့အလီၩ့ဆၧၫ့နၩ့ဝ့ၫဂီၩ့တၭ, အထံၩအဖျဲ ၥံၪဂဲၫလၧအအီၪလီၫ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪအၩ့ထၪ့အနိၭတၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫၥံၪ, စံၭဝ့ၫဒၪ,",
			"3": "<sup>3</sup> ၦၥၭၡၪ့လဖၪနီၪအီၪမုၬဝ့ၫဒၪး အဂဲးဘဲၫယီၩမူၭခိၪ အဘၩ့အမုး မွဲအဝ့ၫၥံၪအဆၧလီၫ.",
			"4": "<sup>4</sup> ၦၥုၪ့ခါၥၭလၩ့လဖၪနီၪ အီၪမုၬဝ့ၫဒၪး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမိဘၪ ဆၧမၩမုၬမၩၡုၪဝ့ၫလီၫ.",
			"5": "<sup>5</sup> ၦၥၭဆၧၩ့လဖၪနီၪ အီၪမုၬဝ့ၫဒၪး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမိန့ၥၫထံၫၥံၪခးၥံၪလီၫ.",
			"6": "<sup>6</sup> ၦၥၭဝံအၥၭဒဲၥူၫအီၩအၥၭလၧ ဆၧတီၩဆၧလီၩ့လ ဖၪနီၪ အီၪမုၬဝ့ၫဒၪး အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ မိဘျဲၩအၪ့ ဘျဲၩအီၩဝ့ၫလီၫ.",
			"7": "<sup>7</sup> ၦယၫ့ၥုၪ့ယၫ့ၥၭဆၧလဖၪနီၪအီၪမုၬဝ့ၫဒၪး အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪမိဘၪ ဆၧယၫ့ၥုၪ့ယၫ့ၥၭဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ၦၥၭဆံၫ့ဎံၪလဖၪနီၪ အီၪမုၬဝ့ၫဒၪး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪ မိဒၪဘၪယွၩလီၫ.",
			"9": "<sup>9</sup> ၦမၩဘၪလိၬထဲၩ့ဆၧလဖၪနီၪ အီၪမုၬဝ့ၫဒၪး အ ဂဲးဘဲၫယီၩအဝ့ၫၥံၪ မိဘၪဆၧကိၭဝ့ၫလၧယွၩအဖိၪခွၫ ၥံၪလီၫ.",
			"10": "<sup>10</sup> ၦဘၪဆၧမၩအၧၩ့မၩနၭဝ့ၫ လၧဆၧတီၩဆၧလီၩ့ အ ကၠီၩ့လဖၪနီၪ အီၪမုၬဝ့ၫဒၪး အဂဲးဘဲၫယီၩ မူၭခိၪအ ဘၩ့အမုးမွဲအဝ့ၫၥံၪအဆၧလီၫ.",
			"11": "<sup>11</sup> ထီးၦဒုၪဒွ့ၪနၥံၪဒဲ မၩအၧၩ့မၩနၭနၥံၪတၭ, စံၭအၧၩ့ စံၭၥၫ့နၥံၪလၧဆၧကိၭမံၩ့ဒ့ၭ လတီၩဘၪလၧယကၠီၩ့",
			"12": "<sup>12</sup> တၭ,နၥံၪမိအီၪမုၬဝ့ၫဒၪလီၫ.- ၥုၪ့ထိၬၥၭထိၬ ဒဲၥုၪ့ ဎွံၫၥၭယီၫဖၭဒိၪဆံၭ. အဂဲးဘဲၫယီၩ နၥံၪအခိးအတၩ အီၪဝ့ၫလၧမူၭခိၪဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩ အၧၩ့မၩနၭမီၪလဖၪလၧနၥံၪလချႃၭအီၪဒံၭဘၪ ဘဲၫနီၪ အၥိၭဆ့လီၫ.",
			"13": "<sup>13</sup> နၥံၪဝ့ၫဒၪယီၩ နၥံၪမွဲဂၪ့ခိၪအထံၫလၪလီၫ. အ့ၪမွဲ ထံၫလၪအဂၫ့အ့ၪဘျိၪခွံၬတၭ, မွဲအမိဂၫ့ထဲၩ့ဝ့ၫလၧ ဆၧနီၪလမံၩ့လဲၪ. န့ကၩလၧၩ့ဆၧနးမံၩ့အ့ၬ. န့ကၩန့ၫ ၦခွံၬၡိၭခွံၬလၧခီၫ့တၭ, ဘၪဆၧယဲးထဲးဝ့ၫ လၧၦၡၩလီၫ.",
			"14": "<sup>14</sup> နၥံၪဝ့ၫဒၪယီၩ နၥံၪမွဲဂၪ့ခိၪအဖၩ့လီၫ. ဒိၩ့လဖျိၪ့",
			"15": "<sup>15</sup> အီၪလၧခိၪလီၩ့အဒၩ့ခိၪနီၪ ကဒုၩဝ့ၫၥ့ၪအ့ၬ.- ၦစီၩ့ထၪ့ မ့ၪဒိၩ့တၭ, အီၪက့ၪလၩ့ဝ့ၫလၧ ဒၩ့လဖျိၪ့အဖၫ့လၬနီၪ အီၪနးဂၩအ့ၬ. မွဲအအီၪက့ၪထၪ့ဝ့ၫ လၧမ့ၪဒိၩ့အ လးအဖၫ့ခိၪတၭ, ဖၩ့ထၪ့ဘၪၦအီၪ လၧဂံၪ့ဖၧၩ့ထီး အလူၬလီၫ.",
			"16": "<sup>16</sup> ဘဲၫနီၪအၥိၭလၧၦၡၩၥံၪဒၪဘၪ နၥံၪအဆၧမၩဂ့ၩ လဖၪအကၠီၩ့ မိဒုၭလၩဖၩ့နၥံၪအဖါအီၪဝ့ၫ လၧမူၭခိၪ အဖၧၩ့တၭ, နၥံၪအဆၧဖၩ့နီၪ,မွဲအဖၩ့ထၪ့ဒၪဝ့ၫ လၧအဝ့ၫၥံၪအမ့ၬယၫဆံၭ.",
			"17": "<sup>17</sup> ဆၧမၪလူၬလဖၪမွဲဂ့ၩ, မီၪၥံၪမွဲဂ့ၩတၭ, ထီးဆီၫ့မီၪ့ လၧယဂဲၫမၩဂၭဂီၩ့နီၪလဂ့ၩး ယလဂဲၫမၩဂၭဂီၩ့ ဘၪယဝ့ၫတၭ,မွဲယဂဲၫမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့လခီၫ",
			"18": "<sup>18</sup> လီၫ.- အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪတီၩတီၩယီၩ, မူၭ ခိၪဒဲဂၪ့ခိၪလချႃၭဒံၩခွံၬဒံၩဖျိၭဒံၭဘၪတၭ, လံၬ ဆၧမၪလူၬအဖျိၪ့ဆံၭလဖျိၪ့ မွဲဂ့ၩ, အနိၪ့ဖိၪလနိၪ့မွဲ ဂ့ၩ,လချႃၭလၧၫ့ထၪ့ဎွ့ၩထၪ့ဒံၭဘၪ ထီးအလူၬတၭ, မွဲအဂၭဂီၩ့ဝ့ၫအ့ၬ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ,ထီးဒၪၦလၧအလၨၪခၫ့ဖၬ ဆၧမၪလူၬ လၧအဆံၭထုၬ လၧအကျၩလထံၪနီၪ, ဒဲၥီၪ့လိၪၦၡၩဘဲၫနီၪအၥိၭလဂၩဂၩတၭ, မိဘၪဆၧ ကိၭဝ့ၫလၧအဆံၭထုၬ လၧမူၭခိၪအဘၩ့အမုးအဖၧၩ့ လီၫ.အ့ၪမွဲထီးဒၪ ၦလၧအထီးန့ဝ့ၫဒဲၥီၪ့လိၪဝ့ၫလဂၩ ဂၩနီၪ,မိဘၪဆၧကိၭဝ့ၫလၧအဒိၪ လၧမူၭခိၪအဘၩ့",
			"20": "<sup>20</sup> အမုးအဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪယီၩ, နၥံၪအဆၧတီၩဆၧလီၩ့ အ့ၪလအၪနဲၪ့ဘၪၦကွ့ၭလံၬ, ဒဲၦဖၫရစံၫၥံၪအဆၧတီၩဆၧလီၩ့တၭ, နၥံၪလ့ၩနုၬ ဘၪလၧမူၭခိၪအဘၩ့ အမုးအဖၧၩ့အ့ၬ.",
			"21": "<sup>21</sup> နၥံၪနါဂၧၫ့ယူၭလၧၦမွံၩၦၡါစံၭဝ့ၫဒၪ, ထီးမၩၥံၫၦ ၡၩလဂ့ၩး ထီးဒၪၦလၧအမၩၥံၫဝ့ၫလဂၩဂၩနီၪဂ့ၩ",
			"22": "<sup>22</sup> ဘၪဆၧစ့ၩရၫ့ခွးလီၫ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ,ယစံၭနၥံၪ ကယဲၦလၧအၥၭထၪ့အထၧၫ့ဖုဝဲပျီၩပျီၩလဂၩဂၩ နီၪ,ဂ့ၩဘၪ ဆၧစ့ၩရၫ့ခွးကိၭအဂၩဒ့ၭလီၫ. ထီးဒၪၦ လၧအစံၭအထၧၫ့ဖုဝဲ,ရၫကၫၬ လဂၩဂၩနီၪ,ကြၨၭ ဘၪဆၧလၧ ၦၥၭ ၡါအီၪကီၪ့တၭး ထီးဒၪၦလၧအစံၭ အထၧၫ့ဖုဝဲၦအဂီၩ့ဧ့ၬ လဂၩဂၩနီၪကြၨၭ ဘၪလရၬ မ့ၪလီၫ.",
			"23": "<sup>23</sup> မၩအၥၭဘဲၫနီၪတၭ,နအ့ၪလ့ၩဆိၬနဆၧဘိၪ့လၧ ဆၧလုအလးတၭ, ထီးနီၪနအ့ၪနၪ့ထၪ့ထဲၩ့ လၧနထၧၫ့",
			"24": "<sup>24</sup> ဖုဝဲ အီၪက့ၪဆၧမၪ လၧနလီၩ့လမံၩ့မံၩ့တၭ,- အီၪက့ၪ ထီနဆၧဘိၪ့ထီးနီၪလၧဆၧလုလးအမ့ၬယၫတၭ, ထဲၩ့ထဲၩ့ဆံၭ. မၩဘၪလိၬထဲၩ့ဆိၫဒၪခလူၬနၥၭလၧ နထၧၫ့ဖုဝဲနီၪတၭ, ထီးနီၪလဖၧၫ့ ဂဲၫမၩနဆၧဘိၪ့နီၪဆံၭ.",
			"25": "<sup>25</sup> နအီၪလၧဖၧၩ့ၥၭ လၧနဒုၪနဒၩအၥိၭအဘိၩ့ဘၭတၭ, မၩဘၪလိၬထဲၩ့နၥၭလၧအဝ့ၫဒၪအ့ၪချဲၫ့ဆံၭ. ဘၪ လဘၪနဒုၪနဒၩ မိဖ့ၪလၫ့ဘၪခိၬနၧၩ လၧၦစ့ၩရၫ့ခွးအ စူၪဖၧၩ့တၭ, ၦစ့ၩရၫ့ခွးနီၪမိဖ့ၪလၫ့ခွံၬနၧၩ လၧဆၧ အခိၪအစူၪဖၧၩ့တၭ, နမိလၩ့ဘၪလၧထီၫ့ဖၧၩ့လီၫ.",
			"26": "<sup>26</sup> ယလီၩဘၪနၧၩတီၩတီၩယီၩ, နလချႃၭလိၭထူၬဒံၭဘၪ ထီးလၧအထုၬလဘံၪ့နီၪ, နဂၭဖျ့ၭထၪ့ဘၪအ့ၬ.",
			"27": "<sup>27</sup> နၥံၪနါဂၧၫ့ယူၭလၧၦမွံၩၦၡါစံၭဝ့ၫဒၪ, ထီးအဲၪဘိၩ့",
			"28": "<sup>28</sup> မၫအဲၪဘိၩ့ဝၩလဂ့ၩ.- အ့ၪမွဲယဝ့ၫဒၪယီၩယစံၭန ၥံၪ,ကယဲၦလၧအယိၦမုၪလၧအၥၭလဲးၥၭဘျၪကိၭ ဂၩဒ့ၭနီၪ,မွဲအမၩမၪယူၭဆၧလၧၦမုၪနီၪလၧအၥၭ",
			"29": "<sup>29</sup> ဖၧၩ့ယူၭလီၫ.- နမ့ၬၥၪအထွ့ၪလခီၫအ့ၪမၩလၩ့ထံၩ ဖါနၧၩတၭ, အီၩ့ခွ့ၭထၪ့ခွံၬဝ့ၫတၭ,ခွံၬၡိၭခွံၬလၧနအီၪ ဆံၭ.အဂဲးဘဲၫယီၩနဂၩ့လ မံၩ့အ့ၪဂၭဂီၩ့တၭ,မွဲ အဂ့ၩနဲၪ့ဒံၭ လၧနဘၪဆၧခွံၬလၩ့နၧၩလၧလရၬဖၧၩ့ထၧၫ့ဂၩယၫ",
			"30": "<sup>30</sup> နီၪဒံၭလီၫ.- နစူၪထွ့ၪလခီၫအ့ၪမၩလၩ့ ထံၩဖါနၧၩတၭ, ဒၪ့ထ့ၬခွံၬဝ့ၫတၭ, ခွံၬၡိၭခွံၭ လၧနအီၪဆံၭ. အဂဲးဘဲၫယီၩ နဂၩ့လမံၩ့အ့ၪဂၭဂီၩ့တၭ, မွဲ အဂ့ၩနဲၪ့ဒံၭ လၧနလၩ့ဘၪ လၧလရၬဖၧၩ့ထၧၫ့ဂၩယၫ နီၪဒံၭလီၫ.",
			"31": "<sup>31</sup> ၦစံၭဝ့ၫဒၪ,ထီးဒၪၦလၧအခွံၬၡိၭအမၫလဂၩဂၩ",
			"32": "<sup>32</sup> နီၪ,မွဲအဖ့ၪလၫ့ဒၪဝ့ၫလၧလံၬလၩ့ၡၪလဘံၪ့ဆံၭ.- အ့ၪ မွဲယဝ့ၫဒၪယီၩယစံၭနၥံၪ, ထီးဒၪၦလၧအခွံၬၡိၭခွံၬ အမၫလၧအလမွဲဘၪလၧဆၧအဲၪဘိၩ့အကၠီၩ့ လဂၩဂၩ နီၪ မွဲအအၪ့မၧၫ့ အမၫအဲၪဘိၩ့ဆၧလီၫ. ၦလၧအအီၪ ဎုၬလၧၦမုၪလၧအဘၪ ဆၧခွံၬၡိၭခွံၬဝ့ၫလဂၩဂၩနီၪ, မွဲအမၩမၪၦမၫလီၫ.",
			"33": "<sup>33</sup> မၩဒီၭလဖၧၫ့ နၥံၪနါဂၧၫ့ယူၭလၧၦမွံၩၦၡါစံၭဝ့ၫဒၪ, ထီးဆိၪလၩ့နၥၭလတီၩလလီၩ့ဘၪလဂ့ၩ. ဆၧလၧ နဆိၪလၩ့နၥၭနီၪမၩတီၩတီၩလီၩ့လီၩ့ လၧကဆါအမ့ၬ",
			"34": "<sup>34</sup> ယၫ နီၪဆံၭ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ,ယစံၭနၥံၪ,ထီး ဆိၪဆၧစံၭဆၧလၩလါလဂ့ၩ. ထီးဆိၪလၩ့နၥၭ လၧမူၭခိၪအမ့ၬယၫလဂ့ၩ, အဂဲးဘဲၫယီၩမွဲယွၩအလး",
			"35": "<sup>35</sup> ဆီၩ့ဆီလီၫ.- ထီးဆိၪလၩ့နၥၭလၧဂၪ့ခိၪအမ့ၬယၫ လဂ့ၩ,အဂဲးဘဲၫယီၩ မွဲအခၪ့ယဲးလၩ့အလးလီၫ. ထီး ဆိၪလၩ့နၥၭလၧယရုစလံၫ့ အမ့ၬယၫလဂ့ၩ, အဂဲး",
			"36": "<sup>36</sup> ဘဲၫယီၩမွဲစဎွၩဖၭဒိၪအဒိၩ့လီၫ.- ထီးဆိၪလၩ့နၥၭ လၧနခိၪဎွံၪအမ့ၬယၫလဂ့ၩ, အဂဲးဘဲၫယီၩ န့ၫခိၪ",
			"37": "<sup>37</sup> ၥူၫလဘီၩ့နီၪၥၧၫ့မွဲဂ့ၩ, ဘွၩမွဲဂ့ၩ,နမၩၥ့ၪအ့ၬ.- မွဲန ၥံၪချဲၩ့ဆၧမွဲမွဲ,မွဲအ့ၬမွဲအ့ၬနီၪဆံၭ. ဆၧအၪနဲၪ့ဆၧ လဖၪနီၪဘၪဆဲၫ့လၧဆၧအၧၩ့လီၫ.",
			"38": "<sup>38</sup> နၥံၪနါဂၧၫ့ယူၭလၧၦစံၭဝ့ၫဒၪ,ပမ့ၬၥၪလတီၪ့အ",
			"39": "<sup>39</sup> ဂးလတီၪ့,ပၥွၫလဘံၪ့အဂးလဘံၪ့လီၫ.- အ့ၪမွဲယဝ့ၫ ဒၪယီၩယစံၭနၥံၪ, ထီးဂဲးလိၬတ့ၭလိၬ ဆၧမၩအၧၩ့ လဂ့ၩးၦလၧအဒဲၩနနိၭဖၩထံၭအထွ့ၪလဂၩနီၪ,",
			"40": "<sup>40</sup> ကၠၪစိၩဝ့ၫလၧအနီၪလခီၫဆံၭ.- ၦလၧအမိမၩန့ဘၪ အၥၭလၧနဆဲၫ့တၭ,ချဲၩ့န့နၧၩလၧခွးနီၪ, ဖ့ၪလၫ့အဝ့ၫ လၧနဖၬဘဲၩ့ဆ့ဆံၭ.",
			"41": "<sup>41</sup> ၦလၧအအၪ့မၧၫ့ဆီၪ့နလ့ၩလမံၫလၬတၭ, လ့ၩ",
			"42": "<sup>42</sup> ဂၧၩ့အဝ့ၫဒၪနံၫမံၫလၬဆံၭ.- ၦလၧအအၪ့ကံၩ့ဆၧနီၪ ဖ့ၪလၫ့အဝ့ၫနီၪဆံၭ. ၦလၧအမိအၪ့လီးဘၪအၥၭ လၧနဆၧနီၪ, ထီးကၠၪဒိၭချိၫ့နၥၭလဂ့ၩ.",
			"43": "<sup>43</sup> နၥံၪနါဂၧၫ့ယူၭ လၧၦစံၭဝ့ၫဒၪ, အဲၪၦလၧနနဲၩ့",
			"44": "<sup>44</sup> ထံၭတၭ,ၥၭဂဲၫ့နဒုၪနဒၩဆံၭ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ ယစံၭနၥံၪ,အဲၪနၥံၪအဒုၪအဒၩဆံၭ. ၦလၧအဆိၪ အၧၩ့နၥံၪနီၪဆိၪဂ့ၩ အဝ့ၫၥံၪဆံၭ. ၦလၧအၥၭဂဲၫ့ နၥံၪနီၪမၩဂ့ၩအဝ့ၫၥံၪဆံၭ. ၦလၧအမၩကြၩ့ထမး နၥံၪ,ဒဲမၩအၧၩ့မၩနၭနၥံၪနီၪ, ဘၩဆိၪဖၪန့အဂး",
			"45": "<sup>45</sup> ဆံၭ.- ဘဲၫၥိၭနၥံၪမိကဲၪထၪ့ နၥံၪအဖါအီၪလၧမူၭခိၪ အဖိၪအဂဲးလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪနီၪအၪ့မၧၫ့အ မုဂဲၫထၪ့လၧၦအဂ့ၩဒဲလၧ ၦအအၧၩ့အလီၩ့တၭ, အၪ့မၧၫ့အဆၧဆၧၩ့လၩ့လၧၦအတီၩအလီၩ့ ဒဲလၧၦ လတီၩလလီၩ့ဘၪ အလီၩ့ဆ့လီၫ.",
			"46": "<sup>46</sup> နၥံၪအ့ၪအဲၪၦလၧအအဲၪနၥံၪတၭ,မွဲနၥံၪအခိးအ တၩအီၪလၧဆၧနီၪလမံၩ့လဲၪ. ၦအၪ့ကံၩ့အခီၫ့ၥံၪမၩ",
			"47": "<sup>47</sup> ဝ့ၫလမံၩ့ဎးမွဲအ့ၬဧၪ.- နၥံၪအ့ၪချဲၩ့ဒုၪ့န့ၫနၥံၪ အထၧၫ့ ဖုဝဲနီၪ,မွဲနၥံၪ မၩအၪနဲၪ့ဒံၭနီၪလဲၪ. ၦအၪ့ကံၩ့အခီၫ့ မၩဝ့ၫဘဲၫနီၪၥိၭ, မွဲအ့ၬဧၪ.",
			"48": "<sup>48</sup> မၩအၥၭဘဲၫနီၪတၭ,မွဲနၥံၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ဘဲၫ နၥံၪအဖါအီၪလၧမူၭခိၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ အၥိၭ နီၪဆံၭ."
		},
		"6": {
			"1": "<sup>1</sup> ထီးလၩ့နၥံၪအၥၭ ဘဲၫၥိၭနၥံၪထီးမၩနၥံၪ အဆၧ တီၩဆၧလီၩ့ လၧၦၡၩအမ့ၬယၫ ဘဲၫအမိဒၪဘၪ ဝ့ၫ အၥိၭနီၪလဂ့ၩ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, နၥံၪအဘိၪ့",
			"2": "<sup>2</sup> အီၪလၧနၥံၪအဖါလၧမူၭခိၪနီၪအ့ၬ.- မၩအၥၭဘဲၫ နီၪတၭ,ထီးနအ့ၪဖ့ၪလၫ့ဆၧယၫ့ၥၭ လဖၪနီၪ, ထီး အူၪထၪ့ခွ့ၩလၧနမ့ၬယၫ, ဘဲၫၦအၪ့လီၫဆၧမၩဝ့ၫလၧ ၥရိၬဖၧၩ့ဒဲလၧဖၧၩ့ၥၭနီၪ, ဘဲၫၦၡၩမိစံၭထၪ့အၪ့အူၭဝ့ၫ အၥိၭနီၪလဂ့ၩ. ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, အဝ့ၫ",
			"3": "<sup>3</sup> ၥံၪန့ဘၪအဘိၪ့ဒၪဝ့ၫလီၫ.- အ့ၪမွဲနဝ့ၫဒၪယီၩ,ထီးနအ့ၪ ဖ့ၪလၫ့ဆၧယၫ့ၥၭနီၪ, ဘဲၫၥိၭနဆၧဖ့ၪလၫ့ယၫ့ၥၭ ထီးအီၪဖျီၪလဂ့ၩတၭ,ဆၧလၧနစူၪထွ့ၪမၩဝ့ၫနီၪ, ထီး",
			"4": "<sup>4</sup> ဒုၭၥ့ၪယၫနစူၪစ့ၪလဂ့ၩ.- နဖါလၧအဒၪဘၪလၧဆၧအီၪ ၥူၪအဖၧၩ့နီၪ, အနၫ့ဆါဒၪဝ့ၫ မိဖ့ၪလၫ့ဆၧဘိၪ့လၧ နၧၩလီၫ.",
			"5": "<sup>5</sup> နအ့ၪဘၩဆိၪဖၪဆၧနီၪ,ထီးအီၪဘဲၫၦအၪ့လီၫဆၧ အၥိၭနီၪလဂ့ၩ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအဲၪဝ့ၫလၧအ ဘၩဆိၪဖၪ ဆၧၫ့ထုၪ့လၧၥရိၬဖၧၩ့, ဒဲလၧဖၧၩ့မုထဲၩ့ ဖၭအခၪ့ထံၭဘဲၫအမိအီၪဖျီၪ လၧၦၡၩအမ့ၬယၫအၥိၭ နီၪလီၫ. ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, အဝ့ၫၥံၪန့ဘၪ",
			"6": "<sup>6</sup> ယူၭအဘိၪ့ဒၪဝ့ၫလီၫ.- အ့ၪမွဲနဝ့ၫဒၪယီၩထီးနအ့ၪ ဘၩဆိၪဖၪဆၧနီၪ,ထဲၩ့နုၬလၧနဒူၭဖၧၩ့တၭ, ကၭဘံၭ ထၬနတရၫ့တၭ,ဘၩဆိၪဖၪ လၧနဖါလၧအအီၪၥူၪနီၪ ဆံၭ.နဖါလၧအဒၪဆၧ လၧဆၧအီၪၥူၪအဖၧၩ့နီၪ, မိ ဖ့ၪလၫ့ဆၧဘိၪ့လၧနၧၩလီၫ.",
			"7": "<sup>7</sup> ထီးနအ့ၪဘၩဆိၪဖၪဆၧနီၪ,ထီးစံၭဂီၩ့စံၭထဲၩ့,စံၭ ဂီၩ့စံၭထဲၩ့ပျီၩပျီၩ, ဘဲၫၦဆၨၩလဖၪအၥိၭနီၪလဂ့ၩ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဆီၫ့မီၪ့ လၧအချဲၩ့ဆၧအၪအ",
			"8": "<sup>8</sup> ကၠီၩ့တၭ,ဆၧမိခိၭနၪဝ့ၫလီၫ.- အခိးမွဲဘဲၫနီၪတၭ, ထီးမၩဒီၩ့အဝ့ၫၥံၪလဂ့ၩး အဂဲးဘဲၫယီၩဆၧလၧနၥံၪ န့ဘၪဝ့ၫအလးအီၪလဖၪနီၪ, နၥံၪအဖါၥ့ၪယၫဝ့ၫ လၧနၥံၪလချႃၭအၪ့ကံၩ့ဒံၭဘၪလီၫ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘၩဆိၪဖၪဘဲၫယီၩး အီၪလၧမူၭခိၪပဖါဧ့,မွဲနမံၩ့အီၪဆံၫ့ဎံၪဒၪဝ့ၫဆံၭ.",
			"10": "<sup>10</sup> နဘၩ့နမုးနီၪ,မွဲအထီၩ့ထဲၩ့ဒၪဝ့ၫဆံၭ. မွဲနၥၭလၧၫ့ထၪ့ ဎွ့ၩထၪ့ထဲၩ့ဒၪဝ့ၫထီးဂၪ့ခိၪချိၫ့ယီၩ ဘဲၫလၧမူၭခိၪအ",
			"11": "<sup>11</sup> ၥိၭနီၪဆံၭ.- ဆၧအၪ့လၧလနံၩအဂး လနံၩအဂးနီၪ",
			"12": "<sup>12</sup> ဖ့ၪလၫ့လါပၧၩလနံၩယီၩဆံၭ.- ကွဲၪဖျါခွံၬလါပဒ့ၪ ပမါဘဲၫပကွဲၪဖျါခွံၬယူၭ ၦၡၩအဒ့ၪအမါလၧအအီၪ",
			"13": "<sup>13</sup> လၧပၧၩအၥိၭနီၪဆံၭ.- ထီးဒုၭလ့ၩနုၬပၧၩ လၧဆၧ ကျဲၩ့ဖစီၩ့အဖၧၩ့နီၪလဂ့ၩး ထုၭထၪ့ခွံၬလါပၧၩလၧ ဆၧအၧၩ့ဆၧၥၫ့အဖၧၩ့နီၪဆံၭ. ဎအဂဲးဘဲၫယီၩ ဘၩ့ ၥံၪမုးၥံၪ,ဒဲဆၧစီၩ့ဆၧမၩ့, ဒဲဆၧအလၩအဖၩ့နီၪ မွဲ နဝ့ၫအဆိၩ ဆိၩအကၠၪကၠၪလီၫ. အၩမံၩ့.ၭ",
			"14": "<sup>14</sup> အဂဲးဘဲၫယီၩနၥံၪအ့ၪကွဲၪဖျါခွံၬၦၡၩအဆၧၥူၭ ဆၧမၪတၭ, နၥံၪအဖါအီၪလၧမူၭခိၪနီၪ မိကွဲၪဖျါခွံၬန",
			"15": "<sup>15</sup> ၥံၪအဆၧၥူၭဆၧမၪဆ့လီၫ.- အ့ၪမွဲနၥံၪအ့ၪလကွဲၪ ဖျါခွံၬဘၪၦၡၩအဆၧၥူၭဆၧမၪတၭ, နၥံၪအဖါကွဲၪဖျါ ခွံၬနၥံၪအဆၧၥူၭဆၧမၪဆ့အ့ၬ.",
			"16": "<sup>16</sup> နၥံၪအ့ၪဒုၪဆၧအၪ့ဆၧအီၩတၭ,ထီးမၩနၥံၪအ မ့ၬၥံၫယူၭၥံၫယူၭ ဘဲၫၦလၧအအၪ့လီၫဆၧအၥိၭနီၪလ ဂ့ၩ,အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဘဲၫအဒုၪ ဆၧအၪ့ဆၧအီၩ နီၪမိအီၪဖျီၪထၪ့ လၧၦၡၩအမ့ၬယၫအၥိၭတၭး မၩၥံၫ ယူၭလၩ့အမ့ၬလီၫ. ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, အ",
			"17": "<sup>17</sup> ဝ့ၫၥံၪန့ဘၪယူၭအဘိၪ့ဒၪဝ့ၫလီၫ.- အ့ၪမွဲနဝ့ၫဒၪယီၩ, ထီးနအ့ၪဒုၪဆၧ အၪ့ဆၧအီၩတၭ, ဘဲၫၥိၭနဒုၪဆၧအၪ့ ဆၧအီၩနီၪ, ထီးအီၪဖျီၪဘၪလၧၦၡၩအမ့ၬယၫလဂ့ၩ တၭ,ဘဲၫအမိအီၪဖျီၪ လၧဖါလၧအအီၪၥူၪဝ့ၫအမ့ၬ",
			"18": "<sup>18</sup> ယၫအၥိၭတၭ,ဂုၪနခိၪဎွံၪ,ဖျါခွံၬနမ့ၬဆံၭ.- နဖါလၧ အဒၪဆၧလၧဆၧအီၪၥူၪအဖၧၩ့နီၪ, မိဖ့ၪလၫ့ဆၧဘိၪ့ လၧနၧၩလီၫ.",
			"19": "<sup>19</sup> ထီးအီၪက့ၪကီၪ့နၥံၪအစူၪလးခၪ့ခိၪ လၧဂၪ့ခိၪချိၫ့ ထီးအလး လၧဆၧအဎိၩ့အဎါ,ဒဲဆၧအထၪ့အ့ၪမၩ ဂၭဂီၩ့ဆၧ,ဒဲထီးဆၧအၪ့ဂူၪဘုၪ့ဖိးဆၧတၭ, အၪ့ဂူၪ",
			"20": "<sup>20</sup> န့ဆၧနီၪလဂ့ၩ.- အ့ၪမွဲအီၪက့ၪကီၪ့နၥံၪအစူၪလး ခၪ့ခိၪလၧမူၭခိၪထီးအလး လၧဆၧအဎိၩ့အဎါမွဲဂ့ၩ, ဆၧအထၪ့အ့ၪမွဲဂ့ၩ, လမၩဂၭဂီၩ့ဘၪဆၧ, ဒဲလၧဆၧ အၪ့ဂူၪလဘုၪ့ဖိးဘၪတၭ, လအၪ့ဂူၪန့ဘၪဆၧနီၪဆံၭ.",
			"21": "<sup>21</sup> အဂဲးဘဲၫယီၩ ထီးဒၪအလး လၧနၥံၪအစူၪလးခၪ့ခိၪ အီၪဝ့ၫလစီၪ့စီၪ့နီၪ,နၥံၪအၥၭ မိအီၪဝ့ၫ ထီးနီၪဆ့ လီၫ.",
			"22": "<sup>22</sup> ၦမိၡါအမ့ၪဒိၩ့မွဲအမ့ၬၥၪလီၫ. မၩအၥၭဘဲၫနီၪ တၭ,နမ့ၬၥၪအ့ၪဆၭတၭ,နမိၡါမိအီၪ လၧဆၧဖၩ့ထၧၫ့ ဂၩယၫလီၫ. အ့ၪမွဲနမ့ၬၥၪအ့ၪလထံၫဘၪတၭ, နမိ",
			"23": "<sup>23</sup> ၡါမိအီၪလၧဆၧခံၭထၧၫ့ဂၩယၫလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,ဆၧဖၩ့အီၪလၧ နဖၧၩ့နီၪအ့ၪမွဲဆၧခံၭတၭ, ဆၧလၧဆၧခံၭနီၪဆံၭဒိၪလဲၪၬ",
			"24": "<sup>24</sup> ကဆါနံၫဂၩအဆၧမၩနီၪ, ၦမၩၥ့ၪနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ မိအဲၪဝ့ၫနးဂၩတၭ, မိၥၭဂဲၫ့ဝ့ၫနးဂၩလီၫ. အ့ၪလမွဲဘၪတၭ, မိဖီၪ့ထၬၦနးဂၩတၭ, မိမၩကြၩ့ ထမးဝ့ၫနးဂၩလီၫ. ယွၩအဆၧမၩ, ဒဲမၫမၧၫ့အဆၧ မၩနီၪနၥံၪမၩၥ့ၪအ့ၬ.",
			"25": "<sup>25</sup> မၩအၥၭဘဲၫနီၪတၭ, ယစံၭနၥံၪ,မွဲပမိအၪ့ဘၪဘဲၫ ၥ့ၪလဲၪ, မွဲပမိအီၩဘၪဘဲၫၥ့ၪလဲၪနီၪ, ထီးအၪ့ယိၪလၩ့ လၧနၥံၪအၥၭမၧၫ့အဂးလဂ့ၩ,မွဲပမိကီၩ့ဘၪပမိၥိၭ ဘၪဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ထီးအၪ့ယိၪလၩ့ လၧန ၥံၪအနၫ့ဆါအဂးလဂ့ၩ. ပၥၭယီၩ, ဂ့ၩနဲၪ့ဆၧအၪ့ဆၧ အီၩတၭ, ပနၫ့ဆါယီၩဂ့ၩနဲၪ့ဆၧကီၩ့ဆၧၥိၭနီၪ,မွဲ",
			"26": "<sup>26</sup> အ့ၬဧၪ.- ယိဆီၫ့မီၪ့ခွါထိၪၥံၪ လံၪၥံၪလၧဆၧဖိၭဖၫ့နီၪ ဆံၭ.အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလဎွံၪဘၪဆၧ, လကူၭ ဘၪဆၧ,အီၪက့ၪကီၪ့ဆၧလၧဖၫ့ဖၧၩ့အ့ၬ. မွဲလါနၫ့ ဘိၩနၥံၪအဖါအီၪလၧမူၭခိၪနီၪ လုအၪ့လုအီၩအဝ့ၫၥံၪ လီၫ.နၥံၪဝ့ၫဒၪယီၩ, နၥံၪဂ့ၩနဲၪ့အဝ့ၫၥံၪဒိၪဒၪအဆၧ",
			"27": "<sup>27</sup> ဒံၭ,မွဲအ့ၬဧၪ.- မွဲပလၫလၧနၥံၪအကျၩလၧအအၪ့ ယိၪဆၧအကၠီၩ့နီၪ, ထုၭထီၫထၪ့အယုၬနးဖျါနီၪ မိၥ့ၪ",
			"28": "<sup>28</sup> လဂၩလဲၪ.- မွဲဘၪနီၪနၥံၪအၪ့ယိဆၧလၧနၥံၪအ ကီၩ့အၥိၭအဂးလဲၪ. ဆၧလၧဖီၫယၫအီၪ လၧဆၧပျၩ့ ဖၧၩ့နီၪ,မွဲအဒိၪထၪ့ဝ့ၫ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ ဆီၫ့ မီၪ့ခွါဘီၪ.အဝ့ၫၥံၪလမၩဘၪဆၧ, လဝံၭဘၪဆၧတၭ,",
			"29": "<sup>29</sup> မွဲလါနၫ့ဘိၩ, ယလီၩဘၪနၥံၪယီၩ စစီလမၧၫ့ဒၪ လ့ၬအီၪလၧအကယးကဖးထီးအလူၬလဂၩနီၪ,ကီၩ့",
			"30": "<sup>30</sup> ၥိၭဝ့ၫထီၩ့ဖီၫလမုနီၪအ့ၬ.- နၥံၪနဲၩဆၧၡၩၥံၪဧ့, ယွၩအ့ၪဒုၭကီၩ့ဒုၭၥိၭ နၪ့လၧဆၧပျၩ့ဖၧၩ့ လၧလနံၩ ယီၩအီၪဝ့ၫ, အ့ၪမွဲကဲဂီၩခိၬလနံၩ ဘၪဆၧဖျႃၭလၩ့ဝ့ၫ လၧဖံၫ့ချၪဖၧၩ့တၭ, မိဒုၭကီၩ့ဒုၭၥိၭနၥံၪအၪနဲၪ့အနီၪ",
			"31": "<sup>31</sup> ဒံၭ,မွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ,မွဲပမိအၪ့ဘၪ, မွဲ ပမိအီၩဘၪ,မွဲပမိ ကီၩ့မိၥိၭဘၪ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ",
			"32": "<sup>32</sup> နီၪ,ထီးစံၭဆၧနီၪဒဲအၪ့ယိၪဆၧလဂ့ၩ.- အဂဲးဘဲၫ ယီၩဆၧနီၪလဖၪ ထီးအလူၬ ၦဆၨၩၥံၪအၪ့ဎၬဝ့ၫဒၪ လီၫ.အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩနၥံၪဂ့ၩန့ဘၪဆၧလဖၪနီၪ, နၥံၪအဖါ အီၪလၧမူၭခိၪၥ့ၪယၫလၧအလးအီၪဝ့ၫ",
			"33": "<sup>33</sup> လီၫ.- အ့ၪမွဲအၪ့ဎၬဆိၫ ယွၩအဘၩ့အမုး ဒဲအဆၧ တီၩဆၧလီၩ့ဆံၭ. ဆၧမိဖ့ၪလၫ့နၥံၪလၧဆၧလဖၪ",
			"34": "<sup>34</sup> နီၪထီးအလူၬလၧအဖၫ့ခိၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ထီးအၪ့ယိၪဆၧ လၧကဲဂီၩခိၬအဂးလဂ့ၩ,ကဲ ဂီၩခိၬနီၪ မိအၪ့ယိၪဆၧလၧ အဂးဒၪဝ့ၫလီၫ. မုလနံၩ အဆၧအၧၩ့ဆၧနၭနီၪအၪယူၭ လၧအဂးဒၪဝ့ၫလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ဘဲၫၥိၭနၥံၪထီးဘၪ ဆၧစ့ၩရၫ့လဂ့ၩနီၪ, စ့ၩရၫ့နၥံၪ",
			"2": "<sup>2</sup> ဝ့ၫလဂ့ၩ,- အဂဲးဘဲၫယီၩနၥံၪမိဘၪဆၧစ့ၩရၫ့ဘဲၫနၥံၪ စ့ၩရၫ့ဆၧအၥိၭနီၪလီၫ. နၥံၪမိဘၪဆၧတိၪ့န့လၧနၥံၪ အဂးဘဲၫနၥံၪတိၪ့န့ဆၧ လၧၦအဂးအၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> ၥံၪ့ဖုၫအီၪလၧနမ့ၬၥၪဖၧၩ့နီၪ, နလဆီၫ့မီၪ့ဘၪတၭ, မွဲ ဘၪနီၪနယိနိၪကဲၩ့ဖိၪ လၧနထၧၫ့ဖုဝဲအမ့ၬၥၪဖၧၩ့နီၪ",
			"4": "<sup>4</sup> လဲၪ.- မွဲဘၪနီၪနစံၭနထၧၫ့ဖုဝဲ, ဖ့ၪလၫ့ယခွ့ၭထၪ့ခွံၬ နိၪကဲၩ့ဖိၪ အီၪလၧနမ့ၬၥၪဖၧၩ့ဆံၭ, နီၪလဲၪ. ယိခွါ,",
			"5": "<sup>5</sup> ၥံၪ့ဖုၫအီၪဝ့ၫ လၧနမ့ၬၥၪဖၧၩ့မၬကၨ.- ၦလၧအအၪ့ လီၫဆၧဧ့း ခွ့ၭထၪ့ခွံၬဆိၫဒၪခလူၬ ၥံၪ့ဖုၫအီၪလၧနမ့ၬ ၥၪဖၧၩ့နီၪဆံၭ. အနီၪတၭ,နမိဒၪဆၧထံၫထံၫဆၭဆၭ ဘဲၫနမိခွ့ၭထၪ့ခွံၬနိၪကဲၩ့ဖိၪ အီၪလၧနထၧၫ့ဖုဝဲအမ့ၬ ၥၪဖၧၩ့အၥိၭနီၪလီၫ.",
			"6": "<sup>6</sup> ထီးဖ့ၪလၫ့ဆၧဆံၫ့ဎံၪလၧထွံၪအီၪလဂ့ၩ, ထီးခွံၬ လၩ့နၥံၪအမနံၬထၫ့မျါ လၧထိၭအမ့ၬယၫလဂ့ၩးမွဲ အမိယဲးထဲးဘၪခိၬလၧအခၪ့တၭ, မိကၠၪထဲၩ့အၥၭအဲၪ့ လၩ့လ့ၭနၥံၪလီၫ.",
			"7": "<sup>7</sup> အၪ့ကံၩ့ဆၧဆံၭ, ဆၧမိဖ့ၪလၫ့နၥံၪလီၫ. အၪ့ဎၬ ဆၧဆံၭ,နၥံၪမိဒၪန့ဆၧလီၫ. ဒိၪထိၬဆၧဆံၭ, ဆၧမိဝဲ",
			"8": "<sup>8</sup> ထၪ့လၧနၥံၪအဂးလီၫ.- အဂဲးဘဲၫယီၩကယဲၦလၧအ အၪ့ကံၩ့ဆၧနီၪမွဲအန့ဘၪဝ့ၫကိၭဂၩဒ့ၭလီၫ. ၦလၧအအၪ့ ဎၬဆၧနီၪ,မွဲအဒၪန့ဘၪဝ့ၫလီၫ. ဆၧမိဝဲထၪ့န့ ၦ",
			"9": "<sup>9</sup> လၧအဒိၪထိၬဆၧနီၪလီၫ.- ၦၡၩအီၪလၧနၥံၪအကျၩ လၧအဖိၪခွၫအ့ၪအၪ့ကံၩ့ ကိၪနးလီၪ့တၭ,မိဖ့ၪလၫ့ဝ့ၫ",
			"10": "<sup>10</sup> လၧလိးနးဖျိၪ့နီၪးမွဲပလၫလဂၩလဲၪ.- အ့ၪအၪ့ကံၩ့ ယၪနးဘံၪ့နီၪ, မွဲအမိဖ့ၪလၫ့ဝ့ၫ လၧဂူနးဘီၩ့ဆ့ဧၪ.",
			"11": "<sup>11</sup> အနီၪတၭ, နၥံၪမွဲၦလၧအအၧၩ့လဖၪနီၪ အ့ၪၥ့ၪယၫ ဖ့ၪလၫ့နၥံၪ အဖိၪအလံၩ လၧဆၧဖ့ၪလၫ့အဂ့ၩတၭ, မွဲနၥံၪအဖါ လၧအအီၪဝ့ၫလၧမူၭခိၪနီၪမိဖ့ၪလၫ့ဆၧအ ဂ့ၩလၧၦလၧအအၪ့ကံၩ့ ဆၧလဖၪအၪနဲၪ့နီၪဆံၭအၪ လဲၪ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, ကယဲဆၧလၧနၥံၪဆိၫ့ ၦ ၡၩမၩနၥံၪကိၭမံၩ့ဒ့ၭနီၪ, မၩအဝ့ၫၥံၪဘဲၫနီၪအၥိၭ ဆံၭ.အဂဲးဘဲၫယီၩအနီၪမွဲဆၧမၪလူၬဒဲမီၪလဖၪနီၪ လီၫ.",
			"13": "<sup>13</sup> လ့ၩနုၬလၧတရၫ့အအံၪ့နီၪဆံၭ. အဂဲးဘဲၫယီၩ တရၫ့မွဲအလဲ, ဒဲဖၧၩ့ၥၭမွဲအဒိၪလၧအထီၩ့ဝ့ၫလၧ ဆၧဂၭဂီၩ့ဂၭစၪနီၪတၭ, ၦလၧအလ့ၩနုၬဝ့ၫလဖၪနီၪ",
			"14": "<sup>14</sup> အီၪအၪဂၩလီၫ.- အ့ၪမွဲတရၫ့မွဲအအံၪ့,ဒဲဖၧၩ့ၥၭမွဲ အဆံၭလၧအထီၩ့ဝ့ၫ လၧဆၧမၧၫ့တၭ,ၦၡၩလၧအဒၪ န့ဝ့ၫလဖၪ အီၪၡၩခိၬဂၩလီၫ.",
			"15": "<sup>15</sup> ထီးလၩ့နၥံၪအၥၭ လၧမီၪအဘျၪလဖၪနီၪဆံၭး အဝ့ၫၥံၪဂဲၫ လၧနၥံၪအအီၪ, ၥိၭၥိၪအကီၩ့အၥိၭ",
			"16": "<sup>16</sup> တၭ,လၧအဖၧၩ့နီၪမွဲထွံၪမံၩ့အဒူၩလဖၪလီၫ.- နၥံၪ မိၥ့ၪယၫအဝ့ၫၥံၪ လၧအဆၧၥၪလီၫ. ၦအၪ့မၩန့ စဘံၭၥၪလၧဆၧဆူၪဆၧမဲၪအလီၩ့, ဒဲချိၪ့ဒိၩ့ၥၪလၧ",
			"17": "<sup>17</sup> ယၩ့ခူၬအလီၩ့ဆ့ဧၪ.- ဘဲၫနီၪတၭ,ကယဲၥံၪ့ထံၭအ ဂ့ၩကိၭထံၭဒ့ၭနီၪး ၥၪထၪ့ဆၧၥၪ အဂ့ၩလီၫ. အ့ၪ မွဲၥံၪ့အအၧၩ့လထံၭနီၪ, ၥၪထၪ့ဆၧၥၪအအၧၩ့လီၫ.",
			"18": "<sup>18</sup> ၥံၪ့အဂ့ၩလထံၭနီၪ ၥၪထၪ့ဆၧၥၪအအၧၩ့ၥ့ၪအ့ၬ. ၥံၪ့အအၧၩ့လထံၭနီၪ ၥၪထၪ့ဆၧၥၪအဂ့ၩ ၥ့ၪအ့ၬ.",
			"19": "<sup>19</sup> ကယဲၥံၪ့လၧအလၥၪထၪ့ဘၪ ဆၧၥၪအဂ့ၩကိၭထံၭဒ့ၭ နီၪဘၪဆၧခူၬခွံၬဝ့ၫတၭ, ဘၪဆၧဖျႃၭလၩ့ဝ့ၫ လၧ",
			"20": "<sup>20</sup> မ့ၪဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,နၥံၪမိၥ့ၪယၫအဝ့ၫ ၥံၪလၧအဆၧၥၪလီၫ.",
			"21": "<sup>21</sup> ၦလၧအစံၭယၧၩ, ကဆါဧ့,ကဆါဧ့နီၪ, မွဲအမိ လ့ၩနုၬဘၪလၧမူၭခိၪအဘၩ့အမုးအဖၧၩ့ ကိၭဂၩဒ့ၭ အ့ၬ.မွဲၦလၧအမၩဝ့ၫထီးဒၪယဖါအီၪလၧမူၭခိၪအၥၭ",
			"22": "<sup>22</sup> နီၪလီၫ.-လၧမုလနံၩနီၪၦအၪဂၩမိစံၭယၧၩ,ကဆါဧ့, ကဆါဧ့,ပချဲၩ့ဆၧလၧမီၪအချိၬလၧနမံၩ့,ဒဲပနၫ့ထၪ့ ခွံၬဆၧနၪလၧနမံၩ့, ဒဲပမၩဆၧလၩ့လၭအၪမံၩ့ လၧန",
			"23": "<sup>23</sup> မံၩ့မွဲအ့ၬဧၪ.- ထီးနီၪလဖၧၫ့ယမိလီၩဘၪဆၧတီၩ တီၩ,ယၥ့ၪယၫနၥံၪနးဆိၭအ့ၬ. ၦလၧအကိၪ့မၩဆၧ အၧၩ့ဆၧၥၫ့ၥံၪဧ့, စဲၪ့ဖၭလၧယၧၩဆံၭ.",
			"24": "<sup>24</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအနါဂၧၫ့ယလူယီၩ ဒဲ ထီးန့ဝ့ၫကိၭဂၩဒ့ၭနီၪ, ယမိဒီၩ့လၩ့အဝ့ၫၥံၪဘဲၫၦ ကိၪ့ဆၧၥ့ၪလၧအမၩဂံၪ့ လၧလိးခိၪလဂၩ အၥိၭနီၪ",
			"25": "<sup>25</sup> လီၫ.- ဆၧဂဲၫဆၧၩ့လၩ့တၭ,ထံၫဆ့ၭဆီၪ့,လံၩအူၪဝ့ၫ နီၪ,ဒဲလၩ့ဘၪဝ့ၫလၧဂံၪ့လဖျိၪ့နီၪ, လလၩ့ဎီးဘၪတၭ,",
			"26": "<sup>26</sup> မွဲအခၪ့ထံၭအီၪဝ့ၫလၧလိးခိၪအဂဲးလီၫ.- ၦလၧအနါ ဂၧၫ့ယလူယထၫယီၩတၭ, လထီးန့ဘၪဝ့ၫကိၭဂၩဒ့ၭ နီၪ,ယမိဒီၩ့လၩ့အဝ့ၫၥံၪဘဲၫၦအဂီၩ့ လၧအမၩဂံၪ့လၧ",
			"27": "<sup>27</sup> မ့ၭခိၪလဂၩအၥိၭနီၪလီၫ.- ဆၧဂဲၫဆၧၩ့လၩ့တၭ, ထံၫ ဆ့ၭဆီၪ့,လံၩအူၪဝ့ၫနီၪ, ဒဲဘၪဂံၪ့လဖျိၪ့နီၪတၭ, လၩ့ ဎီးဝ့ၫလီၫ. အဆၧလၩ့ဎီးနီၪနၭမၬလီၫ.",
			"28": "<sup>28</sup> ဆၧမၩအၥၭထီး ယ့ၫရှူၬ လီၩလၩ့လၬလၩ့ဆၧနီၪ ဂီၩ့တၭ, ၦခမျၧးထီၫမံၫထီၫမၪဝ့ၫ လၧအဆၧၥီၪ့ဆၧၥၫ့",
			"29": "<sup>29</sup> အဂဲးလီၫ.- အဂဲးဘဲၫယီၩမွဲအၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ ဘဲၫၦကွ့ၭလံၬအၥိၭအ့ၬ. မွဲဘဲၫၦအီၪလၧအစီၩ့အမၩ့ လဂၩအၥိၭနီၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ထီးအဂဲၫထဲၩ့လၩ့လၧခိၪလီၩ့ခိၪတၭ, ၦခမျၧးဖၭ",
			"2": "<sup>2</sup> ဒိၪၥံၪဖိၬထၪ့အခဲၫ့လီၫ.- ယိခွါ, ၦလၧအခံၫထူၬဆၫ အၧၩ့လဂၩဂဲၫလၧအအီၪတၭ, ထွံၩလၩ့လၧအမ့ၬယၫ စံၭဝ့ၫဒၪး ကဆါဧ့,နၥၭအ့ၪအီၪလၧနမိမၩဆံၫ့ထၪ့",
			"3": "<sup>3</sup> ထဲၩ့ယၧၩတၭ,နမၩနဝ့ၫၥ့ၪလီၫ.- ယ့ၫရှူၬယူၬစိၩအ စူၪထိၭဘၪအဝ့ၫနီၪ, စံၭဝ့ၫဒၪ,ယၥၭအီၪ, မွဲနဆံၫ့ထၪ့ ထဲၩ့ဆံၭ. တၭအဆၧခံၫထူၬဆၫအၧၩ့ ဆံၫ့ထၪ့ထဲၩ့",
			"4": "<sup>4</sup> ဝ့ၫချဲၫ့မၬလီၫ.- ယ့ၫရှူၬစံၭဝ့ၫ, ထီးလၩ့နၥၭဘဲၫနထီး လီၩဘၪၦနးဂၩလဂ့ၩး လ့ၩဒုၭနဲၪနၥၭလၧၦလုဆၧ တၭ,မၩဘိၪ့ဆၧလၧစမိစ့ၭမၪလူၬ လၧဆၧထိးအၥၭ လၧအဝ့ၫၥံၪအဂးဆံၭ.",
			"5": "<sup>5</sup> ထီးအလ့ၩနုၬဝ့ၫလၧကပၧနအၫ့အဖၧၩ့နီၪ,ၥုၭဖိၪ လယၩအခိၪလဂၩ ဂဲၫလၧအအီၪတၭ, အၪ့ကံၩ့အၪ့",
			"6": "<sup>6</sup> ယၫဝ့ၫ,- စံၭဝ့ၫဒၪ,ကဆါဧ့, ယခ့ၫယၡၩလဂၩၥံၫလ ခီၫဖၩတၭ,ဆီၫ့ခိၬဆီၫ့ကဲၩ့နၭလ့ၬတၭ, မံၫနၩ့လၧဂံၪ့",
			"7": "<sup>7</sup> ဖၧၩ့လီၫ.-ယ့ၫရှူၬစံၭ,ယမိလ့ၩမၩဘျၪထဲၩ့ အဝ့ၫနီၪ",
			"8": "<sup>8</sup> လီၫ.- ၥုၭဖိၪလယၩ အခိၪနီၪစံၭဆၧၫ့ဝ့ၫ,စံၭဝ့ၫဒၪ,က ဆါဧ့,နဂဲၫနုၬလၧယဂံၪ့ခိၪဖၫ့လၬယီၩယကြၨၭအ့ၬး နအ့ၪစံၭလၧနလူနးထံၪတၭ, ယခ့ၫယၡၩမိဘျၪထဲၩ့",
			"9": "<sup>9</sup> ဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩယဝ့ၫဒၪယမွဲၦၡၩအီၪလၧဆၧ အစီၩ့အမၩ့အဖၫ့လၬတၭ, ၥုၭဖိၪၥ့ၪဖိၪအီၪလၧယဖၫ့ လၬဆ့လီၫ. ယစံၭအယီၩလဂၩ, လ့ၩဘီၪ,တၭလ့ၩ ဝ့ၫလီၫးအနီၪလဂၩ, ဂဲၫဘီၪ,တၭဂဲၫဝ့ၫလီၫ. ယခ့ၫ",
			"10": "<sup>10</sup> ယၡၩနီၪမၩဆၧယီၩဘီၪ,တၭမၩဝ့ၫဒၪလီၫ.- ထီးယ့ၫရှူၬ နါဂၧၫ့ဆၧနီၪ, ထီၫမံၫထီၫမၪဝ့ၫတၭ, စံၭၦဖိၬ အခဲၫ့လဖၪနီၪ, ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, လၧအံၫစရ့လၭ အကျၩ ဒၪလ့ၬနီၪ,ဆၧနဲၩအၪန့ၫအယီၩယဒၪဘၪအ့ၬ.",
			"11": "<sup>11</sup> ယစံၭနၥံၪၦအၪဂၩမိဂဲၫလၧမုထၪ့ဒဲလၧ မုနုၬတၭ, မိဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧစပွဲထံၭ လၧစအၫဘြဟၫ့, ဒဲစအံစၭ,ဒဲစယၫကူၭအၥိၭ လၧမူၭခိၪအဘၩ့အ",
			"12": "<sup>12</sup> မုးအဖၧၩ့လီၫ.-အ့ၪမွဲဘၩ့ဖိၪမုးဖိၪလဖၪနီၪဆၧမိနၫ့ ထၪ့ခွံၬအဝ့ၫၥံၪလၧဆၧခံၭကျၩလၧခီၫ့တၭ, ဆၧဘၪ ဂၪ့ဆၧဘၪယၧၩ့,ဆၧခၪအဲၪ့ထံးနီၪ မိအီၪဝ့ၫဒၪထီးနီၪ",
			"13": "<sup>13</sup> လီၫ.- ယ့ၫရှူၬစံၭ,ၦၥုၭဖိၪလယၩအခိၪလဂၩနီၪ, ထဲၩ့ ထဲၩ့ဘီၪ, ဘဲၫနနဲၩဆၧအၥိၭနီၪမွဲအကဲၪထၪ့ဒၪဝ့ၫ ဆံၭ.အခ့ၫအၡၩဘျၪထဲၩ့ဝ့ၫဒၪလၧနၩရံၩနီၪလီၫ.",
			"14": "<sup>14</sup> ယ့ၫရှူၬလ့ၩနုၬဝ့ၫ လၧစပံတၧၫအဂံၪ့ဖၧၩ့တၭ,ဒၪ ဘၪအမံၩ့ၡါမုၪမံၫနၩ့ဝ့ၫတၭ, ဘၪဆၧဆူၪဂိၬလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪထိၭဘၪအစူၪတၭ, အဆၧဆူၪဂိၬနီၪစဲၪ့ထၪ့ခွံၬ",
			"16": "<sup>16</sup> ဝ့ၫတၭ, ဂဲထုၪ့မၩအခ့ၫအၡၩအဆၧလီၫ.- ထီးမုဂၪ လၩ့တၭ, ၦဂဲၫဆိၬၦၡၩလၧဆၧနၪအီၪ လၧအလီၩ့အၪ ဂၩလၧအအီၪတၭ, အဝ့ၫဒၪနၫ့ထၪ့ခွံၬ ဆၧနၪလၧအ လူလထံၪတၭ, မၩဘျၪထဲၩ့ကယဲၦလၧအဆၫလဖၪနီၪ",
			"17": "<sup>17</sup> ထီးအလူၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,မီၪအဲၫစ့ယၫ အလူလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫတၭးစံၭဝ့ၫဒၪ, အဝ့ၫဒၪအနၫ့ ဆါ ဒၪ ဝ့ၫ မၩ န့ ပ ဆၧ ဆီၫ့ ကိၭ ဆီၫ့ ကဲၩ့တၭ, ဆိၬ န့ ပ ဆၧ ဆၫ လီၫ.",
			"18": "<sup>18</sup> ယ့ၫရှူၬဒၪဘၪ ၦခမျၧးဖၭဒိၪၥံၪ အီၪဝၬဖီၩ့ဝ့ၫတၭ,",
			"19": "<sup>19</sup> အၪ့မၧၫ့အခၫ့စိၩဝ့ၫ လၧဝါလခီၫလီၫ.- ၦကွ့ၭလံၬလ ဂၩဂဲၫဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဆရၫဧ့, ထီးဒၪနလ့ၩဆၧလ",
			"20": "<sup>20</sup> စီၪ့လါလါနီၪယမိဖိၬနခဲၫ့လီၫ.- ယ့ၫရှူၬစံၭအဝ့ၫနီၪ, ထွံၪမံၩ့ၥံၪအီၪဝ့ၫလၧအဖၧၩ့, ဒဲထိၪလဖၪလၧဆၧဖိၭ ဖၫ့အီၪဝ့ၫလၧအၥွံၫ, အ့ၪမွဲၦၡၩအဖိၪခွၫလဂၩယီၩ, ထီးအမိအီၪက့ၪလၩ့ဘၪအခိၪဎွံၪနီၪ အလးအီၪအ့ၬ.",
			"21": "<sup>21</sup> ၦအဂူၫဂၩလၧအဖျဲၥံၪအကျၩလဂၩစံၭဝ့ၫဒၪ,ကဆါ ဧ့,ဒုၭထဲၩ့ဆိၫဒၪခလူၬယၧၩဘဲၫယမိခုၪ့လၩ့ဘၧၩ့ခွံၬ",
			"22": "<sup>22</sup> ယဖါအၥိၭဘီၪ.- ယ့ၫရှူၬစံၭအဝ့ၫနီၪ, ဖိၬယခဲၫ့ဆံၭ, ၦၥံၫနီၪမွဲအခုၪ့လၩ့ဘၧၩ့ခွံၬဒၪဝ့ၫအၡၩၥံၫနီၪဆံၭ.",
			"23": "<sup>23</sup> ထီးအလ့ၩနုၬလၧချံၫဖၧၩ့တၭ, အထံၩအဖျဲၥံၪဖိၬ",
			"24": "<sup>24</sup> ထၪ့အခဲၫ့လီၫ.- ယိခွါ,လံၩလဖုၬဖၭဒိၪအီၪထၪ့ဝ့ၫ လၧကွံၩနီၪထီးချံၫဘံၭဝ့ၫလၧလပီၩလဖၪလီၫ. အ့ၪမွဲ",
			"25": "<sup>25</sup> အဝ့ၫဒၪနီၪမံၫမၪဝ့ၫဒၪလီၫ.- အထံၩအဖျဲလ့ၩထိၪဂဲ ထုၪ့ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ကဆါဧ့,ထိးထဲၩ့တၩ့ထဲၩ့ပၧၩ",
			"26": "<sup>26</sup> ဆံၭ,ပမိဂၭဂီၩ့ဖီၩၬ- အဝ့ၫနီၪစံၭအဝ့ၫၥံၪ,ၦနဲၩဆၧၡၩ ၥံၪဧ့,မွဲဘၪနီၫလၧနၥံၪၥၭမဲၪဆၧလဲၪ. ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪဂဲထုၪ့အၪ့လၬလံၩဒဲကွံၩတၭ, ဆၧအီၪထဲၩ့",
			"27": "<sup>27</sup> မၬဂုးဖုးလီၫ.- ၦလဖၪနီၪထီၫမံၫထီၫမၪဝ့ၫတၭ,စံၭဝ့ၫ ဒၪ,အယီၩလဂၩ မွဲၦဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ,လံၩဒဲ ကွံၩခိၭနၪအလူမၬကၨ.",
			"28": "<sup>28</sup> အဝ့ၫဒၪလ့ၩထီၩ့လၧဝါလခီၫ, လၧဂၭဒရၫအခး နီၪတၭ, ၦလၧဆၧနၪအီၪ လၧအလီၩ့နံၫဂၩဒူၩနၭနၭ လ့ၬ,ထီးၦလ့ၩလၧဖၧၩ့ၥၭနီၪ လၥ့ၪဘၪနးဂၩတၭ,ဂဲၫ",
			"29": "<sup>29</sup> ထၪ့ဝ့ၫလၧလီၫ့ဖၧၩ့နီၪအၪ့ဂၬအဝ့ၫဒၪလီၫ.- ယိခွါ,အ ဝ့ၫၥံၪကိၭၡၭထၪ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယွၩအဖိၪခွၫဧ့, ဆၧဘၪဆဲၫ့လိၬပၥၭလၧပၧၩဒဲနၧၩ,မွဲဆၧနီၪလဲၪ. အမု အလၩလဘၪဒံၭဘၪတၭ, မွဲနဂဲၫမၩအၧၩ့မၩနၭပၧၩ",
			"30": "<sup>30</sup> ဆ့ဧၪ.- ထိၭခမျၧးလဒီၪ့အၪ့ဆၧ လၧအယဲၩ့နီၪတၭ,",
			"31": "<sup>31</sup> ဆၧနၪလဖၪနီၪ အၪ့ကံၩ့အၪ့ယၫဝ့ၫတၭ, စံၭဝ့ၫဒၪ, နအ့ၪနၫ့ထၪ့ခွံၬပၧၩတၭ,ဒုၭလ့ၩနုၬပၧၩ လၧထိၭလ",
			"32": "<sup>32</sup> ဒီၪ့နီၪအဖၧၩ့ဆံၭ.- အဝ့ၫနီၪလီၩဘၪဝ့ၫ,လ့ၩကဒၪ ဘီၪအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬတၭ, လ့ၩနုၬဝ့ၫလၧထိၭလ ဒီၪ့အဖၧၩ့လီၫ. ယိခွါ, ထိၭခမျၧးထၧၫ့ဒီၪ့ယၫနီၪစဲၪ့ဖုၫ လၩ့လၧၡၭမ့ၬထုးထၪ့ထီၫအလီၩ့ လၧကွံၩဖၧၩ့တၭ,",
			"33": "<sup>33</sup> လၩ့အုၭၥံၫဝ့ၫလၧထံၫကျၩနီၪလီၫ.- ၦယူၬထိၭလဖၪ စဲၪ့ဝ့ၫတၭလ့ၩနုၬလၧဒိၩ့ဖၧၩ့, လီၩဘၪဆၧထီးအလူၬ, ဒဲဆၧလၧအဘၪဆဲၫ့ လၧၦလၧဆၧနၪအီၪလၧအလီၩ့",
			"34": "<sup>34</sup> နီၪလီၫ.- ယိခွါ, ၦဒိၩ့ဖိၪဂဲၫထၪ့ လၧယ့ၫရှူၬအအီၪ ထၧၫ့ဒိၩ့ယၫတၭ, ထီးအဒၪဘၪဝ့ၫနီၪ အဝ့ၫၥံၪအၪ့ကံၩ့ အၪ့ယၫဝ့ၫဘဲၫၥိၭအမိစဲၪ့ထၪ့ခွံၬလၧအဝ့ၫၥံၪအခးလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> အဝ့ၫဒၪလ့ၩနုၬလၧချံၫဖၧၩ့နီၪ, ခၫ့စိၩဝ့ၫတၭ,ဂဲၫနုၬ",
			"2": "<sup>2</sup> လၧအဒိၩ့ဒၪဝ့ၫအဖၧၩ့လီၫ.- တၭယိခွါ,ၦၥံၫလခီၫဖၩ လဂၩမံၫနၩ့လၧလးမံၫအဖၧၩ့တၭ, ၦဂဲၫဆိၬဝ့ၫလၧ အအီၪလီၫ. ယ့ၫရှူၬဒၪဘၪအဝ့ၫၥံၪ အဆၧနဲၩတၭ, စံၭၦၥံၫလခီၫဖၩလဂၩနီၪ,ဖိၪခွၫဧ့, မွဲနၥၭဎွံၫထၪ့ဘီၪး",
			"3": "<sup>3</sup> နဆၧဒဲၭဘၭဖျါယူၭ.- ယိခွါ,ၦကွ့ၭလံၬလနၩ့နၩ့စံၭ",
			"4": "<sup>4</sup> လၧအၥၭဖၧၩ့း ၦလဂၩယီၩချဲၩ့မၪယွၩလီၫ.- ယ့ၫရှူၬ ၥ့ၪယၫအဆၧဆီၫ့မီၪ့လဖၪတၭ, စံၭဝ့ၫဒၪး မွဲဘၪနီၫ လၧနၥံၪဆီၫ့မီၪ့ဆၧအၧၩ့ လၧနၥံၪ အၥၭဖၧၩ့နီၪလဲၪ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ, မွဲအယီၫထံၪထံၪလဲၪ. ၦစံၭလၧနဆၧ ဒဲၭဘၭဖျါယူၭနီၪ, မိယီၫလဆံၭဧၪ. ၦစံၭ,ဂဲထုၪ့စဲၪ့",
			"6": "<sup>6</sup> ထၪ့ဆံၭနီၪမိယီၫလဆံၭဧၪ.- မွဲလါနၫ့ဘိၩ, ဘဲၫၥိၭ နၥံၪမိၥ့ၪယၫ လၧၦၡၩအဖိၪခွၫလဂၩယီၩအီၪလၧအ စီၩ့အမၩ့လၧဂၪ့ခိၪချိၫ့ယီၩ, ထီးအကွဲၪဖျါဆၧဒဲၩဘၭ မိၥ့ၪတၭ, (ယ့ၫရှူၬစံၭၦၥံၫလခီၫဖၩလဂၩနီၪ,) ယစံၭ နၧၩ,ဂဲထုၪ့ဆိၬထၪ့နလးမံၫတၭ, ထဲၩ့ထဲၩ့ လၧနဂံၪ့",
			"7": "<sup>7</sup> ဆံၭ.- အဝ့ၫဒၪဂဲထုၪ့တၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအဂံၪ့လီၫ.",
			"8": "<sup>8</sup> ၦခမျၧးဒၪဘၪဝ့ၫနီၪ, ထီၫမံၫထီၫမၪ တၭ, စံၭထၪ့အၪ့ အူၭယွၩလၧအဖ့ၪလၫ့ၦၡၩအစီၩ့အမၩ့ဒိၪန့ၫနီၪ လီၫ.",
			"9": "<sup>9</sup> ယ့ၫရှူၬစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ဒၪဘၪၦၡၩလၧအ မံၩ့မွဲစမၭၥုၫဆၧၫ့နၩ့ဝ့ၫ လၧၦအၪ့ကံၩ့အခီၫ့အလးနီၪ တၭ,စံၭအဝ့ၫ, ဖိၬယခဲၫ့ဆံၭ. အဝ့ၫနီၪဂဲထုၪ့တၭဖိၬ",
			"10": "<sup>10</sup> ထၪ့အခဲၫ့လီၫ.- ဆၧမၩအၥၭလၧယ့ၫရှူၬဆၧၫ့နၩ့ဒံၩ့ ခံၫ့လၧစပွဲထံၭလၧအဂံၪ့ဖၧၩ့ အဘိၩ့ဘၭနီၪတၭ, ယိ ခွါ,ၦအၪ့ကံၩ့အခီၫ့ၥံၪဒဲ ၦဆၧဒဲၩဘၭဖိၪၥံၪ အၪဂၩဂဲၫ ဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဎုၬလၧအဝ့ၫနီၪ,ဒဲလၧအထံၩအဖျဲအ",
			"11": "<sup>11</sup> ၥိၭလၧစပွဲထံၭဆ့လီၫ.- ၦဖၫရစံၫလဖၪဒၪဘၪဝ့ၫတၭ, စံၭအထံၩအဖျဲၥံၪ, မွဲဘၪနီၫလၧနၥံၪအဆရၫ အၪ့ဎုၬ ဆၧလၧၦအၪ့ကံၩ့အခီၫ့, ဒဲလၧၦဆၧဒဲၩဘၭဖိၪအၥိၭ",
			"12": "<sup>12</sup> နီၪလဲၪ.- ယ့ၫရှူၬနါဂၧၫ့တၭလီၩဘၪအဝ့ၫၥံၪ,ၦလၧ အအီၪဆီၪ့အီၪချဲၫ့လဖၪမၩၥံၪ ဎၥံၪ့ဎွံၭ ဆရၫအလးအီၪ",
			"13": "<sup>13</sup> အ့ၬ.မၩဝ့ၫအလးအီၪန့ၫၦလၧအဆၫလဖၪလီၫ.- ဘၪ ယၥၭလၧဆၧယၫ့ၥုၪ့ယၫ့ၥၭတၭ, မွဲဆၧလုဆၧဖၬနီၪ အ့ၬ.အနီၪလထံၪမွဲအစံၭဝ့ၫ ဘဲၫၥ့ၪလဲၪနီၪ,လ့ၩမၩ လိၪဆံၭ.အဂဲးဘဲၫယီၩ မွဲယဂဲၫကိၭထဲၩ့ၦအတီၩအ လီၩ့အ့ၬး အ့ၪမွဲၦဆၧဒဲၩဘၭဖိၪလခီၫလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့စယီဟၫ့အထံၩအဖျဲၥံၪ ဂဲၫလၧအအီၪ တၭ,စံၭဝ့ၫ,မွဲဘၪနီၫလၧပဝ့ၫဒဲၦဖၫရစံၫ လဖၪဒုၪဆၧ အၪ့ဆၧအီၩအၪဘျၩ့အၪဘျၩ့တၭ, နထံၩနဖျဲလဖၪလ",
			"15": "<sup>15</sup> ဒုၪဘၪဆၧအၪ့ဆၧအီၩလဲၪ.- ယ့ၫရှူၬလီၩဘၪဝ့ၫ, ဆၧ လၧတလၭမူၭအဖျဲယီၩ, ထီးတလၭမူၭအခွၫအီၪလၧ အၥိၭအဘိၩ့ဘၭတၭ,အၥုၪ့အုၭအၥၭအုၭဘၪမိ ၥ့ၪဆ့ဧၪ.မွဲလါနၫ့ဘိၩအနံၩအၥၫ့မိဘၪ လၧဆၧမိထုၭ လၩ့ဖၭတလၭမူၭအခွၫလၧအအီၪလီၫ. ထီးနီၪလဖၧၫ့",
			"16": "<sup>16</sup> အဝ့ၫၥံၪမိဒုၪဆၧအၪ့ဆၧအီၩလီၫ.- ဆၧကီၩ့ဆၧ ၥိၭအလးလံၩနီၪ ၦလဆၭဒၭဘၪလၧအၥၫ့နးဂၩတၭ, အ့ၪမၩဝ့ၫဘဲၫနီၪ,ဆၧအၥၫ့ၡၫ့ယၬဝ့ၫ, အဖၧၩ့လးယၬ",
			"17": "<sup>17</sup> လဲထၪ့ဝ့ၫလီၫ.- ဆၧလၧထိၪ့ဆၧဖံၭအလးလံၩအဖၧၩ့ နီၪၦလူၫနုၬဝ့ၫစဘံၭထံၫ အၥၫ့အ့ၬ. အ့ၪမၩဝ့ၫဘဲၫနီၪ တၭ,ထိၪ့ဆၧဖံၭနီၪဖီးဖၭဝ့ၫတၭ, စဘံၭထံၫလၩ့ ယွၩခွံၬ,ဒဲထိၪ့ဆၧဖံၭဂၭဂီၩ့ဝ့ၫလီၫ. အ့ၪမွဲစဘံၭထံၫ အၥၫ့နီၪၦလူၫနုၬဝ့ၫ လၧထိၪ့ဆၧဖံၭအၥၫ့အဖၧၩ့တၭ, အီၪဒၪအဆၧနံၫမံၩ့လူၬလီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪလီၩလၩ့လၬလၩ့ဆၧလဖၪနီၪလၧအဝ့ၫ ၥံၪအဘိၩ့ဘၭတၭ, ယိခွါ,ၦအခိၪလဂၩဂဲၫၡီၫ့လၩ့လၧ အမ့ၬယၫတၭ, စံၭဝ့ၫဒၪယဖိၪမုၪလဂၩ ဘိၩ့နဲၪ့ယီၩ ၥံၫယူၭၬမွဲလါနၩ့ဘိၩဂဲၫအီၪက့ၪလၩ့နစူၪ လၧအလီၩ့",
			"19": "<sup>19</sup> တၭ,မွဲအမိမၧၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.- ယ့ၫရှူၬဂဲထုၪ့လ့ၩ",
			"20": "<sup>20</sup> ဖိၬအခဲၫ့တၭ,အထံၩအဖျဲၥံၪအီၪလၧအၥိၭလီၫ.- ယိ ခွါ,ၦမုၪလၧအဆၫၥွံၪလၩ့ဝ့ၫ လဆံၫနံၫနံၪ့လဂၩ လ့ၩလၧယ့ၫရှူၬအချိၫ့တၭ, ထိၭဝ့ၫအဖၬဘဲၩ့အနွံၫ",
			"21": "<sup>21</sup> လီၫ.- အဂဲးဘဲၫယီၩစံၭဝ့ၫလၧအၥၭဖၧၩ့, ယအ့ၪထိၭ",
			"22": "<sup>22</sup> န့ၫအဖၬဘဲၩ့တၭ, ယမိဘျၪထဲၩ့ယဝ့ၫလီၫ.- ယ့ၫရှူၬ ကၠၪထဲၩ့အၥၭတၭ, ဒၪဘၪဝ့ၫနီၪစံၭဝ့ၫဒၪ, ဖိၪမုၪဧ့,မွဲန ၥၭဎွံၫထၪ့ဘီၪ, နဆၧနဲၩနီၪမၩဘျၪထဲၩ့နၧၩယူၭ.",
			"23": "<sup>23</sup> ၦမုၪနီၪဘျၪထဲၩ့ဝ့ၫလၧနၩရံၩနီၪလီၫ.- ယ့ၫရှူၬလ့ၩ နုၬလၧၦအခိၪအဂံၪ့တၭ, ဒၪဘၪဝ့ၫ လၧၦဖိၬဒိၩ့,",
			"24": "<sup>24</sup> အူၪပံၩ,ဒဲၦခမျၧးဂၪ့ကိၭဂၪ့ၡၭနီၪ,- လီၩဘၪဝ့ၫ, အီၪပဲၩဘီၪးၦဖိၪၥၪမုၪယီၩလၥံၫဘၪတၭ, မွဲအမံၫ",
			"25": "<sup>25</sup> မၪဝ့ၫလီၫ.အဝ့ၫၥံၪနံဘၪ ဒုၪဒွ့ၪအဝ့ၫလီၫ.- ထီးအနၫ့ ထၪ့ခွံၬၦခမျၧးနီၪ,လ့ၩနုၬဝ့ၫဖီၪ့ထၪ့အစူၪတၭ, ၦဖိၪ",
			"26": "<sup>26</sup> ၥၪမုၪဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.- ဆၧမၩအၥၭနီၪဂၧၫ့ထၪ့ ၥၩလၩ့ဝ့ၫလၧခးနီၪထၧၫ့ခးယၫလီၫ.",
			"27": "<sup>27</sup> ယ့ၫရှူၬစဲၪ့ထၪ့ခွံၬထီးနီၪ, ၦမ့ၬဘျီၪနံၫဂၩဂဲၫဖိၬအခဲၫ့ တၭ,ကိၭၡၭထၪ့ဆၧစံၭဝ့ၫဒၪ, စဒၫဝံၭအဖိၪခွၫဧ့,",
			"28": "<sup>28</sup> ယၫ့ၥၭထဲၩ့လါပၧၩဆံၭ.- အဝ့ၫဒၪလ့ၩနုၬဝ့ၫလၧဂံၪ့ ဖၧၩ့တၭ,ၦမ့ၬဘျီၪနံၫဂၩနီၪ ဂဲၫလၧအအီၪတၭ, ယ့ၫ ရှူၬစံၭအဝ့ၫၥံၪ,ဆၧယီၩလမံၩ့ ယမၩယဝ့ၫမိၥ့ၪနီၪ,မွဲ",
			"29": "<sup>29</sup> နၥံၪနဲၩဆ့ဧၪ.အဝ့ၫၥံၪစံၭဝ့ၫ မွဲယူၭ, ကဆါဧ့.- ထီး နီၪလဖၧၫ့ အဝ့ၫဒၪထိၭဘၪ အဝ့ၫၥံၪအမ့ၬၥၪတၭ, စံၭ ဝ့ၫဒၪ,ဘဲၫနၥံၪနဲၩဆၧအၥိၭနီၪ,မွဲအကဲၪထၪ့ လၧနၥံၪ",
			"30": "<sup>30</sup> အဂးဆံၭ.- တၭအဝ့ၫၥံၪ အမ့ၬၥၪဖၩ့ထၪ့ထဲၩ့ဝ့ၫလီၫ. ယ့ၫရှူၬမၪလူၬဝ့ၫဆီၪ့ဆီၪ့တၭ, စံၭဝ့ၫဒၪ,ဘဲၫၥိၭၦ ထီးၥ့ၪယၫနးဂၩလဂ့ၩတၭ, ထီးလၩ့နၥံၪအၥၭဆံၭ.",
			"31": "<sup>31</sup> မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬတၭ, မၩဂၧၫ့ထၪ့ၥၩ လၩ့အမံၩ့လၧခးနီၪထၧၫ့ခးယၫလီၫ.",
			"32": "<sup>32</sup> ထီးအဝ့ၫၥံၪ စဲၪ့ထၪ့ဝ့ၫအဘိၩ့ဘၭနီၪ,ယိခွါ, ၦဂဲၫ ဂဲၫဆိၬၦအုၭအၭလၧဆၧနၪအီၪလၧအလီၩ့လဂၩလၧ",
			"33": "<sup>33</sup> အအီၪ,- ထီးအနၫ့ထၪ့ခွံၬဆၧနၪတၭ, ၦအုၭအၭနီၪ ချဲၩ့ထၪ့ထဲၩ့ဆၧလီၫ. ၦခမျၧးထီၫမံၫထီၫမၪတၭ, စံၭဝ့ၫဒၪ,ဆၧဒၪဘၪဆၧဘဲၫယီၩၥိၭ လၧအံၫစရ့လၭ",
			"34": "<sup>34</sup> အကျၩနးဆိၭအ့ၬ.- အ့ၪမွဲၦဖၫရစံၫလဖၪစံၭဝ့ၫဒၪ,မွဲအ နၫ့ထၪ့ခွံၬ ဆၧနၪလၧဆၧနၪ အခိၪလဂၩအကၠီၩ့လီၫ.",
			"35": "<sup>35</sup> ယ့ၫရှူၬစဲၪ့ဝံၩ့ဝၩ့ကိၭဒိၩ့ကိၭတဝၫ့တၭ,ၥီၪ့ထဲၩ့ ဆၧလၧအဝ့ၫၥံၪ အၥရိၬဖၧၩ့တၭ, လီၩလၩ့လၬလၩ့ ဘၩ့မုးအဆၧၥၭထိၬအပရၧၫ့တၭ, မၩဘျၪထဲၩ့ကယဲ",
			"36": "<sup>36</sup> ဆၧဆၫ,ဒဲဆၧဆီၫ့ကိၭဆီၫ့ကဲၩ့ထီးအလူၬလီၫ.- အဝ့ၫ နီၪဒၪဘၪၦခမျၧးတၭ, ယၫ့ၥၭဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ၦလဖၪနီၪ လၩ့ပွံၭလၩ့ထၩ့တၭ, လၩ့မုလၩ့ဖၭဝ့ၫ",
			"37": "<sup>37</sup> ဘဲၫၥိၪလဖၪလၧၦလအီၪယူၬဘၪဝ့ၫအၥိၭနီၪလီၫ.-ထီး နီၪလဖၧၫ့ အဝ့ၫဒၪစံၭအထံၩအဖျဲၥံၪ, ကူၭဆၧအလး အီၪအၪမၬတၭ, အ့ၪမွဲၦမၩဆၧလဖၪနီၪ အီၪၡၩ",
			"38": "<sup>38</sup> ဂၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဘၩဆိၪဖၪအၪ့ကံၩ့ ကူၭဆၧအလးအကဆါ, ဘဲၫၥိၭအမိအၪ့မၧၫ့လၩ့ ၦမၩဆၧလဖၪလၧကူၭဆၧအလးအဖၧၩ့နီၪဆံၭ."
		},
		"10": {
			"1": "<sup>1</sup> အဝ့ၫဒၪကိၭန့အထံၩအဖျဲလဆံၫနံၫဂၩနီၪ လၧ အအီၪတၭ,ဖ့ၪလၫ့ဝ့ၫဆၧစီၩ့ဆၧမၩ့ လၧဆၧနၪအ ဖၫ့ခိၪ,ဘဲၫၥိၭအမိနၫ့ထၪ့ခွံၬဝ့ၫ, ဒဲမၩဘျၪထဲၩ့ကယဲ ဆၧဆၫဒဲကယဲဆၧဆီၫ့ကိၭဆီၫ့ကဲၩ့ ထီးအလူၬအၥိၭ နီၪလီၫ.",
			"2": "<sup>2</sup> ၦဆၧအၪ့မၧၫ့ဖိၪလဆံၫနံၫဂၩနီၪအမံၩ့ မွဲဘဲၫယီၩ, အခၪ့ထံၭမွဲစစဲမၧၫ့ကိၭဝ့ၫလၧစပံတၧၫ, ဒဲအထၧၫ့ဖုဝဲ စအၫ့ဒူၫ,စဇ့ၭဘဒံၫအဖိၪခွၫစယ့မံၭ, ဒဲအထၧၫ့ဖုဝဲ",
			"3": "<sup>3</sup> စယီဟၫ့း- စဖံလံၭဒဲစဘၫၥီလမုၫ, စထီမၭ,ဒဲၦအၪ့ ကံၩ့အခီၫ့စမၭၥုၫး စအၫလဖံအၧၭအဖိၪခွၫစယ့မံၭ,",
			"4": "<sup>4</sup> ဒဲစလ့ၭဘအၧၭကိၭဝ့ၫအမံၩ့အၥၫ့စၥၫဒံအၧၭ,- ၦကၫ နအၫ့ဖိၪစစဲမၧၫ့, ဒဲစယုဒၭအံၭစကၫရအၧၭ လၧအဖ့ၪ လၫ့ခွံၬယ့ၫရှူၬလီၫ.",
			"5": "<sup>5</sup> ၦလဆံၫနံၫဂၩနီၪ ယ့ၫရှူၬအၪ့မၧၫ့ အလ့ၩဆၧတၭ, မၪလူၬဝ့ၫစံၭဝ့ၫဒၪ, လ့ၩဖိၬဖၧၩ့ၥၭလၧ ၦဆၨၩလဖၪ အအီၪလဂ့ၩ, လ့ၩနုၬလၧၦစမ့ရအၫဖိၪ အဒိၩ့ၥံၪနး",
			"6": "<sup>6</sup> စီၪ့လဂ့ၩတၭး- အ့ၪမွဲ,လ့ၩဆိၫဒၪခလူၬလၧၥိၪလၧ အလၩ့မါ,ၦအံၫစရ့လၭအဂံၪ့ဖိၪ အအီၪနီၪဆံၭ.",
			"7": "<sup>7</sup> လ့ၩလီၩလၩ့လၬလၩ့ဆၧတၭ, စံၭနၥံၪဝ့ၫ,မူၭခိၪအ",
			"8": "<sup>8</sup> ဘၩ့အမုးနီၪဘူၭထၪ့ယူၭ.- မၩဘျၪထဲၩ့ၦဆၫၥံၪ, ဒုၭ ဂဲထုၪ့ထဲၩ့ ၦၥံၫလဖၪနီၪ, မၩဆံၫ့ထၪ့ထဲၩ့ၦလၧအခံၫ ထူၬဆၫအၧၩ့လဖၪနီၪ, နၫ့ထၪ့ခွံၬဆၧနၪလဖၪဆံၭ. နၥံၪဒိၭန့ဆၧပျီၩပျီၩတၭ, ဖ့ၪလၫ့ဆၧပျီၩပျီၩဆံၭ.",
			"9": "<sup>9</sup> ထီၫ့မွဲဂ့ၩ,စ့ၩမွဲဂ့ၩ, ထီးလၧနၥံၪအခၧၩ့ယးဖၧၩ့",
			"10": "<sup>10</sup> မွဲဂ့ၩ,- ထိၪ့လဖျိၪ့လၧဖၧၩ့ၥၭအဂးမွဲဂ့ၩ, ဆဲၫ့နံၫဘံၪ့ မွဲဂ့ၩ,ခၪ့ဖံၭ လဖၪမွဲဂ့ၩ, နိၪထိၭလဘီၩ့မွဲဂ့ၩ, တဲၩ့ဝဲၩ လၧနၥံၪအဂးလဂ့ၩး အဂဲးဘဲၫယီၩၦလၧအမၩဆၧနီၪ",
			"11": "<sup>11</sup> ဂ့ၩန့ဘၪဆၧအၪ့ဆၧအီၩလီၫ.- ထီးဒၪဒိၩ့ဂ့ၩး တဝၫ့ ဂ့ၩ,လၧနၥံၪလ့ၩနုၬဘၪလဖျိၪ့ဖျိၪ့တၭ, ၦအဂ့ၩအီၪ လၧအဖၧၩ့ မွဲပလၫလဂၩလဲၪနီၪ, အၪ့စၪ့ဒၪခလူၬတၭ, နၥံၪလချႃၭစဲၪ့ထၪ့ခွံၬဒံၭဘၪနီၪ, အီၪထီးနီၪဆံၭ.",
			"12": "<sup>12</sup> ထီးနၥံၪအ့ၪလ့ၩနုၬလၧဂံၪ့ဖၧၩ့တၭ, ချဲၩ့မုၬဝ့ၫဆံၭ.",
			"13": "<sup>13</sup> ဆၧလၧဂံၪ့နီၪအ့ၪဂ့ၩန့ ဘၪဆၧတၭ, မွဲနၥံၪအဆၧမုၬ ဆၧလၩမိဘၪဒၪဝ့ၫဆံၭး အ့ၪလဂ့ၩန့ဘၪနီၪ,မွဲနၥံၪအ",
			"14": "<sup>14</sup> ဆၧမုၬဆၧလၩဘၪထဲၩ့ဒၪနၥံၪဆံၭ.- ထီးဒၪၦလၧအ လထိးဆၧၫ့ဘၪနၥံၪတၭ, လခိၭနၪဘၪနၥံၪအလူလဂၩ ဂၩနီၪ,ထီးနၥံၪအ့ၪစဲၪ့ထၪ့ခွံၬ လၧအဂံၪ့မွဲဂ့ၩ, အဒိၩ့ မွဲဂ့ၩ,တရူၩလၩ့ခွံၬ ဂၪ့ခိၪအမုၬလၧနၥံၪအခၪ့ယၫ",
			"15": "<sup>15</sup> ၥၭဆံၭ.- ယလီၩဘၪနၥံၪတီၩတီၩယီၩ,လၧမုစ့ၩ ရၫ့အနံၩနီၪခးစီဒၧၫ့,ဒဲဂမီရၫ မိဘၪဆၧယီၫနဲၪ့ ဒိၩ့လ ဖျိၪ့နီၪဒံၭလီၫ.",
			"16": "<sup>16</sup> ယိခွါ, ယအၪ့မၧၫ့နၥံၪလ့ၩဆၧဘဲၫၥိၪလဖၪလၧထွံၪ မံၩ့ၥံၪအကျၩအၥိၭနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ,ကဲၪ ထၪ့ၦအကိၪ့ဆၧၥ့ၪဘဲၫဂူအၥိၭ, ဒဲဆၧမၪလအီၪဘၪ",
			"17": "<sup>17</sup> ဘဲၫထိၪလွံအၥိၭနီၪဆံၭ.- ထီးလၩ့နၥံၪအၥၭ လၧ ၦၡၩၥံၪဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမိဖ့ၪလၫ့ခွံၬ နၥံၪလၧၦအီၪကီၪ့စ့ၩရၫ့ခွးအစူၪဖၧၩ့တၭ, မိထး",
			"18": "<sup>18</sup> နၥံၪလၧအဝ့ၫၥံၪအၥရိၬဖၧၩ့လီၫ.- မိၥိၫ့နၥံၪလၧၦ ဒိၪၦၡါဒဲလၧၦဘိၪ့ၦဎွၩအအီၪလၧယကၠီၩ့, ဘဲၫ ၥိၭနၥံၪမိကဲၪထၪ့ၦထိးအၥၭ လၧအဝ့ၫၥံၪအမ့ၬယၫ, ဒဲလၧၦဆၨၩလဖၪ အမ့ၬယၫလီၫ.",
			"19": "<sup>19</sup> ထီးအဖ့ၪလၫ့ခွံၬနၥံၪတၭ,မွဲနၥံၪမိချဲၩ့ဆၧဘဲၫ ၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ, နၥံၪမိချဲၩ့ဆၧဘဲၫအံၩဘဲၫအိၩနီၪ, ထီးအၪ့ယိၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩလၧနၩရံၩနီၪ",
			"20": "<sup>20</sup> ဆၧမိဖ့ၪလၫ့နၥံၪဆၧလၧနၥံၪမိချဲၩ့ဆၧလီၫ.- အဂဲးဘဲၫ ယီၩနၥံၪချဲၩ့ဒၪနၥံၪဝ့ၫအ့ၬ, မွဲနၥံၪအဖါအၥၭချဲၩ့ဆၧ",
			"21": "<sup>21</sup> လၧနၥံၪအဖၧၩ့လီၫ.- ထၧၫ့ဖုဝဲမိဖ့ၪလၫ့အထၧၫ့ဖုဝဲ လၧဆၧၥံၫအဖၧၩ့, ဒဲဖါဎမိဖ့ၪလၫ့ၭအဖိၪဆ့လီၫ. ဖိၪ လဖၪနီၪမိထၫ့ဒုၪထၫ့ဒၩအမိအဖါတၭ, မိဒုၭၥံၫအဝ့ၫ",
			"22": "<sup>22</sup> ၥံၪလီၫ.- နၥံၪမိဘၪဆၧၥၭဂဲၫ့လၧၦၡၩ ထီးအလူၬလၧ ယမံၩ့အကၠီၩ့လီၫ. အ့ၪမွဲၦလၧအဂုးအခၧၫ့ဝ့ၫထီး အထုၬနီၪ,မိထီၩ့ဝ့ၫလၧဆၧထိးထဲၩ့တၩ့ထဲၩ့လီၫ.",
			"23": "<sup>23</sup> ထီးၦမၩအၧၩ့မၩနၭနၥံၪ လၧဒိၩ့လဖျိၪ့ယီၩတၭ, စဲၪ့နုၬလၧအဂူၫဂၩလဖျိၪ့ဆံၭ. ယလီၩဘၪနၥံၪတီၩ တီၩယီၩ, နၥံၪလ့ၩလၧအံၫစရ့လၭ အဒိၩ့ၥံၪလချႃၭ ဎံၩ့ဒံၭဘၪတၭ, ၦၡၩအဖိၪခွၫယီၩမိဂဲၫဝ့ၫလီၫ.",
			"24": "<sup>24</sup> အဖျဲအီၪလၧအဆရၫအဖၫ့ခိၪအ့ၬ. အဎီးအၡၩ",
			"25": "<sup>25</sup> အီၪလၧအကဆါအဖၫ့ခိၪဆ့အ့ၬ.- အဖျဲအ့ၪအီၪ ဘဲၫအဆရၫအၥိၭတၭ, အဎီးအၡၩအ့ၪအီၪဘဲၫအက ဆါအၥိၭနီၪဘၪယူၭ. ၦအ့ၪကိၭဂံၪ့ကဆါ လၧဘၫအ လၭဇဘၧၭတၭ, မိကိၭၦဂံၪ့ဖိၪနၭနဲၪ့အနီၪဆံၭအၪလဲၪ.",
			"26": "<sup>26</sup> မၩအၥၭဘဲၫနီၪတၭ,ထီးၥၭမဲၪအဝ့ၫၥံၪလဂ့ၩ. အ ဂဲးဘဲၫယီၩ ဆၧလၧအဘၪဆၧချႃၬဘံၭထၬနီၪ ဆၧ လမၩဖျီၪထၪ့ဘၪဝ့ၫအီၪနးမံၩ့အ့ၬ. ဆၧလၧအအီၪ",
			"27": "<sup>27</sup> ၥူၪနီၪ,ဆၧလဒုၭၥ့ၪယၫဘၪဝ့ၫအီၪနးမံၩ့အ့ၬ.- ဆၧ လၧယလီၩဘၪနၥံၪလၧဆၧခံၭကျၩယီၩ, လီၩဘၪထဲၩ့ လၧဆၧဖၩ့အကျၩဆံၭ. ဆၧလၧနၥံၪဂၧၫ့ဘၪလၧန",
			"28": "<sup>28</sup> ၥံၪအနါဖၧၩ့,လီၩဘၪလၧဂံၪ့ခိၪအဖၫ့ခိၪဆံၭ.- ၦလၧ အမၩၥံၫၦနးခီၫ့တၭ,မၩၥံၫၦၥၭၡီၩ့လၥ့ၪဘၪနီၪ, ထီး ၥၭမဲၪလဂ့ၩ, အ့ၪမွဲၦလၧအမၩဂၭဂီၩ့ၦၥၭၡီၩ့ ဒဲၦ နးခီၫ့လၧလရၬဖၧၩ့ၥ့ၪလဂၩနီၪ, ၥၭမဲၪအဝ့ၫဒၪအၪ နဲၪ့အနီၪဆံၭ.",
			"29": "<sup>29</sup> ၦအၪ့ဆၫခွံၬထိၪဎွံၭနံၫဘံၪ့လၧထီးလဘံၪ့အဂး မွဲ အ့ၬဧၪ. နၥံၪအဖါလအီၪဘၪတၭ,လၩ့ထ့ၬဝ့ၫလၧဂၪ့",
			"30": "<sup>30</sup> ခိၪနးဘံၪ့အ့ၬ.- နၥံၪအခိၪၥူၫလဘီၩ့နီၪဒၪလ့ၬ ဘၪ, ဆၧဝံထၪ့နၬထၪ့ဝ့ၫထီးအလူၬလီၫ.-",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫ နီၪတၭ,ထီးၥၭမဲၪဆၧလဂ့ၩ,နၥံၪဂ့ၩနဲၪ့ ထိၪဎွံၭအၪ ဘံၪ့ဒံၭလီၫ.",
			"32": "<sup>32</sup> မၩအၥၭဘဲၫနီၪတၭ, ကယဲၦလၧအအုၩ့လၩ့ယၧၩ လၧၦၡၩၥံၪအမ့ၬယၫလဂၩဂၩနီၪ, ယမိအုၩ့လၩ့အ ဝ့ၫနီၪလၧယဖါအီၪလၧမူၭခိၪအမ့ၬယၫဆ့လီၫ.",
			"33": "<sup>33</sup> အ့ၪမွဲထီးဒၪၦလၧအမီၪ့ဘံၭယၧၩ လၧၦၡၩၥံၪအမ့ၬ ယၫလဂၩဂၩနီၪး ယမိမီၪ့ဘံၭအဝ့ၫနီၪ လၧယဖါ အီၪလၧမူၭခိၪအမ့ၬယၫ ဆ့လီၫ. လမွဲဘၪဆၧဘၪလိၬအိၭလိၬအ့ၪမွဲနၭလဘံၪ့. (လု,ၥ၂;၅ၥ-၅၃,ၥ၄;၂၆-၂၇)",
			"34": "<sup>34</sup> ထီးဆီၫ့မီၪ့လၧယဂဲၫခွံၬလၩ့ ဆၧဘၪလိၬအိၭလိၬ လၧဂၪ့ခိၪချိၫ့ယီၩလဂ့ၩ. မွဲယဂဲၫခွံၬလၩ့ဆၧဘၪ",
			"35": "<sup>35</sup> လိၬအိၭလိၬအ့ၬ,မွဲနၭလဘံၪ့လီၫ.- အဂဲးဘဲၫယီၩယ ဂဲၫမၩလၩ့မုလၩ့ဖၭ ၦလဂၩလၧအဖါ, ဖိၪမုၪလၧ",
			"36": "<sup>36</sup> အမိ,ဒဲၪလၧအမံၩ့ၡါမုၪလီၫ.- ဂံၪ့ကဆါအဒုၪအဒၩမိမွဲ အဂံၪ့ဖိၪၥံၪလီၫ.",
			"37": "<sup>37</sup> ၦလၧအအဲၪအမိဂ့ၩအဖါဂ့ၩအၪနဲၪ့အအဲၪယၧၩ ယီၩ,ကြၨၭလၧယၧၩအ့ၬ. ၦလၧအအဲၪအဖိၪမုၪဂ့ၩ ဖိၪခွၫဂ့ၩအၪနဲၪ့အအဲၪယၧၩယီၩ, ကြၨၭလၧယၧၩ",
			"38": "<sup>38</sup> အ့ၬ.- ၦလၧအလမၩန့ဘၪအထုၪ့စူၪယၫဒဲအလဖိၬ",
			"39": "<sup>39</sup> ဘၪယခဲၫ့နီၪ,ကြၨၭလၧယၧၩအ့ၬ.- ၦလၧအဒၪန့အ ၥၭမၧၫ့နီၪ,မွဲအမိမၩလၩ့မါဝ့ၫလီၫ. ၦလၧအၥၭမၧၫ့ လၩ့မါဝ့ၫလၧယကၠီၩ့ယီၩ မိဒၪန့ထဲၩ့ဝ့ၫလီၫ.",
			"40": "<sup>40</sup> ၦလၧအထိးဆၧၫ့နၥံၪနီၪမွဲအထိးဆၧၫ့ယၧၩတၭ, ၦလၧအထိးဆၧၫ့ယၧၩယီၩး မွဲအထိးဆၧၫ့ ၦလၧအ",
			"41": "<sup>41</sup> အၪ့မၧၫ့လၩ့န့ယၧၩလဂၩနီၪလီၫ.- ၦလၧအထိးဆၧၫ့ မီၪလၧမီၪအမံၩ့အကၠီၩ့နီၪ, မိန့ဘၪမီၪအခိးအတၩ တၭ,ၦလၧအထိးဆၧၫ့ ၦအတီၩအလီၩ့ လၧၦအတီၩ အလီၩ့ အမံၩ့အကၠီၩ့နီၪ, မိန့ဘၪၦအတီၩအလီၩ့အခိး",
			"42": "<sup>42</sup> အတၩလီၫ.- ထီးဒၪၦလၧအဖ့ၪလၫ့အီၩၦလဂၩလၧ ၦအဆံၭလဖၪယီၩအကျၩန့ၫထံၫချံၪ့နးဘျႃၪ့ လၧအ ထံၩအဖျဲအမံၩ့အကၠီၩ့လဂၩဂၩနီၪ, ယလီၩဘၪနၥံၪ တီၩတီၩယီၩ, အခိးအတၩလၩ့မါဘၪအ့ၬ."
		},
		"11": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭ လၧယ့ၫရှူၬမၪလူၬအထံၩအဖျဲလဆံၫ နံၫဂၩနီၪဂီၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪ,ဘဲၫၥိၭအမိၥီၪ့ ထဲၩ့ၥၫ့ထဲၩ့ဆၧ ဒဲလီၩလၩ့လၬလၩ့ဆၧလၧအဝ့ၫၥံၪအ ဒိၩ့လဖၪအဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> စယီဟၫ့အီၪလၧထီၫ့ဖၧၩ့နီၪနါဂၧၫ့ လၧဎရံၬအဆၧ",
			"3": "<sup>3</sup> မၩလဖၪအဂဲး, အၪ့မၧၫ့အဖျဲနံၫဂၩလ့ၩဝ့ၫတၭ,- စံၭ အဝ့ၫနီၪ,နဝ့ၫဒၪယီၩ, နမွဲၦလၧ အဂဲၫဝ့ၫလဂၩနီၪဧၪး အ့ၪလမွဲဘၪနီၪပဘၪယိလါဒံၭ ၦလဂၩဒၪအဖၧၩ့ၥၭဆ့ ဧၪ.",
			"4": "<sup>4</sup> ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭလီၩဘၪဝ့ၫ, ဆၧလၧနၥံၪ နါဂၧၫ့,ဒဲနၥံၪဒၪဘၪလဖၪယီၩ, ထဲၩ့လီၩဘၪစယီဟၫ့",
			"5": "<sup>5</sup> ဆံၭ.- ၦလၧအမ့ၬဘျီၪလဖၪနီၪဒၪထၪ့ထဲၩ့ဆၧ,ဒဲၦလၧ အခၪ့ဂၭဂီၩ့လဖၪနီၪစဲၪ့ထၪ့ထဲၩ့ဝ့ၫ, ဒဲၦလၧအခံၫထူၬ ဆၫအၧၩ့ လဖၪနီၪဆံၫ့ထၪ့ထဲၩ့ဝ့ၫ,ဒဲၦလၧအနါအၧၩ့ လဖၪနီၪ, နါဂၧၫ့ထၪ့ထဲၩ့ဆၧ,ၦလၧအၥံၫလဖၪနီၪဆၧ ဒုၭဂဲထုၪ့ထဲၩ့ဝ့ၫ, ဒဲၦလၧအၡၪ့အယၬလဖၪနီၪ ဘၪ ဆၧလီၩလၩ့လၬလၩ့ဝ့ၫ လၧဆၧၥၭထိၬအပရၧၫ့လီၫ.",
			"6": "<sup>6</sup> ထီးဒၪၦလၧအၥၭလဂၭဂီၩ့ဘၪ လၧယကၠီၩ့လဂၩဂၩ နီၪ,အီၪမုၬဝ့ၫဒၪလီၫ.",
			"7": "<sup>7</sup> ထီးအဝ့ၫၥံၪထဲၩ့ဝ့ၫတၭ, ယ့ၫရှူၬလီၩဘၪၥၫ့ၦခမျၧး လၧစယီဟၫ့အဂဲးအကၠီၪ့တၭ, စံၭဝ့ၫဒၪ,နၥံၪစဲၪ့ထၪ့ လၧမံၩ့လၬကျၩ ဘဲၫၥိၭနၥံၪမိယိဖၧၩ့ ဆၧနီၪလဲၪ.",
			"8": "<sup>8</sup> မွဲဖီးလဘီၩ့လၧလံၩအူၪဝၭဝ့ၫနီၪဧၪ.- အ့ၪလမွဲဘၪ တၭ,မွဲနၥံၪစဲၪ့ထၪ့ ဘဲၫၥိၭနၥံၪမိယိဖၧၩ့ဆၧနီၪလမံၩ့ လဲၪးမွဲၦကီၩ့ဆၧၥိၭဆၧ လၧဆၧကီၩ့ဆၧၥိၭဖူၬလူၭ နီၪဆ့ဧၪ.ယိခွါ, ၦလၧအကီၩ့ဆၧၥိၭဆၧအဖူၬလူၭလ ဖၪနီၪအီၪဝ့ၫ လၧစဎွၩၥံၪအနီးဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> အ့ၪလမွဲဘၪတၭ, မွဲနၥံၪစဲၪ့ထၪ့ဘဲၫၥိၭနၥံၪမိယိဖၧၩ့ ဆၧ နီၪလဲၪ. မွဲမီၪလဂၩဧၪ.မွဲယူၭ,ယလီၩဘၪနၥံၪ, မွဲ",
			"10": "<sup>10</sup> အဒိၪနဲၪ့မီၪလဂၩဒံၭလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪနီၪ မွဲၦလၧဆၧ ကွ့ၭအၥၭလၧအဂဲး. ယိခွါ, ယအၪ့မၧၫ့လၩ့ယၥီၫ့လဂၩလၧနမ့ၬယၫ, လၧအမိမၩထဲၩ့နဖၧၩ့ၥၭလၧနမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> ယလီၩဘၪနၥံၪတီၩတီၩယီၩ ၦလၧၦမုၪအီၪဖျဲၪန့ဝ့ၫ အကျၩနီၪ ဒိၪနဲၪ့ၦဘၭတံၫဇၫ့ဆၧ စယီဟၫ့အီၪနး ဂၩအ့ၬ,မွဲလါနၫ့ဘိၩ, ၦအီၪဝ့ၫလၧမူၭခိၪ အဘၩ့အ မုးအဖၧၩ့အဆံၭထုၬလဂၩနီၪဒိၪနဲၪ့အဝ့ၫနီၪဒံၭလီၫ.",
			"12": "<sup>12</sup> လၧၦဘၭတံၫဇၫ့ဆၧ စယီဟၫ့အမုနံၩလဖၪခီးဘိၩ့ နဲၪ့ယီၩ, မူၭခိၪအဘၩ့အမုးဘၪဆၧအၪ့ဂူၬ ဆီၪ့ဝ့ၫ",
			"13": "<sup>13</sup> တၭ, ၦအၪ့ဂူၬဆီၪ့ဝ့ၫလဖၪမၩန့ဆီၪ့ဝ့ၫလီၫ.- အဂဲး ဘဲၫယီၩ ကယဲမီၪဒဲဆၧမၪလူၬနီၪ ချဲၩ့ဝ့ၫလၧမီၪအချိၬ",
			"14": "<sup>14</sup> ထီၩ့လၩ့လၧစယီဟၫ့လီၫ.- နၥံၪအၥၭအ့ၪအီၪလၧန ၥံၪမိဒိၭန့ဆၧယီၩတၭ, ဆၧလၧၦလဂၩယီၩမွဲၦလၧအ",
			"15": "<sup>15</sup> မိဂဲၫဝ့ၫစအံၫလဲယၫလီၫ.- ၦအီၪလၧအနါလၧအနါ ဂၧၫ့ဆၧနီၪး မွဲအနါဂၧၫ့ဒၪဝ့ၫဆံၭ.",
			"16": "<sup>16</sup> ၦလဆၨၩယီၩ, မွဲယမိဒီၩ့လၩ့ဝ့ၫလၧဆၧနီၪလ မံၩ့လဲၪ,မွဲအမၩအၥၭဘဲၫဖိၪၥၪလဖၪ ဆၧၫ့နၩ့လၧဘိၪ့",
			"17": "<sup>17</sup> ဖၧၩ့တၭ, ကိၭအထံၩအၥိၭ,- စံၭဝ့ၫဒၪ,ပအူၪပံၩလၧ နၥံၪအဂးတၭးနၥံၪဂဲထုၪ့လံအ့ၬ, ပဂၪ့ဆၧလၧနၥံၪ",
			"18": "<sup>18</sup> အဂးတၭ,နၥံၪဒဲၩလၩ့နၥံၪအၥၭနၫၡါဆ့အ့ၬ.- အဂဲး ဘဲၫယီၩစယီဟၫ့ဂဲၫဝ့ၫတၭ, လအၪ့လအီၩဘၪဆၧ",
			"19": "<sup>19</sup> နီၪ,ၦစံၭဝ့ၫဒၪ,မွဲဆၧနၪအီၪလၧအလီၩ့လီၫ.- ၦၡၩ အဖိၪခွၫဂဲၫဝ့ၫတၭ,အၪ့ဆၧအီၩဆၧနီၪ, ၦစံၭဝ့ၫဒၪ, ယိခွါ,ၦလဂၩယီၩ မွဲၦအၪ့လၨၪဆၧတၭ, ၦအီၩလၨၪ စဘံၭထံၫ, ၦထၧၫ့ထံၩထၧၫ့ၥိၭလၧၦအၪ့ကံၩ့အခီၫ့, ဒဲလၧၦဆၧဒဲၩဘၭဖိၪလီၫ. မွဲလါနၫ့ဘိၩ,ဆၧကိၪ့ ဘၪကိၪ့ၥ့ၪနီၪ ဘၪဆၧအီၪ က့ၪတီၩအီၪက့ၪလီၩ့ဝ့ၫ လၧအဖိၪအလံၩလဖၪလီၫ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪအီၪက့ၪၥၫ့ဆၧမၪလၧဒိၩ့လ ဖၪလၧအမၩလၩ့လၭဆၧ လၧအအၪဒၪဆၧဒံၭလၧအ ဖၧၩ့နီၪအလီၩ့, လၧအလနီၫ့ယါလၩ့ထဲၩ့ဘၪ အ",
			"21": "<sup>21</sup> ၥၭအကၠီၩ့လီၫ.- ခိၫရဇံၫ့ဧ့, နဝ့ၫဒၪယီၩ နဘၪဆၧအ ၡၪ့လီၫ.ဘ့ၭၥစ့ဒၫဧ့, နဝ့ၫဒၪယီၩ, နဘၪဆၧအၡၪ့ လီၫ.အဂဲးဘဲၫယီၩဆၧလၩ့လၭလၧအမၩယူၭလၧန ၥံၪအဖၧၩ့လဖၪနီၪ, အ့ၪဘၪဆၧမၩဝ့ၫလၧဒိၩ့တဲအၫ အဖၧၩ့ဒဲဒိၩ့စဲဒၧၫ့အဖၧၩ့တၭ, မိနီၫ့ယါလၩ့ထဲၩ့ယူၭ အၥၭယံၬယံၬယူၭ လၧရၧၬအဆၧကဲၩ့ယၬ, ဒဲလၧဖံၫ့",
			"22": "<sup>22</sup> ချၪအဖၧၩ့ယူၭလီၫ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ,ယလီၩဘၪ နၥံၪ,လၧဆၧစ့ၩရၫ့အမုနံၩနီၪ, တဲအၫဒဲစဲဒၧၫ့ မိဘၪ ဆၧယီၫနဲၪ့နၥံၪဒံၭလီၫ.",
			"23": "<sup>23</sup> နဝ့ၫဒၪ,ကပၧနအၫ့ဧ့, နထၪ့ဘၭလၧမူၭခိၪလါနၫ့ ဘိၩ,နမိဘၪလ့ၩလၩ့ထီၩ့ လၧဖျႃဖၧၩ့လီၫ. အဂဲး ဘဲၫယီၩ,ဆၧလၩ့လၭ လၧအမၩယူၭလၧနဖၧၩ့လဖၪ နီၪ,အ့ၪဘၪဆၧမၩဝ့ၫ လၧစီဒၧၫ့အဖၧၩ့တၭ, မိအီၪဒံၭ",
			"24": "<sup>24</sup> ဝ့ၫထီးမုလနံၩယီၩလီၫ.- ယလီၩဘၪနၥံၪယီၩ,ထီး ဆၧစ့ၩရၫ့အမုနံၩနီၪ ခးစီဒၧၫ့မိဘၪ ဆၧယီၫနဲၪ့နၧၩ ဒံၭလီၫ.",
			"25": "<sup>25</sup> ထီးအထီနီၪယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, မူၭခိၪဒဲဂၪ့ခိၪအကဆါ, ဖါဧ့, ယစံၭထၪ့အၪ့အူၭနၧၩ လီၫ.အဂဲးဘဲၫယီၩ ဆၧလဖၪယီၩနအီၪက့ၪၥူၪခွံၬလၧ ၦအကိၪ့ဘၪကိၪ့ၥ့ၪလဖၪအမ့ၬယၫလါနၫ့ဘိၩ, နမၩ",
			"26": "<sup>26</sup> ဖျီၪထၪ့ဝ့ၫလၧဖိၪၥၪအမ့ၬယၫလီၫ.- မွဲယူၭ,ဖါဧ့,",
			"27": "<sup>27</sup> မွဲအဘၪနၥၭဘဲၫနီၪအဂဲးလီၫ.- ယဖါနီၪဖ့ၪလၫ့ယူၭ ယၧၩလၧဆၧထီးအလူၬယူၭ. အ့ၪလမွဲဘၪဖါနီၪ, ၦၥ့ၪယၫဖိၪခွၫနးဂၩအ့ၬ. အ့ၪလမွဲဘၪဖိၪခွၫဒဲထီးဒၪ ၦလၧဖိၪခွၫမိမၩဖျီၪထၪ့ဝ့ၫလဂၩဂၩနီၪ,ၦၥ့ၪယၫ ဖါနးဂၩအ့ၬ.",
			"28": "<sup>28</sup> ၦလၧအယိၭဆၧဎၧၫ့ ဒဲဆၧပွံၭအၥၭထီးအလူၬၥံၪ ဧ့,ဂဲၫထဲၩ့လၧယအီၪဆံၭ. ယမိဒုၭအီၪပွံၭနၥံၪ",
			"29": "<sup>29</sup> လီၫ.-မၩန့ထၪ့ယနိၪယိၭဘီၩ့လၧနၥံၪအလီၩ့တၭ, မၩလိၪ ဆၧလၧယၧၩယီၩဆံၭ. အဂဲးဘဲၫယီၩ ယၥၭ ဆၧၩ့ဒဲယဆၪ့လၩ့ယၥၭတၭ, နၥံၪမိဒၪန့ဆၧအီၪ",
			"30": "<sup>30</sup> ပွံၭလၧနၥံၪအၥၭၡီၩ့အဂးလီၫ.- အဂဲးဘဲၫယီၩ ယ နိၪယိၭဘီၩ့မွဲအယီၫ,ဒဲယဆၧယိၭ မွဲအဎွံၫခိၬလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ထီးအထီနီၪ ယ့ၫရှူၬလ့ၩဆၧလၧဆံၬဖၧၩ့လၧမး ၥံၫအနံၩတၭ,အထံၩအဖျဲလဖၪ ၥၭဝံအၥၭတၭ ဒ့ၭန့",
			"2": "<sup>2</sup> ၥၫ့ဘုၪဆဲၩၥံၪတၭအၪ့ဝ့ၫလီၫ.- ၦဖၫရစံၫၥံၪဒၪဘၪ ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ယိခွါ,ဆၧလဂ့ၩမၩဘၪလၧမးၥံၫ",
			"3": "<sup>3</sup> အနံၩယီၩနဖျဲလဖၪမၩဝ့ၫမၬကၨ.- အဝ့ၫနီၪစံၭအဝ့ၫ ၥံၪ,စဒၫဝံၭဒဲၦအီၪလၧအၥိၭလဖၪထီးအၥၭဝံအၥၭ တၭ,မၩဆၧဘဲၫအံၩဘဲၫအိၩနီၪ, မွဲနၥံၪလဖီဘၪဧၪ.",
			"4": "<sup>4</sup> အဝ့ၫဒၪလ့ၩနုၬဝ့ၫ လၧယွၩအဂံၪ့ဖၧၩ့တၭ, အၪ့ဆၧမ့ၬ ယၫအကိၪလၧအနၫ့ဆါဒၪဝ့ၫမွဲဂ့ၩ, ၦအီၪလၧအၥိၭ မွဲဂ့ၩ,လဂ့ၩအၪ့ဘၪ, ဂ့ၩအၪ့န့ၫၦလုဆၧလဖၪဘဲၫ",
			"5": "<sup>5</sup> ၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ,မွဲနၥံၪလဖီဘၪဧၪ.- လၧမးၥံၫအ နံၩယီၩ, ၦလုဆၧလဖၪအီၪ လၧဆၧလုအဂံၪ့ဖၧၩ့နီၪ, မၩကြၩ့ထမး မးၥံၫအနံၩတၭ, အဆၧမၪလအီၪဘၪ နီၪးမွဲနၥံၪဖီဘၪ လၧလံၬဆၧမၪလူၬအဖၧၩ့အ့ၬဧၪ.",
			"6": "<sup>6</sup> ယလီၩဘၪနၥံၪ လၧဆၧဒိၪနဲၪ့ဆၧလုအဂံၪ့အီၪမၬ",
			"7": "<sup>7</sup> ထီးယီၩကၨ.- ဘၪ ယ ၥၭ လၧ ဆၧ ယၫ့ ၥုၪ့ ယၫ့ ၥၭ တၭ, မွဲ ဆၧ လု ဆၧ ဖၬ နီၪ အ့ၬ. ဆၧချဲၩ့လ ထံၪယီၩနၥံၪနၪ အ့ၪၥ့ၪနီၪတၭ,ၦလၧအဆၧမၪလအီၪ",
			"8": "<sup>8</sup> ဘၪနီၪ,နၥံၪစ့ၩရၫ့စၪအ့ၬ.- အဂဲးဘဲၫယီၩ ၦၡၩအဖိၪ ခွၫယီၩ,မွဲမးၥံၫအနံၩအကဆါလီၫ.",
			"9": "<sup>9</sup> အဝ့ၫဒၪ, စဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, လ့ၩနုၬလၧအ",
			"10": "<sup>10</sup> ဝ့ၫၥံၪအၥရိၬဖၧၩ့လီၫ.- ယိခွါ,ၦအစူၪၥံၫလခီၫအီၪဝ့ၫ လဂၩလီၫ. ဘဲၫၥိၭအမိအီၪက့ၪဆၧမၪ လၧအလီၩ့နီၪး ၦၡၩၥံၪအၪ့စၪ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဆၧလၧမးၥံၫအနံၩ",
			"11": "<sup>11</sup> နီၪ,မၩဘျၪထဲၩ့ဆၧဆၫဘၪမိဂ့ၩဧၪ.- အဝ့ၫဒၪလီၩ ဘၪအဝ့ၫၥံၪ, ၦလၧနၥံၪအကျၩအၥိၪအီၪလဒုၩတၭ, လၧမးၥံၫအနံၩ အ့ၪလၩ့ထ့ၬလၧဆၧဖၧၩ့နီၪ,လဖီၪ့န့ ဘၪတၭလထုၭထၪ့ထဲၩ့ဘၪဝ့ၫ, မွဲၦလၫလဂၩလဲၪ.",
			"12": "<sup>12</sup> အနီၪတၭ မွဲၦၡၩလဂၩ ဂ့ၩနဲၪ့ၥိၪလဒုၩဆံၭဒိၪလဲၪ. မၩအၥၭဘဲၫနီၪတၭ, လၧမးၥံၫအနံၩယီၩ,ဂ့ၩမၩဆၧ",
			"13": "<sup>13</sup> ဂ့ၩလီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭၦလဂၩနီၪ, ယူၬ ထၪ့နစူၪဆံၭ, မွဲအယူၬထၪ့ဝ့ၫနီၪအဆၧအီၪဆီၪ့ထၪ့",
			"14": "<sup>14</sup> ထဲၩ့ဝ့ၫဘဲၫအလခီၫဒၪအၥိၭလီၫ.- အ့ၪမွဲၦဖၫရစံၫၥံၪ မိမၩၥံၫဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, စဲၪ့ထၪ့တၭကိၪ့ ထၪ့ဖၭလၩ့ဝ့ၫဒၪလီၫ. ယွၩအခ့ၫအၡၩလၧအရွံန့ဝ့ၫ.",
			"15": "<sup>15</sup> ယ့ၫရှူၬ ၥ့ၪယၫဝ့ၫတၭ စဲၪ့ထၪ့ခွံၬထီးနီၪ, ၦခမျၧး ဖၭဒိၪဖိၬထၪ့အခဲၫ့တၭ, အဝ့ၫမၩဘျၪထဲၩ့အဝ့ၫၥံၪ",
			"16": "<sup>16</sup> ထီးအလူၬလီၫ.- တၭအဝ့ၫမၪလူၬအဝ့ၫၥံၪ ဘဲၫၥိၭ",
			"17": "<sup>17</sup> အထီးမၩဖျီၪထၪ့ဝ့ၫလဂ့ၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,",
			"18": "<sup>18</sup> မီၪစအဲၫစ့ယၫအလူလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫတၭ,- စံၭ ဝ့ၫဒၪ, ယိခွါ, ယခ့ၫယၡၩလၧယရွံန့ဝ့ၫ, ၦလၧယအဲၪဝ့ၫ,လၧအဘၪယၥၭလဂၩယီၩ, ယမိအီၪက့ၪယၥၭလၧအလီၩ့, ဒဲအဝ့ၫဒၪ မိလီၩဘၪၦဆၨၩလဖၪ လၧဆၧစ့ၩရၫ့ လီၫ.",
			"19": "<sup>19</sup> အဝ့ၫဒၪလဂဲးလိၬတ့ၭလိၬဘၪ, လကိၭၡၭထၪ့ဘၪ ဝ့ၫ, ဒဲၦနါဂၧၫ့ဘၪအလူၥီၫလၧဖၧၩ့ၥၭနးဂၩဆ့အ့ၬ.",
			"20": "<sup>20</sup> ဖီးလဘီၩ့လၧအဆံၩဖိနီၪ လမၩထ့ၬခွံၬဘၪ, ဒဲမ့ၪအဆၪလၧအခူၪထၪ့ဒံၭနီၪလမၩလၩ့ဖံၬဘၪ, ထီးအအၪ့မၧၫ့ဆၧစ့ၩရၫ့ လၧအမိမၩနၧၩ့ဆၧအ ဂဲးလီၫ.",
			"21": "<sup>21</sup> ဒဲၦဆၨၩလဖၪနီၪ မိဒိၭနဲၩ့အၥၭ လၧအမံၩ့လီၫ.",
			"22": "<sup>22</sup> ထီးနီၪလဖၧၫ့  ၦလၧဆၧနၪအီၪလၧအလီၩ့ အမ့ၬ ဘျီၪ,ဒဲအုၭအၭဝ့ၫလဂၩနီၪ, ၦဂဲၫဆိၬဝ့ၫလၧအအီၪ တၭ,အဝ့ၫဒၪမၩဘျၪထဲၩ့ဝ့ၫ ထီးၦမ့ၬဘျီၪဒဲၦအုၭအၭ လဂၩနီၪ, ဒၪထၪ့ထဲၩ့ဆၧဒဲချဲၩ့ထၪ့ထဲၩ့ဆၧၥ့ၪလီၫ.",
			"23": "<sup>23</sup> ၦခမျၧးထီၫမံၫထီၫမၪတၭ, စံၭဝ့ၫဒၪ,အယီၩလဂၩမွဲ",
			"24": "<sup>24</sup> စဒၫဝံၭအဖိၪခွၫမွဲအ့ၬဧၪ.- အ့ၪမွဲၦဖၫရစံၫၥံၪ နါဂၧၫ့ ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, အယီၩလဂၩအ့ၪလမွဲဘၪ လၧဆၧ နၪအခိၪဘၫအလၭဇဘၧၭနီၪတၭ, နၫ့ထၪ့ခွံၬဆၧနၪ",
			"25": "<sup>25</sup> အ့ၬ.- ယ့ၫရှူၬၥ့ၪယၫအဆၧဆီၫ့မီၪ့လဖၪတၭ, စံၭ အဝ့ၫၥံၪကယဲဘၩ့မုးကိၭစီၪ့ဒ့ၭယီၩ, အ့ၪလၩ့ဖၭလိၬ အၥၭတၭ, မိအီၪယူဝ့ၫလီၫ. ဒိၩ့မွဲဂ့ၩ,ဂံၪ့မွဲဂ့ၩ, အ့ၪ",
			"26": "<sup>26</sup> လၩ့ဖၭလိၬအၥၭတၭ, မိအီၪဂုးခၧၫ့ဝ့ၫနးဖျိၪ့အ့ၬ.- မုၪ ခီၩလဲးအ့ၪနၫ့ထၪ့ခွံၬမုၪခီၩလဲးတၭ, မွဲအလၩ့ဖၭလၧ အနၫ့ဆါဒၪဝ့ၫလီၫ. အခိးမွဲဘဲၫနီၪတၭ, အဘၩ့အမုး",
			"27": "<sup>27</sup> မိအီၪဂုးခၧၫ့ဝ့ၫဘဲၫၥ့ၪလဲၪ.- ယအ့ၪနၫ့ထၪ့ခွံၬ ဆၧနၪ လၧဘၫအလၭဇဘၧၭတၭ, နၥံၪအဖိၪခွၫလဖၪနီၪ မွဲအနၫ့ထၪ့ခွံၬဝ့ၫလၧၦလၫလဂၩလဲၪ. မၩအၥၭဘဲၫ",
			"28": "<sup>28</sup> နီၪတၭ,အဝ့ၫၥံၪမိကဲၪထၪ့ၦစ့ၩရၫ့နၥံၪလီၫ.- အ့ၪမွဲယ ဝ့ၫဒၪယီၩ, ယအ့ၪနၫ့ထၪ့ခွံၬ ဆၧနၪလၧယွၩအၥၭတၭ, ယွၩအဘၩ့အမုးနီၪ,ထီၩ့ယူၭတၡါလၧနၥံၪအအီၪ",
			"29": "<sup>29</sup> ယူၭ,- ၦအ့ၪလစၧၩ့ထၬဆိၫဒၪခလူၬဘၪ ၦအဂဲးဆီၪ့ နီၪ,မွဲအနုၬအၪ့ဂူၬန့အဆၧလၧအဂံၪ့ဖၧၩ့ မိၥ့ၪဘဲၫၥ့ၪ လဲၪး အ့ၪမၩဘဲၫနီၪဂီၩ့တၭ, အၪ့ဂူၬန့အဆၧၥ့ၪလီၫ.",
			"30": "<sup>30</sup> ၦလၧအလအီၪဘၪဝ့ၫလၧယၥိၭယီၩ, မွဲအထၫ့ဒုၪ ဒၩယၧၩတၭ, ၦလၧအလအၪ့ထုၫ့ကီၪ့ဘၪ ဆၧလၧ ယၥိၭယီၩ,မွဲအမၩပြံၩပၩဆၧလီၫ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫနီၪတၭ,ယလီၩဘၪနၥံၪ,ကယဲဆၧဒဲၩ ဘၭ, ဒဲဆၧဒုၪဒွ့ၪထီးအလူၬနီၪ, ဆၧမိမၩဖီၩ့မၩဖျ့ၭ န့ၦၡၩလီၫ. အ့ၪမွဲဆၧဒုၪဒွ့ၪၥၭမုနီၪ, ဆၧမၩဖီၩ့",
			"32": "<sup>32</sup> မၩဖျ့ၭန့ၦၡၩအ့ၬ.- ထီးဒၪၦလၧအချဲၩ့မၪၦၡၩအဖိၪ ခွၫလဂၩဂၩနီၪ, ဆၧမိမၩဖီၩ့မၩဖျ့ၭအဆၧဒဲၩဘၭ လီၫ.အ့ၪမွဲထီးဒၪ ၦလၧအချဲၩ့မၪ ၥၭမုဆံၫ့ဎံၪလဂၩ ဂၩနီၪ,အယီၩလကၠၪမွဲဂ့ၩ, ကဲခိၬနးကၠၪမွဲဂ့ၩ, ဆၧမၩ ဖီၩ့မၩဖျ့ၭအဆၧဒဲၩဘၭအ့ၬ.",
			"33": "<sup>33</sup> အီၪက့ၪၥံၪ့ဂ့ၩဒဲအၥၪဂ့ၩဆံၭ. အ့ၪလမွဲဘၪတၭ, အီၪက့ၪၥံၪ့အၧၩ့ဒဲအၥၪအၧၩ့ဆံၭ, အဂဲးဘဲၫယီၩ ၦၥ့ၪ ယၫၥံၪ့လၧအဆၧၥၪ အကၠီၩ့လီၫ.",
			"34": "<sup>34</sup> ဂူအၧၩ့အဆၨၩအဆၬၥံၪဧ့ၬ နၥံၪမွဲဆၧအၧၩ့တၭ, နၥံၪချဲၩ့ဆၧအဂ့ၩ မိၥ့ၪဘဲၫၥ့ၪလဲၪ. ဘဲၫအဎွ့ၩလၨၪ",
			"35": "<sup>35</sup> ခွံၬလၧၦၥၭအၥိၭနီၪ, ၦနိၭချဲၩ့ဆၧလီၫ.- ၦလၧအ ဂ့ၩနီၪ,ဖီၪ့ထၪ့ဖံၭထၪ့အဆၧဂ့ၩ လၧအအီၪက့ၪကီၪ့ဝ့ၫ လၧအလးဂ့ၩအဖၧၩ့တၭ, ၦလၧအအၧၩ့နီၪ, ဖီၪ့ထၪ့ ဖံၭထၪ့အဆၧအၧၩ့လၧအအီၪက့ၪကီၪ့ဝ့ၫ အလးအၧၩ့",
			"36": "<sup>36</sup> အဖၧၩ့လီၫ.- ယလီၩဘၪနၥံၪလၧကယဲဆၧချဲၩ့အပျီၩ လထံၪလါလါအကၠီၩ့လၧၦၡၩချဲၩ့ဝ့ၫလဖၪနီၪ, မွဲအမိ ဘၪဖ့ၪလၫ့အဆရၫ့လၧဆၧစ့ၩရၫ့အမုနံၩနီၪလီၫ.",
			"37": "<sup>37</sup> အဂဲးဘဲၫယီၩနမိဘၪဆၧ အီၪက့ၪတီၩနၧၩ လၧနဆၧ ချဲၩ့ၥံၪအကၠီၩ့တၭ, နမိဘၪဆၧစ့ၩရၫ့စၪနၧၩလၧန ဆၧချဲၩ့ၥံၪအကၠီၩ့ဆ့လီၫ.",
			"38": "<sup>38</sup> ထီးနီၪလဖၧၫ့ ၦလၧအအီၪဝ့ၫလၧၦကွ့ၭလံၬဒဲၦဖၫရ စံၫအကျၩၥံၪ, ချဲၩ့ဆၧၫ့ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ဆရၫဧ့,နမၩ",
			"39": "<sup>39</sup> လၩ့လၭဆၧနီၪ,မိဒၪဘၪပၥၭနးမံၩ့လီၫ.- အ့ၪမွဲအ ဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ၦအအၧၩ့ဒဲအအဲၪ ဘိၩ့ဆၧအဆိၩအကၠၪယီၩ, အၪ့ဎၬဆၧလၩ့လၭတၭ, ဆၧလဖ့ၪလၫ့ဘၪဝ့ၫ လၧဆၧလၩ့လၭတၭ, ဖ့ၪလၫ့",
			"40": "<sup>40</sup> န့ၫမီၪစယိနၫ အဆၧလၩ့လၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ ဘဲၫစယိနၫအီၪဘၪဝ့ၫလၧယၪဖၭဒိၪ အဂူၭဖိၫ့ဖၧၩ့ ၥၧၫ့နံၩဒဲၥၧၫ့နၩအၥိၭနီၪ, ၦၡၩအဖိၪခွၫ မိဘၪအီၪဝ့ၫ",
			"41": "<sup>41</sup> လၧဂၪ့ခိၪလၬၥၧၫ့နံၩၥၧၫ့နၩ ဘဲၫနီၪၥိၭလီၫ.- လၧဆၧ စ့ၩရၫ့အဖၧၩ့နီၪၦနံနဝ့ၫဖိၪ မိဂဲထုၪ့လၧၦအဆိၩယီၩ အၥိၭတၭ,မိစ့ၩရၫ့စၪဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ စယိနၫ လီၩလၩ့လၬလၩ့ဆၧတၭ, အဝ့ၫၥံၪနီၫ့ယါလၩ့ထဲၩ့ အၥၭလီၫ. ယိခွါ,ၦဒိၪနဲၪ့စယိနၫအီၪမၬ ထီးယီၩလ",
			"42": "<sup>42</sup> ဂၩကၨ.- လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪမုခံၫ့အနးဎွၩမုၪမိ ဂဲထုၪ့လၧၦအဆိၩယီၩအၥိၭတၭ, မိစ့ၩရၫ့စၪဝ့ၫလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫဒၪဂဲၫလၧဂၪ့ခိၪထုၬ အနိၪ့ဘဲၫ ၥိၭအမိခိၭနၪဘၪစစီလမၧၫ့ အဆၧကိၪ့ဘၪကိၪ့ၥ့ၪလီၫ. ယိခွါ, ၦဒိၪနဲၪ့စစီလမၧၫ့အီၪမၬထီးယီၩလဂၩကၨ.",
			"43": "<sup>43</sup> ထီးဆၧနၪစဲၪ့ထၪ့ခွံၬ လၧၦၡၩအလီၩ့တၭ, စဲၪ့ ဝံၩ့ဝၩ့လၧပွ့ၪခိၪ, အၪ့ဎၬဆၧအီၪပွံၭအလးတၭ, ဒၪ",
			"44": "<sup>44</sup> န့ဝ့ၫအ့ၬ.-ထီးနီၪလဖၧၫ့စံၭဝ့ၫ, ယမိထဲၩ့ထဲၩ့လၧယ ဂံၪ့လၧယစဲၪ့ထၪ့ခွံၬ လၧအဖၧၩ့နီၪလီၫ. ထီးအဂဲၫ ထဲၩ့နီၪတၭ, ဒၪဝ့ၫလၧအအီၪပျၩ့, အီၪဝ့ၬဆံၫ့အၥၭ,ဒဲအီၪကယၧၩ့",
			"45": "<sup>45</sup> အၥၭလီၫ.- ထီးနီၪလဖၧၫ့လ့ၩမၩန့ဆၧ နၪအၧၩ့နဲၪ့ အနၫ့ဆါဒၪဝ့ၫနွ့ၫဒုၩတၭ, အဝ့ၫၥံၪလ့ၩ နုၬအီၪဝ့ၫထီးနီၪလီၫ. ၦလဂၩနီၪအထုၬနၭနဲၪ့ဒံၭ အခၪ့ထံၭဒံၭလီၫ. ၦအဆိၩ အကၠၪလၧအအၧၩ့ယီၩ, မိမၩအၥၭဘဲၫနီၪအၥိၭလီၫ.",
			"46": "<sup>46</sup> အဝ့ၫဒၪလီၩလၩ့ဆၧ လၧၦခမျၧးအဘိၩ့ဘၭတၭ, ယိခွါ,အမိဒဲအထၧၫ့ဖုဝဲလဖၪနီၪ,မိချဲၩ့ဒုၪ့ဘၪအ",
			"47": "<sup>47</sup> ၥၭလၧအဝ့ၫဒၪတၭ,ဆၧၫ့ထုၪ့ဝ့ၫလၧခီၫ့လီၫ.- ၦလဂၩ စံၭဝ့ၫ,ယိခွါ,နမိဒဲနထၧၫ့ဖုဝဲၥံၪအၪ့ဎၬချဲၩ့ဒုၪ့နၧၩတၭ,",
			"48": "<sup>48</sup> ဆၧၫ့ထုၪ့ဝ့ၫလၧခီၫ့လီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဝ့ၫတၭ,စံၭ ၦလၧအလီၩဘၪဝ့ၫလဂၩနီၪ, ယမိနီၪမွဲပလၫလဂၩ",
			"49": "<sup>49</sup> လဲၪးယထၧၫ့ဖုဝဲၥံၪမွဲပလၫလဖၪလဲၪ.- ယူၬစိၩအစူၪ လၧအထံၩအဖျဲၥံၪအအီၪတၭ,စံၭဝ့ၫဒၪ, ယိခွါ,ယမိ,",
			"50": "<sup>50</sup> ဒဲယထၧၫ့ဖုဝဲၥံၪလီၫ.- အဂဲးဘဲၫယီၩထီးဒၪၦလၧအ မၩဝ့ၫထီးယဖါအီၪလၧမူၭခိၪအၥၭ, လဂၩဂၩနီၪ, အဝ့ၫဒၪမွဲယထၧၫ့ဖုဝဲမုၪ,ဒဲယထၧၫ့ဖုဝဲခွၫ,ဒဲယမိလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> မုလနံၩနီၪ, ယ့ၫရှူၬစဲၪ့ထၪ့ခွံၬလၧဂံၪ့တၭ,ဆၧၫ့နၩ့",
			"2": "<sup>2</sup> ဝ့ၫလၧကွံၩနဲၩ့ထံၭတၭ,- ၦခမျၧးဖၭဒိၪၥံၪ အီၪကီၪ့ လၧအအီၪထီးအထၪ့ဆၧၫ့နၩ့ဝ့ၫ လၧချံၫလဖျိၪ့အ ဖၧၩ့တၭ,ၦခမျၧးဆၧၫ့ထုၪ့ဝ့ၫ လၧခီၫ့ထီးအလူၬလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪချဲၩ့ဆၧအၪ လၧဆၧချဲၩ့အဒီၩ့တၭ,စံၭဝ့ၫ",
			"4": "<sup>4</sup> ဒၪ,- ယိခွါ,ၦလၧအဎွံၪဆၧလဂၩလ့ၩဎွံၪဆၧလီၫ. လၧအဎွံၪဆၧနီၪ လနၩ့နၩ့လၩ့ဘၪဝ့ၫလၧ ဖၧၩ့ၥၭအ",
			"5": "<sup>5</sup> နဲၩ့ထံၭတၭ, ထိၪၥံၪလံၪၥံၪဂဲၫအၪ့ခွံၬဝ့ၫဒၪလီၫ.- အ ဂူၫဂၩလနၩ့နၩ့လၩ့ဘၪဝ့ၫလၧလိးကျၩ ထီးဂၪ့ခိၪအီၪ လအၪဘၪတၭ, ဂၪ့ခိၪလယိၬဘၪအကၠီၩ့နီၪ, မဲၪထၪ့",
			"6": "<sup>6</sup> ဝ့ၫချဲၫ့ချံၭလီၫ.- ထီးမုမ့ၬထၪ့နီၪ,ဆၧခိဆ့ၭဘၪဝ့ၫတၭ,",
			"7": "<sup>7</sup> အဝံလအီၪဘၪအကၠီၩ့ ဎဲၫ့ထၪ့ခွံၬဝ့ၫလီၫ.- အဂူၫဂၩ လနၩ့နၩ့လၩ့ဘၪဝ့ၫ လၧဆၧဆူၪဆၧမဲၪအကျၩတၭ, ဆၧဆူၪဆၧမဲၪနီၪမဲၪထၪ့ဝ့ၫတၭ, ခဲၪဘံၭခွံၬဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> အဂူၫဂၩ လနၩ့နၩ့လၩ့ဘၪဝ့ၫလၧဂၪ့ခိၪဂ့ၩတၭ, ၥၪ ထၪ့ဝ့ၫလနၩ့နၩ့ အၪနဲၪ့ထဲၩ့ အလးလယၩ,လနၩ့နၩ့",
			"9": "<sup>9</sup> ဎူၫဆံၫ,လနၩ့နၩ့ၥၧၫ့ဆံၫလီၫ.- ၦအီၪလၧအနါလၧအ နါဂၧၫ့ဆၧနီၪ, မွဲအနါဂၧၫ့ဒၪဝ့ၫဆံၭ.",
			"10": "<sup>10</sup> အထံၩအဖျဲလဖၪဂဲၫလၧယ့ၫရှူၬအီၪတၭ,စံၭဝ့ၫ ဒၪ,မွဲဘၪနီၫလၧနလီၩဘၪအဝ့ၫၥံၪ လၧဆၧချဲၩ့အဒီၩ့",
			"11": "<sup>11</sup> နီၪလဲၪ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭအဝ့ၫၥံၪ, အဂဲး ဘဲၫယီၩ မူၭခိၪအဘၩ့အမုးအဆၧအီၪၥူၪနီၪ, ဆၧဖ့ၪ",
			"12": "<sup>12</sup> ၥ့ၪယၫနၥံၪလီၫ. အ့ၪမွဲအဝ့ၫၥံၪဆၧဖ့ၪဝ့ၫအ့ၬ.- အ ဂဲးဘဲၫယီၩ ထီးဒၪၦလၧအဆၧအီၪဝ့ၫလဂၩဂၩနီၪ, ဆၧမိဖ့ၪလၫ့ဆၧလၧအဝ့ၫနီၪတၭ, အဆၧမိအၪလၨၪ လီၫ.အ့ၪမွဲထီးဒၪ ၦလၧအဆၧလအီၪဘၪလဂၩဂၩနီၪ,",
			"13": "<sup>13</sup> ဆၧမိမၩန့ထဲၩ့ဆၧ လၧအအီၪဒၪလ့ၬလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ,ယလီၩဘၪအဝ့ၫၥံၪလၧဆၧချဲၩ့အဒီၩ့ ၥံၪလီၫ.အဂဲးဘဲၫယီၩအဝ့ၫၥံၪဒၪဧီၪလဒၪဘၪတၭ,",
			"14": "<sup>14</sup> နါဂၧၫ့ဧီၪလနါဂၧၫ့ဘၪတၭ,နၪဝ့ၫဒၪၥ့ၪအ့ၬ.- မီၪစအဲၫ စ့ယၫအလူလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧအဖၧၩ့လီၫ. စံၭ ဝ့ၫဒၪ, နါဂၧၫ့ဆၧနီၪနၥံၪမိနါဂၧၫ့တၭ, မိနၪၥ့ၪနၥံၪအၥၭ အ့ၬ. ယိဆၧနီၪနၥံၪမိယိဆၧတၭ,မိဒၪဘၪနၥံၪအၥၭ အ့ၬ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩၦလဆၨၩယီၩ အၥၭဘီၪ့ဝ့ၫ,ၥိၪဝ့ၫ, ဒဲအနိၩ့ဎၧၫ့အနါဎၧၫ့တၭ, အဝ့ၫၥံၪဘံၪ့ဒၪအမ့ၬ, မိဒၪဘၪခိၬဆၧလၧအမ့ၬၥၪ, ဒဲနါဂၧၫ့ဘၪခိၬဆၧလၧအနါ, ဒဲၥ့ၪယၫဘၪခိၬဆၧလၧအၥၭ,ဒဲကၠၪလီၩ့ထဲၩ့ဘၪ ခိၬအၥၭ, ဒဲယမိမၩဘျၪထဲၩ့ဘၪခိၬအဝ့ၫၥံၪလီၫ.",
			"16": "<sup>16</sup> အ့ၪမွဲနၥံၪအမ့ၬၥၪနီၪ,ဘၪဆိၪဂ့ၩဝ့ၫလီၫ. အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪဒၪဆၧလီၫ. နၥံၪအနါနီၪဘၪဆိၪဂ့ၩ",
			"17": "<sup>17</sup> ဝ့ၫလီၫ.အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪနါဂၧၫ့ဆၧလီၫ.- အဂဲး ဘဲၫယီၩယလီၩဘၪနၥံၪတီၩတီၩယီၩ, ဆၧလၧနၥံၪဒၪ ဘၪနီၪမီၪ ဒဲၦတီၩၦလီၩ့ၥံၪအၪဂၩမိဒၪဘၪအၥၭ တၭ,ဒၪဘၪဝ့ၫအ့ၬ. ဆၧလၧနၥံၪနါဂၧၫ့ဘၪနီၪ အဝ့ၫ ၥံၪမိနါဂၧၫ့ဘၪအၥၭတၭ, နါဂၧၫ့ဘၪဝ့ၫအ့ၬ.",
			"18": "<sup>18</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧချဲၩ့အဒီၩ့လၧၦဎွံၪဆၧနီၪ,",
			"19": "<sup>19</sup> ခိၭနၪနၥံၪဝ့ၫဆံၭ.- ထီးၦနါဂၧၫ့ဘၩ့မုးအလူတၭ, နၪဝ့ၫလၥ့ၪဘၪလဂၩဂၩနီၪ, ဆၧအၧၩ့လဂၩဂဲၫအၪ့ ဂူၬန့ခွံၬဆၧဎွံၪအၥၭ လၧအၥၭခံဖၧၩ့လီၫ. အနီၪမွဲဆၧ",
			"20": "<sup>20</sup> ဘၪဎွံၪဝ့ၫလၧဖၧၩ့ၥၭ အနဲၩ့ထံၭနီၪလီၫ.- ဆၧဎွံၪအ ၥၭလၧလိးကျၩနီၪ, မွဲၦလၧအနါဂၧၫ့ဆၧအလူအထၫ တၭ,ဒိၭန့ဝ့ၫချဲၫ့ချံၭလၧအၥုၪ့ထိၬအၥၭထိၬတၭ,",
			"21": "<sup>21</sup> အဝံလအီၪဘၪလၧအနၫ့ဆါဒၪဝ့ၫအဖၧၩ့တၭ, အီၪဝ့ၫ လဆိလလး,ထီးဆၧနၭဆၧၡၪ့မွဲဂ့ၩ, ဆၧမၩအၧၩ့မၩ နၭမွဲဂ့ၩ,အီၪထၪ့လၧဆၧအလူအထၫအကၠီၩ့,မွဲအ",
			"22": "<sup>22</sup> ဂၭဂီၩ့ဝ့ၫချဲၫ့မၬလီၫ.- ဆၧဘၪဎွံၪဝ့ၫလၧဆၧဆူၪဆၧမဲၪ အကျၩနီၪ,မွဲၦနါဂၧၫ့ဆၧအလူအထၫတၭ, ဆၧအၪ့ ယိၪလၧအဘၪဆဲၫ့ဆၧအယီၩလကၠၪ, ဒဲဆၧအၪ့ လီၫလၧအဘၪဆဲၫ့ လၧဆၧအစူၪလးအခၪ့ခိၪလဖၪနီၪ,",
			"23": "<sup>23</sup> ခဲၪဘံၭခွံၬဆၧအလူအထၫတၭ,ၥၪထၪ့ဝ့ၫအ့ၬ.- ဆၧ ဘၪဎွံၪဝ့ၫလၧဂၪ့ခိၪဂ့ၩနီၪ, မွဲၦလၧအနါဂၧၫ့ဆၧအလူ အထၫ, နၪဝ့ၫၥ့ၪတၭ,ၥၪထၪ့ဝ့ၫလနၩ့နၩ့အၪနဲၪ့ထဲၩ့ အလးလယၩ,လနၩ့နၩ့ဎူၫဆံၫ, လနၩ့နၩ့ၥၧၫ့ဆံၫလီၫ. ဆၧချဲၩ့ဒီၩ့လၩ့ဘၪဆဲၫ့ဘုၪထိၪၡၬ.",
			"24": "<sup>24</sup> အဝ့ၫဒၪအီၪက့ၪလၩ့ ဆၧချဲၩ့အဒီၩ့လၧအဂူၫဂၩ လမံၩ့လၧအဝ့ၫၥံၪအဂးတၭ, စံၭဝ့ၫဒၪ,မူၭခိၪအဘၩ့ အမုးယီၩ, မၩအၥၭဘဲၫၦလဂၩဎွံၪဆၧချံၫဂ့ၩလၧ",
			"25": "<sup>25</sup> အဆံၬဖၧၩ့အၥိၭနီၪလီၫ.- ထီးၦမံၫမၪဝ့ၫ အဘိၩ့ဘၭ တၭ,အဒုၪအဒၩလဂၩဂဲၫဎွံၪ ဘုၪထိၪၡၬ လၧဘုၪအ",
			"26": "<sup>26</sup> ကျၩတၭထဲၩ့ဝ့ၫလီၫ.- ထီးအမဲၪထၪ့ဝ့ၫတၭ,အၥူၪအ ၥၪဖျိၬထၪ့ဝ့ၫတၭ,ဘုၪထိၪၡၬ ဖျီၪထၪ့ဆ့လီၫ.-",
			"27": "<sup>27</sup> ဂံၪ့က ဆါအဎီးအၡၩလဖၪ လ့ၩလၧအအီၪတၭ, စံၭဝ့ၫဒၪ, ကဆါဧ့, နဎွံၪဆၧချံၫဂ့ၩလၧနဆံၬဖၧၩ့မွဲအ့ၬဧၪ, မၩ အၥၭဘဲၫနီၪတၭ, ဘုၪထိၪၡၬနီၪမွဲအဂဲၫထၪ့ဝ့ၫခီၫခီၫ",
			"28": "<sup>28</sup> လဲၪ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ,အယီၩလမံၩ့မွဲဒုၪဒၩလ ဂၩမၩဝ့ၫလီၫ. အဎီးအၡၩစံၭဝ့ၫ,ပမိလ့ၩထ့ၭန့ခွံၬ",
			"29": "<sup>29</sup> ဆၧနီၪ,မွဲအဘၪနၥၭဆ့ဧၪ.- အဝ့ၫနီၪစံၭဝ့ၫဒၪ,မွဲအ့ၬ, နၥံၪထ့ၭထၪ့ခွံၬဘုၪထိၪၡၬ အဘိၩ့ဘၭနီၪ,ဘၪလဘၪ",
			"30": "<sup>30</sup> နၥံၪမိထ့ၭန့ဎုၬဘၪဘုၪဆ့လီၫ.- မွဲအဒိၪထၪ့ဎုၬဒၪဝ့ၫ နံၫမံၩ့လူၬထီးကူၭဘုၪအထီဆံၭ. ထီးအဘၪကူၭ ဘုၪအထီနီၪ, ယမိလီၩဘၪၦကူၭဆၧလဖၪ, အၪ့ထုၫ့ ကီၪ့ဆိၫဒၪခလူၬ ဘုၪထိၪၡၬတၭ, ကၭထူလၧအဘၪ ဆူၭထၪ့ခွံၬလၧမ့ၪအဂးဆံၭ. အ့ၪမွဲဘုၪနီၪလူၫကီၪ့ ထဲၩ့ဝ့ၫလၧယဖၫ့ဖၧၩ့ဆံၭ.",
			"31": "<sup>31</sup> အဝ့ၫဒၪအီၪက့ၪလၩ့ဆၧချဲၩ့အဒီၩ့ဂူၫဂၩလမံၩ့လၧ အဝ့ၫၥံၪအဂးတၭ, စံၭဝ့ၫဒၪ, မူၭခိၪအဘၩ့အမုးယီၩ, မၩအၥၭဘဲၫဘၪချံၫလၧၦဎွံၪဝ့ၫ လၧဎုၭဖၧၩ့အၥိၭ",
			"32": "<sup>32</sup> နီၪလီၫ.- မွဲအဆံၭနဲၪ့လါနၫ့ ဆၧဂူၫဂၩအချံၫထီးအ လူၬတၭ, ထီးအကဲၪထၪ့ဝ့ၫနီၪ, မွဲအဒိၪနဲၪ့နၪ့ၥံၪမံၩ့ၥံၪတၭ, ကဲၪထၪ့ၥံၪ့လထံၭလၧထိၪၥံၪလံၪၥံၪ လၧဆၧဖိၭဖၫ့လဖၪ ဂဲၫအီၪဝ့ၫ လၧအထဲၩ့ခံၫထဲၩ့လီၩ့လီၫ.",
			"33": "<sup>33</sup> အဝ့ၫဒၪလီၩဘၪအဝ့ၫၥံၪ လၧဆၧချဲၩ့အဒီၩ့ အဂူၫ ဂၩလမံၩ့တၭ, စံၭဝ့ၫဒၪ, မူၭခိၪအဘၩ့အမုးယီၩ, မၩ အၥၭဘဲၫမံၪလၧၦမုၪလဂၩ ဒူၭလၩ့ဝ့ၫလၧကိၪမုၬၥၧၫ့ ဒၩ့အကျၩ ထီးအဖၭထၪ့ဝ့ၫ ထီးအလူၬအၥိၭနီၪလီၫ.",
			"34": "<sup>34</sup> ဆၧလဖၪနီၪထီးအလူၬ ယ့ၫရှူၬလီၩဘၪၦခမျၧး လၧဆၧချဲၩ့အဒီၩ့ၥံၪတၭ, ဆၧချဲၩ့အဒီၩ့အ့ၪလအီၪ ဘၪနီၪလီၩလၩ့ဆၧလၧအဝ့ၫၥံၪအ့ၬ.",
			"35": "<sup>35</sup> မၩအၥၭဘဲၫနီၪတၭ, မီၪအလူအထၫလၧၫ့ထၪ့ဎွ့ၩ ထၪ့ဝ့ၫဒၪတၭ,စံၭဝ့ၫဒၪ, ယမိအၩ့ထၪ့ယနိၭလၧဆၧချဲၩ့အဒီၩ့ၥံၪလီၫ. ဆၧလၧအအီၪၥူၪ လၧဂၪ့ခိၪအခၪ့ထံၭကဲၪထၪ့ လံၩလံၩနီၪ, ယမိလီၩလၩ့လၬလၩ့လီၫ. ယ့ၫရှူၬချဲၩ့ဖျီၪထၪ့ဆၧချဲၩ့ဒီၩ့လၩ့ဘၪဆဲၫ့ဘုၪထိၪၡၬ.",
			"36": "<sup>36</sup> ထီးနီၪလဖၧၫ့ ယ့ၫရှူၬကွဲၪဖျါခွံၬ ၦခမျၧးဂီၩ့တၭ, လ့ၩနုၬဝ့ၫလၧဂံၪ့ဖၧၩ့လီၫ. အထံၩအဖျဲၥံၪဂဲၫထီၩ့လၧ အအီၪတၭ,စံၭဝ့ၫဒၪ,ဆၧချဲၩ့အဒီၩ့ လၧဘုၪထိၪၡၬအီၪ လၧဆံၬဖၧၩ့နီၪ, လီၩဘၪပၧၩနးထံၪဘီၪ.",
			"37": "<sup>37</sup> အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ,ၦလၧအဎွံၪ",
			"38": "<sup>38</sup> ဆၧချံၫအဂ့ၩနီၪ မွဲၦၡၩအဖိၪခွၫလဂၩလီၫ.- ဆံၬၥံၪနၩ ၥံၪနီၪမွဲဂၪ့ခိၪလီၫ. ဆၧချံၫအဂ့ၩနီၪမွဲဘၩ့မုးအဖိၪ ခွၫၥံၪတၭးဘုၪထိၪၡၬနီၪ မွဲၦအၧၩ့လဂၩအဖိၪ",
			"39": "<sup>39</sup> ခွၫၥံၪ,- ဒုၪဒၩလၧအဎွံၪဝ့ၫလဂၩနီၪ, မွဲမုၪခီၩလဲးလီၫ. ကူၭဘုၪအထီနီၪ,မွဲဂၪ့ခိၪအဆိၩထုၬတၭ,ၦကူၭဆၧ",
			"40": "<sup>40</sup> လဖၪနီၪ, မွဲအၥီၫ့ၥံၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၦအၪ့ထုၫ့ကီၪ့ဘုၪထိၪၡၬဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪအ ၥိၭနီၪ,ဆၧမိမၩအၥၭလၧဂၪ့ခိၪယီၩ အဆိၩထုၬ",
			"41": "<sup>41</sup> ဘဲၫနီၪၥိၭလီၫ.- ၦၡၩအဖိၪခွၫမိအၪ့မၧၫ့ လၩ့အၥီၫ့လ ဖၪတၭ, အဝ့ၫၥံၪမိအၪ့ထုၫ့ကီၪ့ခွံၬ ကယဲဆၧလၩ့ထံၩ ဖါအလးထီးအလူၬ, ဒဲၦလၧအမၩဆၧလတီၩလလီၩ့",
			"42": "<sup>42</sup> ဘၪလၧအဘၩ့အမုးအဖၧၩ့,- မိခွံၬလၩ့ခွံၬဝ့ၫလၧ ဖံၫ့ချၪဖၧၩ့လီၫ. ဆၧဘၪဂၪ့ဆၧဘၪယၧၩ့, ဆၧခၪအဲၪ့",
			"43": "<sup>43</sup> ထံးမိအီၪဝ့ၫထီးနီၪလီၫ.- ထီးနီၪလဖၧၫ့ ၦလၧအ တီၩအလီၩ့လဖၪနီၪ, မိယုၩ့ယဲထၪ့ဝ့ၫလၧအဖါအ ဘၩ့အမုးအဖၧၩ့ ဘဲၫမုမ့ၬအၥိၭလီၫ. ၦအီၪလၧအနါ လၧအနါဂၧၫ့ဆၧနီၪ, မွဲအနါဂၧၫ့ဒၪဝ့ၫဆံၭ. ဆၧချဲၩ့ဒီၩ့လၩ့ဘၪဆဲၫ့,ဆၧလူဒိၪဎွ့ၩဒိၪ လၧအအီၪၥူၪ,",
			"44": "<sup>44</sup> မၩဒီၭလဖၧၫ့ မူၭခိၪအဘၩ့အမုးနီၪ, မၩအၥၭဘဲၫ ဆၧလူဒိၪဎွ့ၩဒိၪ အီၪၥူၪဝ့ၫလၧဆၧပျၩ့ဖၧၩ့အၥိၭနီၪ လီၫ.ၦလၧအဒၪန့ဝ့ၫလဂၩနီၪ, မၩဘံၭမၩဘၧၩ့ခွံၬဝ့ၫ တၭ,လ့ၩအၪ့ဆၫလၩ့ခွံၬ ကယဲအဆၧအီၪထီးအ လူၬလၧအဆၧၥၭထိၬအကၠီၩ့တၭ, ဎွ့ၩဆၧပျၩ့ဖၧၩ့လ စီၪ့နီၪလီၫ. ဆၧချဲၩ့ဒီၩ့လၩ့ဘၪဆဲၫ့မနံၬထၫ့မျါ",
			"45": "<sup>45</sup> မၩဒီၭလဖၧၫ့,မူၭခိၪအဘၩ့အမုးနီၪ, မၩအၥၭဘဲၫ ၦဖနံၬဖိၪလဂၩ လၧအအၪ့ဎၬမနံၬထၫ့မျါ လၧအဂ့ၩအ",
			"46": "<sup>46</sup> ၥိၭနီၪလီၫ.- ထီးအဒၪဘၪမနံၬထၫ့မျါ လၧအလူဒိၪဎွ့ၩ ဒိၪလဖျိၪ့နီၪ, လ့ၩအၪ့ဆၫလၩ့ခွံၬကယဲအဆၧအီၪ ထီးအလူၬတၭ,ဎွ့ၩန့အဝ့ၫနီၪလီၫ. အဆၧချဲၩ့ဒီၩ့လၩ့ဘၪဆဲၫ့ၦခွံၬၡၬ.",
			"47": "<sup>47</sup> မၩဒီၭလဖၧၫ့, မူၭခိၪအဘၩ့အမုးနီၪ,မၩအၥၭဘဲၫ ၦခွံၬၡၬလၧကွံၩဖၧၩ့တၭ, ဘၪန့ဆၧကိၭမံၩ့ဒ့ၭအ",
			"48": "<sup>48</sup> ၥိၭနီၪလီၫ.- ထီးအဆၧဎွ့ၩထၪ့တၭ, မီၩ့ကၠူၭထၪ့ဝ့ၫ လၧခီၫ့နီၪ, ဆၧၫ့နၩ့ဝ့ၫတၭ, ရွံန့ဆၧအဂ့ၩလဖၪ ဒုၭ လၩ့ဝ့ၫလၧဆၧဖၧၩ့, ဆၧအအၧၩ့လဖၪနီၪ ခွံၬၡိၭခွံၬဝ့ၫ",
			"49": "<sup>49</sup> ဒၪလီၫ.- ဆၧမိမၩအၥၭလၧဂၪ့ခိၪအဆိၩထုၬ ဘဲၫနီၪ ၥိၭလီၫ. အၥီၫ့လဖၪမိဂဲၫလၩ့တၭ, မိအၪ့နၩ့ဖၭၦ",
			"50": "<sup>50</sup> အအၧၩ့လၧၦအတီၩအလီၩ့အကျၩတၭ,- မိခွံၬလၩ့ခွံၬ ဝ့ၫလၧမ့ၪဖံၫ့ချၪအဖၧၩ့နီၪလီၫ. ဆၧဘၪဂၪ့ဆၧခၪအဲၪ့ ထံးမိအီၪဝ့ၫထီးနီၪလီၫ. ဆၧမွဲဆၧတီၩအၥၫ့ဒဲအလးလံၩလဖၪ.",
			"51": "<sup>51</sup> ယ့ၫရှူၬစံၭဝ့ၫဒၪ, ဆၧလဖၪထီးအလူၬနီၪ မွဲနၥံၪနၪ",
			"52": "<sup>52</sup> ၥ့ၪယူၭဧၪ. အဝ့ၫၥံၪစံၭ,နၪၥ့ၪယူၭ,ကဆါဧ့.- အဝ့ၫဒၪစံၭ အဝ့ၫၥံၪး မၩအၥၭဘဲၫနီၪတၭ, ၦကွ့ၭလံၬ လၧ အၥ့ၪမူၭခိၪအဘၩ့အမုးအဂဲးအကၠီၪ့ ကိၭဂၩဒ့ၭနီၪ, မၩအၥၭဘဲၫဂံၪ့ ကဆါလၧအဖီၪ့ထၪ့ အဆၧအလံၩ ဒဲအဆၧအၥၫ့ လၧအအီၪက့ၪကီၪ့ ဆၧအလးအၥိၭ နီၪလီၫ.",
			"53": "<sup>53</sup> ဆၧမၩအၥၭ ထီးယ့ၫရှူၬချဲၩ့ဆၧချဲၩ့အဒီၩ့ လဖၪ",
			"54": "<sup>54</sup> ယီၩဂီၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪလီၫ.- ထဲၩ့ဝ့ၫထီၩ့ လၧအခးဒၪဝ့ၫတၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလၧအဝ့ၫၥံၪ အၥရိၬဖၧၩ့ ထီးၦထီၫမံၫထီၫမၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ, အဝ့ၫလဂၩယီၩ အဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ ဒဲအစီၩ့အမၩ့ ယီၩ, မွဲအန့ဘၪဝ့ၫခီၫခီၫလဲၪ. မွဲလဲၬၥမါအဖိၪခွၫမွဲ",
			"55": "<sup>55</sup> အ့ၬဧၪ.- အမိဆၧကိၭဝ့ၫ နးမၫရံၫနီၪ,မွဲအ့ၬဧၪ. အ ထၧၫ့ဖုဝဲခွၫၥံၪ, မွဲစယ့မံၭ,ဒဲစယိစ့ၭ,ဒဲစစဲမၧၫ့,ဒဲစယု ဒၭမွဲအ့ၬဧၪ. အထၧၫ့ဖုဝဲမုၪၥံၪနီၪအီၪ လၧပၥိၭထီးအ",
			"56": "<sup>56</sup> လူၬမွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, မွဲအန့ဘၪကယဲ",
			"57": "<sup>57</sup> ဆၧထီးအလူၬလဖၪ ယီၩခီၫခီၫလဲၪ.- အဝ့ၫၥံၪအၥၭ ဂၭဂီၩ့လၧအကၠီၩ့နီၪလီၫ. ယ့ၫၡုၫစံၭအဝ့ၫၥံၪးမီၪ နီၪအ့ၪလမွဲဘၪ လၧအထံၫအခးဒၪဝ့ၫ, ဒဲလၧအဂံၪ့ဒၪ",
			"58": "<sup>58</sup> ဝ့ၫအဖၧၩ့နီၪ အလၩအဖၩ့အီၪဝ့ၫလီၫ.- အလးနီၪၦၡၩ လနဲၩဘၪဆၧအကၠီၩ့တၭ,မၩလၩ့လၭဆၧလၧအအၪအ့ၬ."
		},
		"14": {
			"1": "<sup>1</sup> ထီးအထီနီၪၦဒိၪဖၭဒိၪစဟ့ရၧၭနါဂၧၫ့ ယ့ၫရှူၬအ",
			"2": "<sup>2</sup> ဆၧဂၧၫ့ထၪ့ၥၩလၩ့တၭ,- စံၭအခ့ၫအၡၩၥံၪ, ၦလဂၩ နီၪမွဲၦဘၭတံၫဇၫ့ဆၧ စယီဟၫ့တၭ, ဂဲထုၪ့လၧဆၧ ၥံၫအဖၧၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ,ဆၧလၩ့လၭလ ဖၪယီၩမၩအၥၭလၧအဝ့ၫနီၪလီၫ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ မွဲလၧအထၧၫ့ဖုဝဲစဖံလံၭအမၫနးဟ ရိဒအၭအကၠီၩ့တၭ,စဟ့ရၧၭဖီၪ့ထၬစယီဟၫ့နီၪ,စၧၩ့",
			"4": "<sup>4</sup> ထၬဝ့ၫတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧထီၫ့ဖၧၩ့လီၫ.- အဂဲး ဘဲၫယီၩစယီဟၫ့စံၭအဝ့ၫ, ၦမုၪနီၪနမၩန့နဝ့ၫတီၩ",
			"5": "<sup>5</sup> အ့ၬ.- အဝ့ၫနီၪမိမၩၥံၫဘၪအၥၭလၧအဝ့ၫဒၪလါနၫ့ ဘိၩ,ၥၭမဲၪၦခမျၧးလီၫ. အဂဲးဘဲၫယီၩ ၦခမျၧးအီၪ က့ၪစယီဟၫ့လၧအမွဲမီၪလဂၩလီၫ.",
			"6": "<sup>6</sup> အ့ၪမွဲထီးစဟ့ရၧၭအီၪဖျဲၪဝ့ၫ အမုလနံၩဆၧၫ့ထဲၩ့ အလးနီၪ, နးဟရိဒအၭအဖိၪမုၪဂဲထုၪ့လံလၧအဝ့ၫၥံၪ",
			"7": "<sup>7</sup> အမ့ၬယၫတၭ,ဘၪစဟ့ရၧၭအၥၭလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ, ဆိၪလၩ့အၥၭလၧအမိဖ့ၪလၫ့ဝ့ၫထီးဒၪဆၧလၧ",
			"8": "<sup>8</sup> အအၪ့ကံၩ့ဝ့ၫလမံၩ့မံၩ့လီၫ.- အဝ့ၫနီၪဘၪဆၧၥီၪ့ဝဲၩဝ့ၫ လၧ အမိတၭ, စံၭအဝ့ၫဒၪ, ဖ့ၪလၫ့လါယၧၩလၧၦဘၭ တံၫဇၫ့ဆၧစယီဟၫ့အခိၪဎွံၪနီၪလၧတဲၪလဲၪအဖၧၩ့",
			"9": "<sup>9</sup> ဆံၭ.- စဎွၩအၥုၪ့အုၭအၥၭအုၭလါနၫ့, မွဲလၧအဆိၪ လၩ့အၥၭနီၪ, ဒဲလၧၦဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဎုၬလၧအၥိၭလၧ စပွဲထံၭအကၠီၩ့တၭ,မၪလူၬဝ့ၫ လၧဆၧဘၪဖ့ၪလၫ့ဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.- တၭအၪ့မၧၫ့ၦလ့ၩဖ့ၬထ့ၬ စယီဟၫ့အခိၬလၧ",
			"11": "<sup>11</sup> ထီၫ့ဖၧၩ့နီၪး- ၦဂဲၫထဲၩ့ဆိၬဝ့ၫအခိၪဎွံၪ လၧတဲၪလဲၪ အဖၧၩ့တၭ, ဖ့ၪလၫ့ဖိၪၥၪမုၪနီၪ, အဝ့ၫဒၪထဲၩ့ဆိၬဝ့ၫ",
			"12": "<sup>12</sup> လၧအမိအအီၪလီၫ.- အထံၩအဖျဲၥံၪလ့ၩခုၪ့လၩ့ဘၧၩ့ အစွၪတၭ, လ့ၩလီၩဘၪယ့ၫရှူၬလီၫ.",
			"13": "<sup>13</sup> ထီးယ့ၫရှူၬနါဂၧၫ့တၭ, စဲၪ့ထၪ့ခွံၬထီးနီၪနုၬလၧ ချံၫဖၧၩ့တၭ, ထီၩ့လၧမံၩ့လၬကျၩလၧဆၧကဒုၩအလး လီၫ. ၦခမျၧးနါဂၧၫ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫလၧဒိၩ့ၥံၪ",
			"14": "<sup>14</sup> တၭဖိၬထၪ့အခဲၫ့ လၧအခၪ့လီၫ.- ယ့ၫရှူၬစဲၪ့ထၪ့ဒၪ ဘၪၦခမျၧးဖၭဒိၪတၭ, ယၫ့ၥၭဝ့ၫမၩဘျၪထဲၩ့ၦ လၧအဆၫလဖၪလီၫ.",
			"15": "<sup>15</sup> မုမ့ၬဂၪလၩ့တၭ အထံၩအဖျဲၥံၪဂဲၫလၧယ့ၪရှူၬအ အီၪနီၪ,စံၭဝ့ၫဒၪ, ဆၧထီးယီၩမွဲမံၩ့လၬကျၩတၭ, ဘိၩ့ နဲၪ့ယီၩမုဘၪယူၭ, ဘဲၫၥိၭၦခမျၧးမိလ့ၩဎွ့ၩအၪ့ဆၧ လၧအဂးဒၪဝ့ၫလၧတဝၫ့လဖၪအဖၧၩ့တၭ, ကွဲၪဖျါလါ",
			"16": "<sup>16</sup> အဝ့ၫၥံၪဆံၭ.- ယ့ၫရှူၬစံၭအထံၩအဖျဲၥံၪ,ၦလ့ၩဆၧ နီၪအလးအီၪအ့ၬ. နၥံၪဝ့ၫဒၪယီၩဖ့ၪအၪ့အဝ့ၫၥံၪဆံၭ.",
			"17": "<sup>17</sup> အဝ့ၫၥံၪစံၭအဝ့ၫဒၪ,ပဆၧအီၪထီးယီၩ, မွဲန့ၫကိၪယဲ",
			"18": "<sup>18</sup> လီၪ့ဒဲယၪနံၫဘံၪ့လီၫ.- အဝ့ၫနီၪစံၭဝ့ၫဒၪ,ဂဲၫဆိၬဆၧ",
			"19": "<sup>19</sup> နီၪလၧယအီၪဆံၭ.- မၪလူၬၦခမျၧးလဖၪ,လၧအမိဘၪ ဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧနၪ့ကျၩလီၫ. မၩန့ကိၪယဲလီၪ့,ဒဲယၪ နံၫဘံၪ့တၭ, ယိထၪ့ဆၧ လၧမူၭခိၪ, ဆိၪဂ့ၩကံၪ့ဘျ့ၭ ဝ့ၫတၭ,ဖ့ၪလၫ့ကိၪနီၪလၧအထံၩအဖျဲၥံၪတၭ, အထံၩ",
			"20": "<sup>20</sup> အဖျဲၥံၪဖ့ၪလၫ့ထဲၩ့လၧၦခမျၧးလီၫ.- ၦအၪ့ဝ့ၫကိၭဂၩ ဒ့ၭတၭ,ဘျဲၩအၪ့ဝ့ၫလီၫ. ၦအၪ့ထုၫ့ထဲၩ့ဝ့ၫ အဘျဲၪအ",
			"21": "<sup>21</sup> ဆဲဎွ့ၩဒၩ့လဆံၫနံၫဖျိၪ့လီၫ.- လၧၦမုၪဒဲဖိၪၥၪအမ့ၬ ယၫနီၪ,ၦခွၫလၧအအၪ့ဆၧမွဲဖိၭဘိၭယဲထီၫ့လီၫ.",
			"22": "<sup>22</sup> ထီးအကွဲၪဖျါခွံၬ ၦခမျၧးအဘိၩ့ဘၭနီၪ, ယ့ၫရှူၬ အၪ့မၧၫ့အထံၩအဖျဲၥံၪ လ့ၩနုၬလၧချံၫလဖျိၪ့အဖၧၩ့",
			"23": "<sup>23</sup> ချဲၫ့ချဲၫ့တၭ, ခၫ့စိၩဝ့ၫလၧဝါလခီၫလီၫ.- ကွဲၪဖျါခွံၬၦ ခမျၧးဂီၩ့တၭ,လ့ၩဘၩဆိၪဖၪဆၧလၧခိၪလီၩ့လဖျိၪ့ အလီၩ့လၧဆၧကဒုၩအလးလီၫ. မုမ့ၬဂၪလၩ့တၭ,",
			"24": "<sup>24</sup> အီၪဝ့ၫထီးနီၪလဂၩဎးလီၫ.- ချံၫအီၪဝ့ၫလၧကွံၩအၥၭ ကျၩတၭ,လပီၩထၪ့မၩဝၭဝ့ၫနၭနၭလ့ၬဆ့လီၫ. အဂဲး",
			"25": "<sup>25</sup> ဘဲၫယီၩလံၩတီၩအ့ၬ.- ဆၧခိၭဆၧလၧမုနၩလံဆၫ့လ ဆၫ့နီၪ, ယ့ၫရှူၬလ့ၩလၧအအီၪတၭ, စဲၪ့ဝ့ၫလၧကွံၩ",
			"26": "<sup>26</sup> ဖၧၩ့လၧထံၫဖံၭခိၪလီၫ.- စဲၪ့ဝ့ၫလၧကွံၩဖၧၩ့လၧထံၫ ဖံၭခိၪနီၪ,အထံၩအဖျဲၥံၪဒၪဘၪဝ့ၫတၭ, အဝ့ၫၥံၪ ၡုၭၥၭမဲၪထၪ့ဝ့ၫတၭ, စံၭလၧအမွဲၦစၪလီၫ. ၥၭမဲၪ",
			"27": "<sup>27</sup> ၥၭဖျဲၩ့ဆၧတၭ, ကိၭၡၭထၪ့ဝ့ၫဒၪလီၫ.- ယ့ၫရှူၬလီၩ ဘၪအဝ့ၫၥံၪချဲၫ့မၬတၭ, စံၭဝ့ၫဒၪ,မွဲနၥံၪအၥၭဎွံၫ",
			"28": "<sup>28</sup> ထၪ့ဘီၪ,မွဲယၧၩတၭ,ထီးၥၭမဲၪလဂ့ၩ.- စပံတၧၫချဲၩ့ ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ကဆါဧ့, အ့ၪမွဲနၧၩတၭ, မၪလူၬလါယၧၩဘဲၫယမိလ့ၩစိၩ လၧနအီၪလၧထံၫဖံၭ",
			"29": "<sup>29</sup> ခိၪအၥိၭဆံၭ.- အဝ့ၫနီၪစံၭဝ့ၫဒၪ,ဂဲၫဘီၪ. စပံတၧၫစဲၪ့ လၩ့ခွံၬဝ့ၫလၧချံၫဖၧၩ့တၭ, စဲၪ့ဝ့ၫလၧထံၫဖံၭခိၪ ဘဲၫအ",
			"30": "<sup>30</sup> မိလ့ၩထီၩ့လၧယ့ၫရှူၬအအီၪအၥိၭနီၪလီၫ.- ထီးအဒၪ ဘၪလံၩဂဲၫထၪ့ဆီၪ့ဆီၪ့လ့ၬတၭ, ၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫနီၪ, လၩ့ဘၧၩ့ၥၫ့ဝ့ၫတၭ,ကိၭၡၭထၪ့ဆၧစံၭဝ့ၫဒၪ, ကဆါ",
			"31": "<sup>31</sup> ဧ့,ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩဆံၭ.- ယ့ၫရှူၬယူၬစိၩအ စူၪတၭ,ဖီၪ့ထဲၩ့အဝ့ၫဒၪချဲၫ့မၬတၭ,စံၭဝ့ၫ,ၦနဲၩဆၧ ၡၩဧ့,မွဲဘၪနီၫလၧနၥၭဂံၩ့ဂၩ့လဲၪ.",
			"32": "<sup>32</sup> အဝ့ၫၥံၪထၪ့ဘၭဝ့ၫလၧချံၫဖၧၩ့တၭ, လံၩပထုၬ",
			"33": "<sup>33</sup> ဝ့ၫလီၫ.ၦအီၪလၧချံၫဖၧၩ့လဖၪနီၪ ဂဲၫစိၩတၭ,- ဘိၪ့ ထၪ့ဘၩထၪ့အဝ့ၫနီၪစံၭဝ့ၫဒၪ,နဝ့ၫဒၪယီၩ,နမွဲမၬယွၩ အဖိၪခွၫတၡါလီၫ.",
			"34": "<sup>34</sup> အဝ့ၫၥံၪခၫ့ဂၬဝ့ၫတၭ, ဂဲၫနုၬလၧ ခးဂန့ၭစရ့ၭအ",
			"35": "<sup>35</sup> ဖၧၩ့လီၫ.- ၦခးဖိၪထီးနီၪၥ့ၪယၫဝ့ၫတၭ, အၪ့မၧၫ့ၦ လ့ၩလၧခးထၧၫ့ဘံၪ့ယၫတၭ, ဂဲၫဆိၬကယဲၦဘၪစူၭ",
			"36": "<sup>36</sup> ဘၪဆၫလၧအအီၪတၭ,- ဘဲၫအမိထိၭဘၪန့ၫ အကီၩ့ အၥိၭအနွံၫတၭ, အၪ့ကံၩ့အၪ့ယၫဝ့ၫလီၫ. ထီး ဒၪၦလၧအထိၭဘၪအဝ့ၫလဖၪနီၪဘျၪထဲၩ့ဝ့ၫဒၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦဖၫရစံၫ,ဒဲၦကွ့ၭလံၬၥံၪ လၧယရုစ လံၫ့အဖၧၩ့နီၪ, ဂဲၫလၧယ့ၫရှူၬအအီၪတၭ,စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ၦမွံၩၦၡါလီၩဆိၩလၬဆိၩဆၧနီၪ, မွဲဘၪနီၫလၧနထံၩ နဖျဲၥံၪလၨၪခၫ့ဖၬအဆၧလဲၪး အဂဲးဘဲၫယီၩ လၥူၫဝၭ",
			"3": "<sup>3</sup> ခွံၬဘၪအစူၪတၭ, အၪ့မၬဆၧကၨ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ ဝ့ၫတၭ,လီၩဘၪအဝ့ၫၥံၪ, မွဲဘၪနီၫလၧနၥံၪလၨၪခၫ့",
			"4": "<sup>4</sup> ဖၬယွၩအဆၧမၪလူၬ လၧနၥံၪလီၩဆိၩဆၧအကၠီၩ့ နီၪလဲၪ.- အဂဲးဘဲၫယီၩယွၩမၪလူၬဆၧတၭ, စံၭဝ့ၫဒၪ, ယူၭ ယၪ့ န မိ န ဖါ ဆံၭ. အ မိ မွဲ ဂ့ၩ, အ ဖါ မွဲ ဂ့ၩ, ၦ လၧ အ ချဲၩ့ အၧၩ့ အ ဝ့ၫ နီၪ, ၥံၫ တၭ,",
			"5": "<sup>5</sup> မွဲ အ ၥံၫ ဒၪ ဝ့ၫ ဆံၭ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪ စံၭ,ထီးဒၪၦလၧအစံၭအမိအဖါ, ထီးဒၪဆၧလၧနဂ့ၩ န့ဘၪလၧယၧၩလမံၩ့မံၩ့ယီၩ, မွဲအကဲၪဒၪဝ့ၫလၧဆၧ",
			"6": "<sup>6</sup> ဘိၪ့ဆၧထးဆံၭ.- ယူၭယၪ့အမိအဖါအ့ၬ, မွဲလၧနၥံၪ အဆၧလီၩဆိၩ လၬဆိၩအကၠီၩ့နီၪ နၥံၪမၩဂၭဂီၩ့ခွံၬ",
			"7": "<sup>7</sup> ယွၩအဆၧမၪလူၬလီၫ.- ၦအၪ့လီၫဆၧၥံၪဧ့, စအဲၫစ့ ယၫစံၭဝ့ၫ လၧမီၪအချိၬလၧနၥံၪအဂဲးနီၪဘၪမၬတၭ,",
			"8": "<sup>8</sup> စံၭဝ့ၫ, ၦလဆၨၩယီၩၥုၭဘူၭအၥၭလၧယၧၩလၧအနိၭ, ဒဲယူၭယၪ့ယၧၩလၧအနိၭဖျံၩနီၪ, အ့ၪမွဲအဝ့ၫၥံၪအၥၭယဲၩ့လၧယၧၩလီၫ.",
			"9": "<sup>9</sup> မွဲလါနၫ့ဘိၩအဝ့ၫၥံၪၥီၪ့လိၪဆၧလၧၦၡၩအဆၧ မၪလူၬ, လၧဆၧၥီၪ့ဆၧၥၫ့အလးတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ပျီၩပျီၩယၧၩလီၫ.",
			"10": "<sup>10</sup> အဝ့ၫဒၪကိၭန့ၦခမျၧးလၧအအီၪတၭ, စံၭဝ့ၫဒၪ, ခိၭ",
			"11": "<sup>11</sup> နၪဆၧတၭနၪၥ့ၪဆံၭ.- မွဲဆၧလၧအလ့ၩနုၬလၧၦနိၭ ဖၧၩ့နီၪမၩစံၪစၪၦၡၩအ့ၬ. မွဲဆၧလၧအဂဲၫထၪ့လၧ ၦနိၭဖၧၩ့တၭ, အယီၩမၩစံၪစၪၦၡၩလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့ အထံၩအဖျဲၥံၪဂဲၫ လၧအအီၪ,စံၭဝ့ၫ ဒၪ, ၦဖၫရစံၫၥံၪ နါဂၧၫ့ဆၧချဲၩ့လထံၪနီၪ, အၥၭဂၭဂီၩ့",
			"13": "<sup>13</sup> ဝ့ၫတၭ,မွဲနၥ့ၪယၫဆ့ဧၪ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ကယဲဆၧအထံၭ လၧယဖါအီၪ လၧမူၭခိၪလ ၥုၪ့လၩ့ဘၪဝ့ၫကိၭထံၭဒ့ၭနီၪ, မိဘၪဆၧထ့ၭခွံၬဝ့ၫ",
			"14": "<sup>14</sup> ဒၪလီၫ.- မၩဘူၭအဝ့ၫၥံၪလဂ့ၩး ၦမ့ၬဘျီၪမီၩ့ၦလၧ အမ့ၬဘျီၪနီၪ, ၦမ့ၬဘျီၪခီၫၦမ့ၬဘျီၪအ့ၪမီၩ့လိၬအ",
			"15": "<sup>15</sup> ၥၭတၭ,မိလၩ့ထ့ၬလၧဆၧဖၧၩ့ နံၫဂၩလူၬလီၫ.- စပံ တၧၫချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫဒၪ, ဆၧချဲၩ့အဒီၩ့နီၪလီၩ",
			"16": "<sup>16</sup> ဘၪပၧၩဆံၭ.- ယ့ၫရှူၬစံၭဝ့ၫဒၪ,နၥံၪအဆၧကိၪ့လ",
			"17": "<sup>17</sup> အီၪဒံၭဘၪဧၪ.-ကယဲဆၧလၧအလ့ၩနုၬဝ့ၫ လၧၦနိၭ ဖၧၩ့ထီးအလူၬနီၪလၩ့ဘၪဝ့ၫလၧဂူၭဖိၫ့ဖၧၩ့တၭ, ဘၪဆၧခွံၬၡိၭခွံၬဝ့ၫ လၧဆၧလ့ၩဂၭလိၫအလးနီၪ, န",
			"18": "<sup>18</sup> ၥံၪနၪၥ့ၪဒံၭအ့ၬဧၪ.-အ့ၪမွဲဆၧလၧအဂဲၫထၪ့ဝ့ၫ လၧ ၦနိၭဖၧၩ့နီၪ,မွဲအဂဲၫထၪ့လၧပၥၭဖၧၩ့တၭ, မၩစံၪစၪၦ",
			"19": "<sup>19</sup> ၡၩလီၫ.- အဂဲးဘဲၫယီၩ ဆၧကိၪ့လၧအအၧၩ့ ဆၧ မၩၥံၫၦၡၩ, ဆၧအဲၪဘိၩ့အဲၪဖၬ, ဆၧမၩမၪမုၪမၩမၪ ခွၫ,ဆၧအၪ့ဂူၪဆၧ, ဆၧထိးအၥၭလၧအလမွဲလတီၩ",
			"20": "<sup>20</sup> ဘၪ,ဆၧဒုၪဒွ့ၪၥံၪနီၪ ဂဲၫထၪ့လၧၦၥၭဖၧၩ့လီၫ.- တၭ ဆၧယီၩမၩစံၪစၪၦၡၩနီၪး အ့ၪမွဲၦအၪ့ဆၧလၧအစူၪ လၧအလၥူၫဝၭခွံၬဘၪနီၪ, မွဲအမၩစံၪစၪၦၡၩအ့ၬ.",
			"21": "<sup>21</sup> ယ့ၫရှူၬစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, လ့ၩထီၩ့ဝ့ၫလၧ",
			"22": "<sup>22</sup> တဲအၫဒဲစဲဒၧၫ့အခးလီၫ.- ယိခွါ,ၦကၫနအၫ့မုၪလဂၩ ဂဲၫလၧခးနီၪကိၭၡၭထၪ့ဝ့ၫတၭး စံၭဝ့ၫဒၪ,စဒၫဝံၭအ ဖိၪခွၫကဆါဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭလါယၧၩဆံၭ. ဆၧနၪ အီၪလၧယဖိၪမုၪလဂၩအလီၩ့တၭ, ဘၪဆၧနၭမၬ",
			"23": "<sup>23</sup> လီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧနးထံၪအ့ၬ. အထံၩအ ဖျဲလဖၪဂဲၫလၧအအီၪတၭ, အၪ့ယၫဝ့ၫစံၭဝ့ၫဒၪ, ကွဲၪ ဖျါခွံၬၦမုၪနီၪဆံၭ. အဂဲးဘဲၫယီၩမွဲအကိၭၡၭထၪ့ လၧ",
			"24": "<sup>24</sup> ပလးခဲၫ့လီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဆၧအၪ့မၧၫ့လၩ့ ယဂဲၫန့ၫလၧၥိၪလၧအလၩ့မါ လၧၦ",
			"25": "<sup>25</sup> အံၫစရ့လၭအဂံၪ့ဖိၪအအီၪလီၫ.- ၦမုၪနီၪဂဲၫလၧအ အီၪ,ထွံၩလၩ့လၧအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ကဆါဧ့,",
			"26": "<sup>26</sup> မၩဘိၭမၩဆၧၩ့ယၧၩဆံၭ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫဒၪ, ဆၧလၧဖိၪၥၪအဆၧအၪ့နီၪ ပမၩန့",
			"27": "<sup>27</sup> တၭ,ခွံၬလၩ့လၧထွံၪအီၪနီၪဂ့ၩအ့ၬ.- အဝ့ၫနီၪစံၭ ဝ့ၫဒၪ,မွဲယူၭ, ကဆါဧ့း အဂဲးဘဲၫယီၩ,ထွံၪဒၪလ့ၬအၪ့ ဆၧအီၪဘျဲၪအီၪဆဲလၩ့ဎွံၪလၩ့လဲၩ့ လၧအကဆါစပွဲ",
			"28": "<sup>28</sup> ထံၭနီၪလီၫ.- ထီးနီၪလဖၧၫ့,ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭအဝ့ၫနီၪၦမုၪဧ့,နနဲၩဆၧဒိၪမၬလီၫ. မွဲအ ကဲၪထၪ့ထီးဒၪနၥၭဆံၭ. လၧနၩရံၩနီၪ အဖိၪမုၪဘျၪ ထဲၩ့ဝ့ၫလီၫ. ယ့ၫရှူၬမၩဘျၪထဲၩ့ၦအၪဂၩ.",
			"29": "<sup>29</sup> ယ့ၫရှူၬစဲၪ့ထၪ့ဝ့ၫထီးနီၪတၭ,ဂဲၫလၧကွံၩဂၫလ လံၫအနဲၩ့ထံၭတၭ, လ့ၩထၪ့ဝ့ၫ လၧခိၪလီၩ့လဖျိၪ့အ",
			"30": "<sup>30</sup> လီၩ့တၭ,ဆၧၫ့နၩ့ဝ့ၫထီးနီၪလီၫ.- ၦခမျၧးဖၭဒိၪဂဲၫ လၧအအီၪတၭ, အီၪဝ့ၫလၧအခၪ့ဂၭဂီၩ့, ၦအမ့ၬဘျီၪ, ၦအုၭအၭ,ၦအစူၪခါအခၪ့ချံၭ, ဒဲၦစူၭၦဆၫ အဂူၫဂၩ အၪဂၩတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧ ယ့ၫရှူၬအခၪ့ထံၭ",
			"31": "<sup>31</sup> တၭ,အဝ့ၫဒၪမၩဘျၪထဲၩ့အဝ့ၫၥံၪလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ထီးၦခမျၧးဒၪဘၪ ၦအုၭအၭနီၪချဲၩ့ဆၧ, ၦစူၪခါခၪ့ချံၭနီၪအီၪဆီၫ့အီၪချဲၫ့, ၦခၪ့ဂၭဂီၩ့နီၪစဲၪ့ထၪ့ ထဲၩ့,ဒဲၦအမ့ၬဘျီၪနီၪဒၪထၪ့ထဲၩ့ဆၧတၭ, ထီၫမံၫထီၫ မၪဝ့ၫတၭ, အဝ့ၫၥံၪစံၭထၪ့အၪ့အူၭၦအံၫစရ့လၭ အ ယွၩလီၫ.",
			"32": "<sup>32</sup> ယ့ၫရှူၬကိၭန့ အထံၩအဖျဲလၧအအီၪတၭ,စံၭဝ့ၫ ဒၪ,ယယၫ့ၥၭၦခမျၧးလီၫ. အဂဲးဘဲၫယီၩ အီၪယူၭဝ့ၫ လၧယၥိၭၥၧၫ့နံၩယူၭ, အဆၧလၧအမိအၪ့ဝ့ၫနီၪ အီၪ နးမံၩ့အ့ၬ. အဝ့ၫၥံၪဒုၪဆၧအၪ့ဆၧအီၩတၭ, မိကွဲၪဖျါ ထဲၩ့ဘၪယၥၭအ့ၬ. ဘၪလဘၪမိလၩ့ဒိၩဘၪခိၬဝ့ၫ",
			"33": "<sup>33</sup> လၧဖၧၩ့ၥၭလီၫ.- အထံၩအဖျဲၥံၪစံၭအဝ့ၫ ၦခမျၧးဖိၭ ဘိၭယီၩ, ဘဲၫအမိအၪ့ဘျဲၩအၪ့အၥိၭတၭ, ကိၪအၪန့ၫ",
			"34": "<sup>34</sup> နီၪမိအီၪလၧပၧၩလၧမံၩ့လၬကျၩခီၫခီၫလဲၪ.- ယ့ၫ ရှူၬစံၭဝ့ၫဒၪ, နၥံၪအကိၪအီၪဎွ့လီၪ့ လဲၪ အဝ့ၫၥံၪစံၭ",
			"35": "<sup>35</sup> ဝ့ၫဒၪ,နွ့ၫလီၪ့ဒဲယၪဖိၪအီၪၡၩခိၬဘံၪ့လီၫ.- အဝ့ၫဒၪ မၪလူၬၦခမျၧးဘဲၫၥိၭအမိဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧဂၪ့ခိၪ",
			"36": "<sup>36</sup> အလီၩ့လီၫ.- မၩန့စိၩကိၪနွ့ၫလီၪ့,ဒဲယၪဖိၪလဖၪနီၪ တၭ,စံၭထၪ့အၪ့အူၭဆၧအခိးအတၩတၭ, ကံၪ့ဘျ့ၭ ဝ့ၫ,ဖ့ၪလၫ့အထံၩအဖျဲၥံၪတၭ, အထံၩအဖျဲၥံၪဖ့ၪလၫ့",
			"37": "<sup>37</sup> ထဲၩ့ၦခမျၧးလီၫ.- ၦအၪ့ဝ့ၫကိၭဂၩဒ့ၭတၭ ဘျဲၩအၪ့ ဝ့ၫနီၪ,အၪ့ထုၫ့ကီၪ့ထဲၩ့ဝ့ၫ အဘျဲၪအဆဲဎွ့ၩဒၩ့နွ့ၫဖျိၪ့",
			"38": "<sup>38</sup> လီၫ.- လၧၦမုၪဒဲၦဖိၪၥၪလဖၪအမ့ၬယၫနီၪ, အခွၫလၧ",
			"39": "<sup>39</sup> အအၪ့ဆၧလဖၪအီၪဝ့ၫလံထီၫ့လီၫ.- အဝ့ၫဒၪကွဲၪဖျါ ခွံၬၦခမျၧးၥံၪ, နုၬလၧချံၫဖၧၩ့ထီၩ့လၧမၫကဒၫလၫ အ ခးနဲၩ့ထံၭလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ၦဖၫရစံၫဒဲၦစၭဒုၫစံၫၥံၪဂဲၫလၧအအီၪ ကျဲၩ့ဖစီၩ့ ဝ့ၫတၭ, အၪ့ကံၩ့အၪ့ယၫဝ့ၫ ဘဲၫၥိၭအမိဒုၭနဲၪ ဆၧလၩ့",
			"2": "<sup>2</sup> လၭလမံၩ့မံၩ့လၧမူၭခိၪလခီၫလီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ ဆၧတၭ,စံၭအဝ့ၫၥံၪ, မုမ့ၬဂၪလၩ့တၭ, နၥံၪစံၭ,ဆၧမိ",
			"3": "<sup>3</sup> ယီၩထၪ့ဖီၩၬအဂဲးဘဲၫယီၩ, မူၭခိၪၡးဝီၩဝ့ၫလီၫ.- လၧ မုဂီၩနီၪ, နၥံၪစံၭလံၩလဖုၬလနံၩယီၩဖီၩၬ အဂဲးဘဲၫ ယီၩ,မူၭခိၪဝီၩတၭ,ဆၧအုၪ့ချႃၬလၩ့ဝ့ၫလီၫ. ၦအၪ့ လီၫဆၧၥံၪဧ့, မူၭခိၪမူၭနါအဂဲးနီၪ, နၥံၪၥ့ၪယၫအၪ့ နၩ့ဖၭအဆၧၫ့ၥ့ၪလီၫ. အ့ၪမွဲအဆၧၫ့အထီအဆၧမၩနဲၪ့ လဖၪနီၪ,နၥံၪၥ့ၪယၫအၪ့နၩ့ဖၭၥ့ၪအ့ၬဧၪ.",
			"4": "<sup>4</sup> ၦလၧအအၧၩ့အၥၫ့, ဒဲအအဲၪဘိၩ့ဆၧလဆိၩယီၩ အၪ့ဎူၫအၪ့ဎၬဆၧလၩ့လၭ, ဆၧမိဒုၭနဲၪဝ့ၫလၧဆၧလၩ့ လၭနးမံၩ့အ့ၬ. မိဒုၭနဲၪန့ၫစယိနၫ အဆၧလၩ့ လၭလမံၩ့နီၪလီၫ. အဝ့ၫဒၪစဲၪ့ဒၪအဝ့ၫၥံၪတၭ, လ့ၩ ဆၧလီၫ.",
			"5": "<sup>5</sup> အထံၩအဖျဲလဖၪလ့ၩခၫ့စိၩဝ့ၫ လၧဝါလခီၫတၭ,",
			"6": "<sup>6</sup> ၥၭနၪ့မၩန့ကိၪနီၪလီၫ.- ယ့ၫရှူၬစံၭဝ့ၫ,ယိခွါ,ထီး လၩ့နၥံၪအၥၭလၧၦဖၫရစံၫ ဒဲလၧၦစၭဒုၫစံၫၥံၪအမံၪ",
			"7": "<sup>7</sup> ဘီၪ.- အဝ့ၫၥံၪကိၪ့လိၬအၥၭလဂၩဒဲလဂၩတၭ, စံၭဝ့ၫ",
			"8": "<sup>8</sup> ဒၪ, မွဲပလမၩန့ဘၪကိၪအဂဲးလီၫ.- ယ့ၫရှူၬၥ့ၪယၫ, စံၭဝ့ၫဒၪ,ၦလၧအနဲၩဆၧၡၩၥံၪဧ့, မွဲဘၪနီၫလၫလၧ နၥံၪစံၭလိၬနၥံၪအၥၭလၧနၥံၪလမၩန့ဘၪ ကိၪအဂဲး",
			"9": "<sup>9</sup> နီၪလဲၪ.- နၥံၪနၪၥ့ၪဒံၭအ့ၬဧၪ. ကိၪယဲလီၪ့ဘၪဆဲၫ့ လၧၦယဲထီၫ့နီၪ, နၥံၪအၪ့ထုၫ့ကီၪ့ထဲၩ့န့ဒၩ့ဎွ့ဖျိၪ့လဲၪ",
			"10": "<sup>10</sup> နီၪ,- ဒဲကိၪနွ့ၫလီၪ့ဘၪဆဲၫ့လၧၦလံထီၫ့နီၪ, နၥံၪအၪ့ ထုၫ့ကီၪ့ထဲၩ့ န့ဒၩ့ဎွ့ဖျိၪ့လဲၪနီၪ, နၥံၪနၪ့ထၪ့ထဲၩ့အ့ၬ",
			"11": "<sup>11</sup> ဧၪ.- ယစံၭထီးလၩ့နၥံၪအၥၭလၧ ၦဖၫရစံၫဒဲၦစၭဒုၫ စံၫၥံၪအမံၪ, ယလစံၭဘၪလၧကိၪအဂဲးအကၠီၪ့နီၪ,မွဲ",
			"12": "<sup>12</sup> ဘၪနီၫနၥံၪနၪလၥ့ၪဘၪလဲၪ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪ နၪဝ့ၫၥ့ၪလၧအစံၭ, ထီးလၩ့နၥံၪအၥၭလၧကိၪအမံၪ နီၪလမွဲဘၪ, အ့ၪမွဲၦဖၫရစံၫဒဲၦစၭဒုၫစံၫၥံၪအဆၧ ၥီၪ့အဆၧၥၫ့အဂဲးနီၪလီၫ.",
			"13": "<sup>13</sup> ယ့ၫရှူၬလ့ၩဝ့ၫထီၩ့လၧ စ့ၭစရံအၫဖံလံၭအခးတၭ, အၪ့စၪ့အထံၩအဖျဲၥံၪ, စံၭဝ့ၫဒၪ, ၦၡၩအဖိၪခွၫယၧၩ",
			"14": "<sup>14</sup> ယီၩ,ၦၡၩၥံၪစံၭလၧယမွဲပလၫလဂၩလဲၪ.- အဝ့ၫ ၥံၪစံၭဝ့ၫဒၪ, ၦလနၩ့နၩ့စံၭဝ့ၫ, မွဲၦဘၭတံၫဇၫ့ဆၧ စယီဟၫ့တၭ, အဂူၫဂၩလနၩ့နၩ့စံၭဝ့ၫ, စအံၫလဲယၫ တၭ,အဂူၫဂၩလနၩ့နၩ့စံၭဝ့ၫ, စယ့ၫရမဲအၫ,အ့ၪလ မွဲဘၪတၭ, မွဲမီၪလဂၩဂၩလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪစံၭဝ့ၫ, အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩနၥံၪစံၭလၧယ",
			"16": "<sup>16</sup> မွဲပလၫလဂၩလဲၪ.- စစဲမၧၫ့ပံတၧၫချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫဒၪ,နဝ့ၫဒၪယီၩနမွဲဎရံၬနီၪ, ယွၩလၧအမၧၫ့",
			"17": "<sup>17</sup> ဝ့ၫလဂၩအဖိၪခွၫလီၫ.- ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,စဲမၧၫ့ဘၫယိနၫဧ့, နဘၪဆိၪဂ့ၩ နဝ့ၫဒၪလီၫ. အဂဲးဘဲၫယီၩဆၧယၪဒဲဆၧၥွံၪနီၪမၩဖျီၪထၪ့ဝ့ၫ လၧနၧၩလမွဲဘၪ, အ့ၪမွဲယဖါအီၪလၧမူၭခိၪ",
			"18": "<sup>18</sup> လီၫ.- ယဝ့ၫဒၪယီၩ,ယလီၩဘၪနၧၩလၧနမွဲပံတၧၫ တၭ,ယမိအီၪက့ၪလၩ့ ယဆၧအီၪကီၪ့လၧလိးယီၩ အလီၩ့တၭ, ဖျႃဖၧၩ့အတရၫ့လဖၪ မၩနၧၩ့မၩစၪဘၪ",
			"19": "<sup>19</sup> ဝ့ၫအ့ၬ.- ယမိဖ့ၪလၫ့နၧၩလၧမူၭခိၪအဘၩ့အမုးအ နိၪဝံၬတၭ, ထီးဒၪနစၧၩ့ထၬဆၧလၧဂၪ့ခိၪချိၫ့လမံၩ့ မံၩ့ယီၩ,မိဘၪဆၧစၧၩ့ထၬဝ့ၫ လၧမူၭခိၪအဖၧၩ့တၭ, ထီးဒၪနကွဲၪလၩ့ဆၧလၧဂၪ့ခိၪချိၫ့လမံၩ့မံၩ့ယီၩ, မိ ဘၪဆၧကွဲၪလၩ့ဝ့ၫလၧမူၭခိၪအဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪမၪလူၬအထံၩအဖျဲၥံၪထံၫ ထံၫဆၭဆၭဘဲၫၥိၭအထီးလီၩဘၪၦၡၩလၧအမွဲဎရံၬ နီၪနးဂၩလဂ့ၩ.",
			"21": "<sup>21</sup> လၧအခၫဘိၩ့နီၪတၭ, ယ့ၫရှူၬဒုၭနဲၪၥၫ့အထံၩ အဖျဲၥံၪလၧအဘၪလ့ၩလၧယရုစလံၫ့တၭ, မိဘၪထိး ဆၧနၭဆၧၡၪ့အၪမံၩ့လၧၦၥုၪ့က့ၭၥၭၡါ, ဒဲလၧၦလု ဆၧအဒိၪၥံၪ,ဒဲလၧၦကွ့ၭလံၬလဖၪအစူၪဖၧၩ့တၭ, မိ ဘၪဆၧမၩၥံၫဝ့ၫတၭ, ထီးဘၪၥၧၫ့နံၩလနံၩနီၪ, မိဂဲ ထုၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"22": "<sup>22</sup> စပံတၧၫမၩန့အဝ့ၫဒၪတၭ,အၪ့လၬဝ့ၫစံၭဝ့ၫဒၪ,က ဆါဧ့, မွဲဆၧယၫ့ၥၭလါနၧၩဆံၭ. ဆၧယီၩမွဲထီးဘၪ",
			"23": "<sup>23</sup> နၧၩလဂ့ၩ.- အဝ့ၫဒၪကၠၪထဲၩ့အၥၭတၭ, စံၭစပံတၧၫ, ဒုၪဒၩဧ့,ထဲၩ့ထဲၩ့နဝ့ၫလၧယလးခဲၫ့ဆံၭ. နမွဲယ ဆၧလၩ့ထံၩဖါအလးလီၫ. အဂဲးဘဲၫယီၩနၥၭအီၪ လၧယွၩအဆၧအ့ၬ, မွဲလၧၦၡၩအဆၧလီၫ.",
			"24": "<sup>24</sup> ထီးနီၪလဖၧၫ့ ယ့ၫရှူၬစံၭအထံၩအဖျဲၥံၪ ထီးဒၪၦ လၧအမိဖိၬဘၪအၥၭလၧယခဲၫ့လဂၩဂၩနီၪ,မွဲအ ခွံၬၡိၭခွံၬအၥၭဒၪဝ့ၫ, မၩန့အထုၪ့စူၪယၫတၭ, ဖိၬယ",
			"25": "<sup>25</sup> ခဲၫ့ဆံၭ.- အဂဲးဘဲၫယီၩ ထီးဒၪၦလၧအမိထိးထဲၩ့ တၩ့ထဲၩ့ဘၪအၥၭလၧအၥၭမၧၫ့လဂၩဂၩနီၪ, အၥၭ မၧၫ့မိလၩ့မါခွံၬဝ့ၫဒၪလီၫ. ထီးဒၪၦလၧအၥၭမၧၫ့အ့ၪ လၩ့မါခွံၬလၧယကၠီၩ့လဂၩဂၩနီၪ, မွဲအမိဒၪဘၪထဲၩ့",
			"26": "<sup>26</sup> ဒီၭအၥၭမၧၫ့လီၫ.- အဂဲးဘဲၫယီၩၦအ့ၪန့ဘၪဂၪ့ခိၪ ထၧၫ့ဖျိၪ့ယၫတၭ, အၥၭၡီၩ့အ့ၪလၩ့မါခွံၬနီၪ, မွဲအန့ ကၩဆၧနီၪလဲၪ. လၧအၥၭၡီၩ့အဂးနီၪ, မွဲပမိဖ့ၪလၫ့",
			"27": "<sup>27</sup> အဎွ့ၩလၧဆၧနီၪလမံၩ့လဲၪ.- အဂဲးဘဲၫယီၩ ၦၡၩ အဖိၪခွၫယီၩ မိဂဲၫဝ့ၫလၧအဖါအလၩအဖၩ့အီၪ လၧအၥီၫ့လဖၪလီၫ. ထီးနီၪလဖၧၫ့မိဖ့ၪလၫ့ဆၧလၧ ၦၡၩဘဲၫအမၩဒၪအဆၧအၥိၭနီၪဆုၬဆုၬလီၫ.",
			"28": "<sup>28</sup> ယလီၩဘၪနၥံၪတီၩတီၩယီၩ,ၦဆၧၫ့ထုၪ့ထီး ယီၩလနၩ့နၩ့လၧအလချႃၭဒၪဒံၭဘၪ ၦၡၩအဖိၪခွၫ ဂဲၫထဲၩ့လၧအဘၩ့အမုးအဖၧၩ့နီၪ မိထဲးယိဘၪဆၧ ၥံၫအ့ၬ."
		},
		"17": {
			"1": "<sup>1</sup> လၧဎူၫနံၩအလးခဲၫ့နီၪ, ယ့ၫရှူၬကိၭန့စပံတၧၫ,စ ယ့မံၭ,ဒဲအထၧၫ့ဖုဝဲစယီဟၫ့တၭ, ၥိၫ့ထၪ့ဝ့ၫလၧဆၧ",
			"2": "<sup>2</sup> ကဒုၩ,လၧခိၪလီၩ့ဖၭထီၫလဖျိၪ့အလီၩ့လီၫ.- အခံးအ ဂၩ့ဘၪဆၧအၪ့လဲၩခွံၬအၥၭ လၧအဝ့ၫၥံၪအမ့ၬယၫ တၭ,အမ့ၬယုၩ့ယဲဝ့ၫဘဲၫမုမ့ၬအၥိၭ,အကီၩ့အၥိၭနီၪ",
			"3": "<sup>3</sup> ဘွၩဝ့ၫဘဲၫဆၧဖၩ့အၥိၭနီၪလီၫ.- ယိခွါ,စမိစ့ၭဒဲစအံၫ လဲယၫအီၪဖျီၪထၪ့ဝ့ၫ လၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, ချဲၩ့",
			"4": "<sup>4</sup> ဒုၪ့လိၬအၥၭလၧယ့ၫရှူၬလီၫ.- စပံတၧၫ့ချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭယ့ၫရှူၬ,ကဆါဧ့, ပအီၪထီးယီၩမုၬကၨ.နၥၭ အ့ၪအီၪတၭ, ပမိမၩတဲၩထီးယီၩနးၥၧၫ့ဖျိၪ့, လၧက ဆါအဂးနးဖျိၪ့, လၧစမိစ့ၭအဂးနးဖျိၪ့,ဒဲလၧစအံၫလဲ",
			"5": "<sup>5</sup> ယၫအဂးနးဖျိၪ့လီၫ.- မွဲအချဲၩ့ဆၧနီၪအဘိၩ့ဘၭတၭ, ယိခွါ,ဆၧအုၪ့ဖၩ့အလၩၡုၪလၩ့ ဘၪအဝ့ၫၥံၪလီၫ. ယိ ခွါ,ဆၧအလူၥီၫလၩ့ လၧဆၧအုၪ့အကျၩတၭ, စံၭဝ့ၫ ဒၪ,အယီၩလဂၩ မွဲယဖိၪခွၫၥၭဘီၩ့တၭ, မုၬယၥၭ",
			"6": "<sup>6</sup> လၧအဝ့ၫနီၪးခိၭနၪအလူဆံၭ.- အထံၩအဖျဲလဖၪနါ ဂၧၫ့တၭ, လၩ့ထံၩဖါချႃၬလၩ့အၥၭတၭ, ၥၭမဲၪၥၭဖျဲၩ့",
			"7": "<sup>7</sup> ဝ့ၫဒိၪမၬလီၫ.- ယ့ၫရှူၬဂဲၫထိၭဘၪဝ့ၫတၭ,စံၭဝ့ၫဒၪ,",
			"8": "<sup>8</sup> ဂဲထုၪ့ဘီၪ. ထီးၥၭမဲၪဆၧလဂ့ၩ.-အဝ့ၫၥံၪစၪ့ထၪ့အ မ့ၬတၭ,အ့ၪလမွဲဘၪယ့ၫရှူၬလဂၩနီၪဒၪဘၪၦနးဂၩအ့ၬ.",
			"9": "<sup>9</sup> အဝ့ၫၥံၪဂဲၫထဲၩ့လၩ့ လၧခိၪလီၩ့အဘိၫ့ဘၭနီၪ ယ့ၫ ရှူၬမၪလူၬဝ့ၫ, စံၭဝ့ၫဒၪ, ၦၡၩအဖိၪခွၫယီၩလချႃၭ ဂဲ ထုၪ့ထဲၩ့ဒံၭဘၪလၧဆၧၥံၫအဖၧၩ့တၭ, ဆၧလၧနၥံၪ ဒၪဘၪလမံၩ့ယီၩထီးလီၩဘၪ ၦနးဂၩလဂ့ၩ.",
			"10": "<sup>10</sup> အထံၩအဖျဲၥံၪအၪ့စၪ့ဝ့ၫ,စံၭဝ့ၫဒၪ, မွဲဘၪနီၫလၧ ၦကွ့ၭလံၬၥံၪစံၭဝ့ၫလၧစအံၫလဲယၫဘၪဂဲၫဆိၫလဲၪ.",
			"11": "<sup>11</sup> ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, စအံၫလဲယၫမိဂဲၫ",
			"12": "<sup>12</sup> ဆိၫဝ့ၫတၡါတၭ, မိမၩထဲၩ့ဆၧထီးအလူၬလီၫ.- အ့ၪ မွဲယလီၩ ဘၪနၥံၪလၧ စအံၫလဲယၫဂဲၫယူၭဝ့ၫယူၭတၭ, ၦၥ့ၪယၫဝ့ၫအ့ၬ. မွဲအဝ့ၫၥံၪမၩယူၭလၧအဝ့ၫဒၪထီး ဒၪအၥၭယူၭ, ၦၡၩအဖိၪခွၫယီၩ မိဘၪထိးဆၧလၧ အဝ့ၫၥံၪအစူၪဖၧၩ့ဘဲၫနီၪၥိၭဆ့လီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့အထံၩအဖျဲၥံၪနၪၥ့ၪလၧ အစံၭဝ့ၫ လၧၦဘၭတံၫဇၫ့ဆၧ စယီဟၫ့အဂဲးလီၫ.",
			"14": "<sup>14</sup> ထီးအဝ့ၫၥံၪဂဲၫထီၩ့လၧၦခမျၧးအအီၪတၭ, ၦဂဲၫ",
			"15": "<sup>15</sup> လၧအအီၪလဂၩ ချံၭလၩ့အခၪ့တၭစံၭဝ့ၫဒၪ,- ကဆါ ဧ့,ယၫ့ၥုၪ့ယၫ့ၥၭယဖိၪခွၫလဂၩဆံၭ. အဂဲးဘဲၫယီၩ ဆၧဆၫဖျႃထိၭဘၪဝ့ၫတၭ, ဘၪဝ့ၫနၭနၭလ့ၬလီၫ. အ ဂဲးဘဲၫယီၩမွဲအလၩ့ဖျႃၭလၧမ့ၪဖၧၩ့ အၪဘျၩ့တၭ,",
			"16": "<sup>16</sup> လၩ့ထံၩဖါလၧထံၫကျၩအၪဘျၩ့ဆ့လီၫ.-ယဂဲၫဆိၬ လၧနထံၩနဖျဲၥံၪအအီၪတၭ, အဝ့ၫၥံၪမၩဘျၪထဲၩ့ဝ့ၫ",
			"17": "<sup>17</sup> ၥ့ၪအ့ၬ.- ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫဒၪ, ၦလၧ အလနဲၩဘၪဆၧဒဲအနါကဲၪ့အဆၨၩအဆၬၥံၪဧ့, ယမိ ဘၪအီၪလၧနၥံၪအကျၩဆံၭယံၬလဲၪ. ယမိဘၪအွံၪ ၥၭဆၧၩ့နၥံၪဆံၭယံၬလဲၪ. ဂဲၫဆိၬစိၩအဝ့ၫနီၪလၧယ",
			"18": "<sup>18</sup> အီၪထီးယီၩဆံၭ.- ယ့ၫရှူၬအၪ့လၬ ဆၧနၪတၭ, မွဲအ စဲၪ့ထၪ့ခွံၬလၧအလီၩ့တၭ, ဖိၪၥၪဘျၪ ထဲၩ့ဝ့ၫလၧနၩ ရံၩနီၪလီၫ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ အထံၩအဖျဲၥံၪဂဲၫစိၩလၧယ့ၫရှူၬအ အီၪလၧဆၧကဒုၩတၭ,စံၭဝ့ၫဒၪ, ပဝ့ၫဒၪယီၩ မွဲဘၪ",
			"20": "<sup>20</sup> နီၫလၧပနၫ့ထၪ့ခွံၬအဝ့ၫနီၪ လၥ့ၪဘၪလဲၪ.- ယ့ၫရှူၬ စံၭဆၧၫ့ဝ့ၫ,မွဲနၥံၪလနဲၩဘၪဆၧအဂဲးလီၫ. အဂဲး ဘဲၫယီၩယလီၩဘၪနၥံၪတီၩတီၩယီၩ, နၥံၪအဆၧနဲၩ အ့ၪအီၪန့ၫဘၪချံၫနးဖျိၪ့တၭ, နၥံၪစံၭခိၪလီၩ့လဖျိၪ့ ယီၩ,ၥုၭခွံၬနၥၭထီးယီၩ လၧအလးအိၩဆံၭ. တၭဆၧ မိၥုၭခွံၬအၥၭလီၫ. ဆၧလၥ့ၪဘၪနီၪအီၪလၧနၥံၪ နး",
			"21": "<sup>21</sup> မံၩ့အ့ၬ.- မွဲလါနၫ့ဘိၩ ဆၧဘၩဆိၪဖၪ, ဒဲဒုၪဆၧအၪ့ ဆၧအီၩအ့ၪလအီၪဘၪတၭ, အယီၩလမံၩ့ စဲၪ့ထၪ့ခွံၬ ဝ့ၫအ့ၬ.",
			"22": "<sup>22</sup> အဝ့ၫၥံၪအီၪဝ့ၫ လၧဂၫလလံၫအဘိၩ့ဘၭတၭ, ယ့ၫရှူၬစံၭအဝ့ၫၥံၪ, ဆၧလၧၦၡၩအဖိၪခွၫယီၩ မိဘၪ",
			"23": "<sup>23</sup> ဆၧဖ့ၪလၫ့ဝ့ၫလၧၦၡၩအစူၪဖၧၩ့လီၫ.- အဝ့ၫၥံၪမိမၩ ၥံၫဝ့ၫတၭ, ထီးအဘၪၥၧၫ့နံၩလနံၩနီၪ မိဂဲထုၪ့ထဲၩ့ဝ့ၫ လီၫ.အဝ့ၫၥံၪအၥုၪ့အုၭအၥၭအုၭဝ့ၫဒိၪမၬလီၫ. ဆၧဖ့ၪလၫ့ဆၧလုဂံၪ့အခီၫ့.",
			"24": "<sup>24</sup> ထီးအဂဲၫထီၩ့လၧကပၧနအၫ့တၭ, ၦလၧအမၩန့ ဖိၭဖၫ့ၡက့လၭနီၪဂဲၫလၧစပံတၧၫအအီၪတၭ, စံၭဝ့ၫဒၪ, မွဲနၥံၪအဆရၫဖ့ၪလၫ့ဖိၭဖၫ့ၡက့လၭ နီၪအ့ၬဧၪ.",
			"25": "<sup>25</sup> အဝ့ၫနီၪစံၭဝ့ၫဒၪ, မွဲကဒၪယူၭ. ထီးအလ့ၩနုၬလၧဂံၪ့ ဖၧၩ့တၭ,ယ့ၫရှူၬချဲၩ့ဆိၫဝ့ၫတၭ, စံၭဝ့ၫဒၪ, စစဲမၧၫ့ဧ့, နဆီၫ့မီၪ့နဝ့ၫဘဲၫၥ့ၪလဲၪ. ဆၧအခီၫ့ဂ့ၩ,ဆၧအကီၭ ဂ့ၩ,ဂၪ့ခိၪအစဎွၩလဖၪ မၩန့ဝ့ၫလၧပလၫလဖၪလဲၪ. လၧအဖိၪခွၫဒၪဝ့ၫၥံၪနီၪဧၪ, မွဲလၧၦဂူၫဂၩလဖၪလဲၪ.",
			"26": "<sup>26</sup> စပံတၧၫစံၭဝ့ၫ, လၧၦဂူၫဂၩလီၫ. ယ့ၫရှူၬစံၭဝ့ၫမၩ",
			"27": "<sup>27</sup> အၥၭဘဲၫနီၪတၭ, အဖိၪၥံၪဖျ့ၭဝ့ၫလီၫ.- မွဲလါနၫ့ဘိၩ ဘဲၫပထီးကဲၪထၪ့ဆၧလၩ့ထံၩဖါအလးလဂ့ၩအ ၥိၭတၭ,လ့ၩလၧကွံၩတၭ, ခွံၬလၩ့ခွ့ၫဘီၪ. ယၪလၧ အဂဲၫထၪ့ဆိၫလဘံၪ့နီၪ မၩန့အိၭထၪ့အနိၭတၭ, နမိ ဒၪန့ၡက့လၭလဘံၪ့နီၪ, မၩန့ဝ့ၫဖ့ၪလၫ့ၦလဖၪနီၪလၧ နဂးဒဲလၧယဂးဆံၭ."
		},
		"18": {
			"1": "<sup>1</sup> လၧအထီနီၪအထံၩအဖျဲၥံၪဂဲၫလၧယ့ၫရှူၬအအီၪ တၭ,စံၭဝ့ၫဒၪ, ၦအဒိၪထုၬလၧမူၭခိၪ အဘၩ့အမုးအ ဖၧၩ့နီၪ,မွဲပလၫလဂၩလဲၪ.",
			"2": "<sup>2</sup> ယ့ၫရှူၬကိၭန့ဖိၪၥၪဆံၭလဂၩ လၧအအီၪတၭ, အီၪ",
			"3": "<sup>3</sup> က့ၪဝ့ၫလၧအဝ့ၫၥံၪအကျၩလီၫ.- စံၭဝ့ၫဒၪ,ယလီၩဘၪ နၥံၪတီၩတီၩယီၩ, နၥံၪအ့ၪလကၠၪလီၩ့ထဲၩ့ဘၪ နၥံၪ အၥၭတၭ,လကဲၪထဲၩ့ဘၪဘဲၫဖိၪၥၪဆံၭၥံၪအၥိၭ,",
			"4": "<sup>4</sup> နၥံၪနုၬဘၪလၧမူၭခိၪအဘၩ့အမုးအဖၧၩ့အ့ၬ.- မၩ အၥၭဘဲၫနီၪတၭ,ၦလၧအဆၪ့လၩ့အၥၭဘဲၫဖိၪၥၪ ဆံၭလဂၩယီၩအၥိၭနီၪ, အနီၪလဂၩမွဲအဒိၪထုၬလၧ",
			"5": "<sup>5</sup> မူၭခိၪအဘၩ့အမုးအဖၧၩ့လီၫ.- ထီးဒၪၦလၧအထိး ဆၧၫ့ဖိၪၥၪဆံၭယီၩလၧယမံၩ့အကၠီၩ့ လဂၩဂၩနီၪ, မွဲအထိးဆၧၫ့ယၧၩလီၫ.",
			"6": "<sup>6</sup> ထီးဒၪၦလၧအမၩလၩ့ထံၩဖါၦအဆံၭလၧအ နဲၩထဲၩ့ယၧၩလဂၩဂၩနီၪ, အခိၬအ့ၪဘၪဆၧစၧၩ့ထၬ လၧဆုၪ့ဂူၬလိးတၭ, ဘၪဆၧခွံၬလၩ့ခွံၬဝ့ၫလၧ မၫဆ မံၭအဆၧယိၬအဖၧၩ့နီၪ,မွဲအဂ့ၩဒၪအဆၧဒံၭလီၫ.",
			"7": "<sup>7</sup> မွဲဆၧလၩ့ထံၩဖါအလးလဖၪအကၠီၩ့နီၪ, ၦဂၪ့ခိၪဖိၪ ဘၪအၡၪ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧလၩ့ထံၩဖါအလး လဖၪနီၪ,မိဘၪအီၪဝ့ၫလီၫ. မွဲလါနၫ့ဘိၩၦလၧအမၩ",
			"8": "<sup>8</sup> အီၪထၪ့ဆၧလၩ့ထံၩဖါအလးနီၪဘၪအၡၪ့လီၫ.- အနီၪတၭ, နစူၪမွဲဂ့ၩ,နခၪ့မွဲဂ့ၩ,အ့ၪမၩလၩ့ထံၩဖါနၧၩတၭ, ဒၪ့ထ့ၬခွံၬတၭ, ခွံၬၡိၭခွံၬလၧနအီၪဆံၭ. နလ့ၩနုၬ အီၪဘၪလၧဆၧမၧၫ့အဖၧၩ့ လၧနစူၪဂၭဂီၩ့နခၪ့ဂၭ ဂီၩ့,နစူၪခါနခၪ့ချံၭနီၪ, မွဲအဂ့ၩနဲၪ့ဒံၭနဘၪဆၧခွံၬလၩ့ ခွံၬလၧနစူၪနံၫခီၫ, နခၪ့နံၫခီၫလၧမ့ၪလၩ့ဆိၩလၩ့ကၠၪ",
			"9": "<sup>9</sup> အဖၧၩ့ဒံၭလီၫ.- နမ့ၬၥၪအ့ၪ မၩလၩ့ထံၩဖါနၧၩတၭ, အီၩ့ခွ့ၬထၪ့ခွံၬဝ့ၫတၭ, ခွံၬၡိၭခွံၬဆံၭ. နနုၬအီၪဘၪ လၧဆၧမၧၫ့အဖၧၩ့ လၧနမ့ၬၥၪလခီၫနီၪ, မွဲအဂ့ၩနဲၪ့ ဒံၭနဘၪဆၧခွံၬလၩ့ခွံၬ လၧလရၬမ့ၪဖၧၩ့ လၧနမ့ၬၥၪ နံၫခီၫလူၬဒံၭလီၫ.",
			"10": "<sup>10</sup> ထီးလၩ့နၥံၪအၥၭဘဲၫၥိၭနၥံၪထီးမၩကြၩ့ထမး ၦ လဂၩဂၩလၧအဆံၭလဖၪယီၩ အကျၩလဂ့ၩ. အဂဲး ဘဲၫယီၩယလီၩဘၪနၥံၪ လၧအဝ့ၫၥံၪအၥီၫ့လၧမူၭ",
			"11": "<sup>11</sup> ခိၪလဖၪယိဘၪယဖါအမ့ၬလထံၪဎးလီၫ.- အဂဲး ဘဲၫယီၩၦၡၩအဖိၪခွၫယီၩဂဲၫဝ့ၫဘဲၫၥိၭ အမိထိးထဲၩ့ တၩ့ထဲၩ့ဆၧလၧအလၩ့မါဝ့ၫနီၪလီၫ.",
			"12": "<sup>12</sup> မွဲနၥံၪဆီၫ့မီၪ့ဘဲၫၥ့ၪလဲၪ. ၦလဂၩအၥိၪအီၪဝ့ၫလ ယၩတၭ, အ့ၪဂၭဖျိၭလဒုၩနီၪ, မိအီၪက့ၪလၩ့ထးဝ့ၫ ခွံၫဆံၫခွံၫဒုၩလၧခိၪလီၩ့ခိၪတၭ, မိလ့ၩအၪ့ဎူၫအၪ့",
			"13": "<sup>13</sup> ဎၬထဲၩ့ဆၧလၧအဂၭဖျိၭလဒုၩနီၪ, မွဲအ့ၬဧၪ.- အ့ၪဒၪ န့ထဲၩ့ဝ့ၫတၭ, ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, မိၥၭထိၬ ဝ့ၫလၧအကၠီၩ့ အၪနဲၪ့အဆၧၥၭထိၬလၧၥိၪလဂၭဖျိၭ",
			"14": "<sup>14</sup> ဘၪခွံၫဆံၫခွံၫဒုၩအကၠီၩ့ဒံၭလီၫ.- ဘဲၫနီၪအၥိၭၦလ ဂၩလၧအဆံၭလဖၪယီၩအကျၩမိလၩ့မါဝ့ၫနီၪ, န ၥံၪအဖါလၧမူၭခိၪအၥၭအီၪအ့ၬ. ၦလဂၩဂၩထီးအမၩဆၧဒဲၩဘၭ.",
			"15": "<sup>15</sup> နထၧၫ့ဖုဝဲအ့ၪမၪဘၪနၧၩနီၪတၭ, လ့ၩဒုၭၥ့ၪယၫ ဝ့ၫအဆၧမၪနီၪ, နဝ့ၫဒၪဒဲအဝ့ၫနီၪ နၥံၪနံၫဂၩနီၪဆံၭ.",
			"16": "<sup>16</sup> အ့ၪခိၭနၪဝ့ၫတၭ, နန့ဘၪယူၭနထၧၫ့ဖုဝဲယူၭ.- အ့ၪ လခိၭနၪဘၪတၭ, ကိၭန့နၥိၭလဂၩနံၫဂၩဘဲၫၥိၭ ဆၧ ချဲၩ့ကိၭထံၪဒ့ၭ မိအီၪဂုးအီၪခၧၫ့လၧၦထိးအၥၭနံၫ",
			"17": "<sup>17</sup> ဂၩၥၧၫ့ဂၩအကၠီၩ့နီၪဆံၭ.- အ့ၪလခိၭနၪဘၪအဝ့ၫၥံၪ အလူနီၪတၭ, လီၩဘၪဆၧအီၪကီၪ့ဆံၭ. အ့ၪလခိၭနၪ ဘၪဆၧအီၪကီၪ့အလူတၭ, အီၪက့ၪအဝ့ၫဘဲၫၦလ ၥ့ၪယၫဘၪယွၩ, ဘဲၫၦအၪ့ကံၩ့အခီၫ့အၥိၭနီၪဆံၭ. ဆၧစၧၩ့ထၬဒဲဆၧကွဲၪလၩ့.",
			"18": "<sup>18</sup> ယစံၭနၥံၪတီၩတီၩယီၩ, ထီးဒၪဆၧလၧနၥံၪစၧၩ့ ထၬလၧဂၪ့ခိၪချိၫ့ယီၩလမံၩ့မံၩ့နီၪ,မိဘၪဆၧစၧၩ့ထၬ ဝ့ၫလၧမူၭခိၪအဖၧၩ့လီၫ. ထီးဒၪဆၧလၧနၥံၪကွဲၪလၩ့ လၧဂၪ့ခိၪချိၫ့လမံၩ့မံၩ့နီၪ, မိဘၪဆၧကွဲၪလၩ့ဝ့ၫလၧမူၭ ခိၪအဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> မၩဒီၭလဖၧၫ့ ယလီၩဘၪနၥံၪ ၦလၧနၥံၪအကျၩနံၫ ဂၩနီၪ အၥၭအ့ၪမီၪ့ဎီၩ့လိၬအၥၭလၧ ဆၧလမံၩ့မံၩ့အ ဂဲးလၧအအၪ့ကံၩ့ဝ့ၫလၧဂၪ့ခိၪချိၫ့ယီၩတၭ, ဆၧမိကဲၪ ထၪ့လၧအဂးလၧယဖါလၧအအီၪဝ့ၫ လၧမူၭခိၪအ",
			"20": "<sup>20</sup> ဖၧၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩထီးဒၪအလးလၧနံၫဂၩ ၥၧၫ့ဂၩအီၪကိၩ့အီၪကီၪ့လၧယမံၩ့အကၠီၩ့နီၪ, ယအီၪ ယဝ့ၫလၧအကျၩထီးနီၪလီၫ. ဆၧချဲၩ့ဒီၩ့လၩ့,ဎီးၡၩလၧဖျါခွံၬဆၧလၥ့ၪဘၪ.",
			"21": "<sup>21</sup> ထီးနီၪလဖၧၫ့ စပံတၧၫဂဲၫလၧအအီၪတၭ,စံၭဝ့ၫဒၪ, ကဆါဧ့,ယထၧၫ့ဖုဝဲအ့ၪမၩမၪဘၪယၧၩတၭ, ယဘၪ ကွဲၪဖျါအဆၧနီၪဎွ့ဖၧၫ့လဲၪး ထီးအဎွ့ၩထၪ့နွ့ၫဖၧၫ့",
			"22": "<sup>22</sup> ဧၪ.- ယ့ၫရှူၬစံၭဝ့ၫ, ယစံၭထီးအဎွ့ၩထၪ့နွ့ၫဖၧၫ့လ ကၭလၧၩ့မွဲထီးအဎွ့ၩထၪ့နွ့ၫဖၧၫ့အဖၧၫ့နွ့ၫဆံၫလီၫ.",
			"23": "<sup>23</sup> အခိးမွဲဘဲၫနီၪတၭ, မူၭခိၪအဘၩ့အမုးမၩအၥၭဘဲၫ စဎွၩလဂၩ လၧအၥၭအီၪလၧအမိမၩန့ဘၪအၥၭ လၧ",
			"24": "<sup>24</sup> အဎီးအၡၩၥံၪအဆရၫ့လီၫ.- မၩန့အဆရၫ့အဘိၩ့ ဘၭနီၪတၭ, ၦဂဲၫၥိၫ့ၦလၧအဒ့ၪအမါအီၪဝ့ၫ လၧစ့ၩ အတၫလၫ့လလၬ ဎအဘၭလံဘၩ့ဘျဲၪၭ လဂၩလၧအ",
			"25": "<sup>25</sup> အီၪလီၫ.- မွဲအဆၧလအီၪဘၪလၧအမိလိၭထဲၩ့ဝ့ၫအ ကၠီၩ့တၭ, အကဆါမၪလူၬလၧအမိဘၪဆၧအၪ့ဆၫ ခွံၬဝ့ၫ,ဒဲအဖိၪအမၫ,အဖိၪအလံၩ, ဒဲကယဲဆၧအီၪ ထီးအလူၬ, ကိၭအမံၩ့ဒ့ၭတၭ,ဘၪလိၭထဲၩ့ဝ့ၫလီၫ.",
			"26": "<sup>26</sup> မၩအၥၭဘဲၫနီၪတၭ, အဎီးအၡၩ ထွံၩလၩ့လၧအမ့ၬ ယၫ,စံၭဝ့ၫဒၪ,ကဆါဧ့, အွံၪၥၭဆၧၩ့ဒၪခလူၬယၧၩ",
			"27": "<sup>27</sup> ဆံၭ.ယမိလိၭထဲၩ့နၧၩထီးအလူၬလီၫ.- အဎီးအၡၩ နီၪအကဆါလဂၩ အၥၭလၩ့ဝ့ၫကွဲၪဖျါထဲၩ့ဝ့ၫဒၪ",
			"28": "<sup>28</sup> တၭ,ဆၧၫ့လၩ့ထူၬခွံၬဝ့ၫ အဒ့ၪအမါနီၪလီၫ.- ဆၧလၧ အဎီးအၡၩလဂၩနီၪ,စဲၪ့ထၪ့ခွံၬဝ့ၫဒၪတၭ,ဒၪန့ဎီးအၡၩ ခီၫဎီးအၡၩလဂၩလၧအဒ့ၪအမါအီၪဝ့ၫ လၧအစူၪ ဖၧၩ့စ့ၩဒန့ရံၫလယၩဎအဘၭနံၫဆံၫဘျဲၪၭတၭ,ဖျဲးစိၩ ဆီးထၬဝ့ၫဒၪအခိၬတၭ, စံၭဝ့ၫ,နဒ့ၪနမါအီၪလၧယၧၩ",
			"29": "<sup>29</sup> နီၪဖ့ၪထဲၩ့ယၧၩဆံၭ.- မၩအၥၭဘဲၫနီၪတၭ, ဎီးအၡၩ ခီၫဎီးအၡၩလဂၩ ထွံၩလၩ့လၧအခၪ့ထံၭတၭ, အၪ့ ကံၩ့အၪ့ယၫထၪ့ဝ့ၫ, စံၭဝ့ၫဒၪ, အွံၪၥၭဆၧၩ့ဒၪခလူၬ",
			"30": "<sup>30</sup> ယၧၩဆံၭး ယမိလိၭထဲၩ့နၧၩလီၫ.- မွဲလါနၫ့ဘိၩ, အဝ့ၫဒၪလခိၭနၪဘၪတၭ, လ့ၩခွံၬလၩ့ဝ့ၫလၧထီၫ့ဖၧၩ့",
			"31": "<sup>31</sup> ထီးအမိလိၭထဲၩ့အဒ့ၪအမါလီၫ.- အဎီးအၡၩခီၫဎီး အၡၩၥံၪဒၪဘၪဆၧမၩအၥၭနီၪ, အၥုၪ့အုၭအၥၭအုၭ ဒိၪမၬတၭ, လ့ၩလီၩဘၪအကဆါ လၧဆၧမၩအၥၭ",
			"32": "<sup>32</sup> ထီးအလူၬလီၫ.- ထီးနီၪလဖၧၫ့အကဆါကိၭထဲၩ့အ ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ဎီးအၡၩအၧၩ့လဂၩဧ့,မွဲနအၪ့ ကံၩ့ထဲၩ့နၥၭလၧယၧၩတၭ, ယဆၧၫ့လၩ့ထူၬခွံၬမၬ",
			"33": "<sup>33</sup> နဒ့ၪနမါထီးအလူၬကၨ.- ဘဲၫယယၫ့ၥၭနၧၩအၥိၭနီၪ, နကြၨၭယၫ့ၥၭဎီးအၡၩခီၫဎီးအၡၩလၧနၧၩ ဘဲၫနီၪ",
			"34": "<sup>34</sup> အၥိၭ,မွဲအ့ၬဧၪ.- အကဆါအၥၭထၪ့, ဖ့ၪလၫ့ခွံၬဝ့ၫ လၧၦမၩၡၪ့မၩနၭဆၧအစူၪဖၧၩ့ ထီးအမိလိၭထဲၩ့ အ",
			"35": "<sup>35</sup> ဒ့ၪအမါထီးအလူၬလီၫ.- နၥံၪအ့ၪလကွဲၪဖျါဘၪနၥံၪ အထၧၫ့ဖုဝဲအဆၧမၪ လၧနၥံၪအၥၭဖၧၩ့ဆုၬဆုၬတၭ, ယဖါအီၪလၧမူၭခိၪနီၪ မိမၩနၥံၪဘဲၫနီၪအၥိၭဆ့ လီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧယ့ၫရှူၬလီၩလၩ့လၬလၩ့ ဆၧချဲၩ့ လဖၪနီၪလူၬ တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫလၧဂၫလလံၫတၭ,",
			"2": "<sup>2</sup> ဂဲၫလၧခးယုဒၫအနဲၩ့ထံၭ လၧယီၫဒၫ့ဝါလခီၫလီၫ.- ၦ ခမျၧးဖၭဒိၪဖိၬထၪ့အခဲၫ့တၭ, အဝ့ၫဒၪမၩဘျၪထဲၩ့အ ဝ့ၫၥံၪထီးနီၪလီၫ.",
			"3": "<sup>3</sup> ၦဖၫရစံၫၥံၪဂဲၫလၧအအီၪကျဲၩ့ဖစီၩ့ဝ့ၫတၭ, စံၭဝ့ၫ ဒၪ,ထီးဒၪဆၧအဂဲး လမံၩ့လါလါအကၠီၩ့နီၪ, ၦခွံၬၡိၭ အမၫနီၪဘၪမိဂ့ၩဆ့ဧၪ.",
			"4": "<sup>4</sup> အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, လၧဆၧမၩ ကဲၪထၪ့ၥၫ့ၦၡၩလၧအခၪ့ထံၭနီၪ, မၩကဲၪထၪ့ဝ့ၫၦမုၪ",
			"5": "<sup>5</sup> လဂၩဒဲၦခွၫလဂၩနီၪ, မွဲနၥံၪဖီဘၪဒံၭအ့ၬဧၪ.- တၭ စံၭဝ့ၫ, အ ခိး မွဲ ဘဲၫ နီၪ တၭ, ၦ ခွၫ မိ ဘၪ စဲၪ့ဒၪ အ မိ အ ဖါ တၭ, မိ ဘၪ ၥုၭ ဘူၭ အ ၥၭ လၧအ မၫ တၭ,ဆၧလၧ ၦနံၫဂၩနီၪမိကဲၪထၪ့လၥွံၪဎးလယၪဎးလီၫ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲလၧၩ့ၦနံၫဂၩအ့ၬ. မွဲလၥွံၪဎး လယၪဎးလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧယွၩအီၪက့ၪ",
			"7": "<sup>7</sup> ဎုၬဝ့ၫနီၪမွဲၦၡၩထီးထုၭလၩ့ၡၪလဂ့ၩ.- အဝ့ၫၥံၪစံၭ, အ့ၪမွဲဘဲၫနီၪတၭ, မွဲဘၪနီၪလၧစမိစ့ၭမၪလူၬဝ့ၫလၧ ၦမိဖ့ၪလၫ့လံၬလၩ့ၡၪလဘံၪ့တၭ,ခွံၬၡိၭဝ့ၫနီၪလဲၪ.",
			"8": "<sup>8</sup> အဝ့ၫဒၪချဲၩ့ဆၧၫ့ ဝ့ၫမွဲနၥံၪအၥုၪ့နီၩ့အၥၭနီၩ့အကၠီၩ့တၭ, စမိစ့ၭဒုၭခွံၬၡိၭနၥံၪလၧနၥံၪအမၫလီၫ. မွဲလါနၫ့ဘိၩလၧအၥၫ့",
			"9": "<sup>9</sup> လၧအခၪ့ထံၭနီၪမွဲဘဲၫနီၪၥိၭအ့ၬ.- ယဝ့ၫဒၪယီၩ,ယလီၩ ဘၪနၥံၪထီးဒၪၦလၧအခွံၬၡိၭအမၫလၧအလမွဲဘၪ ဆၧအဲၪဘိၩ့အကၠီၩ့တၭ, အီၪဎုၬလၧၦမုၪဂူၫဂၩလဂၩ ဂၩနီၪ,မွဲအအဲၪဘိၩ့အမၫလီၫ. ၦလၧအအီၪဎုၬလၧ ၦမုၪလၧအဘၪဆၧခွံၬၡိၭဝ့ၫနီၪ,မွဲအမၩမၪၦမၫလီၫ.",
			"10": "<sup>10</sup> အထံၩအဖျဲလဖၪ,စံၭဝ့ၫဒၪ,ၦၡၩအီၪလၧအမၫနီၪ ဆၧအ့ၪမၩအၥၭဘဲၫနီၪတၭ,ဂ့ၩအီၪဎုၬအ့ၬ.",
			"11": "<sup>11</sup> အဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ,ဆၧချဲၩ့လထံၪယီၩ,ၦထီးန့ဝ့ၫ ကိၭဂၩဒ့ၭကဲၪအ့ၬ. ထီးန့ဝ့ၫကဲၪန့ၫၦလၧဆၧဖ့ၪထီး",
			"12": "<sup>12</sup> န့ဝ့ၫလဖၪနီၪလီၫ.- အဂဲးဘဲၫယီၩၦလနၩ့နၩ့မွဲၦဖၫဆွံၪ လၧ အမိဒၧၩ့လးဖၧၩ့လံၩလံၩတၭ, လနၩ့နၩ့ကဲၪထၪ့ ၦဖၫဆွံၪလၧၦၡၩအစူၪတၭ, လနၩ့နၩ့မၩဒၪအၥၭလၧ ၦဖၫဆွံၪလၧမူၭခိၪအဘၩ့အမုးအကၠီၩ့လီၫ.ၦလၧ အထီးန့အ့ၪကဲၪနီၪ, မွဲအထီးန့ဒၪဝ့ၫဆံၭ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ ၦဂဲၫဆိၬဖိၪၥၪလၧအအီၪဘဲၫၥိၭအမိ အီၪက့ၪထၪ့အစူၪလၧအလီၩ့, ဒဲဘၩဆိၪဖၪဆၧတၭ,",
			"14": "<sup>14</sup> အထံၩအဖျဲအၪ့လၬအဝ့ၫၥံၪလီၫ.- ယ့ၫရှူၬစံၭဝ့ၫဒၪ, ဖိၪၥၪဆံၭလဖၪနီၪဖ့ၪလၫ့အဂဲၫလၧယအီၪတၭ,ထီး ပဒၩ့အဝ့ၫၥံၪလဂ့ၩ, အဂဲးဘဲၫယီၩမူၭခိၪအဘၩ့ဖိၪမုး",
			"15": "<sup>15</sup> ဖိၪမွဲၦဘဲၫနီၪအၥိၭလီၫ.- အဝ့ၫဒၪအီၪက့ၪထၪ့အ စူၪလၧအလီၩ့ဂီၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪလီၫ.",
			"16": "<sup>16</sup> ယိခွါ,ၦလဂၩဂဲၫလၧအအီၪတၭ, စံၭဝ့ၫဒၪ,ဆရၫ လၧအဂ့ၩဧ့, ဘဲၫၥိၭယမိန့ဘၪဆၧမၧၫ့အဆိၩ အကၠၪ",
			"17": "<sup>17</sup> တၭ,ယဘၪမၩဆၧနီၫလၫလၧအဂ့ၩနးမံၩ့လဲၪ.- အ ဝ့ၫဒၪလီၩဘၪဝ့ၫ, မွဲဘၪနီၫနကိၭယၧၩလၧၦအဂ့ၩလဲၪ. အ့ၪလမွဲဘၪယွၩလဂၩနီၪ,ၦအဂ့ၩအီၪနးဂၩအ့ၬ. မွဲ လါနၫ့ဘိၩ အ့ၪမိလ့ၩနုၬဘၪနၥၭလၧဆၧမၧၫ့အဖၧၩ့",
			"18": "<sup>18</sup> တၭ,ထီးန့ဖံၭထၬဆၧမၪလူၬလဖၪဆံၭ.- အဝ့ၫနီၪစံၭ ဝ့ၫ,လထံၪထံၪလဲၪး ယ့ၫရှူၬစံၭဝ့ၫဒၪ, ထီး မၩ ၥံၫ ၦ ၡၩ လ ဂ့ၩ.ထီး အဲၪ ဘိၩ့ မၫ အဲၪ ဘိၩ့ ဝၩ လ ဂ့ၩ. ထီး အၪ့ ဂူၫ ဆၧ လ ဂ့ၩ. ထီး ထိး န ၥၭ",
			"19": "<sup>19</sup> လၧ ဆၧ ချဲၩ့ အ ဘျံၭ အ ဘျၪ လ ဂ့ၩ.- ယူၭ ယၪ့ န မိ န ဖါ ဆံၭ. အဲၪ ၦ လၧ န နဲၩ့ ထံၭ ဘဲၫ န အဲၪ လၩ့ န ၥၭ ဒၪ န ဝ့ၫ အ ၥိၭ နီၪ ဆံၭ.",
			"20": "<sup>20</sup> ၦဖိၪၥၪခွၫစံၭဝ့ၫ, ဆၧနီၪလဖၪယထီးန့ယူၭထီးအလူၬ",
			"21": "<sup>21</sup> ယူၭ,မွဲဆၧနီၪအီၪဒံၭလမံၩ့လဲၪ.- ယ့ၫရှူၬစံၭဝ့ၫ, အ့ၪ ဘၪနၥၭလၧ နမိလၧၫ့ထၪ့ဎွ့ၩထၪ့တၭ,ထဲၩ့အၪ့ဆၫခွံၬ နစူၪလးနခၪ့ခိၪ, ဖ့ၪလၫ့ၦၡၪ့ဖိၪယၬဖိၪဆံၭ. နမိန့ ဘၪဆၧလူဒိၪဎွ့ၩဒိၪလၧမူၭခိၪအဖၧၩ့တၭ, ဂဲၫဖိၬယ",
			"22": "<sup>22</sup> ခဲၫ့ဆံၭ.- ထီးၦဖိၪၥၪခွၫနါဂၧၫ့ဆၧချဲၩ့လထံၪနီၪ, အ ၥုၪ့အုၭအၥၭအုၭတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အစူၪလးအခၪ့ခိၪအီၪဝ့ၫအၪမၬလီၫ.",
			"23": "<sup>23</sup> ထီးနီၪလဖၧၫ့, ယ့ၫရှူၬစံၭအထံၩအဖျဲၥံၪ, ယလီၩ ဘၪနၥံၪတီၩတီၩ, ၦၥထံၫနီၪနုၬဝ့ၫလၧမူၭခိၪအဘၩ့အ",
			"24": "<sup>24</sup> မုးအဖၧၩ့ကၪမၬလီၫ.- မၩဒီၭလဖၧၫ့ ယလီၩဘၪန ၥံၪလၧကလအူၭနုၬဖျီၫ့ထၭမ့ခဲၫ့ဖၧၩ့ယီၫနဲၪ့ဒံၭၦၥထံၫ လဂၩလ့ၩနုၬလၧမူၭခိၪအဘၩ့အမုး အဖၧၩ့ဒံၭလီၫ.",
			"25": "<sup>25</sup> အထံၩအဖျဲလဖၪနါဂၧၫ့ဝ့ၫတၭ, ထီၫမံၫထီၫမၪဒိၪမၬ တၭ,စံၭဝ့ၫဒၪ, အ့ၪမွဲဘဲၫနီၪတၭ, မွဲၦထီၩ့လၧ ဆၧထိး",
			"26": "<sup>26</sup> ထဲၩ့တၩ့ထဲၩ့မိၥ့ၪနးဂၩလဲၪ.- ယ့ၫရှူၬယိဆၧထံၫထံၫ ဆၭဆၭတၭ, စံၭအဝ့ၫၥံၪ, အယီၩၦၡၩမၩၥ့ၪအ့ၬ.",
			"27": "<sup>27</sup> အ့ၪမွဲယွၩနီၪၥ့ၪဆၧထီးအလူၬလီၫ.- ထီးနီၪလဖၧၫ့ စပံတၧၫချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ,ယိခွါ,ပဝ့ၫဒၪယီၩ, ပစဲၪ့ဒၪဆၧထီးအလူၬတၭ,ပဖိၬယူၭနခဲၫ့ယူၭ. မၩ",
			"28": "<sup>28</sup> အၥၭဘဲၫနီၪတၭ,ပမိန့ဘၪဆၧနီၪလဲၪ.- ယ့ၫရှူၬစံၭဝ့ၫ, ယလီၩဘၪနၥံၪတီၩတီၩလၧကယဲဆၧထီးအလူၬ လဖၪ, ထီးဆၧအ့ၪမၩထဲၩ့အၥၫ့ခိၬအဖၧၩ့နီၪ, ထီးၦ ၡၩအဖိၪခွၫမိဆၧၫ့နၩ့ဝ့ၫလၧအလးဆီၩ့ဆီ ကယးက ဖးအဖၫ့ခိၪတၭ, ၦလၧအဖိၬယခဲၫ့နၥံၪဝ့ၫဒၪယီၩ, နၥံၪ မိဆၧၫ့နၩ့ဆ့ လၧလးဆီၩ့ဆီလဆံၫနံၫဖျိၪ့အဖၫ့ ခိၪတၭ,နၥံၪမိစ့ၩရၫ့ဘၪ ၦအံၫစရ့လၭလဆံၫနံၫဒီၪ့",
			"29": "<sup>29</sup> လီၫ.- ကယဲၦလၧအစဲၪ့ဒၪအဂံၪ့အဎၫ့မွဲဂ့ၩ, အထၧၫ့ဖု ဝဲမုၪမွဲဂ့ၩ,အထၧၫ့ဖုဝဲခွၫမွဲဂ့ၩ,အမိမွဲဂ့ၩ,အဖါမွဲ ဂ့ၩ,အဖိၪအမၫမွဲဂ့ၩ, အဖိၪအလံၩမွဲဂ့ၩ, အဆံၬအနၩ အဎံၪအဎုၭမွဲဂ့ၩ, လၧယမံၩ့အကၠီၩ့ ကိၭဂၩဒ့ၭနီၪ,မိန့ ဘၪထဲၩ့ဝ့ၫအၪနဲၪ့ အလးလယၩတၭ, မိန့ဘၪထဲၩ့ၥၫ",
			"30": "<sup>30</sup> ဆၧမၧၫ့အဆိၩအကၠၪလီၫ.- မွဲလါနၫ့ဘိၩ ၦအီၪဝ့ၫလၧ ယၫအၪဂၩနီၪမိအီၪထဲၩ့ဝ့ၫလၧခဲၫ့တၭ, ၦလၧခဲၫ့နီၪ မိအီၪထဲၩ့ဝ့ၫလၧယၫလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> အဂဲးဘဲၫယီၩ ဆၧလၧမူၭခိၪအဘၩ့အမုးနီၪ, မၩအ ၥၭဘဲၫဂံၪ့ကဆါအၥိၭလၧအစဲၪ့ထၪ့လၧဂီၩနၪခုၬ ဘဲၫအမိအၪ့မၧၫ့လံၩ့ ၦမၩစဘံၭအလးအၥိၭနီၪလီၫ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪအုၩ့လၩ့ဝ့ၫ လၧၦမၩဆၧလဖၪလၧအဝ့ၫၥံၪမိ န့ဒန့ရံၫလဂၩလဘံၪ့လၧလနံၩအဂးတၭ, အၪ့မၧၫ့ အလ့ၩလၧအစဘံၭအလးဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> ၥၧၫ့နၩရံၩဘၪကၪတၭ, အဝ့ၫဒၪစဲၪ့ထၪ့ဝ့ၫတၭ, ဒၪ ဘၪလၧၦဂူၫဂၩလဖၪ ဆၧၫ့ထုၪ့ပျီၩပျီၩလၧဖၠၫဖၧၩ့",
			"4": "<sup>4</sup> တၭ,- စံၭအဝ့ၫၥံၪ,လ့ၩနၥံၪဝ့ၫလၧစဘံၭအလးဖၧၩ့ ဆ့ဆံၭ. ထီးအတီၩအဘၪနီၪယမိဖ့ၪလၫ့နၥံၪလီၫ. အဝ့ၫၥံၪလ့ၩဝ့ၫလီၫ.",
			"5": "<sup>5</sup> မၩဒီၭလဖၧၫ့, လၧဎူၫနၩရံၩဒဲခွံၫနၩရံၩဘၪကၪနီၪ,",
			"6": "<sup>6</sup> စဲၪ့ထၪ့ဝ့ၫတၭ,မၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ.- လၧလဆံၫလ နၩရံၩဘၪကၪနီၪစဲၪ့ထၪ့ဝ့ၫတၭ, ဒၪဘၪလၧၦဂူၫဂၩ လဖၪဆၧၫ့ထုၪ့ပျီၩပျီၩတၭ, စံၭအဝ့ၫၥံၪးမွဲဘၪနီၫလၧ နၥံၪဆၧၫ့ထုၪ့ပျီၩပျီၩၥံၫ့နံၩချီၩ့ထီးယီၩလဲၪ.",
			"7": "<sup>7</sup> အဝ့ၫၥံၪစံၭ,အဂဲးဘဲၫယီၩ ၦအၪ့မၧၫ့လံၩ့ပၧၩနးဂၩ အ့ၬ.အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, လ့ၩနၥံၪဝ့ၫလၧစဘံၭအ လးဖၧၩ့ဆ့ဆံၭ. (တၭထီးအတီၩအဘၪနီၪနၥံၪမိန့ ဘၪလီၫ.)",
			"8": "<sup>8</sup> မုမ့ၬဂၪလၩ့နီၪ, စဘံၭလးအကဆါစံၭ,ၦလၧအခိၭ ယိဆၧလဂၩ,ကိၭထဲၩ့ၦမၩဆၧလဖၪဆံၭ. ၦလ့ၩမၩ ဆၧလၧခဲၫ့ထုၬလဖၪဖိးလၧၦမၩဆိၫဆၧလဖၪနီၪဖ့ၪ",
			"9": "<sup>9</sup> လၫ့အလံၩ့အလဲၫဆံၭ.- ၦလၧအလ့ၩမၩဆၧလဆံၫ လနၩရံၩလဖၪဂဲၫဝ့ၫတၭ, န့ဘၪဒန့ရံၫဂၩဘံၪ့ဂၩ",
			"10": "<sup>10</sup> ဘံၪ့လီၫ.- ထီးၦလၧအလ့ၩမၩဆိၫဆၧလဖၪနီၪဂဲၫဝ့ၫ တၭ, အဝ့ၫၥံၪဆီၫ့မီၪ့လၧအမိန့ဘၪဆၧအၪနဲၪ့အနီၪ ဒံၭလီၫ. မွဲလါနၫ့ဘိၩန့ဘၪဝ့ၫဒန့ရံၫဂၩဘံၪ့ဂၩဘံၪ့ဆ့",
			"11": "<sup>11</sup> လီၫ.- ထီးအန့ဘၪဝ့ၫနီၪ, ၥူၭဝံၥူၭလၩဂံၪ့ကဆါလီၫ.",
			"12": "<sup>12</sup> စံၭဝ့ၫဒၪ, ပဝ့ၫဒၪယီၩၦဘၪယိၭဆၧအဎၧၫ့ဒဲဘၪဆၧခိ ဆၧဝီၩအထီတၭ, နအီၪက့ၪၦလၧအမၩဆၧန့ၫလနၩ ရံၩလဖၪနီၪ,န့ၫၥိၭလၧပၧၩယီၩမၬကၨ.",
			"13": "<sup>13</sup> အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭၦလၧအဝ့ၫၥံၪအကျၩ လဂၩ,တခွၫဧ့, ယမၩနၧၩလၧဆၧလတီၩဘၪနးမံၩ့ အ့ၬ.နအုၩ့လၩ့လၧယၧၩ လၧဒန့ရံၫလဘံၪ့အဂးမွဲအ့ၬ",
			"14": "<sup>14</sup> ဧၪ.- မၩန့ထၪ့ထဲၩ့နဆၧတၭ,ထဲၩ့ထဲၩ့ဆံၭ.ၦအထုၬ လဂၩယီၩယၥၭအီၪလၧယမိဖ့ၪလၫ့အဝ့ၫနီၪ ဘဲၫနဝ့ၫ",
			"15": "<sup>15</sup> ဒၪအၥိၭဆ့လီၫ.- ယမၩယဆၧဒၪယဝ့ၫထီးဒၪယၥၭ ယီၩတီၩအ့ၬဧၪ. မွဲယဂ့ၩအကၠီၩ့နီၪနယိဆၫနမ့ၬ ဆ့ဧၪ.",
			"16": "<sup>16</sup> ဘဲၫနီၪအၥိၭၦလၧခဲၫ့လဖၪနီၪ မိအီၪဘၪလၧယၫ တၭ,ၦလၧယၫလဖၪ မိအီၪဘၪလၧခဲၫ့လီၫ. အဂဲးဘဲၫ ယီၩ,ၦလၧဆၧကိၭဝ့ၫလဖၪနီၪအီၪဝ့ၫအၪဂၩတၭ, အ့ၪမွဲၦလၧဆၧရွံန့ဝ့ၫလဖၪနီၪ အီၪၡၩခိၬဂၩလီၫ.",
			"17": "<sup>17</sup> ယ့ၫရှူၬလ့ၩထၪ့ လၧယရုစလံၫ့တၭ, လၧဖၧၩ့ၥၭ နီၪကိၭန့ အထံၩအဖျဲလဆံၫနံၫဂၩ လၧဆၧကဒုၩအ",
			"18": "<sup>18</sup> လးလီၫ.- စံၭဝ့ၫဒၪ, ယိခွါ,ပလ့ၩထၪ့လၧယရုစလံၫ့ တၭ,ၦၡၩအဖိၪခွၫယီၩ မိဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫ လၧ ၦလုဆၧအဒိၪၥံၪ ဒဲလၧၦကွ့ၭလံၬၥံၪအစူၪဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> ၦလဖၪနီၪမိစ့ၩရၫ့ၥံၫဝ့ၫတၭ, မိဖ့ၪလၫ့ဝ့ၫလၧၦဆၨၩ လဖၪအစူၪဖၧၩ့ဘဲၫအမိဒုၪဒွ့ၪဝ့ၫ,ဒိၪဝ့ၫထးဝ့ၫ, ဒဲဖျၩ ထၪ့ဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့အၥိၭလီၫ. ထီးအဘၪ ၥၧၫ့နံၩလနံၩနီၪ, မိဂဲထုၪ့ထဲၩ့ဝ့ၫဒၪလီၫ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့စဇ့ၭဘဒံၫအဖိၪခွၫလဖၪ အမိနီၪ ဂဲၫလၧအအီၪ လၧအဖိၪခွၫၥံၪအၥိၭတၭ, ဘၩထၪ့ဆၧ",
			"21": "<sup>21</sup> တၭ,အၪ့ကံၩ့ဆၧလမံၩ့မံၩ့လီၫ.- အဝ့ၫနီၪစံၭဆၧၫ့ဆၧ, မိန့ဘၪနၥၭလၧဆၧနီၪလမံၩ့လဲၪ. အဝ့ၫဒၪစံၭဝ့ၫဘဲၫ ၥိၭယဖိၪခွၫနံၫဂၩယီၩ မိဆၧၫ့နၩ့လၧနစူၪထွ့ၪနးဂၩ, ဒဲလၧနစူၪစ့ၪနးဂၩလၧနဘၩ့နမုးအဖၧၩ့နီၪတၭ, မၪ",
			"22": "<sup>22</sup> လူၬနဝ့ၫနးထံၪဘီၪ.- ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ ဒၪ,နၥံၪအၪ့ကံၩ့နီၫလဲၪနီၫလဲၪနီၪ, နၥံၪၥ့ၪယၫအ့ၬ. လိၫ့လၧယအီၩနီၪ နၥံၪအီၩမိကဲၪဧၪ. အဝ့ၫၥံၪစံၭ",
			"23": "<sup>23</sup> ဝ့ၫဒၪ,ကဲၪဝ့ၫတကၨ.- အဝ့ၫဒၪစံၭ, နၥံၪမိအီၩဘၪလိၫ့ လၧယအီၩတၡါတၭး မွဲလါနၫ့ဘိၩ ဆၧဆၧၫ့နၩ့လၧ ယစူၪထွ့ၪဒဲယစူၪစ့ၪနီၪ မွဲယဆၧဘဲၫယမိဖ့ၪလၫ့ အ",
			"24": "<sup>24</sup> ၥိၭမွဲန့ၫလၧၦလၧယဖါတဲၩ့ဝဲၩလၧအဂးလီၫ.- ထီး ၦလဆံၫနီၪနါဂၧၫ့ဝ့ၫတၭ, အၥၭထၪ့အထၧၫ့ဖုဝဲနံၫဂၩ",
			"25": "<sup>25</sup> နီၪလီၫ.- ယ့ၫရှူၬကိၭဝ့ၫတၭ, စံၭဝ့ၫဒၪ, နၥံၪၥ့ၪယၫ လၧၦအဆၨၩအခိၪလဖၪ မၩဒိၪအၥၭလၧအဖၫ့ခိၪ",
			"26": "<sup>26</sup> နီၪ,ၦဒိၪၦၡါမၩဝ့ၫလၧအစီၩ့အမၩ့လီၫ.- ဆၧမၩဘၪ အၥၭလၧနၥံၪအကျၩဘဲၫနီၪၥိၭအ့ၬ.အ့ၪမွဲထီး ဒၪၦလၧအမိကဲၪဘၪအၥၭ လၧအဒိၪလဂၩဂၩ လၧ နၥံၪအကျၩနီၪ, မွဲအကဲၪဒၪဝ့ၫလၧနၥံၪအခ့ၫအၡၩ",
			"27": "<sup>27</sup> ဆံၭ.- ထီးဒၪၦလၧအမိကဲၪဘၪ အၥၭလၧအခိၪလဂၩ ဂၩလၧနၥံၪအကျၩနီၪ, မွဲအကဲၪဒၪဝ့ၫလၧနၥံၪအဎီးအ",
			"28": "<sup>28</sup> ၡၩဆံၭ.- ဘဲၫနီၪအၥိၭ ၦၡၩအဖိၪခွၫယီၩ ဂဲၫအၪ့မၧၫ့ ၦၡၩအ့ၬ, မွဲအဂဲၫဒိၭဆၧအၪ့မၧၫ့ဝ့ၫလခီၫ, ဒဲဖ့ၪလၫ့ အၥၭလၧၦၡၩအၪဂၩအဎွ့ၩလီၫ.",
			"29": "<sup>29</sup> ထီးအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧယ့ၫရခိၫတၭ, ၦခမျၧး",
			"30": "<sup>30</sup> ဖၭဒိၪဖိၬထၪ့အခဲၫ့လီၫ.- ယိခွါ,ၦမ့ၬဘျီၪဆၧၫ့နၩ့ လၧဖၧၩ့ၥၭအနဲၩ့ထံၭနံၫဂၩ နါဂၧၫ့လၧယ့ၫရှူၬဂဲၫဝ့ၫ တၭ,ကိၭၡၭထၪ့ဆၧစံၭဝ့ၫဒၪ, စဒၫဝံၭအဖိၪခွၫ, က",
			"31": "<sup>31</sup> ဆါဧ့,ယၫ့ၥုၪ့ယၫ့ၥၭလါပၧၩဆံၭ.- ၦခမျၧးအၪ့လၬ အဝ့ၫၥံၪ,ဘဲၫအမိအီၪလၩ့မါပံၭအၥိၭတၭ, အဝ့ၫၥံၪ ကိၭၡၭဒံၭဒိၪထၪ့လခီၫဒံၭတၭ,စံၭဝ့ၫဒၪ, စဒၫဝံၭအ",
			"32": "<sup>32</sup> ဖိၪခွၫကဆါဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭလါပၧၩဆံၭ.- ယ့ၫရှူၬ အီၪပထုၬတၭ, ကိၭစိၩအဝ့ၫၥံၪ,စံၭဝ့ၫဒၪ, မွဲအဘၪန",
			"33": "<sup>33</sup> ၥံၪအၥၭလၧယမိမၩနၥံၪလၧဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫ ၥံၪစံၭဝ့ၫဒၪ, ကဆါဧ့, ဘဲၫပမ့ၬၥၪမိဘၪအိၭထၪ့အၥၭ",
			"34": "<sup>34</sup> အၥိၭလီၫ.- ယ့ၫရှူၬယၫ့ၥၭဝ့ၫတၭ,ထိၭဝ့ၫအမ့ၬၥၪ နီၪအမ့ၬၥၪဖၩ့ထၪ့ချဲၫ့မၬတၭ,အဝ့ၫၥံၪဖိၬထၪ့အခဲၫ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ထီးအဝ့ၫၥံၪလ့ၩဘူၭထၪ့ လၧယရုစလံၫ့တၭ, ထီၩ့ဝ့ၫလၧဘ့ၥဖၭ လၧခိၪလီၩ့အလဲအိၫ့နီၪတၭ, ယ့ၫ",
			"2": "<sup>2</sup> ရှူၬအၪ့မၧၫ့လၩ့အထံၩအဖျဲနံၫဂၩ,- စံၭအဝ့ၫၥံၪလ့ၩ လၧတဝၫ့အီၪတီၩလၧနၥံၪ အမ့ၬယၫဘီၪး နၥံၪမိဒၪ ဆၧချဲၫ့မၬလၧကၥ့ၪယီၩ့လဒုၩ ဘၪဆၧစၧၩ့ထၬဝ့ၫအီၪ လၧအဖိၪလဒုၩလီၫ. ကွဲၪလၩ့ခွံၬတၭ,ဂဲၫထဲၩ့မီၩ့ လၧ",
			"3": "<sup>3</sup> ယအီၪယီၩဆံၭ.- ၦလဂၩဂၩအ့ၪစံၭနၥံၪလမံၩ့မံၩ့ တၭ,စံၭနၥံၪဝ့ၫ,ကဆါန့ဘၪဝ့ၫအလးအီၪတၭ, အဝ့ၫ ဒၪမိဖ့ၪလၫ့ဝ့ၫချဲၫ့မၬလီၫ.",
			"4": "<sup>4</sup> ဆၧထီးအလူၬယီၩ မၩအၥၭဘဲၫမီၪ အလူအထၫ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့အၥိၭ,စံၭဝ့ၫဒၪ,",
			"5": "<sup>5</sup> လီၩဘၪဇံအိၫ့အဖိၪမုၪ, ယိခွါ,နစဎွၩဂဲၫလၧနအီၪ, အၥုၪ့ဆၧၩ့အၥၭဆၧၩ့ဒဲထူၬကၥ့ၪယီၩ့, ကၥ့ၪယီၩ့လၧၦအၪ့မၧၫ့ဝ့ၫအဖိၪဖၫ, ကၥ့ၪယီၩ့အဖိၪလီၫ.",
			"6": "<sup>6</sup> အထံၩအဖျဲလဖၪနီၪ လ့ၩမၩဝ့ၫဘဲၫယ့ၫရှူၬမၪလူၬ",
			"7": "<sup>7</sup> ဝ့ၫအၥိၭ,- မီၩ့ကၥ့ၪယီၩ့ဒဲအဖိၪတၭ,ဒၩလၩ့အကီၩ့ အၥိၭလၧအလီၩ့တၭ, ဒုၭဆၧၫ့နၩ့အဝ့ၫဒၪ လၧအဖၫ့",
			"8": "<sup>8</sup> ခိၪလီၫ.- ၦခမျၧးဖၭဒိၪလဖၪဒၩလၩ့အကီၩ့အၥိၭလၧ ဖၧၩ့ၥၭတၭ, အဂူၫဂၩလနၩ့နၩ့ ဖ့ၬလၩ့ၥံၪ့ထဲၩ့တၭ,",
			"9": "<sup>9</sup> လုလဲလၩ့ဝ့ၫလၧဖၧၩ့ၥၭလီၫ.- ၦခမျၧးလၧအလ့ၩ လၧယၫ, ဒဲလ့ၩလၧခဲၫ့လဖၪနီၪကိၭၡၭထၪ့တၭ, စံၭဝ့ၫဒၪ, စဒၫဝံၭအဖိၪခွၫဧ့, ထိးထဲၩ့တၩ့ထဲၩ့ဘိၩ့နဲၪ့ယီၩ ဆံၭ.ၦလၧအဂဲၫလၧကဆါအမံၩ့လဂၩယီၩ,မွဲအ ဘၪဆိၪဂ့ၩဆံၭ. ထိးထဲၩ့တၩ့ထဲၩ့ဘိၩ့နဲၪ့ယီၩလၧ",
			"10": "<sup>10</sup> ဆၧထီၫထုၬဆံၭ.- ထီးအလ့ၩနုၬဝ့ၫလၧယရုစလံၫ့ အ ဖၧၩ့တၭ, ၦတုၩ့ထၪ့တုၩ့လၩ့ဆၧ ထၧၫ့ဒိၩ့ယၫတၭ,",
			"11": "<sup>11</sup> စံၭဝ့ၫဒၪ, အယီၩမွဲပလၫလဂၩလဲၪ.- ၦခမျၧးၥံၪစံၭဝ့ၫ ဒၪ, အယီၩမွဲယ့ၫရှူၬမီၪလဂၩနီၪ, ဂဲၫလၧနၭဇရ့ၭလၧ ဂၫလလံၫအဖၧၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> ယ့ၫရှူၬလ့ၩနုၬလၧယွၩအဆၧလုအဂံၪ့ဖၧၩ့တၭ, နၫ့ထၪ့ခွံၬကယဲၦဎွ့ၩဆၧ, ဒဲၦအၪ့ဆၫဆၧလၧဆၧလု အဂံၪ့ဖၧၩ့ထီးအလူၬနီၪ, ချႃၬလၩ့ခွံၬ ၦအၪ့လဲၩစ့ၩအ",
			"13": "<sup>13</sup> လးဒဲၦအၪ့ဆၫထိၪလွံဆၧၫ့နၩ့အလးလီၫ.- မွဲအစံၭအ ဝ့ၫၥံၪ, ဆၧကွ့ၭအၥၭ, ယဂံၪ့မိဘၪဆၧကိၭဝ့ၫ, လၧဆၧဘၩဆိၪဖၪအဂံၪ့တၭ, အ့ၪမွဲနၥံၪမၩဝ့ၫလၧၦထမျၬအဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> ၦမ့ၬဘျီၪဒဲၦခၪ့ဂၭဂီၩ့ အီၪလၧဆၧလုအဂံၪ့ဖၧၩ့လ ဖၪနီၪ,ဂဲၫလၧအအီၪတၭ,အဝ့ၫဒၪမၩဘျၪထဲၩ့အဝ့ၫ",
			"15": "<sup>15</sup> ၥံၪလီၫ.- ထီးၦလုဆၧအဒိၪၥံၪ,ဒဲၦကွ့ၭလံၬၥံၪဒၪဆၧ လၩ့လၭလၧအမၩဝ့ၫလဖၪ, ဒဲဖိၪၥၪကိၭၡၭထၪ့ဆၧ လၧဆၧလုအဂံၪ့ဖၧၩ့တၭ,စံၭဝ့ၫ, စဒၫဝံၭအဖိၪခွၫဧ့, ထိးထဲၩ့တၩ့ထဲၩ့ဘိၩ့နဲၪ့ယီၩဆံၭနီၪတၭ, အၥၭထၪ့",
			"16": "<sup>16</sup> ဝ့ၫဒၪလီၫ.- စံၭအဝ့ၫနီၪ,ၦလဖၪယီၩစံၭနီၫလဲၪနီၫလဲၪ နီၪ,မွဲနနါဂၧၫ့ဆ့ဧၪ. ယ့ၫရှူၬစံၭဝ့ၫဒၪ, နါဂၧၫ့ယူၭ တၭးနမၩဝဲၩယူၭဆၧစံၭထၪ့အၪ့အူၭလၧဖိၪဒံၩဖိၪ ၥၪ,ဒဲဖိၪၥၪအၪ့နူလဖၪအနိၭနီၪ, မွဲနၥံၪဖီဘၪနးဆိၭ",
			"17": "<sup>17</sup> အ့ၬဧၪ.- မွဲအစဲၪ့ဒၪအဝ့ၫၥံၪ, စဲၪ့ထၪ့ခွံၬလၧဒိၩ့ဖၧၩ့ လၧခီၫ့ထီၩ့လၧဘ့ၭၥနံၫအဖၧၩ့တၭ, အီၪဝ့ၫထီးနီၪၥၫ့ နၩချီၩ့လီၫ.",
			"18": "<sup>18</sup> မုဆဲၪ့ထၪ့တၭ, မွဲအထဲၩ့ကဒၩထဲၩ့ဝ့ၫလၧဒိၩ့ဖၧၩ့",
			"19": "<sup>19</sup> အဘိၩ့ဘၭတၭ,ၥၭဝံအၥၭလီၫ.- ဒၪဘၪချိၪ့ဒိၩ့အီၪ လၧဖၧၩ့ၥၭအနဲၩ့ထံၭလထံၭတၭ, လ့ၩဝ့ၫလၧအအီၪ နီၪ,ဒၪဆၧ လၧအလီၩ့နးမံၩ့အ့ၬး ဒၪဘၪန့ၫအဒိၭအ လၪလီၫ. စံၭဝ့ၫဒၪး မွဲနထီးၥၪထၪ့လၧၩ့နးဆိၭလဂ့ၩ",
			"20": "<sup>20</sup> တၭ,ချိၪ့ဒိၩ့ဎဲၫ့ထၪ့ခွံၬဝ့ၫချဲၫ့မၬလီၫ.- အထံၩအဖျဲ လဖၪဒၪဘၪဝ့ၫတၭ, ထီၫမံၫထီၫမၪဝ့ၫ,စံၭဝ့ၫဒၪ,ချိၪ့",
			"21": "<sup>21</sup> ဒိၩ့နီၪဎဲၫ့ထၪ့ခွံၬ ချဲၫ့မၬကၨ,- ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧ တၭ, စံၭအဝ့ၫၥံၪယလီၩဘၪနၥံၪတီၩတီၩယီၩ, နၥံၪ အ့ၪနဲၩဆၧတၭ,နၥံၪအၥၭအ့ၪလဂံၩ့ဂၩ့ဘၪနီၪ, မွဲ နၥံၪမိမၩန့ၫဆၧမၩအၥၭ လၧချိၪ့ဒိၩ့ယီၩကၭအ့ၬး နၥံၪအ့ၪစံၭခိၪလီၩ့ယီၩ ၥုၭခွံၬနၥၭတၭ, လ့ၩခွံၬၡိၭခွံၬ နၥၭလၧမၫဆမံၭဖၧၩ့ဆံၭး ဆၧမိမၩအၥၭဆ့လီၫ.",
			"22": "<sup>22</sup> လၧဆၧနဲၩအီၪဝ့ၫနီၪ ထီးဒၪနၥံၪအၪ့ကံၩ့ဆၧလၧန ၥံၪအဆၧဘၩဆိၪဖၪအဖၧၩ့ ထီးအလူၬလဖၪတၭ,န ၥံၪမိန့ဘၪလီၫ.",
			"23": "<sup>23</sup> ထီးအလ့ၩနုၬဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, ၥီၪ့ ထဲၩ့ၥၫ့ထဲၩ့ဆၧအဘိၩ့ဘၭနီၪ, ၦလုဆၧအဒိၪလဖၪ, ဒဲၦခမျၧးအၥုၪ့က့ၭၥၭၡါ လဖၪဂဲၫလၧအအီၪတၭ,စံၭ ဝ့ၫဒၪ,နမၩဆၧလဖၪယီၩ မွဲလၧပလၫအစီၩ့အမၩ့လ ဂၩလဲၪ. မွဲပလၫဖ့ၪလၫ့နၧၩ လၧဆၧစီၩ့ဆၧမၩ့ယီၩလ",
			"24": "<sup>24</sup> ဂၩလဲၪ.- ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭအဝ့ၫၥံၪယမိ အၪ့စၪ့နၥံၪနး မံၩ့ဆ့လီၫ. ဆၧနီၪနၥံၪအ့ၪလီၩဘၪယၧၩ တၭ,ယမၩဆၧလဖၪယီၩ, လၧပလၫအစီၩ့အမၩ့လဂၩ",
			"25": "<sup>25</sup> လဲၪနီၪ,ယမိလီၩဘၪနၥံၪဆ့လီၫ.- စယီဟၫ့အဆၧ ဘၭတံၫဇၫ့နီၪ, မွဲအဂဲၫဝ့ၫလၧခီၫခီၫလဲၪ. မွဲအဂဲၫ",
			"26": "<sup>26</sup> လၧမူၭခိၪလခီၫနီၪ,မွဲအဂဲၫလၧၦၡၩလခီၫလဲၪ.- အဝ့ၫ ၥံၪကိၪ့ထၪ့လိၬအၥၭတၭ, စံၭဝ့ၫဒၪ,ပအ့ၪစံၭလၧမူၭ ခိၪနီၪ,အဝ့ၫနီၪမိစံၭပၧၩ, အ့ၪမွဲဘဲၫနီၪတၭ, မွဲဘၪ နီၫလၧနၥံၪလနဲၩဘၪလဲၪ. ပအ့ၪစံၭလၧၦၡၩနီၪပၥၭ မဲၪၦခမျၧးလီၫ. အဂဲးဘဲၫယီၩၦထီးအလူၬအီၪက့ၪစ",
			"27": "<sup>27</sup> ယီဟၫ့ဘဲၫမီၪလဂၩအၥိၭလီၫ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ ဆၧတၭ,စံၭယ့ၫရှူၬ,ပၥ့ၪယၫအ့ၬ. အဝ့ၫဒၪစံၭ,ဘဲၫ နီၪအၥိၭယမၩဆၧနီၪလဖၪ, လၧပလၫအစီၩ့အမၩ့ လဂၩလဲၪနီၪ, ယလီၩဘၪနၥံၪဆ့အ့ၬ. ဆၧချဲၩ့ဒီၩ့လၩ့ဘၪဆဲၫ့ဖိၪခွၫနံၫဂၩ.",
			"28": "<sup>28</sup> မွဲနၥံၪဆီၫ့မီၪ့နၥံၪဝ့ၫဘဲၫၥ့ၪလဲၪ. ၦလဂၩအဖိၪ ခွၫအီၪနံၫဂၩတၭ, ဂဲၫဝ့ၫလၧအခၪ့ထံၭလဂၩအအီၪ နီၪ,စံၭဝ့ၫဒၪ, ဖိၪခွၫဧ့, လ့ၩမၩဆၧလၧယစဘံၭအလး",
			"29": "<sup>29</sup> ဖၧၩ့လနံၩယီၩဆံၭ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭ ဝ့ၫဒၪ,ယလ့ၩအ့ၬ. မွဲလါနၫ့ဘိၩ, လၧခဲၫ့ထဲၩ့နၪ့လၩ့",
			"30": "<sup>30</sup> အၥၭတၭ, လ့ၩဝ့ၫလီၫ.- ဂဲၫလၧၦနံၫဂၩလဂၩ အ အီၪတၭ,စံၭဝ့ၫဘဲၫနီၪၥိၭဆ့လီၫ. အဝ့ၫနီၪချဲၩ့ဆၧၫ့ ဆၧတၭ,စံၭဝ့ၫဒၪ,ယမိလ့ၩလီၫ, ကဆါဧ့း တၭလ့ၩ",
			"31": "<sup>31</sup> ဘၪအ့ၬ.- ၦနံၫဂၩနီၪမွဲအမၩဝ့ၫထီးဒၪအဖါအၥၭလ ဂၩဂၩလဲၪ. အဝ့ၫၥံၪစံၭဝ့ၫ,လၧအခၪ့ထံၭလဂၩလီၫ. ယ့ၫရှူၬစံၭဆၧၫ့ဝ့ၫ, ယလီၩဘၪနၥံၪတီၩတီၩလၧၦ အၪ့ကံၩ့အခီၫ့ဒဲၦမဲၩဎွဲၩမုၪလဖၪနီၪ လ့ၩနုၬဝ့ၫလၧမူၭခိၪ",
			"32": "<sup>32</sup> အဘၩ့အမုးအဖၧၩ့လၧနၥံၪအမ့ၬယၫလီၫ.- အဂဲး ဘဲၫယီၩ, စယီဟၫ့ဂဲၫလၧဆၧတီၩဆၧလီၩ့အဖၧၩ့ၥၭ, နၥံၪနဲၩအ့ၬ. အ့ၪမွဲၦအၪ့ကံၩ့အခီၫ့ဒဲၦမဲၩဎွဲၩမုၪ လဖၪနီၪနဲၩဝ့ၫတၭ, နၥံၪဒၪဘၪနၥံၪဝ့ၫတၭ, ဘဲၫနၥံၪ မိနဲၩဝ့ၫအၥိၭ, နၥံၪနီၫ့ယါလၩ့ထဲၩ့နၥံၪအၥၭလၧ အလးခဲၫ့ဆ့အ့ၬ.",
			"33": "<sup>33</sup> ခိၭနၪဆၧချဲၩ့အဒီၩ့လၧအဂူၫဂၩနးထံၪဘီၪ. ဂံၪ့က ဆါလဂၩ ၥုၪ့လၩ့စဘံၭအလးလလးတၭ, မၩဖီၩ့ ထၬဝ့ၫတၭ, ခုၪ့လၩ့ဆၧဖၧၩ့လၧအဖၧၩ့တၭ, မၩတၨၭ ခိၭဆၧလဖျိၪ့လီၫ. ဖ့ၪလၫ့ဝ့ၫလၧၦမၩကၩၥံၪ အစူၪ",
			"34": "<sup>34</sup> ဖၧၩ့တၭ,စဲၪ့ထၪ့လ့ၩဝ့ၫလၧထံၫယဲၩ့ခးယဲၩ့လီၫ.- ထီး အဘူၭထၪ့လၧဆၧၥၪထၪ့အဆၧၫ့အထီဘဲၫအမိန့ဘၪ ဆၧၥၪအၥိၭတၭ, အၪ့မၧၫ့အဎီးအၡၩလဖၪလ့ၩ",
			"35": "<sup>35</sup> လၧၦမၩကၩၥံၪအအီၪလီၫ.- ၦမၩကၩလဖၪနီၪဖီၪ့ ထၬန့အဎီးအၡၩတၭး ဒိၪဝ့ၫထးဝ့ၫလဂၩတၭ, မၩၥံၫ",
			"36": "<sup>36</sup> ဝ့ၫလဂၩဒၪတၭ,ခွံၬဝ့ၫလၧလိးလဂၩဒၪလီၫ.- မၩဒီၭ လဖၧၫ့,အဝ့ၫဒၪအၪ့မၧၫ့ အဎီးအၡၩဂူၫဂၩအၪနဲၪ့ လၧ အခၪ့ထံၭဒံၭတၭ, မွဲအမၩအဝ့ၫၥံၪဘဲၫလးလးလီၫ.",
			"37": "<sup>37</sup> လၧခဲၫ့ထုၬလဖၧၫ့နီၪ, မွဲအအၪ့မၧၫ့အဖိၪခွၫ လ့ၩလၧ အအီၪတၭ, စံၭဝ့ၫဒၪ, အဝ့ၫၥံၪမိယူၭယၪ့ ယဖိၪခွၫ",
			"38": "<sup>38</sup> လီၫ.- အ့ၪမွဲထီးၦမၩကၩလဖၪဒၪဘၪအဖိၪခွၫနီၪ, စံၭ လိၬအၥၭ, အယီၩလဂၩမွဲၦန့ၥၫဆၧလီၫ. ဂဲၫမၩၥံၫ",
			"39": "<sup>39</sup> ၡီၩ့ဘီၪးပမိမၩန့အဆၧန့ၥၫလီၫ.- အဝ့ၫၥံၪဖီၪ့ထၬဝ့ၫ တၭ,နၫ့ထၪ့ခွံၬဝ့ၫလၧစဘံၭအလး လၧခီၫ့နီၪမၩၥံၫ",
			"40": "<sup>40</sup> ခွံၬဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ထီးစဘံၭလးအက ဆါအ့ၪဂဲၫထဲၩ့ဝ့ၫတၭ, မွဲအမိမၩၦမၩကၩလဖၪနီၪ",
			"41": "<sup>41</sup> ဘဲၫၥ့ၪလဲၪ.- အဝ့ၫၥံၪစံၭ, မိမၩဂၭဂီၩ့ခွံၬၦအအၧၩ့ လဖၪနီၪနၭမၬလီၫ. မိဖ့ၪလၫ့စဘံၭအလးလၧၦမၩ ကၩၥံၪအဂူၫဂၩလၧအမိဖ့ၪလၫ့ထဲၩ့ ဆၧၥၪလၧအ",
			"42": "<sup>42</sup> ဆၧၫ့အထီဘၪလီၫ.- ယ့ၫရှူၬစံၭအဝ့ၫၥံၪ, လိးလၧၦမၩဂံၪ့လဖၪခွံၬၡိၭဝ့ၫလဖျိၪ့နီၪ, ကဲၪထၪ့ဝ့ၫလၧဆၧအနိၪ့အခိၪစီၪ့တၭး အယီၩဂဲၫလၧကဆါတၭ, မွဲဆၧလၩ့လၭလၧပမ့ၬၥၪဖၧၩ့လီၫ. ဆၧနီၪမွဲနၥံၪဖီဘၪ လၧဆၧကွ့ၭအၥၭအဖၧၩ့ နးဆိၭ",
			"43": "<sup>43</sup> အ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ,ယလီၩဘၪနၥံၪလၧဆၧ မိမၩန့ယွၩအဘၩ့အမုးလၧနၥံၪအအီၪတၭ, မိဖ့ၪ လၫ့ဝ့ၫလၧၦဆၨၩလၧအမိၥၪထၪ့ဝ့ၫလၧဘၩ့မုးအ ဆၧၥၪလဖၪနီၪလီၫ.",
			"44": "<sup>44</sup> ၦလၧအလၩ့ထံၩဖါဝ့ၫလၧလိးယီၩအလီၩ့, မိခါ ဝ့ၫလီၫ. အ့ၪမွဲထီးဒၪၦလၧအလၩ့ထ့ၬဝ့ၫလၧအလီၩ့ လဂၩဂၩနီၪ, မွဲအမိမၩလၩ့ဘျ့ၭအဝ့ၫလီၫ.",
			"45": "<sup>45</sup> ၦလုဆၧအဒိၪ, ဒဲၦဖၫရစံၫၥံၪ နါဂၧၫ့ဆၧချဲၩ့အဒီၩ့ လဖၪနီၪ, ၥ့ၪယၫလၧအဝ့ၫနီၪ ချဲၩ့ဝ့ၫလၧအဝ့ၫၥံၪ အဂဲး",
			"46": "<sup>46</sup> အကၠီၪ့လီၫ.- အဝ့ၫၥံၪအၪ့ဎၬဖီၪ့ထၬဝ့ၫလါနၫ့တၭ, ၥၭမဲၪၦခမျၧးနီၪး အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအီၪက့ၪ အ ဝ့ၫဒၪဘဲၫမီၪလဂၩအၥိၭလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဒီၭဝ့ၫလၧဆၧချဲၩ့အ",
			"2": "<sup>2</sup> ဒီၩ့လဖၪတၭ, စံၭဝ့ၫ,- မူၭခိၪအဘၩ့အမုးမၩအၥၭ ဘဲၫစဎွၩလၧအမၩဆၧအီၪဎုၬလိၬအၥၭအမူၭလၧ အ",
			"3": "<sup>3</sup> ဖိၪခွၫအဂးအၥိၭနီၪတၭ,- အၪ့မၧၫ့အဎီးအၡၩလ့ၩ လၧၦလၧအဘၪ ဆၧလီၩဝဲၩဝ့ၫလဖၪနီၪ ကိၭန့အဝ့ၫ ၥံၪလၧမူၭအဖၧၩ့လီၫ. တၭအဝ့ၫၥံၪဂဲၫနီၪ အၥၭအီၪ",
			"4": "<sup>4</sup> အ့ၬ.- မၩဒီၭလဖၧၫ့အၪ့မၧၫ့အဎီးအၡၩအဂူၫဂၩလဖၪ လ့ၩဝ့ၫတၭ,စံၭဝ့ၫဒၪ, လီၩဘၪၦလၧအဘၪဆၧလီၩ ဝဲၩဝ့ၫလဖၪနီၪ, ယိခွါ,ယတဲၩ့ဝဲၩယူၭယဆၧအၪ့ဆၧ အီၩယူၭ, ချီၥံၪ,ဒဲဆၧလၧအဘီၪ့အၥိၪလဖၪ လၧဆၧ မၩၥံၫယူၭဝ့ၫယူၭ. ဆၧအီၪတဲၩ့ဝဲၩယူၭ ကိၭမံၩ့ဒ့ၭ",
			"5": "<sup>5</sup> ယူၭ,ဂဲၫလၧမူၭအဖၧၩ့ဆံၭ.- မွဲလါနၫ့ဘိၩ, အဝ့ၫၥံၪ အီၪက့ၪဝ့ၫလၧဆၧနးမံၩ့အ့ၬး လ့ၩဝ့ၫလဂၩလၧအဎံၪ အဎုၭအဆံၬအနၩတၭ, လဂၩဒၪလၧအဆၧမၩဖနံၬ",
			"6": "<sup>6</sup> လီၫ.- ၦအီၪလၩ့ထးလဖၪနီၪဖီၪ့ထၬအဎီးအၡၩတၭ,",
			"7": "<sup>7</sup> မၩအၧၩ့မၩနၭဝ့ၫဒဲမၩၥံၫဝ့ၫလီၫ.- စဎွၩနါဂၧၫ့ဘၪ ဆၧနီၪ,အၥၭထၪ့တၭ ခၫ့ထၪ့အၥုၭအၥ့ၪနီၪ, မၩၥံၫ ခွံၬၦလၧအမၩၥံၫၦၡၩလဖၪနီၪတၭ, ဆူၭထၪ့ခွံၬအဝ့ၫ",
			"8": "<sup>8</sup> ၥံၪအဒိၩ့လီၫ.- ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪစံၭအဎီးအၡၩ, ဆၧလၧ မူၭယီၩဆၧတဲၩ့ဝဲၩယူၭး အ့ၪမွဲၦလၧအဘၪ",
			"9": "<sup>9</sup> ဆၧလီၩဝဲၩဝ့ၫလဖၪနီၪကြၨၭအ့ၬ.- မၩအၥၭဘဲၫနီၪ တၭ,လ့ၩလၧဖၧၩ့ၥၭထဲၩ့ဖၭအခၪ့ထံၭတၭ, ထီးဒၪၦ လၧနၥံၪဒၪန့လဖၪနီၪ, ကိၭထဲၩ့အဝ့ၫၥံၪလၧမူၭအဖၧၩ့",
			"10": "<sup>10</sup> ယီၩဆံၭ.- အဎီးအၡၩလဖၪနီၪလ့ၩလၧဖၧၩ့ၥုၪ့ဖၧၩ့ ၥၭတၭ,ထီးဒၪၦလၧအဒၪန့ဝ့ၫထီးအလူၬ, ၦအဂ့ၩမွဲ ဂ့ၩ,ၦအအၧၩ့မွဲဂ့ၩ,ကိၭကီၪ့ဝ့ၫလၧမူၭဖၧၩ့နီၪတၭ, ဆၧဎွ့ၩယူၭဝ့ၫ လၧၦအၪ့မူၭလီၫ.",
			"11": "<sup>11</sup> စဎွၩဂဲၫယိၦအၪ့မူၭလဖၪတၭ, ဒၪဘၪဝ့ၫၦလကီၩ့ လၥိၭဘၪၦအၪ့မူၭအကီၩ့အၥိၭလဂၩထီးနီၪတၭ,",
			"12": "<sup>12</sup> စံၭအဝ့ၫနီၪ, တခွၫဧ့,နလကီၩ့လၥိၭဘၪၦအၪ့မူၭအ ကီၩ့အၥိၭတၭ, နဂဲၫနုၬထီးယီၩဘဲၫၥ့ၪလဲၪ. အဝ့ၫနီၪ",
			"13": "<sup>13</sup> အီၪလၩ့မါပံၭလီၫ.- ထီးနီၪလဖၧၫ့ စဎွၩစံၭအဎီးအ ၡၩ,စၧၩ့ထၬအဝ့ၫဒၪအစူၪအခၪ့, ဆိၬထၪ့ခွံၬတၭ, ခွံၬလၩ့ခွံၬလၧဆၧခံၭကျၩလၧခီၫ့ဆံၭ. ဆၧဘၪဂၪ့ ဆၧဘၪယၧၩ့, ဆၧခၪအဲၪ့ထံးနီၪမိအီၪဝ့ၫဒၪထီးနီၪ",
			"14": "<sup>14</sup> လီၫ.- အဂဲးဘဲၫယီၩ ၦလၧအဘၪဆၧကိၭဝ့ၫလဖၪ အီၪဝ့ၫအၪဂၩ, အ့ၪမွဲၦလၧအဘၪဆၧရွံန့ဝ့ၫလဖၪအီၪ ဝ့ၫၡၩခိၬဂၩလီၫ.",
			"15": "<sup>15</sup> ထီးနီၪလဖၧၫ့ ၦဖၫရစံၫၥံၪစဲၪ့ထၪ့ခွံၬတၭ, ကိၪ့ ထၪ့ဖၭလၩ့ဝ့ၫဒၪ, ဘဲၫအမိမၩဘံၪဘူၪ အဆၧချဲၩ့အ",
			"16": "<sup>16</sup> ၥိၭလီၫ.- အဝ့ၫၥံၪအၪ့မၧၫ့လၩ့အထံၩအဖျဲၥံၪဒဲၦဟ့ၫ ရိဒအၫ့ၥံၪလ့ၩလၧအအီၪတၭ, စံၭဝ့ၫဒၪ,ဆရၫဧ့,ပၥ့ၫ ယၫလၧနမွဲၦအတီၩတၭ, နၥီၪ့လိၪဆၧလၧယွၩအဖၧၩ့ ၥၭတီၩတီၩတၭ, နလီၩ့ၦၡၩအၥၭနးဂၩအ့ၬ. အဂဲး",
			"17": "<sup>17</sup> ဘဲၫယီၩနယိမ့ၬၦၡၩအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,နဆီၫ့ မီၪ့နဝ့ၫဘဲၫၥ့ၪလဲၪ, ပဖ့ၪလၫ့အခီၫ့လၧစံစၧၫနီၪ, မွဲအ",
			"18": "<sup>18</sup> တီၩလတီၩဘၪလဲၪ,လီၩဘၪပၧၩနးထံၪဘီၪ.- ယ့ၫရှူၬ ၥ့ၪယၫအဝ့ၫၥံၪအဆၧအၧၩ့ဆၧၥၫ့တၭ, စံၭဝ့ၫဒၪ,ၦ အၪ့လီၫဆၧၥံၪဧ့, မွဲဘၪနီၫလၧနၥံၪကျဲၩ့ဖစီၩ့ယၧၩ",
			"19": "<sup>19</sup> လဲၪ.- ဒုၭနဲၪယၧၩလၧခီၫ့အစ့ၩနးဘံၪ့ဘီၪ. အဝ့ၫၥံၪ,",
			"20": "<sup>20</sup> ဂဲၫဆိၬန့စ့ၩဒန့ရံၫလဘံၪ့လီၫ.- အဝ့ၫနီၪစံၭအဝ့ၫၥံၪ, အယီၩမွဲပလၫအခံးအဂၩ့ ဒဲမွဲပလၫအဆၧကွ့ၭအၥၭ လၧအလီၩ့လဂၩလဲၪ. အဝ့ၫၥံၪစံၭဝ့ၫ, မွဲစံစၧၫအဆၧ",
			"21": "<sup>21</sup> လီၫ.- ထီးနီၪလဖၧၫ့ယ့ၫရှူၬစံၭအဝ့ၫၥံၪ, အခိးမွဲဘဲၫ နီၪတၭ,ဖ့ၪလၫ့ထဲၩ့စံစၧၫလၧစံစၧၫအဆၧတၭ, ဒဲ",
			"22": "<sup>22</sup> ယွၩလၧယွၩအဆၧဆံၭ.- ထီးအဝ့ၫၥံၪနါဂၧၫ့ဝ့ၫတၭ, ထီၫမံၫထီၫမၪ, စဲၪ့ထၪ့ခွံၬလၧအအီၪတၭ, ထဲၩ့ထဲၩ့ ဝ့ၫဒၪလီၫ.",
			"23": "<sup>23</sup> မုနံၩလနံၩနီၪ,ၦစၭဒုၫစံၫၥံၪလၧအစံၭဝ့ၫ ဆၧဂဲ ထုၪ့ထဲၩ့လၥ့ၪဘၪနီၪ, ဂဲၫလၧအအီၪတၭ, အၪ့စၪ့ဝ့ၫ,",
			"24": "<sup>24</sup> စံၭဝ့ၫဒၪ,-ဆရၫဧ့, စမိစ့ၭစံၭး ၦလဂၩဂၩအဖိၪလအီၪ ဘၪနီၪ, အ့ၪ ၥံၫ တၭ, အ ထၧၫ့ဖု ဝဲ ခွၫ ဘၪ အီၪ ဎုၬ လိၬ အၥၭလၧအမၫတၭ, ဘၪဒုၭအီၪထၪ့အထၧၫ့ဖုဝဲခွၫ",
			"25": "<sup>25</sup> အချံၫအၥၪလီၫ.- အနီၪတၭ, ၦထၧၫ့ဖုဝဲခွၫ နွ့ၫဂၩ အီၪဝ့ၫလၧၦကျၩလီၫ. အခၪ့ထံၭလဂၩအီၪဎုၬလိၬအ ၥၭလၧအမၫနီၪၥံၫဝ့ၫတၭ, အချံၫအၥၪလအီၪဘၪနီၪ,",
			"26": "<sup>26</sup> အမၫအီၪလၩ့ထးလၧအထၧၫ့ဖုဝဲအဂးလီၫ.- ဘဲၫနီၪ အၥိၭၦနံၫဂၩလဂၩ, ဒဲၥၧၫ့ဂၩလဂၩတၭ, ထီၩ့လၩ့လၧ",
			"27": "<sup>27</sup> နွ့ၫဂၩလဂၩလီၫ.- လၧၦထီးအလူၬနီၪ အလးခဲၫ့ထုၬ တၭ, ၦမုၪၥံၫဝ့ၫဒၪလီၫ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, လၧဆၧဂဲထုၪ့ထဲၩ့အဖၧၩ့နီၪ, မွဲအမိကဲၪဝ့ၫလၧ ၦနွ့ၫဂၩလဖၪနီၪ အမၫလဂၩဂၩလဲၪ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪန့မၫလၧအဝ့ၫနီၪ ထီးအလူၬ",
			"29": "<sup>29</sup> လီၫ.- ယ့ၫရှူၬ ချဲၩ့ဆၧၫ့ဆၧ,စံၭအဝ့ၫၥံၪ, ဆၧကွ့ၭအ ၥၭမွဲဂ့ၩ,ယွၩအစီၩ့အမၩ့မွဲဂ့ၩ, မွဲနၥံၪလၥ့ၪယၫဘၪ",
			"30": "<sup>30</sup> တၭ,နၥံၪနဲၩမၪဆၧလီၫ.- အဂဲးဘဲၫယီၩလၧဆၧဂဲထုၪ့ ထဲၩ့အဖၧၩ့နီၪ ဆၧအီၪဎုၬလိၬအၥၭအ့ၬး ဘၪဆၧအီၪ ဎုၬလိၬအၥၭဆ့အ့ၬး မွဲအမၩအၥၭဘဲၫယွၩအၥီၫ့",
			"31": "<sup>31</sup> လၧမူၭခိၪအၥိၭနီၪလီၫ.- ယွၩလီၩဘၪနၥံၪလၧၦၥံၫဂဲ",
			"32": "<sup>32</sup> ထုၪ့ထဲၩ့အဂဲးနီၪ,မွဲနၥံၪဖီဘၪအ့ၬဧၪ.- မွဲအစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩ, ယ မွဲ စ အၫ ဘြ ဟၫ့ အ ယွၩ, ဒဲ စ အံ စၭ အ ယွၩ, ဒဲ စ ယၫ ကူၭ အ ယွၩ လီၫ. ယွၩနီၪလမွဲဘၪၦၥံၫအယွၩတၭ, မွဲၦမၧၫ့အယွၩလီၫ.",
			"33": "<sup>33</sup> ထီးၦခမျၧးနါဂၧၫ့ဝ့ၫတၭ, ထီၫမံၫထီၫမၪလၧအ ၥီၪ့ဆၧအကၠီၩ့လီၫ.",
			"34": "<sup>34</sup> ထီးၦဖၫရစံၫၥံၪနါဂၧၫ့လၧအတ့ၭနၧၩ့ ၦစၭဒုၫစံၫၥံၪ အဆၧချဲၩ့နီၪ, အဝ့ၫၥံၪအီၪကိၩ့အီၪကီၪ့ဝ့ၫဒၪလၧအအီၪ",
			"35": "<sup>35</sup> တၭ,- ၦၥ့ၪလံၬလၧအကျၩလဂၩနီၪ,ကျဲၩ့ဖစီၩ့ဆၧ",
			"36": "<sup>36</sup> တၭ,အၪ့စၪ့ဝ့ၫလၧဆၧလမံၩ့နီၪ, စံၭဝ့ၫဒၪ,- ဆရၫဧ့, ဆၧမၪလူၬဖၭဒိၪ လၧလံၬဆၧမၪလူၬအဖၧၩ့နီၪမွဲထံၪ",
			"37": "<sup>37</sup> ထံၪလဲၪ.- ယ့ၫရှူၬစံၭဝ့ၫ, အဲၪ ယွၩ န က ဆါ လၧ န ၥၭ ထၧၫ့ ဖျိၪ့ ယၫ ဒဲ လၧ န ၥၭ ၡီၩ့ ထီး အ လူၬ, ဒဲ လၧ န ၥၭ ကိၪ့ ၥ့ၪ ထီး အ",
			"38": "<sup>38</sup> လူၬ ဆံၭ.- အယီၩမွဲဆၧမၪလူၬအခၪ့ထံၭ ဒဲအဖၭ",
			"39": "<sup>39</sup> ဒိၪလထံၪလီၫ.- နံၫထံၪလထံၪနီၪလၩ့ဂၬ လၧအဝ့ၫ နီၪလီၫ. အဲၪ ၦ လၧ န နဲၩ့ ထံၭ ဘဲၫ န နၫ့ ဆါ ဒၪ န ဝ့ၫ အ ၥိၭ နီၪ ဆံၭ.-",
			"40": "<sup>40</sup> ဆၧလၧဆၧမၪလူၬနံၫထံၪ နံၫမီၫ့ယီၩ ဆၧမၪလူၬဒဲမီၪလဖၪလၩ့ဆဲၩ လၧအဝ့ၫၥံၪ ထီးအလူၬလီၫ.",
			"41": "<sup>41</sup> ၦဖၫရစံၫလဖၪနီၪ, အီၪကိၩ့အီၪကီၪ့အဘိၩ့ဘၭတၭ,",
			"42": "<sup>42</sup> ယ့ၫရှူၬအၪ့စၪ့အဝ့ၫၥံၪ,- စံၭဝ့ၫဒၪ, နၥံၪဝ့ၫယီၩမွဲနၥံၪ ဆီၫ့မီၪ့ဎရံၬအဂဲးနီၪဘဲၫၥ့ၪလဲၪ. အဝ့ၫမွဲပလၫအ ဖိၪခွၫလဂၩလဲၪ. အဝ့ၫၥံၪစံၭဝ့ၫ, မွဲစဒၫဝံၭ အဖိၪခွၫ လီၫ.",
			"43": "<sup>43</sup> ယ့ၫရှူၬစံၭဆၧၫ့အဝ့ၫၥံၪ, အ့ၪမွဲဘဲၫနီၪတၭ, လၧ ၥၭမုအဖၧၩ့နီၪ, မွဲဘၪနီၫစဒၫဝံၭကိၭဝ့ၫ လၧကဆါ",
			"44": "<sup>44</sup> လဲၪ.-စံၭဝ့ၫဒၪ, ကဆါစံၭယကဆါလဂၩ, ဆၧၫ့နၩ့လၧယစူၪထွ့ၪ, ထီးယအီၪက့ၪ နဒုၪနဒၩၥံၪ လၧနခၪ့ယဲးလၩ့အ လးဆံၭ.",
			"45": "<sup>45</sup> မၩအၥၭဘဲၫနီၪတၭ, စဒၫဝံၭအ့ၪကိၭအဝ့ၫနီၪလၧ",
			"46": "<sup>46</sup> ကဆါတၭ, မွဲအကဲၪအဖိၪခွၫဘဲၫၥ့ၪလဲၪ.- ၦချဲၩ့ဆၧၫ့ ဝ့ၫလထံၪၥ့ၪနးဂၩအ့ၬ. လၧမုလနံၩနီၪ အလးခဲၫ့ တၭ, ၦအၪ့စၪ့ဆၧဘုၪ့လၧၩ့နးဂၩအ့ၬ."
		},
		"23": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ယ့ၫရှူၬလီၩဘၪ ဆၧလၧၦခမျၧးဒဲလၧ",
			"2": "<sup>2</sup> အထံၩအဖျဲလဖၪတၭ,- စံၭဝ့ၫဒၪ, ၦကွ့ၭလံၬဒဲၦဖၫရ စံၫၥံၪ ဆၧၫ့နၩ့ဝ့ၫလၧစမိစ့ၭ အလးဆၧၫ့နၩ့ အဖၧၩ့",
			"3": "<sup>3</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ထီးဒၪအမၪလူၬနၥံၪကိၭ မံၩ့ဒ့ၭနီၪ, ထီးန့မၩနၥံၪဝ့ၫဆံၭ. အ့ၪမွဲဘဲၫအမၩဆၧ အၥိၭနီၪ,မၩလဂ့ၩ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလီၩလၩ့",
			"4": "<sup>4</sup> လၬလၩ့ဆၧတၭ,မၩဝ့ၫအ့ၬ.-အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ ဘဲၩ့ထၬဆၧယိၭလၧအဎၧၫ့ဒဲဆၧယိၭဝ့ၫကၪတၭ, အီၪက့ၪထၪ့ဝ့ၫ လၧၦၡၩအခိၬထံၭလီၫ. အ့ၪမွဲအဝ့ၫ ၥံၪမိၥုၭဝ့ၫန့ၫ လၧအစူၪမုစူၪနိၩ့နးဘီၩ့နီၪအၥၭအီၪ",
			"5": "<sup>5</sup> အ့ၬ.- ကယဲအဆၧမၩထီးအလူၬနီၪဘဲၫၦဂူၫဂၩမိဒၪ ဘၪဝ့ၫအၥိၭတၭမၩဝ့ၫလီၫ. အဝ့ၫၥံၪခဲးအစူၪဖၭလဲ",
			"6": "<sup>6</sup> တၭ, မၩထီၫထၪ့အကီၩ့အၥိၭအနွံၫလီၫ.- အဲၪဒိၭဝ့ၫ အလးလၧအဂ့ၩထုၬလၧဆၧဘိၪ့ဖၧၩ့, ဒဲအလးဆၧၫ့",
			"7": "<sup>7</sup> နၩ့အဂ့ၩထုၬလၧၥရိၬဖၧၩ့,- ဒဲဆၧချဲၩ့ဒုၪ့ဘၪဝ့ၫလၧ ဖၠၫဖၧၩ့,ဒဲၦကိၭဝ့ၫလၧ,ရၭဘံၫဧ့,ရၭဘံၫဧ့,နီၪလီၫ.",
			"8": "<sup>8</sup> အ့ၪမွဲနၥံၪဝ့ၫယီၩ ထီးဖ့ၪလၫ့ၦကိၭနၥံၪ, ရၭဘံၫဧ့, နီၪလဂ့ၩ.အဂဲးဘဲၫယီၩ နၥံၪအဆရၫဖၭဒိၪအီၪဝ့ၫ လဂၩဎး,ဒဲနၥံၪဝ့ၫဒၪထီးအလူၬယီၩ နၥံၪမွဲထၧၫ့ဖုဝဲ",
			"9": "<sup>9</sup> လီၫ.- နၥံၪထီးကိၭၦလၧဂၪ့ခိၪချိၫ့ယီၩလၧဖါနးဂၩ လဂ့ၩ.အဂဲးဘဲၫယီၩ နၥံၪအဖါအီၪဝ့ၫလဂၩဎးလၧ",
			"10": "<sup>10</sup> မူၭခိၪအဖၧၩ့နီၪလီၫ.- ထီးဖ့ၪလၫ့ၦကိၭနၥံၪလၧအခိၪ လဂ့ၩ. အဂဲးဘဲၫယီၩနၥံၪအခိၪ အီၪလဂၩဎးဎရံၬနီၪ",
			"11": "<sup>11</sup> လီၫ.-ၦလၧအဒိၪထုၬလၧနၥံၪအကျၩလဂၩနီၪမိဘၪ",
			"12": "<sup>12</sup> ကဲၪထၪ့လၧနၥံၪအခ့ၫအၡၩလီၫ.- ထီးဒၪၦလၧအအီၪ က့ၪထၪ့ထီၫ အၥၭလဂၩဂၩနီၪမိဘၪဆၧဆၪ့လၩ့ဝ့ၫ တၭ,ထီးဒၪၦလၧအဆၪ့လၩ့အၥၭလဂၩဂၩနီၪ မိဘၪ ဆၧဒုၭထၪ့ထီၫဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ၦကွ့ၭလံၬဒဲၦဖၫရစံၫ,ၦအၪ့လီၫဆၧၥံၪဧ့,နၥံၪဘၪ ဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪကၭဘံၭထၬမူၭခိၪ အဘၩ့အမုး လၧၦၡၩအမ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩ နၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫ နၥံၪနုၬအ့ၬ. ၦလၧအမိလ့ၩနုၬ ဝ့ၫလဖၪနီၪနၥံၪဖ့ၪလၫ့အနုၬအ့ၬ.",
			"14": "<sup>14</sup> ဎၦကွ့ၭလံၬဒဲၦဖၫရစံၫ,ၦအၪ့လီၫဆၧၥံၪဧ့,နၥံၪဘၪ ဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪအၪ့ယုလၩ့ခွံၬၦမုၪ မဲၫအဂံၪ့တၭ, ဘဲၫဆၧမိဖျီၪထၪ့ဝ့ၫလၧနၥံၪအဂးနီၪ နၥံၪဘၩဆိၪဖၪဆၧထီၫထီၫလ့ၬလီၫ. မၩအၥၭဘဲၫနီၪ တၭ,လၧဆၧနီၪလမံၩ့အကၠီၩ့ နၥံၪမိဘၪဆၧစ့ၩရၫ့နၭ ထၪ့လခီၫဒံၭလီၫ.ၭ",
			"15": "<sup>15</sup> ၦကွ့ၭလံၬဒဲၦဖၫရစံၫ,ၦအၪ့လီၫဆၧၥံၪဧ့, နၥံၪဘၪ ဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩဘဲၫနၥံၪမိဒုၭအၪထၪ့န ၥံၪအထံၩအဖျဲနးဂၩအၥိၭတၭ, နၥံၪလ့ၩဎဲၪ့ဎဲၪ့ဝၩ့ဝၩ့ လၧထံၫထံၫလၧခီၫ့ခီၫ့လီၫ. ထီးအနုၬဝ့ၫတၭ, နၥံၪမၩ ဝ့ၫလၧၦလရၬဖိၪနၭနဲၪ့နၥံၪနံၫစၩလီၫ.",
			"16": "<sup>16</sup> ၦမ့ၬဘျီၪလၧအဒုၭနဲၪဖၧၩ့ၥၭၥံၪဧ့, နၥံၪဘၪဆၧအ ၡၪ့လီၫ.နၥံၪစံၭ,ထီးဒၪၦလၧ အဆိၪလၩ့အၥၭလၧ ဆၧလုဂံၪ့အမ့ၬယၫ လဂၩဂၩနီၪ, မွဲဆၧပျီၩပျီၩလီၫ. အ့ၪမွဲထီးဒၪၦလၧအဆိၪလၩ့အၥၭ လၧထီၫ့အီၪလၧ ဆၧလုဂံၪ့ဖၧၩ့အမ့ၬယၫလဂၩနီၪ, မွဲအဘၪမၩဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ၦအဂီၩ့ဒဲၦအမ့ၬဘျီၪၥံၪဧ့, အဂဲးဘဲၫယီၩမွဲအဒိၪ လမံၩ့မံၩ့လဲၪ. မွဲထီၫ့,မွဲဆၧလုဂံၪ့လၧအမၩဆံၫ့ဎံၪ",
			"18": "<sup>18</sup> ထၪ့ထီၫ့နီၪလဲၪ.- ဒဲထီးဒၪၦလၧအဆိၪလၩ့အၥၭလၧ ဆၧလုအလးအမ့ၬယၫလဂၩဂၩနီၪမွဲဆၧပျီၩပျီၩလီၫ. အ့ၪမွဲထီးဒၪၦလၧအဆိၪလၩ့အၥၭ လၧဆၧမၩဘိၪ့လၧ ဆၧလုလးအဖၫ့ခိၪအမ့ၬယၫလဂၩဂၩနီၪ, မွဲအဘၪမၩ",
			"19": "<sup>19</sup> ဝ့ၫလီၫ.- ၦအဂီၩ့ဒဲၦအမ့ၬဘျီၪၥံၪဧ့,အဂဲးဘဲၫယီၩ,မွဲ အဒိၪလမံၩ့မံၩ့လဲၪ.မွဲဆၧမၩဘိၪ့လၧဆၧလုလး အဖၫ့ခိၪနီၪ, မွဲဆၧလုလးလၧအမၩဆံၫ့ဎံၪထၪ့ဆၧမၩ ဘိၪ့နီၪလဲၪ.",
			"20": "<sup>20</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအဆိၪလၩ့အၥၭလၧ ဆၧလုလးအမ့ၬယၫနီၪ, မွဲအဆိၪလၩ့အၥၭ လၧအဝ့ၫ နီၪ ဒဲလၧကယဲဆၧအီၪ လၧအလီၩ့အမ့ၬယၫလီၫ.",
			"21": "<sup>21</sup> ၦလၧအဆိၪလၩ့အၥၭ လၧဆၧလုဂံၪ့အမ့ၬယၫနီၪ, မွဲ အဆိၪလၩ့အၥၭလၧအဝ့ၫနီၪ ဒဲလၧဆၧအီၪဝ့ၫလၧ",
			"22": "<sup>22</sup> အဖၧၩ့အမ့ၬယၫလီၫ.- ၦလၧအဆိၪလၩ့အၥၭလၧမူၭ ခိၪအမ့ၬယၫနီၪ မွဲအဆိၪလၩ့အၥၭလၧယွၩအလး ဆီၩ့ဆီ,ဒဲလၧဆၧလၧအဆၧၫ့နၩ့ဝ့ၫလၧ အလီၩ့လဂၩ အမ့ၬယၫလီၫ.",
			"23": "<sup>23</sup> ၦကွ့ၭလံၬဒဲၦဖၫရစံၫ, ၦအၪ့လီၫဆၧၥံၪဧ့, နၥံၪဘၪ ဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪမၩဘိၪ့ဖီၫဘိၭ, ဒဲစမူၭ,ဒဲစံၩယၩၥံၪဆံၫပိၩ့နီၪလပိၩ့လီၫ. အ့ၪမွဲဆၧၥီၪ့ ဆၧၥၫ့လၧ အဎၧၫ့နဲၪ့အနီၪ, ဆၧစ့ၩရၫ့,ဆၧယၫ့ၥၭ ဒဲဆၧနဲၩနီၪ,နၥံၪအီၪက့ၪလၩ့ထးဝ့ၫလီၫ. အနီၪလဖၪ နၥံၪကြၨၭမၩတၭ, အယီၩလဖၪကြၨၭနၥံၪအီၪက့ၪ",
			"24": "<sup>24</sup> လၩ့ထးဝ့ၫဆ့အ့ၬ.- ၦမ့ၬဘျီၪလၧအဒုၭနဲၪဖၧၩ့ၥၭၥံၪ ဧ့,နၥံၪဆၩ့ခွံၬခံၫနိၬနးဘီၩ့တၭ, အၪ့ယုလၩ့ကလအူၭ နးဒုၩလီၫ.",
			"25": "<sup>25</sup> ၦကွ့ၭလံၬဒဲၦဖၫရစံၫၦအၪ့လီၫဆၧၥံၪဧ့, နၥံၪဘၪ ဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪၥူၫဝၭဆံၫ့ လိၫ့အ ချိၫ့ဒဲတဲၪလဲၪအချိၫ့လီၫ. အ့ၪမွဲအဖၧၩ့နီၪဎွ့ၩဝ့ၫလၧ ဆၧအၪ့ဘျံၭအၪ့ဘျၪ ဒဲဆၧလတီၩလလီၩ့ဘၪလီၫ.",
			"26": "<sup>26</sup> ၦဖၫရစံၫ လၧအမ့ၬဘျီၪၥံၪဧ့, ၥူၫဝၭဆံၫ့ဆိၫဒၪခလူၬ လိၫ့ဒဲတဲၪလဲၪအဖၧၩ့လခီၫဘီၪ, တၭအချိၫ့နီၪမိဆံၫ့ဝ့ၫ ဘဲၫနီၪၥိၭဆ့လီၫ.",
			"27": "<sup>27</sup> ၦကွ့ၭလံၬဒဲၦဖၫရစံၫ, ၦအၪ့လီၫဆၧၥံၪဧ့, နၥံၪဘၪ ဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪလၩ့ဂၬ လၧဆၧၥွၪ ခိၪဖၧၩ့လၧအဂုၪဘွၩအၥၭအၥိၭနီၪလီၫ. အချိၫ့ လခီၫဖျီၪဝ့ၫလၧအဎံၫအလၩတကၨ. အ့ၪမွဲအဖၧၩ့ နီၪဎွ့ၩဝ့ၫလၧၦၥံၫအဎွံၪအနၧၩ့, ဒဲကယဲဆၧစံၪစၪဘၪ",
			"28": "<sup>28</sup> ၥၭလိၪၥၭလံၭထီးအလူၬလီၫ.- ဘဲၫနီၪအၥိၭနၥံၪဝ့ၫဒၪ ယီၩ,နၥံၪမၩတီၩနၥံၪအၥၭလၧခီၫ့ လၧၦၡၩအမ့ၬယၫ လီၫ.အ့ၪမွဲလၧယၫလခီၫနီၪ, နၥံၪဎွ့ၩလၧဆၧအၪ့လီၫ ဆၧအၪ့ဝံၩ, ဒဲဆၧလတီၩလလီၩ့ဘၪလီၫ.",
			"29": "<sup>29</sup> ၦကွ့ၭလံၬဒဲၦဖၫရစံၫ, ၦအၪ့လီၫဆၧၥံၪဧ့,နၥံၪဘၪ ဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪမၩထၪ့မီၪလဖၪအ ၥွၪခိၪဖၧၩ့နီၪ, နၥံၪကယၧၩ့ၦအတီၩအလီၩ့ လဖၪအ",
			"30": "<sup>30</sup> ၥွၪခိၪနီၪ,- နၥံၪစံၭနၥံၪဝ့ၫ,လၧပမိပဖါအဆိၩနီၪပအ့ၪ အီၪဝ့ၫတၭ, ၦမၩဎုၬဆၧလၧအဝ့ၫၥံၪအၥိၭလၧမီၪအ",
			"31": "<sup>31</sup> ၥွံၪဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,နၥံၪထိးလၩ့ဒၪနၥံၪ အၥၭလၧနၥံၪမွဲၦမၩၥံၫမီၪလဖၪ အဖိၪအလံၩလီၫ.",
			"32": "<sup>32</sup> နၥံၪဝ့ၫဒၪယီၩမၩဎွ့ၩထၪ့နၥံၪအဖါလဖၪ အဆၧတိၪ့ နီၪဆံၭ.",
			"33": "<sup>33</sup> ဂူၥံၪၬ ဂူအၧၩ့အဆၨၩအဆၬၥံၪဧ့ၬ နၥံၪမိစဲၪ့ဖီၩ့ ဖျ့ၭဆၧစ့ၩရၫ့ဘၪဆဲၫ့ လၧလရၬနီၪမိၥ့ၪဘဲၫၥ့ၪလဲၪ.",
			"34": "<sup>34</sup> မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ,ယအၪ့မၧၫ့လၩ့မီၪ လ ဖၪဒဲၦကိၪ့ဆၧၥ့ၪ, ဒဲၦကွ့ၭလံၬလဖၪ လၧနၥံၪအအီၪ လီၫ.လနၩ့နၩ့နၥံၪ မိမၩၥံၫခွံၬတၭ,လနၩ့နၩ့နၥံၪ မိဖျၩထၪ့ခွံၬလၧထုၪ့စူၪယၫအလီၩ့တၭ, လနၩ့နၩ့နၥံၪ မိဒိၪမိထး လၧၥရိၬဖၧၩ့တၭ, နၥံၪမိမၩအၧၩ့မၩနၭ အဝ့ၫၥံၪ လၧလဒိၩ့ဘၪလဒိၩ့, လဒိၩ့ဘၪလဒိၩ့",
			"35": "<sup>35</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, လၧၦအတီၩအလီၩ့ စအၫ ဘလၭအၥွံၪ, ထီၩ့လၩ့လၧ စဘၫရကဲအၫ အဖိၪခွၫ စဇ့ၭခရဲအၫအၥွံၪလၧနၥံၪမၩၥံၫဝ့ၫ လၧဆၧလုအလး, ဒဲလၧဆၧလုအဒူၭဖၧၩ့အဘိၩ့ဆၧၩ့နီၪ, ကယဲၦအ တီၩအလီၩ့အၥွံၪအထံၫနီၪ လူၫလၩ့အၥၭလၧဂၪ့ခိၪ",
			"36": "<sup>36</sup> ချိၫ့ထီးအလူၬနီၪမိဘၪ နၥံၪအလီၩ့လီၫ.- ယလီၩဘၪ နၥံၪတီၩတီၩယီၩ, ကယဲဆၧလဖၪနီၪမိဘၪၦလဆိၩ ယီၩထီးအလူၬလီၫ.",
			"37": "<sup>37</sup> ယရုစလံၫ့ဧ့ၬ ယရုစလံၫ့ဧ့ၬနဝ့ၫဒၪယီၩနမၩၥံၫ မီၪလဖၪ ဒဲၦလၧဆၧအၪ့မၧၫ့လၩ့ဝ့ၫလၧနအီၪလဖၪနီၪ နခွံၬလၧလိးလီၫ. ဘဲၫဆၫ့မိၡါဒုၭအီၪကီၪ့အဖိၪလၧ အဒံၭဖၫ့လၬအၥိၭနီၪ, မိဒုၭအီၪကီၪ့ဘၪယၥၭလၧန ဖိၪၥံၪအဘျၩ့အၪမၬကၨ. အ့ၪမွဲနဝ့ၫဒၪယီၩနၥၭအီၪ",
			"38": "<sup>38</sup> အ့ၬ.- ယိခွါ,ဆၧစဲၪ့ဒၪနၥံၪအဂံၪ့တၭ, အီၪယူဝ့ၫ",
			"39": "<sup>39</sup> လီၫ.- အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪယီၩဘိၩ့နၥံၪ လချႃၭစံၭဒံၭဘၪ, ၦလၧအဂဲၫလၧကဆါအမံၩ့လဂၩ နီၪ,ဘၪဆၧဆိၪဂ့ၩဝ့ၫတၭ, နၥံၪလမိဒၪလၧၩ့ဘၪ ယၧၩ လီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ယ့ၫရှူၬလ့ၩထၪ့လၧခီၫ့တၭ,စဲၪ့ထၪ့ခွံၬဝ့ၫလၧဆၧ လုအဂံၪ့ဖၧၩ့နီၪ, အထံၩအဖျဲၥံၪဂဲၫလၧအအီၪဘဲၫၥိၭ အမိဒုၭနဲၪအဝ့ၫလၧဆၧလုဂံၪ့အဖျိၪ့လဖၪလီၫ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ဆၧလဖၪ ယီၩနၥံၪဒၪဘၪထီးအလူၬမွဲအ့ၬဧၪ. ယလီၩဘၪနၥံၪ တီၩတီၩယီၩ, လိးလၧအဒၩ့ဒိၭလိၬအၥၭလဖၪယီၩ ဆၧလမၩလၩ့ဎီးဘၪနီၪမိအီၪလၩ့ထးဘၪနးဖျိၪ့အ့ၬ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪဆၧၫ့နၩ့ လၧခိၪလီၩ့အလဲအိၫ့အလီၩ့အ ဘိၩ့ဘၭတၭ, အထံၩအဖျဲၥံၪဂဲၫလၧအအီၪ လၧဆၧက ဒုၩအလးစံၭဝ့ၫဒၪ, ဆၧနီၪလဖၪဆံၭယံၬခိၬ မိမၩအ ၥၭလဲၪး နဂဲၫလၩ့နီၪဒဲဂၪ့ခိၪအထုၬ ဆၧမၩနဲၪ့နီၪ, မွဲအမိမၩအၥၭလၧဆၧနီၪလမံၩ့လဲၪ, လီၩဘၪပၧၩ",
			"4": "<sup>4</sup> ဆံၭ.-ယ့ၫရှူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ဘဲၫၥိၭၦ ထီးအၪ့လီၫန့နၥံၪနးဂၩလဂ့ၩတၭ, ထီးလၩ့နၥံၪအ",
			"5": "<sup>5</sup> ၥၭဆံၭ.- အဂဲးဘဲၫယီၩ ၦအၪဂၩမိဂဲၫလၧယမံၩ့ တၭ,စံၭဝ့ၫ,ယမွဲဎရံၬနီၪ မိအၪ့လီၫန့ၦအၪဂၩလီၫ.",
			"6": "<sup>6</sup> နၥံၪမိနါဂၧၫ့ဘၪ ဆၧဒုၭၥုၭဒုၭၥ့ၪအဂဲး, ဒဲဆၧဒုၭၥုၭ ဒုၭၥ့ၪအပရၧၫ့လီၫ. ထီးလၩ့နၥံၪအၥၭဆံၭ. ထီးၥုၪ့ခိ ၥၭဝီၩလဂ့ၩ, အဂဲးဘဲၫယီၩဆၧလဖၪနီၪ ဘၪမၩအၥၭ",
			"7": "<sup>7</sup> ထီးအလူၬလီၫ. မွဲလါနၫ့ဘိၩ,အထုၬအီၪဒံၭအ့ၬ.- အ ဂဲးဘဲၫယီၩ ၦၡၩလဆၨၩမိထၫ့ဒုၪဒၩ ၦၡၩလဆၨၩဒၪ တၭ,ဘၩ့မုးမိထၫ့ဒုၪဒၩလဘၩ့မုးဒၪလီၫ. ဆၧအီၪဝံ အီၪဆံၩ့,ဒဲဆၧဆၫဆီၪ့, ၥံၫဆီၪ့မိအီၪထၪ့တၭ, ဒဲဂၪ့ခိၪ ဝၭၡိၩ့ၡိၬမိအီၪထၪ့ဝ့ၫလၧအံၩလစီၪ့ လၧအိၩလစီၪ့",
			"8": "<sup>8</sup> လီၫ.- ဆၧနီၪလဖၪထီးအလူၬမွဲဆၧၡၪ့ဆၧနၭအခၪ့",
			"9": "<sup>9</sup> ထံၭလီၫ.- ထီးနီၪလဖၧၫ့ၦမိဖ့ၪလၫ့နၥံၪလၧဆၧၡၪ့ ဆၧနၭအဖၧၩ့တၭ,မိမၩၥံၫခွံၬနၥံၪလီၫ. အ့ၪမွဲၦအ ဆၨၩထီးအလူၬနီၪ, မိၥၭဂဲၫ့နၥံၪလၧယမံၩ့အကၠီၩ့",
			"10": "<sup>10</sup> လီၫ.- ထီးနီၪလဖၧၫ့ၦၡၩအၥၭမိဂၭဂီၩ့,မိကဒံၩက ဒၩဝ့ၫအၪဂၩတၭ, မိဖ့ၪလၫ့ခွံၬလိၬအၥၭဒဲမိၥၭဂဲၫ့လိၬ",
			"11": "<sup>11</sup> အၥၭလီၫ.- မီၪအဘျၪမိအီၪထၪ့ဝ့ၫအၪဂၩတၭ, မိ",
			"12": "<sup>12</sup> အၪ့လီၫန့ၦၡၩအၪဂၩလီၫ.- မွဲဆၧလတီၩလလီၩ့ ဘၪမိအၪထၪ့အကၠီၩ့တၭ, ၦၡၩအၪဂၩအဆၧအဲၪဆၧ",
			"13": "<sup>13</sup> ကွံၩမိၡၩလၩ့ဝ့ၫလီၫ.- အ့ၪမွဲၦလၧအဂုးအခၧၫ့ ဝ့ၫထီးအထုၬနီၪ မိထီၩ့ဝ့ၫလၧဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"14": "<sup>14</sup> လီၫ.- ဘၩ့မုးအဆၧၥၭထိၬအပရၧၫ့ယီၩ, မိဘၪဆၧ လီၩလၩ့လၬလၩ့ဝ့ၫလၧဂၪ့ခိၪချိၫ့ထၧၫ့ဖျိၪ့ယၫလၧ ဆၧထိးအၥၭလၧ ၦၡၩကိၭဆၨၩဒ့ၭအဂးတၭ, ထီးနီၪ လဖၧၫ့ဆၧအထုၬ မိအီၪထၪ့ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးနၥံၪဒၪဘၪဆၧစံၪစၪဘၪ ဆဲၫ့လၧဆၧမၩယူ လၧမီၪစဒၫ့နအ့လၭချဲၩ့ဝ့ၫလၧအ ဂဲးနီၪဆၧၫ့ထုၪ့လၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့တၭ, (ၦ",
			"16": "<sup>16</sup> လၧအဖီဘၪနီၪ,မွဲအနၪၥ့ၪဆံၭ.)- ၦအီၪဝ့ၫလၧခးယုဒၫ",
			"17": "<sup>17</sup> လဖၪနီၪ,မွဲအစဲၪ့ထၪ့လၧခိၪလီၩ့ထိၩ့ချိၬဆံၭ.- ၦလၧ အအီၪလၧဂံၪ့ခိၪနီၪ, ဘဲၫၥိၭအမိမၩန့ဘၪဆၧလမံၩ့",
			"18": "<sup>18</sup> မံၩ့လၧအဂံၪ့ဖၧၩ့နီၪ,မွဲအထီးစဲၪ့လၩ့လဂ့ၩ.- ၦအီၪ ဝ့ၫလၧဆံၬဖၧၩ့ဎုၭဖၧၩ့ ဘဲၫၥိၭအမိမၩန့ အကီၩ့အၥိၭ တၭ,မွဲအထီးထဲၩ့ထဲၩ့လၧအလးခဲၫ့လဂ့ၩ.",
			"19": "<sup>19</sup> ၦလၧအဒၧၩ့,ဒဲၦလၧအဒုၭအၪ့နူ ဆၧလၧမုနံၩလဖၪ",
			"20": "<sup>20</sup> နီၪဘၪအၡၪ့လီၫ.- လၧဆၧဂီးအထီမွဲဂ့ၩ,မးၥံၫအ နံၩမွဲဂ့ၩ,ဘဲၫၥိၭနၥံၪထီးစဲၪ့တလဲးခွံၬဘၪလဂ့ၩတၭ,",
			"21": "<sup>21</sup> အၪ့ကံၩ့ဘၩဆိၪဖၪဆၧဆံၭ.- အဂဲးဘဲၫယီၩထီးနီၪ လဖၧၫ့ဆၧၡၪ့ဆၧနၭဖၭဒိၪမိအီၪထၪ့ဝ့ၫတၭ, ဒိၪန့ၫ နီၪလၧဂၪ့ခိၪကဲၪထၪ့ၥၫ့ ခီးဘိၩ့နဲၪ့ယီၩ အီၪနးဆိၭ အ့ၬ.အယီၩလၧယၫလခီၫနီၪ မိအီၪထၪ့လၧၩ့ဆ့အ့ၬ.",
			"22": "<sup>22</sup> ဆၧအ့ၪလမၩၡၩလၩ့ဘၪ မုနံၩလဖၪနီၪတၭ, ဆၧဖံၭ ဆၧယၪထီၩ့လၧဆၧထိးထဲၩ့တၩ့ဝ့ၫၥ့ၪနးဂၩအ့ၬ. မွဲဆၧမိမၩလၩ့ၡၩမုနံၩလဖၪနီၪလၧၦဘၪဆၧရွံန့",
			"23": "<sup>23</sup> ဝ့ၫလဖၪအဂးလီၫ.- ထီးနီၪလဖၧၫ့ ၦလဂၩဂၩအ့ၪ စံၭနၥံၪ,ယိခွါ, ဎရံၬအီၪထီးယီၩမွဲဂ့ၩ, ထီးအိၩမွဲဂ့ၩနီၪ,",
			"24": "<sup>24</sup> ထီးနဲၩလဂ့ၩ.- အဂဲးဘဲၫယီၩဎရံၬအဘျၪလဖၪဒဲ မီၪအဘျၪလဖၪမိအီၪထၪ့ဝ့ၫတၭ,မိဒုၭနဲၪဆၧ မၩနဲၪ့ လၩ့လၭ, ဒဲဆၧလၩ့လၭဖၭဒိၪလဖၪ ထီးအ့ၪၥ့ၪတၭ, မွဲအမိအၪ့လီၫန့ၦလၧအဘၪဆၧရွံန့ဝ့ၫလဖၪ နီၪလီၫ. ယိခွါ, ယလီၩဘၪဝဲၩနၥံၪလီၫ.",
			"25": "<sup>25</sup> မၩအၥၭဘဲၫနီၪ တၭ,ၦအ့ၪစံၭနၥံၪ,ယိခွါ, အဝ့ၫဒၪအီၪဝ့ၫလၧမံၩ့လၬ ကျၩနီၪတၭ, လ့ၩဆီးလဂ့ၩ. ယိခွါ,အဝ့ၫဒၪအီၪဝ့ၫ",
			"27": "<sup>27</sup> လၧဒူၭကဒုၩလဖၪအဖၧၩ့နီၪ, ထီးနဲၩလဂ့ၩ.- အဂဲး ဘဲၫယီၩ ဘဲၫလၫ့ဝဲအဒံၭဂဲၫထၪ့လၧမုထၪ့တၭ, ဖၩ့ ထၪ့ဖိးလၧမုနုၬအၥိၭနီၪ ၦၡၩအဖိၪခွၫမိဂဲၫလၩ့ဝ့ၫ",
			"28": "<sup>28</sup> ဘဲၫနီၪအၥိၭလီၫ.- အဂဲးဘဲၫယီၩထီးဒၪဆၧစွၪအီၪ ဝ့ၫလစီၪ့စီၪ့နီၪ, လၫ့ကထၬလဖၪမိအီၪကိၩ့အီၪကီၪ့ ထီးနီၪလီၫ.",
			"29": "<sup>29</sup> မုနံၩလဖၪနီၪ အဆၧၡၪ့ဆၧနၭအလးခဲၫ့တၭ, မုမ့ၬမိခံၭလၩ့ဝ့ၫချဲၫ့မၬတၭ,လၩလဖ့ၪလၫ့ဘၪအဆၧ ဖၩ့နီၪ,ၡၪၥံၪမိလၩ့ထ့ၬခွံၬလၧမူၭခိၪတၭ, မူၭခိၪအစီၩ့",
			"30": "<sup>30</sup> အမၩ့လဖၪမိဝၭဝ့ၫဒၪလီၫ.- ထီးနီၪလဖၧၫ့ၦၡၩအ ဖိၪခွၫအဆၧမၩနဲၪ့လၩ့လၭမိအီၪဖျီၪထၪ့လၧမူၭခိၪ လီၫ.အနီၪတၭ,ဂၪ့ခိၪဖိၪၥံၪ ကိၭဆၨၩဒ့ၭနီၪ မိဂၪ့မိ ယၧၩ့ဆၧတၭ, မိဒၪဘၪၦၡၩအဖိၪခွၫ ဂဲၫလၩ့လၧမူၭ ခိၪလၧဆၧအုၪ့အလီၩ့, အီၪလၧအစီၩ့အမၩ့လၧအ",
			"31": "<sup>31</sup> ကယးဒိၪအကဖးဒိၪလီၫ.- အဝ့ၫဒၪနီၪမိအၪ့ မၧၫ့လၩ့ အၥီၫ့လဖၪအီၪလၧအခွ့ၩၥီၫဖၭဒိၪတၭ, အဝ့ၫၥံၪမိ ဒုၭအီၪကိၩ့အီၪကီၪ့ ၦလၧအဘၪဆၧရွံန့ဝ့ၫလဖၪ လၧအအီၪဝ့ၫလၧလံၩလံဖျီၩ့ လၧမူၭထံၭလခီၫဖိးလၧ မူၭထံၭလခီၫဒၪနီၪလီၫ.",
			"32": "<sup>32</sup> အယီၩတၭ,မၩလိၪအဒီၩ့အထ့ၬလၧချိၪ့ဒိၩ့အ ထံၭဆံၭ. ထီးအထဲၩ့ဘၪ့ထၪ့ ဒဲဒိၭထၪ့ဝ့ၫတၭ, နၥံၪ",
			"33": "<sup>33</sup> ၥ့ၪယၫလၧဆၧခိအထီဘူၭထၪ့ဝ့ၫလီၫ.- ဘဲၫနီၪအၥိၭ ထီးနၥံၪဒၪဘၪဆၧယီၩလဖၪ ထီးအလူၬတၭ, ၥ့ၪယၫ လၧဆၧအီၪဘူၭထၪ့လၧတရၫ့အခၪ့ထံၭဆံၭ.",
			"34": "<sup>34</sup> ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, ၦလဆၨၩယီၩလချႃၭ ဖီၩ့ခွံၬဒံၭဘၪတၭ, ဆၧနီၪလဖၪမိမၩအၥၭထီးအလူၬ",
			"35": "<sup>35</sup> လီၫ.- မူၭခိၪဒဲဂၪ့ခိၪမိဒံၩခွံၬဒံၩဖျိၭဝ့ၫလီၫ. အ့ၪမွဲ ယဆၧချဲၩ့လဖၪဒံၩခွံၬဝ့ၫအ့ၬ.",
			"36": "<sup>36</sup> မွဲလါနၫ့ဘိၩလၧမုနံၩဒဲနၩရံၩနီၪ, ၦၥ့ၪယၫနးဂၩ အ့ၬ.မူၭခိၪအၥီၫ့ၥံၪၥ့ၪယၫဝ့ၫဆ့အ့ၬ. ၥ့ၪယၫန့ၫယဖါ လၧမူၭခိၪလဂၩဎးလီၫ.",
			"37": "<sup>37</sup> ဘဲၫစနိအၫအမုနံၩလဖၪအၥိၭနီၪ ၦၡၩအဖိၪခွၫအ့ၪ",
			"38": "<sup>38</sup> ဂဲၫလၩ့ခိၬတၭ,ဆၧမိမၩအၥၭဘဲၫနီၪအၥိၭလီၫ.- အဂဲး ဘဲၫယီၩဘဲၫမုနံၩမုနၩလၧထံၫလချႃၭထၪ့ မၩလၩ့ဘံၭ ခွံၬဒံၭဘၪဆၧလဖၪအၥိၭနီၪ, ၦအၪ့ဆၧအီၩဆၧ,အီၪ ဎုၬလိၬအၥၭ, ဒုၭအီၪဎုၬလိၬအၥၭ ထီၩ့လၩ့လၧမုလနံၩ လၧစနိအၫလ့ၩနုၬလၧတလၫဖၭဒိၪအဖၧၩ့တၭ,",
			"39": "<sup>39</sup> လၥ့ၪယၫဘၪဝ့ၫ ထီးထံၫမၩလၩ့ဘံၭဆၧဂဲၫထၪ့ဝ့ၫနီၪ မၩဂၭဂီၩ့ခွံၬဆၧထီးအလူၬအၥိၭနီၪတၭး ၦၡၩအဖိၪ ခွၫအဆၧဂဲၫလၩ့မိမၩ အၥၭဘဲၫနီၪအၥိၭလီၫ.-",
			"40": "<sup>40</sup> ထီးနီၪ လဖၧၫ့ၦခွၫအီၪဝ့ၫလၧဆံၬဖၧၩ့နံၫဂၩနီၪ, ဆၧမိမၩန့ဝ့ၫနးဂၩတၭ,အဝ့ၫလဂၩမိအီၪလၩ့ထးလီၫ.-",
			"41": "<sup>41</sup> ၦမုၪဂူၬ ဆုၪ့ဂူၬနံၫဂၩနီၪဆၧမိမၩန့ဝ့ၫနးဂၩတၭ, အဝ့ၫလဂၩ မိအီၪလၩ့ထးဝ့ၫလီၫ.",
			"42": "<sup>42</sup> မၩအၥၭဘဲၫနီၪတၭ, အီၪခိၭဆၧဆံၭ.အဂဲးဘဲၫ ယီၩနၥံၪအကဆါမိဂဲၫဝ့ၫနၩရံၩ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ",
			"43": "<sup>43</sup> နီၪ,နၥံၪၥ့ၪယၫအ့ၬ.- မွဲလါနၫ့ဘိၩၥ့ၪယၫအယီၩဆံၭ, ဂံၪ့ကဆါအ့ၪၥ့ၪယၫ လၧဆၧအၪ့ဂူၪမိဂဲၫလၧၦခိၭဆၧ အဆၧၫ့အထီနီၫလဲၪနီၫလဲၪနီၪ, မိအီၪခိၭဝ့ၫတၭ,မိဖ့ၪ",
			"44": "<sup>44</sup> လၫ့ဆၧဘုၪ့ဖိးအဂံၪ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, အီၪ တဲၩ့ဝဲၩ့နၥံၪအၥၭဆံၭ. အဂဲးဘဲၫယီၩ,နၩရံၩလၧနၥံၪ လဆီၫ့မီၪ့ဘၪနီၪ, ၦၡၩအဖိၪခွၫမိဂဲၫဝ့ၫလီၫ.",
			"45": "<sup>45</sup> အနီၪတၭ,ဆၧအဎီးအၡၩ လၧအလူတီၩဒဲအကိၪ့ ဆၧၥ့ၪလၧအကဆါမိအီၪက့ၪဝ့ၫလၧအဂံၪ့ဖိၪအခိၪဘဲၫၥိၭအမိဒုၭအၪ့ဒုၭအီၩဆၧလၧအဆၧၫ့အထီဘၪနီၪ မွဲပလၫလဂၩလဲၪ.",
			"46": "<sup>46</sup> အဎီးအၡၩလၧအကဆါဂဲၫဒၪန့ဝ့ၫ လၧအမၩဝ့ၫ",
			"47": "<sup>47</sup> ဘဲၫနီၪၥိၭလဂၩအီၪမုၬဝ့ၫဒၪလီၫ.- ယလီၩဘၪနၥံၪတီၩ တီၩယီၩအကဆါမိအီၪက့ၪထၪ့အဝ့ၫ လၧအဆၧဖိၪ",
			"48": "<sup>48</sup> ဆၧလံၩထီးအလူၬအခိၪလီၫ.- အ့ၪမွဲအဎီးအၡၩ လၧအအၧၩ့နီၪ, အ့ၪစံၭဝ့ၫလၧအၥၭ,ယကဆါမိအီၪ",
			"49": "<sup>49</sup> ယံၬအီၪနး,- ဒိၪဝ့ၫထးဝ့ၫအဎီးအၡၩခီၫဎီးအၡၩလ ဖၪနီၪ,ဒဲအၪ့လၨၪအီၩလၨၪဆၧလၧ ၦအီၩလၨၪဆၧ",
			"50": "<sup>50</sup> အၥိၭတၭ,- မုနံၩမုနၩလၧအလယိလါဘၪအဖၧၩ့ၥၭ တၭ,နၩရံၩလၧအလၥ့ၪယၫဘၪဝ့ၫနီၪ, ဆၧလၧအ",
			"51": "<sup>51</sup> ဎီးအၡၩအကဆါမိဂဲၫထဲၩ့တၭ,- မိဒၪ့ထ့ၬခွံၬဝ့ၫနံၫ ကုၭတၭ,အီၪက့ၪအလးလၧၦအၪ့လီၫဆၧအၥိၭလီၫ. ဆၧဘၪဂၪ့ဆၧဘၪယၧၩ့ဆၧခၪအဲၪ့ထံးမိအီၪဝ့ၫထီး နီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ မူၭခိၪအဘၩ့အမုး မိဘၪဆၧဒီၩ့လၩ့ ဝ့ၫဘဲၫၦမုၪနၩ့ဆံၫဂၩလၧအမၩန့အမ့ၪဒိၩ့ၥံၪတၭ, လ့ၩထၪ့ဝ့ၫဘဲၫအမိအၪ့ဂၬဘၪ တလၭမူၭအခွၫအ",
			"2": "<sup>2</sup> ၥိၭနီၪလီၫ.- ၦကိၪ့ဘၪကိၪ့ၥ့ၪအီၪဝ့ၫယဲဂၩတၭးအ",
			"3": "<sup>3</sup> ဂီၩ့အီၪဝ့ၫယဲဂၩလီၫ.- ၦအဂီၩ့လဖၪနီၪမၩန့အမ့ၪဒိၩ့",
			"4": "<sup>4</sup> တၭ,မၩန့ၥိၪလၧအၥိၭအ့ၬ.- အ့ၪမွဲၦကိၪ့ၥ့ၪကိၪ့ဘၪ လဖၪနီၪ, မၩန့ၥိၪလၧကီၩ့ဖၧၩ့ လၧအမ့ၪဒိၩ့အၥိၭ",
			"5": "<sup>5</sup> လီၫ.- တလၭမူၭအခွၫ မၩယံၬမၩနးအၥၭအဘိၩ့ဘၭ နီၪ,အဝ့ၫၥံၪ မံၫခံၫ့ဝ့ၫတၭ, မံၫမၪဝ့ၫဒၪကိၭဂၩဒ့ၭ",
			"6": "<sup>6</sup> လီၫ.- လၧဖိၭဖၫ့မုနီၪဆၧကိၭၡၭထၪ့ဝ့ၫ,ယိခွါ,တ လၭမူၭအခွၫဂဲၫထၪ့ဖီၩၬ လ့ၩထၪ့နၥံၪဝ့ၫအၪ့ဂၬအ",
			"7": "<sup>7</sup> ဝ့ၫဆံၭ.- ထီးနီၪလဖၧၫ့ၦမုၪနၩ့လဖၪနီၪ နၪ့ထၪ့အၥၭ",
			"8": "<sup>8</sup> ထီးအလူၬတၭ,မၩဂ့ၩထၪ့ထဲၩ့အမ့ၪဒိၩ့လီၫ.- အဂီၩ့ လဖၪစံၭၦလၧအကိၪ့ဘၪကိၪ့ၥ့ၪလဖၪနီၪ, ဖ့ၪလၫ့ပၧၩ လၧနၥံၪအၥိၪဆံၭ. အဂဲးဘဲၫယီၩပမ့ၪဒိၩ့လၩ့ဖံၬ",
			"9": "<sup>9</sup> ခွံၬဝ့ၫဒၪလီၫ.- ၦလၧအကိၪ့ဘၪကိၪ့ၥ့ၪလဖၪ ချဲၩ့ဆၧၫ့ ဆၧတၭ, စံၭဝ့ၫဒၪ,မွဲအ့ၬ,လၧပဂးဒဲလၧနၥံၪအဂးယီၩ ဘၪလဘၪၥိၪလလၧၫ့ဘၪတၭ, လ့ၩဒၪခလူၬလၧၦ အၪ့ဆၫဆၧအအီၪတၭ, ဎွ့ၩဆၧလၧနၥံၪအဂးဒၪနၥံၪ",
			"10": "<sup>10</sup> ဝ့ၫဆံၭ.- အဝ့ၫၥံၪလ့ၩဎွ့ၩဆၧ,အဘိၩ့အဘၭနီၪ,တ လၭမူၭအခွၫဂဲၫဝ့ၫဒၪတၭ, ၦလၧအတဲၩ့ဝဲၩအၥၭနီၪ လ့ၩနုၬဝ့ၫလၧမူၭဖၧၩ့ လၧအၥိၭတၭ, ဆၧကၭဘံၭ",
			"11": "<sup>11</sup> ထၬတရၫ့လီၫ.- လၧခဲၫ့ထဲၩ့တၭ, ၦမုၪနၩ့အီၪလၩ့ ထးဝ့ၫလဖၪနီၪဂဲၫထဲၩ့ဝ့ၫစံၭဝ့ၫဒၪ,ကဆါဧ့,ကဆါဧ့,",
			"12": "<sup>12</sup> ဝဲထၪ့န့ပဂးဘီၪ.- အဝ့ၫနီၪချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ ဒၪ,ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, ယၥ့ၪယၫနၥံၪ",
			"13": "<sup>13</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, အီၪခိၭဆံၭ.အဂဲးဘဲၫ ယီၩဎၦၡၩအဖိၪခွၫမိဂဲၫဝ့ၫၭ အနံၩအၥၫ့နီၫလဲၪ, အ နၩရံၩနီၫလဲၪနီၪ, နၥံၪၥ့ၪယၫအ့ၬ.",
			"14": "<sup>14</sup> အဂဲးဘဲၫယီၩ ဆၧမၩအၥၭဘဲၫၦလဂၩလၧအ လ့ၩလၧထံၫယဲၩ့ခးယဲၩ့တၭ, ကိၭန့အဎီးအၡၩဒၪဝ့ၫ, ဖ့ၪလၫ့ဝ့ၫလၧအဆၧဖိၪဆၧလံၩ လၧအစူၪဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> အလဂၩနီၪဖ့ၪလၫ့ဝ့ၫယဲတၫလၫ့, အလဂၩဒၪနံၫတၩ လၫ့,အလဂၩဒၪလတၫလၫ့, ထီးဒၪအမၩဆၧၥ့ၪဆုၬ ဆုၬတၭ,လ့ၩဝ့ၫလၧထံၫယဲၩ့ခးယဲၩ့ချဲၫ့မၬလီၫ.",
			"16": "<sup>16</sup> ၦလၧအန့ဘၪဝ့ၫယဲတၫလၫ့လဂၩနီၪ လ့ၩမၩဖနံၬ",
			"17": "<sup>17</sup> ဝ့ၫတၭ,န့ဘၪဒီၭအဂူၫဂၩယဲတၫလၫ့လီၫ.- ဘဲၫနီၪ အၥိၭၦလၧအန့ဘၪနံၫတၫလၫ့လဂၩနီၪ, န့အၪထၪ့ အဂူၫဂၩနံၫတၫလၫ့လီၫ.",
			"18": "<sup>18</sup> အ့ၪမွဲၦလၧအန့ဘၪလတၫလၫ့လဂၩနီၪး လ့ၩခုၪ့ လၩ့ဘၧၩ့ၥူၪခွံၬ အကဆါအစ့ၩ လၧဂၪ့ခိၪလၬလီၫ.",
			"19": "<sup>19</sup> ယံၬယံၬတၭး အဎီးအၡၩလဖၪနီၪ အကဆါဂဲၫ",
			"20": "<sup>20</sup> ထဲၩ့တၭ,ယိထဲၩ့အဝ့ၫၥံၪအဆရၫ့လီၫ.- ၦလၧအန့ ဘၪယဲတၫလၫ့လဂၩနီၪဂဲၫစိၩဝ့ၫတၭ, ဆိၬအဂူၫဂၩ ယဲတၫလၫ့တၭ,စံၭဝ့ၫဒၪ, ကဆါဧ့,နဖ့ၪလၫ့ယၧၩယဲ တၫလၫ့တၭ,ယိခွါ, ယန့ဘၪအၪထၪ့ယူၭအဂူၫဂၩယဲ",
			"21": "<sup>21</sup> တၫလၫ့လၧအဖၫ့ခိၪယူၭ.- အကဆါစံၭဝ့ၫ, ဘၪယူၭ, ဎီးအၡၩလၧအဂ့ၩ လၧအလူတီၩဧ့,နအီၪလၧဆၧၡၩ အဖၫ့ခိၪတၭ, နလူတီၩယူၭ,ယမိအီၪက့ၪနၧၩလၧဆၧ အၪအဖၫ့ခိၪလီၫ. နုၬထဲၩ့လၧနကဆါ အဆၧၥၭ",
			"22": "<sup>22</sup> ထိၬအဖၧၩ့ဆံၭ.- ၦလၧအန့ဘၪနံၫတၫလၫ့လဂၩနီၪ ဂဲၫစိၩဆ့တၭ, စံၭဝ့ၫဒၪ,ကဆါဧ့,နဖ့ၪလၫ့ယၧၩနံၫတၫ လၫ့တၭ, ယိခွါ, ယန့အၪထၪ့ထဲၩ့ယူၭ အဂူၫဂၩနံၫတၫ",
			"23": "<sup>23</sup> လၫ့လၧအဖၫ့ခိၪယူၭ.- အကဆါစံၭဝ့ၫ,ဘၪယူၭ,ဎီးအ ၡၩလၧအဂ့ၩလၧအလူတီၩဧ့, နအီၪလၧဆၧၡၩအဖၫ့ ခိၪတၭနလူတီၩယူၭ, ယမိအီၪက့ၪနၧၩလၧဆၧအၪအ ဖၫ့ခိၪလီၫ.နုၬထဲၩ့လၧနကဆါ အဆၧၥၭထိၬအဖၧၩ့",
			"24": "<sup>24</sup> ဆံၭ.- ၦလၧအန့ဘၪလတၫလၫ့လဂၩနီၪဂဲၫစိၩဝ့ၫဆ့ တၭ,စံၭဝ့ၫဒၪ, ကဆါဧ့,ယၥ့ၪယၫလၧနမွဲၦအကၪ,န လဎွံၪဘၪအလးနီၪနကူၭနဝ့ၫ, နလမၩပြံၩပၩဘၪ",
			"25": "<sup>25</sup> အလးနီၪနအၪ့ထုၫ့ကီၪ့နဝ့ၫလီၫ.-ယၥၭမဲၪဆၧ နီၪယလ့ၩအီၪက့ၪၥူၪခွံၬနစ့ၩလတၫလၫ့ လၧဂၪ့ခိၪလၬ",
			"26": "<sup>26</sup> လီၫ.ယိခွါ,နန့ဘၪထဲၩ့နဆၧဒၪနဝ့ၫလီၫ.- အကဆါ ချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ, ဎီးအၡၩအအၧၩ့အကၠႃၪ့လ ဂၩဧ့,နၥ့ၪယၫလၧယလဎွံၪဘၪအလးနီၪယကူၭယ ဝ့ၫ,ယလမၩပြံၩပၩဘၪအလးနီၪ ယအၪ့ထုၫ့ကီၪ့ယ",
			"27": "<sup>27</sup> ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နကြၨၭဒုၭအၪ့လီးလၩ့ ယစ့ၩလၧၦအၪ့လီးစ့ၩလဖၪတၭ, ယဂဲၫထဲၩ့နီၪယမိ",
			"28": "<sup>28</sup> န့ဘၪယစ့ၩလၧအအ့ၪထၪ့ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,မၩန့ထဲၩ့အဝ့ၫဒၪလတၫလၫ့နီၪတၭ, ဖ့ၪလၫ့ထဲၩ့",
			"29": "<sup>29</sup> ၦအီၪလၧစ့ၩ အတၫလၫ့လဆံၫလဂၩနီၪဆံၭ.- အဂဲး ဘဲၫယီၩ, ဆၧမိဖ့ၪလၫ့ဆၧလၧၦလၧအဆၧအီၪကိၭဂၩ ဒ့ၭနီၪတၭ, အဝ့ၫဒၪအဆၧမိအၪလၨၪဝ့ၫလီၫ. အ့ၪမွဲ ၦလၧအဆၧလအီၪဘၪနီၪဆၧမိမၩန့ခွံၬဝ့ၫထီးဒၪ",
			"30": "<sup>30</sup> အအီၪဝ့ၫနီၪ,- ဒဲနၫ့ထၪ့ခွံၬဎီးအၡၩလၧအလန့ကၩ ဘၪဆၧလဂၩလၧဆၧခံၭကျၩလၧခီၫ့ဆံၭ. ဆၧဘၪ ဂၪ့ဆၧဘၪယၧၩ့ ဆၧခၪအဲၪ့ထံး မိအီၪဝ့ၫထီးနီၪလီၫ.",
			"31": "<sup>31</sup> ထီးၦၡၩအဖိၪခွၫမိဂဲၫလၩ့ဝ့ၫလၧအလၩအဖၩ့ ဒဲအၥီၫ့ ဎဆံၫ့ဎံၪၭ ထီးအလူၬနီၪး ထီးနီၪလဖၧၫ့မိဆၧၫ့ နၩ့ဝ့ၫလၧအလးဆီၩ့ဆီ ကယးကဖးအဖၫ့ခိၪတၭ,",
			"32": "<sup>32</sup> ၦကိၭဆၨၩဒ့ၭ မိဘၪအီၪကီၪ့ လၧအမ့ၬယၫလီၫ. အဝ့ၫဒၪမိအၪ့နၩ့ဖၭအဆၧၫ့ ဘဲၫၦယူၬၥိၪလဂၩ အၪ့",
			"33": "<sup>33</sup> နၩ့ဖၭၥိၪဒဲဘ့ၪအဆၧၫ့အၥိၭနီၪလီၫ.- အဝ့ၫဒၪမိ အီၪက့ၪၥိၪလဖၪနီၪလၧအစူၪထွ့ၪလခီၫ, အ့ၪမွဲဘ့ၪ လဖၪနီၪမိအီၪက့ၪဝ့ၫ လၧအစူၪစ့ၪလခီၫလီၫ.",
			"34": "<sup>34</sup> ထီးနီၪလဖၧၫ့ စဎွၩမိစံၭၦအီၪဘၪဝ့ၫလၧအစူၪထွ့ၪ လဖၪနီၪ, ၦလၧအဘၪဆိၪဂ့ၩလၧယဖါနၥံၪဝ့ၫဧ့,ဂဲၫ ဘီၪမၩန့ၥၫဘၩ့မုးလၧဆၧတဲၩ့ဝဲၩန့နၥံၪအဂး ခီၫ",
			"35": "<sup>35</sup> လၧဂၪ့ခိၪအခၪ့ထံၭကဲၪထၪ့လံၩလံၩဆံၭ.- အဂဲးဘဲၫ ယီၩဆၧၥၭဝံယၥၭတၭ, နၥံၪဖ့ၪအၪ့ဘၪယၧၩလီၫ. ဆၧၥၭဝံယၥၭလၧထံၫတၭ, နၥံၪဒုၭအီၩဘၪယၧၩလီၫ.",
			"36": "<sup>36</sup> ယမွဲၦမွံၩတၭ, နၥံၪထိးဆၧၫ့ဘၪယၧၩလီၫ.- ယအီၪ ဘိၪ့တၭ,နၥံၪဒုၭကီၩ့ဒုၭၥိၭဘၪယၧၩလီၫ. ယစူၭ ယဆၫတၭ, နၥံၪအီၪၡီၩ့ဘၪယၧၩလီၫ. ယအီၪလၧ ထီၫ့ဖၧၩ့တၭ,နၥံၪဂဲၫဘၪလၧယအီၪလီၫ.",
			"37": "<sup>37</sup> ထီးနီၪလဖၧၫ့ ၦအတီၩအလီၩ့လဖၪမိချဲၩ့ဆၧၫ့ဝ့ၫ တၭ,စံၭဝ့ၫဒၪ, ကဆါဧ့, မွဲဆၧၥၭဝံနၥၭတၭ,ပဒုၭအၪ့ ဘၪနၧၩနီၪမွဲဂ့ၩ, ဆၧၥၭဝံနၥၭလၧထံၫတၭ, ပဒုၭအီၩ",
			"38": "<sup>38</sup> ဘၪနၧၩမွဲဂ့ၩ,ပဒၪဘၪပဝ့ၫဎွ့ဆိၭလဲၪ.- နမွဲၦမွံၩတၭ, ပထိးဆၧၫ့ နၧၩနီၪမွဲဂ့ၩ, နအီၪဘိၪ့တၭ,ပဒုၭကီၩ့ဒုၭ",
			"39": "<sup>39</sup> ၥိၭဘၪနၧၩနီၪမွဲဂ့ၩ, ပဒၪဘၪပဝ့ၫဎွ့ဆိၭလဲၪ.- ဆၧစူၭ ဆၧဆၫနၧၩမွဲဂ့ၩ, နအီၪလၧထီၫ့ဖၧၩ့မွဲဂ့ၩ, ပဒၪဘၪ",
			"40": "<sup>40</sup> တၭ,ပလ့ၩလၧနအီၪနီၪမွဲဎွ့ဆိၭလဲၪ.- စဎွၩမိချဲၩ့ဆၧၫ့ ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, မွဲနၥံၪမၩဘၪ ၦလၧအဆံၭထုၬလဂၩလၧယထၧၫ့ဖု ဝဲအကျၩယီၩတၭ,မွဲနၥံၪမၩဘၪယၧၩလီၫ.",
			"41": "<sup>41</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪမိစံၭၦအီၪလၧအစူၪစ့ၪလဖၪ, ၦလၧအဘၪဆိၪအၧၩ့ၥံၪဧ့, စဲၪ့ဖၭလၧယၧၩ,လၧမ့ၪ အဆိၩအကၠၪအဖၧၩ့,လၧဆၧတဲၩ့ဝဲၩန့မုၪခီၩလဲး",
			"42": "<sup>42</sup> ဒဲအၥီၫ့ၥံၪအဂးနီၪဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧၥၭဝံ ယၥၭ,နၥံၪလဖ့ၪအၪ့ဘၪယၧၩတၭ, ဆၧၥၭဝံယၥၭ",
			"43": "<sup>43</sup> လၧထံၫ,နၥံၪဒုၭအီၩဘၪယၧၩအ့ၬ.- ယမွဲၦမွံၩ,နၥံၪ ထိးဆၧၫ့ဘၪယၧၩအ့ၬ. ယအီၪဘိၪ့,နၥံၪဒုၭကီၩ့ဒုၭၥိၭ ဘၪယၧၩအ့ၬ. ယစူၭယဆၫ, ဒဲယအီၪလၧထီၫ့ဖၧၩ့, နၥံၪဂဲၫအီၪၡီၩ့ဘၪယၧၩဆ့အ့ၬ.",
			"44": "<sup>44</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမိချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫဒၪ, ကဆါဧ့, ဆၧၥၭဝံနၥၭဒဲဆၧၥၭဝံနၥၭလၧထံၫမွဲဂ့ၩ, နမွဲၦမွံၩမွဲဂ့ၩ, နအီၪဘိၪ့မွဲဂ့ၩ, နဘၪစူၭဘၪဆၫမွဲဂ့ၩ, နအီၪလၧထီၫ့ဖၧၩ့မွဲဂ့ၩ, ပဒၪဘၪတၭပလမၩဘၪနဎီး နၡၩအဆၧမၩနီၪ မွဲဎွ့ဆိၭလဲၪ.",
			"45": "<sup>45</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪမိချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, မွဲနၥံၪလမၩဘၪ ၦလၧ အဆံၭထုၬလဂၩလၧၦလဖၪယီၩအကျၩတၭ, နၥံၪ",
			"46": "<sup>46</sup> လမၩဘၪယၧၩလီၫ.- ၦလဖၪယီၩမိလ့ၩနုၬဘၪလၧ ဆၧစ့ၩရၫ့စၪအဖၧၩ့ အဆိၩဆိၩအကၠၪကၠၪလီၫ. အ့ၪမွဲၦလၧအတီၩအလီၩ့လဖၪနီၪ, မိလ့ၩနုၬဘၪလၧ ဆၧမၧၫ့အဖၧၩ့ အဆိၩဆိၩအကၠၪကၠၪလီၫ."
		},
		"26": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧ ယ့ၫရှူၬလီၩလၩ့လၬလၩ့ ဆၧထီး",
			"2": "<sup>2</sup> အလူၬနီၪဂီၩ့တၭ, စံၭအထံၩအဖျဲလဖၪ,- နၥံၪၥ့ၪယၫ လၧနံၫနံၩအလးခဲၫ့တၭ,ဘိၪ့လ့ၩဖၬ မိဘၪဝ့ၫလီၫ. ဆၧမိဖ့ၪလၫ့ခွံၬ ၦၡၩအဖိၪခွၫ ဘဲၫၥိၭဆၧမိဖျၩထၪ့ဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့လီၫ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့ၦလုဆၧအဒိၪ, ဒဲၦကွ့ၭလံၬ,ဒဲၦခမျၧး အၥုၪ့က့ၭအၥၭၡါၥံၪ အီၪကိၩ့အီၪကီၪ့ဝ့ၫလၧၦလုဆၧ အခိၪကိၭဝ့ၫအမံၩ့ လၧစက့အဖၭအဂံၪ့ဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> အဝ့ၫၥံၪကိၪ့ထၪ့လိၬအၥၭဘဲၫၥိၭအမိဖီၪ့ထၬ ယ့ၫရှူၬ",
			"5": "<sup>5</sup> လၧဆၧအၪ့လံၬအၪ့လီၫ, ဒဲမၩၥံၫဝ့ၫဒၪလီၫ.- မွဲလါနၫ့ စံၭဝ့ၫဒၪ,မၩလၧဘိၪ့ဖၧၩ့လဂ့ၩ, ဘၪလဘၪၦခမျၧးၥံၪ မိတုၩ့ထၪ့ တုၩ့လၩ့ဘၪခိၬလီၫ.",
			"6": "<sup>6</sup> ယ့ၫရှူၬအီၪဝ့ၫလၧၦခံၫထူၬဆၫအၧၩ့ စစဲမၧၫ့အဂံၪ့",
			"7": "<sup>7</sup> လၧဘ့ၭၥနံၫအဖၧၩ့အဘိၩ့ဘၭတၭ,- ကီၩ့လိးဘွၩလ ဖျိၪ့အီၪလၧ ၥိၪနၧၫ့မၧၫ့လၧအလူဒိၪဎွ့ၩဒိၪ လၧအဖၧၩ့ နီၪၦမုၪလဂၩဂဲၫဆိၬလၧအအီၪတၭ, လူၫလၩ့ဝ့ၫလၧ အခိၪဎွံၪလီၩ့ ထီးအဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဝ့ၫ လၧစပွဲထံၭနီၪ",
			"8": "<sup>8</sup> လီၫ.- အထံၩအဖျဲလဖၪ ဒၪဘၪဝ့ၫတၭ, အၥၭထၪ့စံၭ ဝ့ၫဒၪ, မွဲဘၪနီၫလၫဆၧမၩလူၬဂီၩ့ ပျီၩပျီၩဆၧယီၩ",
			"9": "<sup>9</sup> လဲၪ.- အဂဲးဘဲၫယီၩၦအ့ၪအၪ့ဆၫခွံၬဝ့ၫနီၪ မိန့အဎွ့ၩ",
			"10": "<sup>10</sup> ဖၭဒိၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦၡၪ့ဖိၪယၬဖိၪၥ့ၪလီၫ.- ယ့ၫ ရှူၬၥ့ၪယၫတၭစံၭအဝ့ၫၥံၪ, မွဲဘၪနီၫလၧနၥံၪ မၩထံၬ ထၬၦမုၪယီၩလဲၪ. အဂဲးဘဲၫယီၩအဝ့ၫမၩယူၭယၧၩ",
			"11": "<sup>11</sup> လၧဆၧမၩအဂ့ၩယူၭ.- အဂဲးဘဲၫယီၩၦၡၪ့ဖိၪယၬဖိၪ အီၪလၧနၥံၪအကျၩလထံၪဎးလီၫ. အ့ၪမွဲယၧၩယီၩ",
			"12": "<sup>12</sup> ယအီၪလၧနၥံၪအၥိၭလထံၪဎးအ့ၬ.- အဂဲးဘဲၫယီၩ မွဲအလူၫလၩ့ၥိၪနၧၫ့မၧၫ့နီၪ လၧယမိၡါအလီၩ့ယီၩ တၭ, မၩဝ့ၫလၧယဘၪဆၧခုၪ့လၩ့ဘၧၩ့ အဂးလီၫ.",
			"13": "<sup>13</sup> ယလီၩဘၪ နၥံၪတီၩတီၩယီၩ, ထီးဒၪဆၧၥၭထိၬအ ပရၧၫ့ယီၩဘၪဆၧ လီၩလၩ့လၬလၩ့ဝ့ၫ လၧဂၪ့ခိၪချိၫ့ ထၧၫ့ဖျိၪ့ယၫလစီၪ့လါလါနီၪ, ဆၧလၧၦမုၪမၩဆၧ ယီၩ,မိဘၪဆၧလီၩလၩ့လၬလၩ့ဝ့ၫ လၧဆၧနၪ့ထၪ့ ထဲၩ့အဝ့ၫနီၪအဂဲးလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့ ၦလၧလဆံၫနံၫဂၩအကျၩစယုဒၭအံၭ စကၫရအၧၭလဂၩနီၪ,လ့ၩလၧၦလုဆၧအဒိၪလဖၪ",
			"15": "<sup>15</sup> အအီၪတၭ,စံၭဝ့ၫဒၪ,- ယအ့ၪဖ့ၪလၫ့ခွံၬအဝ့ၫဒၪလၧ နၥံၪအစူၪဖၧၩ့တၭ, မွဲနၥံၪမိဖ့ၪလၫ့ယၧၩ လၧဆၧနီၪ လမံၩ့လဲၪ. အဝ့ၫၥံၪခံၫ့န့စ့ၩအဘံၪ့ၥၧၫ့ဆံၫလၧအဂး",
			"16": "<sup>16</sup> လီၫ.- လၧအခၫနီၪအဝ့ၫဒၪအၪ့ဎူၫအၪ့ဎၬဝ့ၫ အဆၧၫ့ အထီအဘၪဘဲၫၥိၭအမိဖ့ၪလၫ့ခွံၬဝ့ၫဒၪလီၫ.",
			"17": "<sup>17</sup> လၧဘိၪ့ကိၪလဘၪဘၪလၧမံၪမုခၪ့ထံၭအနံၩနီၪ, အထံၩအဖျဲၥံၪဂဲၫလၧယ့ၫရှူၬအအီၪတၭ,စံၭဝ့ၫ, ဘဲၫ နမိအၪ့ဘၪဘိၪ့လ့ၩဖၬအၥိၭတၭ, မွဲအဘၪနၥၭလၧပ",
			"18": "<sup>18</sup> တဲၩ့ဝဲၩအလးခီၫခီၫလဲၪ.- အဝ့ၫနီၪစံၭဝ့ၫဒၪ, လ့ၩလၧ ဒိၩ့ဖၧၩ့လၧၦလဂၩအအီၪတၭ, စံၭအဝ့ၫဒၪ, ဆရၫစံၭ ဝ့ၫ,ယမုယလၩလၩ့ဘူၭယူၭ, ယမိမၩဘိၪ့လ့ၩဖၬလၧ",
			"19": "<sup>19</sup> နဂံၪ့လၧယထံၩယဖျဲအၥိၭလီၫ.- အထံၩအဖျဲၥံၪမၩ ဝ့ၫဘဲၫယ့ၫရှူၬမၪလူၬဝ့ၫအၥိၭနီၪ တဲၩ့ဝဲၩဘိၪ့လ့ၩဖၬ နီၪလီၫ.",
			"20": "<sup>20</sup> မုဂၪလၩ့နီၪအဝ့ၫဒၪဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဝ့ၫ လၧစပွဲထံၭ",
			"21": "<sup>21</sup> လၧအဝ့ၫၥံၪလဆံၫနံၫဂၩအၥိၭလီၫ.- အၪ့ဆၧအဘိၩ့ ဘၭတၭ စံၭဝ့ၫဒၪ, ယလီၩဘၪနၥံၪအဆၧတီၩတီၩ ယီၩ,ၦအီၪလၧနၥံၪအကျၩလဂၩ မိဖ့ၪလၫ့ခွံၬယၧၩ",
			"22": "<sup>22</sup> လီၫ.- အဝ့ၫၥံၪအုၭအၥၭဒိၪဒိၪလ့ၬတၭ, လဂၩဒဲလ",
			"23": "<sup>23</sup> ဂၩစံၭဝ့ၫဆုၬဆုၬတၭ,ကဆါဧ့, မွဲယၧၩဧၪ.- အဝ့ၫနီၪ ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ၦလၧအဘၧၩ့လၩ့ဎုၬအ စူၪလၧထွ့ၫဖၧၩ့လၧယၧၩလဂၩယီၩ, မိဖ့ၪလၫ့ခွံၬ",
			"24": "<sup>24</sup> ယၧၩလီၫ.- ဘဲၫဆၧကွ့ၭအၥၭလၧအဂဲးအၥိၭနီၪ, ၦၡၩအဖိၪခွၫလ့ၩဝ့ၫတၭ မွဲလါနၩ့ဘိၩၦလၧအဖ့ၪလၫ့ ခွံၬၦၡၩအဖိၪခွၫလဂၩဘၪဆၧအၡၪ့လီၫ. အဝ့ၫလဂၩ နီၪအ့ၪလအီၪဖျဲၪဘၪတၭ, မွဲအဂ့ၩဒၪအဆၧဒံၭလီၫ.",
			"25": "<sup>25</sup> ၦလၧအဖ့ၪလၫ့ခွံၬဝ့ၫ စယုဒၭအံၭစကၫရအၧၭ ချဲၩ့ ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ရၭဘံၫဧ့, မွဲယၧၩဧၪ.အဝ့ၫ ဒၪစံၭဝ့ၫ,နစံၭယူၭဆၧယူၭ.",
			"26": "<sup>26</sup> အဝ့ၫၥံၪအၪ့ဆၧအဘိၩ့အဘၭနီၪ,ယ့ၫရှူၬမၩန့ကိၪ လလီၪ့တၭ, ဆိၪဂ့ၩဝ့ၫ,ကံၪ့ဘျ့ၭဝ့ၫတၭ, ဖ့ၪလၫ့အထံၩ",
			"27": "<sup>27</sup> အဖျဲစံၭဝ့ၫဒၪ, ဆၧယီၩမွဲယမိၡါ,မၩန့အၪ့ဆံၭ.- အဝ့ၫ ဒၪမၩန့လိၫ့လဖျိၪ့နီၪ စံၭထၪ့အၪ့အူၭဆၧအခိးအတၩ တၭ,ဖ့ၪလၫ့ဝ့ၫလၧအဝ့ၫၥံၪ, စံၭဝ့ၫဒၪ, အီၩနၥံၪဝ့ၫကိၭ",
			"28": "<sup>28</sup> ဂၩဒ့ၭဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧယီၩမွဲယၥွံၪဘၪဆဲၫ့ လၧဆၧအုၩ့လၩ့အၥၫ့ လၧအလူၫလၩ့အၥၭလၧၦ",
			"29": "<sup>29</sup> အၪဂၩအဂးလၧဆၧဒဲၩဘၭဖီၩ့ဖျ့ၭဝ့ၫအဂးလီၫ.- ယ လီၩဘၪနၥံၪ လၧယလအီၩလၧၩ့ဘၪ စဘံၭၥၪအထံၫ ယီၩ,ထီးမုနံၩလၧယမိအီၩဝ့ၫ အၥၫ့လၧနၥံၪအၥိၭလၧ",
			"30": "<sup>30</sup> ယဖါအဘၩ့အမုးအဖၧၩ့လီၫ.- ထီးအၥံၫကျံၩဆၧ ဂီၩ့တၭ, အဝ့ၫၥံၪလ့ၩထၪ့ဝ့ၫထီၩ့လၧခိၪလီၩ့အလဲအိၫ့ အလီၩ့လီၫ.",
			"31": "<sup>31</sup> ထီးနီၪလဖၧၫ့ ယ့ၫရှူၬစံၭအဝ့ၫၥံၪ,မုလနၩဎးယီၩ, နၥံၪအၥၭမိဂၭဂီၩ့လၧယကၠီၩ့ကိၭဂၩဒ့ၭလီၫ. အဂဲး ဘဲၫယီၩဆၧကွ့ၭအၥၭ, ယ မိ ဖ့ၬ ခွံၬ ၦ ယူၬ ၥိၪ လ ဂၩ တၭ, ၥိၪ လ ဖၪ မိ လၩ့ ပြံၩ လၩ့ ပၩ ခွံၬ",
			"32": "<sup>32</sup> ဝ့ၫ ဒၪ လီၫ.- မွဲလါနၫ့ဘိၩယအ့ၪဂဲထုၪ့ထဲၩ့အလးခဲၫ့ တၭ, ယမိလ့ၩဝဲၩလၧနၥံၪအမ့ၬယၫလၧဂၫလလံၫ အဖၧၩ့လီၫ.",
			"33": "<sup>33</sup> စပံတၧၫချဲၩ့ဆၧၫ့ဆၧတၭစံၭဝ့ၫ, ၦအၥၭအ့ၪဂၭဂီၩ့ လၧနကၠီၩ့ကိၭဂၩဒ့ၭလါနၫ့တၭ, ယဝ့ၫဒၪယီၩယၥၭမိ",
			"34": "<sup>34</sup> ဂၭဂီၩ့နးဆိၭအ့ၬ.- ယ့ၫရှူၬစံၭဝ့ၫ,ယလီၩဘၪနၧၩတီၩ တီၩ,မုလနၩဎးယီၩ, ဆၫ့ဖၫလချႃၭအီၩ့အိၪထၪ့ဒံၭ",
			"35": "<sup>35</sup> ဘၪ,နဝ့ၫဒၪယီၩနမိမီၪ့ဘံၭယၧၩနးၥၧၫ့ဖၧၫ့လီၫ.- စပံ တၧၫစံၭဝ့ၫ, ယအ့ၪဘၪၥံၫဎုၬလါနၫ့လၧနၧၩတၭ,ယမီၪ့ ဘံၭနၧၩအ့ၬ. အထံၩအဖျဲၥံၪစံၭဝ့ၫ ဘဲၫနီၪၥိၭကိၭဂၩ ဒ့ၭဆ့လီၫ.",
			"36": "<sup>36</sup> ထီးနီၪလဖၧၫ့ယ့ၫရှူၬဒဲအဝ့ၫၥံၪ, လ့ၩလၧအလး ကိၭဝ့ၫဂ့ၭၥစ့မနံၫတၭ, စံၭအထံၩအဖျဲၥံၪ,ယလ့ၩဘၩ ဆိၪဖၪဆၧလၧယၫအဘိၩ့ဘၭနီၪ, ဆၧၫ့နၩ့ဒၪခလူၬ",
			"37": "<sup>37</sup> နၥံၪဝ့ၫထီးယီၩဆံၭ.- မွဲအကိၭန့စပံတၧၫ,ဒဲစဇ့ၭဘဒံၫ အဖိၪခွၫနံၫဂၩနီၪ, အၥုၪ့အုၭအၥၭအုၭၥၫ့တၭး အၥုၪ့",
			"38": "<sup>38</sup> ဎၧၫ့အၥၭဎၧၫ့မၬလီၫ.- ထီးနီၪလဖၧၫ့ မွဲအစံၭအဝ့ၫၥံၪ, ဆၧၥၭအုၭအီၪဝၬ ဖီၩ့ယၧၩထီးယမိၥံၫကၪယူၭ လီၫ. အီၪထီးယီၩတၭအီၪခိၭဆၧလၧယၥိၭဆံၭ.",
			"39": "<sup>39</sup> မွဲအလ့ၩဝ့ၫလၧယၫလဆံၭတၭ, ထွံၩလၩ့အခၪ့ကျၭ လၩ့အမ့ၬတၭ, ဘၩဆိၪဖၪဆၧ,စံၭဝ့ၫဒၪ, ယဖါဧ့, ဆၧလၧလိၫ့ယီၩအ့ၪၥ့ၪတၭ, မွဲဆၧဒုၭဖီၩ့ခွံၬယၧၩ ဆံၭ.မွဲလါနၫ့ဘိၩ ထီးဒၪယၥၭဒၪယဝ့ၫမွဲအ့ၬ, မွဲထီးဒၪနၥၭဒၪနဝ့ၫဆံၭ.-",
			"40": "<sup>40</sup> ဂဲၫထဲၩ့ဝ့ၫလၧအထံၩအဖျဲ အအီၪတၭ, ဒၪဘၪဝ့ၫလၧအဝ့ၫၥံၪမံၫမၪဝ့ၫတၭ, စံၭ စပံတၧၫးမွဲနၥံၪအီၪခိၭဆၧလၧယၥိၭလနၩရံၩနီၪကဲၪအ့ၬဧၪ.-",
			"41": "<sup>41</sup> ဘဲၫၥိၭနၥံၪထီးလ့ၩနုၬဘၪလၧဆၧကျဲၩ့ဖစီၩ့ အဖၧၩ့လဂ့ၩတၭ, အီၪခိၭဘၩဆိၪဖၪဆၧဆံၭ. မွဲ ၥၭလမံၩ့အၥၭအီၪဝ့ၫ, အ့ၪမွဲဆၧဖံၭဆၧယၪလမံၩ့ အဂဲးဆါအဘၭဆါလီၫ.",
			"42": "<sup>42</sup> လ့ၩဒီၭဝ့ၫနံၫဖၧၫ့လဖၧၫ့တၭ, ဘၩဆိၪဖၪဆၧစံၭဝ့ၫ ဒၪ,ယဖါဧ့, လိၫ့ယီၩယအ့ၪလအီၩဘၪတၭ, လ့ၩဖီၩ့",
			"43": "<sup>43</sup> ခွံၬယၧၩအ့ၪလၥ့ၪဘၪနီၪ, မွဲထီးဒၪနၥၭဆံၭ.- ဂဲၫထဲၩ့ ဝ့ၫတၭ,ဒၪဘၪလၧအဝ့ၫၥံၪ မံၫမၪဒီၭလီၫ. အဂဲးဘဲၫ ယီၩအမ့ၬဖံၭဎၧၫ့ဝ့ၫလီၫ.",
			"44": "<sup>44</sup> အဝ့ၫဒၪစဲၪ့ဒၪအဝ့ၫၥံၪ, လ့ၩဒီၭဘၩဆိၪဖၪဆၧၥၧၫ့ ဖၧၫ့လဖၧၫ့တၭ, ချဲၩ့ဆၧဘဲၫလးလးအၥိၭလီၫ.",
			"45": "<sup>45</sup> ထီးနီၪလဖၧၫ့ဂဲၫထဲၩ့ဝ့ၫ လၧအထံၩအဖျဲၥံၪ အအီၪ တၭ,စံၭအဝ့ၫၥံၪ, ဘိၩ့နဲၪ့ယီၩ, မွဲနၥံၪအီၪပွံၭဒဲမံၫမိ ချႃၭဆ့ဧၪ.ယိခွါ, နၩရံၩနီၪဘူၭထၪ့ယူၭး ဆၧမိဖ့ၪလၫ့ ခွံၬၦၡၩအဖိၪခွၫ လၧၦဆၧဒဲၩဘၭဖိၪအစူၪဖၧၩ့လီၫ.",
			"46": "<sup>46</sup> ဂဲထုၪ့တၭ, မွဲပလ့ၩၡီၩ့ဘီၪၬ ယိခွါ,ၦဖ့ၪလၫ့ခွံၬယၧၩ လဂၩနီၪအီၪဘူၭထၪ့ယူၭ.",
			"47": "<sup>47</sup> ချဲၩ့ဆၧအဘိၩ့ဘၭနီၪတၭ, ယိခွါ, ၦလၧလဆံၫ နံၫဂၩအကျၩနီၪ, စယုဒၭလဂၩဂဲၫဝ့ၫတၭ, ၦခမျၧး ဖၭဒိၪဖိၬအခဲၫ့, အီၪလၧအနၭၥံၪဒဲ အနိၪထိၭၥံၪ, ဂဲၫစဲၪ့ ထၪ့ခွံၬလၧၦလုဆၧအဒိၪၥံၪ, ဒဲလၧၦခမျၧး အၥုၪ့က့ၭ",
			"48": "<sup>48</sup> ၥၭၡါၥံၪအအီၪလီၫ.- ၦလၧအဖ့ၪလၫ့ခွံၬဝ့ၫလဂၩနီၪ, ဖ့ၪလၫ့ဆၧမၩနဲၪ့လမံၩ့လၧၦလဖၪနီၪတၭ, စံၭဝ့ၫဒၪ, ထီးဒၪၦလၧယအဲၪဂါဝ့ၫလဂၩနီၪ, မွဲအဝ့ၫဒၪတၭး",
			"49": "<sup>49</sup> ဖီၪ့ထၬအဝ့ၫနီၪဆံၭ.- ဂဲၫထီၩ့လၧယ့ၫရှူၬအအီၪချဲၫ့မၬ တၭ,စံၭဝ့ၫဒၪ,ရၭဘံၫဧ့,မွဲနဘၪဆၧအမုၬဆံၭးအဲၪဂါ",
			"50": "<sup>50</sup> ဝ့ၫလီၫ.- ယ့ၫရှူၬစံၭဝ့ၫ, တခွၫဧ့,နဂဲၫမၩဆၧနီၪလဲၪး ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪအီၪက့ၪထၪ့ အစူၪလၧယ့ၫရှူၬ",
			"51": "<sup>51</sup> အလီၩ့တၭ,ဖီၪ့ထၬဝ့ၫလီၫ.- ယိခွါ, ၦအီၪလၧယ့ၫရှူၬ အၥိၭလဂၩနီၪ ယၩ့ထၪ့အစူၪတၭထုၭထၪ့အနၭနီၪဖ့ၬ ၦလုဆၧအခိၪအဎီးအၡၩတၭ, အနါထူၬခွံၬဝ့ၫလခီၫ",
			"52": "<sup>52</sup> လီၫ.- ထီးနီၪလဖၧၫ့ယ့ၫရှူၬစံၭဝ့ၫ,ဖျၪ့နုၬထဲၩ့နနၭလၧ အကၠိၭဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩကယဲၦလၧအဖီၪ့နၭ",
			"53": "<sup>53</sup> လဖၪနီၪမိဘၪၥံၫ လၧနၭထီးအလူၬလီၫ.- ဘိၩ့နဲၪ့ ယီၩဒၪလ့ၬယအၪ့ကံၩ့လၧယဖါၥ့ၪတၭ, မွဲအမိအၪ့ မၧၫ့အၥီၫ့အဒီၪ့ဖၭဒိၪ ဂဲၫလၩ့လၧယအီၪလဆံၫနံၫဒီၪ့",
			"54": "<sup>54</sup> လကၭဘၪနီၪနဆီၫ့မီၪ့အ့ၬဧၪ.- ဆၧအ့ၪမၩအၥၭဘဲၫ နီၪတၭ,ဆၧကွ့ၭအၥၭလၧဆၧဘၪမၩအၥၭဘဲၫယီၩ, မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫဘဲၫၥ့ၪလဲၪ.",
			"55": "<sup>55</sup> လၧနၩရံၩနီၪယ့ၫရှူၬစံၭၦခမျၧး, နၥံၪဂဲၫဖီၪ့ယၧၩ ဘဲၫထမျၬအၥိၭ, လၧနၭၥံၪဒဲလၧနိၪထိၭၥံၪဆ့ဧၪ. ယ ဆၧၫ့နၩ့ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလၧနၥံၪအကျၩ လၧဆၧလု အဂံၪ့ဖၧၩ့ၥံၫ့ၥံၫ့နံၩတၭ, နၥံၪလဖီၪ့ထၬမၬယၧၩကၨ.",
			"56": "<sup>56</sup> ဆၧယီၩ ထီးအလူၬ မၩအၥၭဘဲၫၥိၭဆၧကွ့ၭအ ၥၭလၧမီၪၥံၪမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ. ထီးနီၪလဖၧၫ့ အထံၩအဖျဲၥံၪခွံၬၡိၭဝ့ၫတၭ, စဲၪ့ဖျိၭဝ့ၫကိၭဂၩဒ့ၭ လီၫ.",
			"57": "<sup>57</sup> ၦလၧအဖီၪ့ထၬယ့ၫရှူၬလဖၪနီၪ ထဲၩ့ၥိၫ့ဝ့ၫလၧ ၦလုဆၧအခိၪ စက့အဖၭအအီၪ ထီးၦၥုၪ့က့ၭၥၭၡါ,",
			"58": "<sup>58</sup> ဒဲၦကွ့ၭလံၬၥံၪအီၪကီၪ့ဝ့ၫအလးလီၫ.- စပံတၧၫလဂၩ ဖိၬအခဲၫ့ယဲၩ့ယိၬတၭ, ထီၩ့လၧၦလုဆၧအခိၪအဂံၪ့ ဖၧၩ့လ့ၩနုၬဝ့ၫတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧအဎီးအၡၩအ ကျၩဘဲၫအမိဒၪဘၪဝ့ၫလၧအထုၬအၥိၭနီၪလီၫ.",
			"59": "<sup>59</sup> ၦလုဆၧအဒိၪလဖၪ,ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ, ဒဲၦကိၪ့ ဆၧၥံၪထီးအလူၬနီၪ, အၪ့ဎၬၦအဘျံၭအဘျၪလၧအမိ ထိးအၥၭထၫ့ဒုၪဒၩယ့ၫရှူၬနီၪ ဘဲၫအမိမၩၥံၫအဝ့ၫအ",
			"60": "<sup>60</sup> ၥိၭလီၫ.- လဒၪန့ဘၪဝ့ၫတၭ,ၦထိးအၥၭလၧဆၧအ ဘျံၭအဘျၪဂဲၫဝ့ၫအၪဂၩလါနၫ့တၭ, ဒၪန့ဝ့ၫအ့ၬ. လၧ ခဲၫ့ထုၬနီၪ ၦထိးအၥၭလၧ ဆၧအဘျံၭအဘျၪဂဲၫဝ့ၫ",
			"61": "<sup>61</sup> နံၫဂၩ.- စံၭ,အယီၩလဂၩစံၭဝ့ၫဒၪ,ယွၩအဆၧလု အဂံၪ့နီၪယမၩလၩ့ဎီးခွံၬဝ့ၫတၭ, ၥၧၫ့နံၩအထးဖၧၩ့ နီၪယမၩထၪ့ထဲၩ့ယဝ့ၫၥ့ၪလီၫ.",
			"62": "<sup>62</sup> ၦလုဆၧအခိၪလဂၩနီၪ, ဂဲထုၪ့တၭ,စံၭဝ့ၫ,နဝ့ၫဒၪ ယီၩမွဲနချဲၩ့ဆၧၫ့နးထံၪအ့ၬဧၪ. အဝ့ၫၥံၪထိးအၥၭ",
			"63": "<sup>63</sup> ထၫ့ဒုၪဒၩနၧၩဘဲၫၥ့ၪလဲၪ.- ယ့ၫရှူၬအီၪလၩ့မါပံၭ လီၫ.ၦလုဆၧအခိၪချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ, နမွဲယွၩ အဖိၪခွၫဎရံၬဧၪ, လမွဲဘၪလဲၪနီၪ, ဘဲၫနမိလီၩဘၪပၧၩ အၥိၭ,ယအၪ့မၧၫ့နဆိၪလၩ့နၥၭလၧယွၩအမၧၫ့ဝ့ၫ",
			"64": "<sup>64</sup> အမ့ၬယၫလီၫ.- ယ့ၫရှူၬစံၭဝ့ၫ,နစံၭယူၭဆၧယူၭ, မွဲ လါနၫ့ဘိၩ ယလီၩဘၪနၥံၪယီၩ, လၧခဲၫ့ထဲၩ့တၭ, နၥံၪမိဒၪဘၪၦၡၩအဖိၪခွၫ ဆၧၫ့နၩ့ဝ့ၫလၧဆၧအစီၩ့ အမၩ့အစူၪထွ့ၪလခီၫတၭ, ဂဲၫလၩ့လၧမူၭခိၪ အ",
			"65": "<sup>65</sup> ဆၧအုၪ့အလီၩ့လီၫ.- ထီးနီၪလဖၧၫ့ ၦလုဆၧအခိၪၡၫ့ ယၬအဆဲၫ့တၭ, စံၭဝ့ၫဒၪ, အဝ့ၫဒၪချဲၩ့ဒုၪဒွ့ၪယူၭ ဆၧ ယူၭ,ပမိမၩဒံၭၦထိးအၥၭ လၧအဂူၫဂၩအလးအီၪ ဘဲၫၥ့ၪလဲၪ. ယိခွါ, အဆၧချဲၩ့ဒုၪ့ဒွ့ၪယွၩနီၪ နၥံၪနါဂၧၫ့",
			"66": "<sup>66</sup> ယူၭမၬဘိၩ့နဲၪ့ယီၩကၨ.- နၥံၪဆီၫ့မီၪ့နၥံၪဝ့ၫဘဲၫၥ့ၪ လဲၪ.ၦလဖၪနီၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ကြၨၭ",
			"67": "<sup>67</sup> ဘၪၥံၫလီၫ.- ထီးနီၪ လဖၧၫ့အဝ့ၫၥံၪထိၪဖျံၭဝ့ၫအ မ့ၬတၭ,မ့ၭအဝ့ၫဒၪလီၫ. လနၩ့နၩ့ဒဲၩဝ့ၫတၭ, စံၭဝ့ၫ",
			"68": "<sup>68</sup> ဒၪဎရံၬဧ့,- မွဲပလၫဒဲၩနၧၩလဂၩလဲၪ. လီၩဘၪပၧၩ လၧမီၪအချိၬဆံၭ.",
			"69": "<sup>69</sup> စပံတၧၫဆၧၫ့နၩ့လၧခီၫ့လၧဂံၪ့အဝၩ့ဖၧၩ့တၭ, ၦမုၪနၩ့လဂၩဂဲၫလၧအအီၪ, စံၭဝ့ၫဒၪ, နဝ့ၫဒၪယီၩန",
			"70": "<sup>70</sup> အီၪလၧၦဂၫလလံၫဖိၪယ့ၫရှူၬအၥိၭနီၪဆ့လီၫ.- အဝ့ၫ ဒၪမီၪ့ဘံၭဝ့ၫလၧၦထီးအလူၬအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ,",
			"71": "<sup>71</sup> နချဲၩ့ဆၧနီၪယၥ့ၪယၫယဝ့ၫအ့ၬ.- မွဲအစဲၪ့ထၪ့နုၬလၧ ထိၬချိၫ့ဖၧၩ့တၭ,ၦမုၪလၧအဂူၫဂၩလဂၩ ဒၪဘၪဝ့ၫ တၭ,စံၭၦလၧအအီၪဝ့ၫထီးနီၪ, အယီၩလဂၩအီၪလၧ",
			"72": "<sup>72</sup> ၦနၭဇရ့ၭဖိၪ ယ့ၫရှူၬအၥိၭနီၪဆ့လီၫ.- အဝ့ၫဒၪဆိၪ လၩ့အၥၭတၭ,မီၪ့ဘံၭဒီၭဝ့ၫ, ၦလဂၩနီၪယၥ့ၪယၫ",
			"73": "<sup>73</sup> အ့ၬ.- လဆိဖိၪဖီၩ့ခွံၬတၭ,ၦဆၧၫ့ထုၪ့ထီးနီၪလဖၪဂဲၫ တၭ,စံၭစပံတၧၫ့, နဝ့ၫဒၪယီၩ,မွဲမၬ,နအီၪလၧအဝ့ၫၥံၪ အကျၩလီၫ.အဂဲးဘဲၫယီၩ နလူမၩဖျီၪထၪ့နၧၩလီၫ.",
			"74": "<sup>74</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪ ဆိၪဆၧစံၭဆၧတၭ, ဆိၪလၩ့ အၥၭ,ၦလဂၩနီၪယၥ့ၪယၫအ့ၬ. တၭဆၫ့ဖၫအီၩ့အိၪ",
			"75": "<sup>75</sup> ထၪ့ဝ့ၫချဲၫ့မၬလီၫ.- စပံတၧၫနၪ့ထၪ့ထဲၩ့ဝ့ၫ လၧယ့ၫ ရှူၬစံၭ,လၧဆၫ့ဖၫလချႃၭအီၩ့အိၪထၪ့ဒံၭဘၪနီၪ နမိ မီၪ့ဘံၭယၧၩ နးၥၧၫ့ဖၧၫ့ လီၫ. လ့ၩထၪ့ဝ့ၫလၧခီၫ့တၭ, ဂၪ့ဝ့ၫနၭမၬလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> ထီးဆၧဖၩ့ထၪ့တၭ, ၦလုဆၧအဒိၪထီးအလူၬၥံၪ,ဒဲ ၦခမျၧးအၥုၪ့က့ၭၥၭၡါၥံၪကိၪ့ထၪ့ဖၭလၩ့ဝ့ၫ ဘဲၫအမိ",
			"2": "<sup>2</sup> မၩၥံၫယ့ၫရှူၬအၥိၭလီၫ.- တၭစၧၩ့ထၬဝ့ၫဂီၩ့နီၪ, လ့ၩ ၥိၫ့ဖ့ၪလၫ့ခွံၬဝ့ၫလၧၦဒိၪဖၭဒိၪ စပီၪ့တအၧၭပဲလၭအ စူၪဖၧၩ့နီၪလီၫ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့ၦလၧအဖ့ၪလၫ့ခွံၬဝ့ၫ, စယုဒၭလဂၩ နီၪး ထီးအၥ့ၪယၫလၧယ့ၫရှူၬ ဘၪဆၧစ့ၩရၫ့စၪတၭ, နၪ့ထၪ့ထဲၩ့အၥၭ, ဖ့ၪလၫ့ထဲၩ့စ့ၩအဘံၪ့ၥၧၫ့ဆံၫလၧ",
			"4": "<sup>4</sup> ၦလုဆၧအဒိၪလဖၪ, ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ,- စံၭဝ့ၫဒၪ, မွဲယဖ့ၪလၫ့ခွံၬဆၧ အၥွံၪလၧအဆၧဒဲၩဘၭလအီၪဘၪ တၭ,ယမၩမၪဘၪယူၭဆၧယူၭ. အဝ့ၫၥံၪစံၭဝ့ၫဒၪ,",
			"5": "<sup>5</sup> အနီၪဘၪဆဲၫ့လၧပၧၩဘဲၫၥ့ၪလဲၪ.ယိဒၪနဝ့ၫဆံၭ.- အ ဝ့ၫနီၪခွံၬလၩ့စ့ၩအဘံၪ့ၥံၪ လၧဆၧလုအဂံၪ့ဖၧၩ့တၭ,",
			"6": "<sup>6</sup> စဲၪ့ထၪ့ခွံၬဝ့ၫနီၪ လ့ၩစၧၩ့ၥံၫလၩ့ခွံၬအၥၭလီၫ.- ၦလု ဆၧအဒိၪၥံၪ မၩန့ထဲၩ့စ့ၩအဘံၪ့ၥံၪ, စံၭဝ့ၫဒၪ, မွဲဆၧ ၥွံၪအဎွ့ၩတၭ, ဒူၭလၩ့လၧစ့ၩအီၪကီၪ့အလး ကြၨၭ",
			"7": "<sup>7</sup> အ့ၬ.- အဝ့ၫၥံၪကိၪ့ထၪ့လိၬအၥၭတၭ, ဎွ့ၩဂၪ့ခိၪလၧ ၦတဲၩ့ဖၧၩ့လဝၩ့လၧစ့ၩနီၪလၧၦမွံၩအၥွၪခိၪအဂးလီၫ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ, ဂၪ့ခိၪအဝၩ့နီၪဆၧကိၭဝ့ၫလၧ",
			"9": "<sup>9</sup> ဆၧၥွံၪအဝၩ့ထီးမုလနံၩယီၩလီၫ.- ထီးနီၪလဖၧၫ့ စယ့ၫရမဲအၫ အလူအထၫလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ. စံၭဝ့ၫဒၪ, တၭအဝ့ၫၥံၪမၩန့စ့ၩအဘံၪ့ၥၧၫ့ဆံၫ, ၦလၧဆၧချဲၩ့ဝဲၩဝ့ၫအဎွ့ၩလဂၩနီၪအဎွ့ၩ, လၧအံၫစရ့လၭအဖိၪခွၫၥံၪချဲၩ့ဝဲၩဝ့ၫ,",
			"10": "<sup>10</sup> ဒဲဖ့ၪလၫ့ဝ့ၫလၧၦတဲၩ့ဖၧၩ့အဝၩ့အဂး, ဘဲၫကဆါမၪလူၬယၧၩအၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ယ့ၫရှူၬဆၧၫ့ထုၪ့လၧၦဒိၪဖၭဒိၪ အမ့ၬယၫတၭ, ၦဒိၪဖၭဒိၪအၪ့စၪ့ဝ့ၫနီၪ, စံၭဝ့ၫဒၪ, နဝ့ၫဒၪယီၩနမွဲၦယု ဒၫဖိၪအစဎွၩဧၪ, ယ့ၫရှူၬစံၭဝ့ၫ, နစံၭယူၭဆၧယူၭ.",
			"12": "<sup>12</sup> ထီးၦလုဆၧအဒိၪၥံၪ, ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪအီၪက့ၪဆၧ မၪလၧအလီၩ့တၭ, အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧနးထံၪအ့ၬ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့ စပဲလၭစံၭဝ့ၫ, မွဲၦထိးအၥၭထၫ့ဒုၪဒၩ",
			"14": "<sup>14</sup> နၧၩဆံၭအၪဆံၭအၪလဲၪနီၪ, နနါဂၧၫ့အ့ၬဧၪ.- န့ၫလ ထံၪနီၪမွဲအချဲၩ့ဆၧၫ့ဝ့ၫအ့ၬ. အခိးမွဲဘဲၫနီၪတၭ, ၦဒိၪ ဖၭဒိၪထီၫမံၫထီၫမၪဝ့ၫဒိၪမၬလီၫ.",
			"15": "<sup>15</sup> ထီးၦမၩဘိၪ့နီၪၦဒိၪဖၭဒိၪ ကွဲၪဖျါၦထီၫ့ဖိၪလဂၩ,",
			"16": "<sup>16</sup> အထူၫအရူၫအီၪဝ့ၫလီၫ.- အထီထီးနီၪၦလၧအမံၩ့အ ၥၪဖျီၪဝ့ၫ, စဘရၭဘၭလဂၩ အီၪဝ့ၫလၧထီၫ့ဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးၦအီၪကိၩ့အီၪကီၪ့တၭ, စပဲ လၭစံၭအဝ့ၫၥံၪ, မွဲအဘၪနၥံၪအၥၭ လၧယမိကွဲၪဖျါ ခွံၬလၧနၥံၪအဂးပလၫလဂၩလဲၪ. မွဲစဘရၭဘၭနီၪဧၪ,",
			"18": "<sup>18</sup> မွဲယ့ၫရှူၬလၧၦကိၭဝ့ၫဎရံၬနီၪဧၪ.- အဂဲးဘဲၫယီၩၥ့ၪ ယၫဝ့ၫလၧအဝ့ၫၥံၪဖ့ၪလၫ့ခွံၬဝ့ၫ လၧဆၧၥၭခ့ၬအ ကၠီၩ့လီၫ.",
			"19": "<sup>19</sup> အဝ့ၫဒၪဆၧၫ့နၩ့ဝ့ၫ လၧစ့ၩရၫ့ဆၧအလးဖၫ့ခိၪအ ဘိၩ့ဘၭနီၪ, အမၫအၪ့မၧၫ့လၩ့အလူလၧအအီၪ, စံၭ ဝ့ၫဒၪ,မွဲဆၧဘၪဆဲၫ့လၧနၧၩ လၧၦအတီၩအလီၩ့လ ဂၩနီၪထီးအီၪနးမံၩ့လဂ့ၩ. အဂဲးဘဲၫယီၩ လၧမုလ နံၩယီၩယဘၪဆၧအၪမံၩ့ လၧအဝ့ၫဒၪအကၠီၩ့ လၧ",
			"20": "<sup>20</sup> ဆၧမံၫမးအဖၧၩ့လီၫ.- ၦလုဆၧအဒိၪၥံၪ ဒဲၦၥုၪ့က့ၭ ၥၭၡါၥံၪပဂၨၪထၪ့ၦခမျၧး ဘဲၫၥိၭအမိအၪ့ကံၩ့စဘ",
			"21": "<sup>21</sup> ရၭဘၭတၭ, မၩၥံၫခွံၬယ့ၫရှူၬလီၫ.- ၦဒိၪဖၭဒိၪချဲၩ့ ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ, ဆၧလၧၦနံၫဂၩနီၪ, မွဲအဘၪနၥံၪ အၥၭလၧယမိကွဲၪဖျါ လၧနၥံၪအဂးလဂၩဂၩလဲၪ.",
			"22": "<sup>22</sup> တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, စဘရၭဘၭလီၫ.- စပဲလၭစံၭ အဝ့ၫၥံၪးအ့ၪမွဲဘဲၫနီၪတၭ, ယ့ၫရှူၬၦကိၭဝ့ၫဎရံၬနီၪ, ယမိမၩအဝ့ၫဘဲၫၥ့ၪလဲၪ. ၦခမျၧးထီးအလူၬနီၪစံၭဝ့ၫ, ဖျၩထၪ့ခွံၬဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့ဆံၭ.",
			"23": "<sup>23</sup> ၦဒိၪဖၭဒိၪစံၭဝ့ၫဒၪ, ဘၪနီၫလဲၪ,မွဲအမၩမၪဘၪဆၧနီၪ လမံၩ့လဲၪ. အဝ့ၫၥံၪကိၭၡၭထၪ့ အၪနဲၪ့အလးဒံၭတၭ, စံၭဝ့ၫဒၪ, ဖျၩထၪ့ခွံၬဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့ဆံၭ.",
			"24": "<sup>24</sup> ထီးစပဲလၭဒၪဘၪဝ့ၫ လၧအချဲၩ့ဆၧလန့ကၩဘၪ ဆၧနးမံၩ့နီၪ အ့ၪမွဲဆၧတုၩ့ထၪ့တုၩ့လၩ့ ကဲၪထၪ့ဝ့ၫ လခီၫတၭ, မၩန့ထံၫၥူၫဝၭခွံၬအစူၪလၧၦခမျၧးအ မ့ၬယၫတၭ, စံၭဝ့ၫဒၪ,ယဝ့ၫဒၪယီၩ, ယဖီၩ့ဖျ့ၭလၧၦ အတီၩအလီၩ့လဂၩယီၩအၥွံၪလီၫ. ယိနၥံၪဝ့ၫဆံၭ.",
			"25": "<sup>25</sup> ၦခမျၧးထီးအလူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, အဝ့ၫ ဒၪအၥွံၪနီၪမွဲအအီၪဒၪဝ့ၫလၧပလီၩ့, ဒဲလၧပဖိၪပ",
			"26": "<sup>26</sup> လံၩအလီၩ့ဆံၭ.- ထီးနီၪလဖၧၫ့ အဝ့ၫနီၪကွဲၪဖျါခွံၬ စဘရၭဘၭလၧအဝ့ၫၥံၪအဂးတၭး အ့ၪမွဲယ့ၫရှူၬလ ဂၩဒိၪဝ့ၫထးဝ့ၫဂီၩ့တၭ, ဖ့ၪလၫ့ခွံၬဝ့ၫဘဲၫၥိၭအမိ ဘၪဆၧဖျၩထၪ့ခွံၬ လၧထုၪ့စူၪယၫအလီၩ့နီၪလီၫ.",
			"27": "<sup>27</sup> ထီးနီၪလဖၧၫ့ ၦဒိၪအၥုၭဖိၪလဖၪမီၩ့နုၬယ့ၫရှူၬလၧ စ့ၩရၫ့ခွးအလးတၭ, ၥုၭဖိၪထၧၫ့ဒီၪ့ယၫ ဂဲၫအီၪကီၪ့",
			"28": "<sup>28</sup> လၧအအီၪ,- အဝ့ၫၥံၪဘဲၪ့လၩ့ခွံၬအကီၩ့အၥိၭတၭ,",
			"29": "<sup>29</sup> ဒုၭၥိၭထၪ့ဝ့ၫလၧအဝိၬလိၫ့ဝီၩလီၫ.- အဝ့ၫၥံၪထဲၫ့ၥရ ဖူၩလၧဆၧဆူၪတၭ, ဒုၭချႃၬထၪ့ဝ့ၫလၧအခိၪဎွံၪနီၪ, အီၪက့ၪဖီးလဘီၩ့လၧအစူၪထွ့ၪတၭ, ချံၭလၩ့အခၪ့ လၧအမ့ၬယၫ, ဒုၪဒွ့ၪဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ၦယုဒၫအ",
			"30": "<sup>30</sup> စဎွၩဧ့,မွဲနဘၪဆၧအမုၬဆံၭ.- အဝ့ၫၥံၪထိၪဖျံၭအ",
			"31": "<sup>31</sup> ဝ့ၫတၭ,မၩန့ဖီးလဘီၩ့နီၪဒိၪဝ့ၫအခိၪဎွံၪလီၫ.- ထီး အဒုၪဒွ့ၪဝ့ၫဂီၩ့တၭ, ဘဲၪ့လၩ့ခွံၬအဝိၬလိၫ့ဝီၩ လၧအ လီၩ့တၭ, ဒုၭကီၩ့ဒုၭၥိၭထၪ့ထဲၩ့ အကီၩ့အၥိၭဒၪဝ့ၫ တၭ,လ့ၩၥိၫ့ထၪ့ဝ့ၫ ဘဲၫအမိဘၪဆၧဖျၩထၪ့ဝ့ၫလၧထုၪ့ စူၪယၫအလီၩ့အၥိၭလီၫ.",
			"32": "<sup>32</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့အဘိၩ့ဘၭတၭ, ဒၪန့ၦစဲၫရံနံၫဖိၪ, အမံၩ့မွဲစစဲမၧၫ့လဂၩတၭ, အၪ့မၧၫ့ဆီၪ့ဝ့ၫနီၪဘဲၫအမိ ယိၭအဝ့ၫဒၪအထုၪ့စူၪယၫအၥိၭနီၪလီၫ.",
			"33": "<sup>33</sup> ထီးအဝ့ၫၥံၪလ့ၩထီၩ့ လၧအလးကိၭဝ့ၫလၧဂီၫလ ဂိၥၫ,ဘဲၫၦစံၭဆၧအၥိၭ, ဆၧခိၪဎွံၪလဲၫအလးတၭ,",
			"34": "<sup>34</sup> အဝ့ၫၥံၪဖ့ၪဒုၭအီၩယ့ၫရှူၬ လၧဆၧဆဲၪ့ထံၫလၧအလဲၩ ဎုၬဝ့ၫလၧၥံၪခၪနီၪတၭ, အဝ့ၫဒၪထဲးယိဝ့ၫတၭ,",
			"35": "<sup>35</sup> အီၩဝ့ၫနီၪအၥၭအီၪအ့ၬ.- ၦဖျၩထၪ့ဝ့ၫလၧထုၪ့စူၪ ယၫအလီၩ့ဂီၩ့တၭ, အၪ့နၩ့ဖၭအကီၩ့အၥိၭ,ဎဘဲၫမီၪ အလူအထၫမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ ဝ့ၫအၥိၭလီၫ. စံၭဝ့ၫ ဒၪ,အဝ့ၫၥံၪအၪ့နၩ့ဖၭယကီၩ့ယၥိၭ လၧအဂးဒၪဝ့ၫ",
			"36": "<sup>36</sup> တၭ,ဖၭဝ့ၫလၧယဆဲၫ့အဂးလီၫ.ၭ- အဝ့ၫၥံၪဆၧၫ့နၩ့ အီၪခိၭဝ့ၫထီးနီၪလီၫ.",
			"37": "<sup>37</sup> အဝ့ၫၥံၪအီၪက့ၪထၪ့ဝ့ၫ လၧအခိၪဎွံၪအဖၫ့ခိၪ အဆၧ မၪအီၪကွ့ၭအၥၭ, အယီၩလဂၩမွဲၦယုဒၫဖိၪအစဎွၩယ့ၫရှူၬ လီၫ.",
			"38": "<sup>38</sup> ထီးနီၪလဖၧၫ့ ဆၧဖျၩထၪ့ၦထမျၬနံၫဂၩလၧအ ၥိၭ,လၧအစူၪထွ့ၪလဂၩ, လၧအစူၪစ့ၪလဂၩလီၫ.",
			"39": "<sup>39</sup> ၦလဲးလီၩ့ လဲးထၪ့လဖၪဖျၭလၩ့အခိၪတၭ,ဒုၪဒွ့ၪဝ့ၫ",
			"40": "<sup>40</sup> နီၪ,- စံၭဝ့ၫဒၪ, ၦလၧအမၩလၩ့ဎီးဆၧလုအဂံၪ့တၭ, မၩထၪ့ထဲၩ့ဝ့ၫလၧၥၧၫ့နံၩအထးဖၧၩ့လဂၩဧ့, ထိးထဲၩ့ တၩ့ထဲၩ့ဒၪနၥၭဆံၭ. နအ့ၪ မွဲယွၩအဖိၪခွၫလဂၩတၭ,",
			"41": "<sup>41</sup> ဂဲၫထဲၩ့လၩ့လၧထုၪ့စူၪယၫအလီၩ့ဆံၭ.- ဘဲၫနီၪအၥိၭ ၦလုဆၧအဒိၪၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪ,ဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ",
			"42": "<sup>42</sup> နီၪ,ဒုၪဒွ့ၪဆ့တၭ,စံၭဝ့ၫဒၪ,- အဝ့ၫဒၪထိးထဲၩ့တၩ့ထဲၩ့ ၦအဂူၫဂၩၥံၪ, အ့ၪမွဲအနၫ့ဆါဒၪဝ့ၫနီၪ, ထိးထဲၩ့ တၩ့ထဲၩ့ဝ့ၫၥ့ၪအ့ၬ. အ့ၪမွဲၦအံၫစရ့လၭအစဎွၩတၭ, မွဲအဂဲၫထဲၩ့လၩ့ထဲၩ့ လၧထုၪ့စူၪယၫအလီၩ့ဆံၭ.ပမိ",
			"43": "<sup>43</sup> နဲၩထဲၩ့ပဝ့ၫလီၫ.- အဝ့ၫဒၪဒိၭနဲၩ့အၥၭလၧယွၩနီၪ တၭ,ယွၩအၥၭအ့ၪအီၪဝ့ၫ, မွဲအကွဲၪဖျါခွံၬဝ့ၫဘိၩ့နဲၪ့ ယီၩဆံၭ. အဂဲးဘဲၫယီၩ စံၭဝ့ၫ, ယမွဲယွၩအဖိၪ",
			"44": "<sup>44</sup> ခွၫလီၫ.- ၦထမျၬလၧအဘၪဆၧဖျၩထၪ့ဝ့ၫ လၧ အၥိၭ,လၧထုၪ့စူၪယၫ အလီၩ့နီၪဒုၪဒွ့ၪဝ့ၫဘဲၫနီၪၥိၭဆ့ လီၫ.",
			"45": "<sup>45</sup> လၧဎူၫနၩရံၩထီၩ့ လၧခွံၫနၩရံၩနီၪ, ဆၧခံၭဝ့ၫဒၪ",
			"46": "<sup>46</sup> လၧခးဖၧၩ့ထၧၫ့ဘံၪ့ယၫလီၫ.- ဘၪခွံၫနၩရံၩကၪယူၭ တၭ,ယ့ၫရှူၬကိၭၡၭထၪ့ လၧအလူဖၭဒိၪတၭ, စံၭဝ့ၫဒၪ, အံလဲၫ, အံလဲၫ လ့မၫစဘၭၥနဲၫ, ဘဲၫၦစံၭ ဆၧအၥိၭ, ယယွၩဧ့,ယယွၩဧ့,ဘၪနီၫလၧနစဲၪ့",
			"47": "<sup>47</sup> ဒၪယၧၩလဲၪ.- ၦလၧအဆၧၫ့ထုၪ့ထီးနီၪလနၩ့နၩ့ထီး အနါဂၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪအယီၩလဂၩကိၭထၪ့စအံၫ",
			"48": "<sup>48</sup> လဲယၫလီၫ.- ၦလဂၩထဲၩ့စဲၪ့တလဲးချဲၫ့မၬတၭ,မၩန့ ဎၧၩ့မၫဆမံၭလလီၪ့တၭ, စုၪလၩ့စီၪဝ့ၫလၧဆၧဆဲၪ့ ထံၫတၭ,ယူၬထၪ့ဝ့ၫလၧဖီးလဘီၩ့အခံၫတၭ, ဒုၭ",
			"49": "<sup>49</sup> အီၩဝ့ၫလီၫ.- အ့ၪမွဲၦဂူၫဂၩလဖၪစံၭဝ့ၫဒၪ, အီၪဒၪဝ့ၫ ဆံၭ.စအံၫလဲယၫမိဂဲၫ ထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫဆ့ဧၪး မွဲ",
			"50": "<sup>50</sup> ပယိခွါဒၪခလူၬဘီၪ.- ထီးနီၪလဖၧၫ့ ယ့ၫရှူၬကိၭၡၭ ထၪ့ဒီၭလၧ အလူဖၭဒိၪတၭ, ဖ့ၪလၫ့ခွံၬအၥၭလီၫ.",
			"51": "<sup>51</sup> ယိခွါ, ဆၧလုဂံၪ့အကလကၫယၬလၩ့လၧအခံၫ ထိၭဖိးလၩ့လၧအခၪ့ထံၭနံၫခီၫလီၫ. ဂၪ့ခိၪဝၭဝ့ၫတၭ,",
			"52": "<sup>52</sup> လိးမုလဲၫ့ဖၫ ထ့ဖိးထ့ဖၭခွံၬဝ့ၫဒၪလီၫ.- ဆၧၥွၪခိၪအ ဖၧၩ့လဖၪ ဝဲထၪ့အၥၭတၭ, ၦဆံၫ့ဎံၪလၧအမံၫဝ့ၫ",
			"53": "<sup>53</sup> အၪဂၩအစွၪၥံၪဂဲထုၪ့တၭ,- လၧယ့ၫရှူၬဂဲထုၪ့ထဲၩ့ အလးခဲၫ့နီၪဂဲၫထဲၩ့ထၪ့ဝ့ၫလၧဆၧၥွၪခိၪအဖၧၩ့တၭ, လ့ၩနုၬဝ့ၫလၧဒိၩ့ဆံၫ့ဎံၪအဖၧၩ့ တၭ, မၩဖျီၪထၪ့အ ၥၭလၧၦအၪဂၩအမ့ၬယၫလီၫ.",
			"54": "<sup>54</sup> ၦၥုၭဖိၪလယၩအခိၪလဂၩ, ဒဲၦအီၪလၧအၥိၭလဖၪ လၧအခိၭယ့ၫရှူၬနီၪ, ထီးအဒၪဘၪဂၪ့ခိၪဝၭ, ဒဲဆၧမၩ အၥၭလဖၪနီၪ, ၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫဒိၪမၬတၭ,စံၭဝ့ၫဒၪ,အ ယီၩလဂၩမွဲယွၩအဖိၪခွၫတၡါလီၫ.",
			"55": "<sup>55</sup> ၦမုၪၥံၪလၧအဖိၬယ့ၫရှူၬအခဲၫ့လၧဂၫလလံၫမၩ အခ့ၫအၡၩ အဆၧမၩအၪဂၩအီၪထီးနီၪတၭ, ယိစိၩ",
			"56": "<sup>56</sup> ဝ့ၫလၧအယဲၩ့လီၫ.- နးမၫရံၫမၭဂဒၫလံနံၫ, စယ့မံၭ ဒဲစယိစ့ၭအမိနးမၫရံၫ ဒဲစဇ့ၭဘဒံၫအဖိၪခွၫလဖၪ အမိနီၪအီၪဝ့ၫလၧအကျၩနီၪလီၫ.",
			"57": "<sup>57</sup> မုမ့ၬဂၪလၩ့နီၪၦၥထံၫအၫရမၫၥံအၫဖိၪ ကိၭဝ့ၫ အမံၩ့လၧစယိစ့ၭလၧအမွဲယ့ၫရှူၬအဖျဲလဂၩဆ့ ဂဲၫ",
			"58": "<sup>58</sup> ဝ့ၫလီၫ.- အဝ့ၫဒၪနီၪလ့ၩလၧစပဲလၭအအီၪတၭ, အၪ့ ကံၩ့န့ယ့ၫရှူၬအစွၪလီၫ. ထီးနီၪလဖၧၫ့စပဲလၭမၪလူၬ",
			"59": "<sup>59</sup> ဝ့ၫဘဲၫၦမိဖ့ၪလၫ့ထဲၩ့အစွၪနီၪအၥိၭလီၫ.- စယိစ့ၭ မၩန့အစွၪနီၪတၭ, ဘီၪ့ထၬဝ့ၫလၧဆၧဘွၩအဖျ့ၫလံၬ",
			"60": "<sup>60</sup> ကံၭ,- အီၪက့ၪလၩ့ဝ့ၫ လၧအဆၧၥွၪခိၪဒၪဝ့ၫအၥၫ့ လၧအချိၬန့ဝ့ၫလၧလိးအဖၧၩ့နီၪလီၫ. ချံးစိၩလိးဖၭဒိၪ",
			"61": "<sup>61</sup> လဖျိၪ့လၧဆၧၥွၪခိၪအဖၧၩ့ခိၪထိၭဂီၩ့တၭ, ထဲၩ့ထဲၩ့ ဝ့ၫလီၫ.- နးမၫရံၫမၭဂဒၫလံနံၫ, ဒဲနးမၫရံၫအဂူၫဂၩ လဂၩနီၪ,ဆၧၫ့နၩ့ဎၩ့လၧဆၧၥွၪခိၪနီၪလီၫ.",
			"62": "<sup>62</sup> မုနံၩတဲၩ့ဝဲၩဆၧဖီၩ့ခွံၬ လၧဆၧဖၩ့ထၪ့ဒီၭလနံၩနီၪ ၦလုဆၧအဒိၪၥံၪ, ဒဲၦဖၫရစံၫၥံၪအီၪကီၪ့ဝ့ၫ လၧစပဲ",
			"63": "<sup>63</sup> လၭအအီၪတၭ,- စံၭဝ့ၫဒၪ, ကဆါဧ့,ပနၪ့ထၪ့ထဲၩ့လၧ ၦအၪ့လီၫဆၧလဂၩနီၪလၧအမၧၫ့ဒံၭအဘိၩ့ဘၭစံၭ ဝ့ၫဒၪ,ၥၧၫ့နံၩလနံၩအ့ၪဘၪတၭ, ယမိဂဲထုၪ့ထဲၩ့လီၫ.",
			"64": "<sup>64</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭၦမိမၩထၬ ဆၧၥွၪခိၪ အဖၧၩ့ထီးအဘၪၥၧၫ့နံၩလနံၩနီၪ, မၪလူၬလါဆံၭ. ဘၪလဘၪအထံၩအဖျဲၥံၪ မိဂဲၫအၪ့ဂူၪန့ဘၪခိၬဝ့ၫ ဎလၧ မုနၩလခီၫၭ တၭ, မိစံၭၦခမျၧး လၧအဂဲထုၪ့ထဲၩ့လၧ ဆၧၥံၫအဖၧၩ့နီၪ, ဆၧအၪ့လီၫလၧခဲၫ့ မိနၭနဲၪ့ဆၧလၧ",
			"65": "<sup>65</sup> အခၪ့ထံၭနီၪဒံၭလီၫ.- စပဲလၭစံၭအဝ့ၫၥံၪ, နၥံၪဝ့ၫ ဒၪယီၩနၥံၪအၡၩခိၭဆၧအီၪယူၭလဒီၪ့ယူၭ, ထဲၩ့ခွံၬ",
			"66": "<sup>66</sup> မၩထၬဆၧဘဲၫနၥံၪၥ့ၪယၫအၥိၭဆံၭ.- အဝ့ၫၥံၪလ့ၩ မၩထၬဆၧၥွၪခိၪအဖၧၩ့နီၪ, စဲၩနဲၪ့ထၬလိးတၭအီၪက့ၪ ၦခိၭဆၧၥံၪလဒီၪ့လီၫ."
		},
		"28": {
			"1": "<sup>1</sup> လၧမးၥံၫအနံၩအလးခဲၫ့လၧမုနံၩအခၪ့ထံၭ ဆၧ ဖၩ့ထၪ့လၧဂီၩနၪခုၬနီၪ, နးမၫရံၫမၭဂဒလံနံၫ,ဒဲနး",
			"2": "<sup>2</sup> မၫရံၫအဂူၫဂၩနီၪ လ့ၩယိဆၧၥွၪခိၪနီၪလီၫ.- ယိခွါ, ဂၪ့ခိၪဝၭဝ့ၫဆီၪ့ဆီၪ့လ့ၬနီၪ, အဂဲးဘဲၫယီၩ ယွၩအၥီၫ့ ဂဲၫလၩ့လၧမူၭခိၪတၭ, ဂဲၫချံးခွံၬလိးတၭ, ဆၧၫ့နၩ့ဝ့ၫ",
			"3": "<sup>3</sup> လၧအဖၫ့ခိၪနီၪလီၫ.- အခံးအဂၩ့မၩအၥၭဘဲၫလၫ့ဝဲ အဒံၭအၥိၭနီၪတၭ, အကီၩ့အၥိၭဘွၩဝ့ၫဘဲၫမူၭခိၪ",
			"4": "<sup>4</sup> ဖီၫအၥိၭလီၫ.- ၦခိၭဆၧၥံၪလၧအၥၭမဲၪ အဝ့ၫဒၪအ ကၠီၩ့နီၪ,ဝၭထိၬဝၭတ့ၭတၭ, ကဲၪထၪ့ဝ့ၫဘဲၫၦၥံၫအၥိၭ",
			"5": "<sup>5</sup> လီၫ.- အၥီၫ့လဂၩချဲၩ့ဆၧၫ့ဆၧတၭစံၭၦမုၪလဖၪ နီၪ,ထီးၥၭမဲၪနၥံၪလဂ့ၩ, အဂဲးဘဲၫယီၩယၥ့ၪယၫ လၧနၥံၪအၪ့ဎၬ ယ့ၫရှူၬလၧဆၧဖျၩထၪ့ဝ့ၫ လၧထုၪ့စူၪ",
			"6": "<sup>6</sup> ယၫအလီၩ့နီၪလီၫ.- အဝ့ၫဒၪအီၪလၧၩ့ထီးယီၩအ့ၬ, အဂဲးဘဲၫယီၩ ဘဲၫအစံၭဝဲၩဝ့ၫအၥိၭနီၪ, မွဲအဂဲထုၪ့ ထဲၩ့ယူၭတၭ,ဂဲၫယိခွါအလးလၧကဆါမံၫနၩ့ထီး",
			"7": "<sup>7</sup> ယီၩဘီၪ.- ထဲၩ့ချဲၫ့ချဲၫ့တၭလီၩဘၪ အထံၩအဖျဲၥံၪလၧ အဂဲထုၪ့ထဲၩ့လၧဆၧၥံၫအဖၧၩ့ယူၭ. ယိခွါ, အဝ့ၫဒၪ လ့ၩဝဲၩဝ့ၫ လၧနၥံၪအမ့ၬယၫ လၧဂၫလလံၫနီၪလီၫ. နၥံၪမိဒၪဘၪအဝ့ၫထီးနီၪလီၫ. ယိခွါ,ယလီၩဘၪ ယူၭနၥံၪယူၭ.",
			"8": "<sup>8</sup> အဝ့ၫၥံၪၥၭမဲၪၥၭဖျဲၩ့, ဒဲၥုၪ့ထိၬၥၭထိၬဒိၪမၬတၭ, စဲၪ့ထၪ့ခွံၬချဲၫ့ချံၭ လၧဆၧၥွၪခိၪအအီၪတၭ, ထဲၩ့စဲၪ့ တလဲးဘဲၫအမိလီၩဘၪ အထံၩအဖျဲၥံၪအၥိၭလီၫ.",
			"9": "<sup>9</sup> တၭ,ယိခွါ, ယ့ၫရှူၬဘၪခီၩ့လိၬအၥၭ လၧအဝ့ၫၥံၪနီၪ, စံၭဝ့ၫဒၪ,မွဲနၥံၪဘၪဆၧအမုၬဆံၭ. ၦမုၪလဖၪလ့ၩ",
			"10": "<sup>10</sup> ဖိၬထၬဝ့ၫအခၪ့တၭ, ဘိၪ့ထၪ့ဘၩထၪ့အဝ့ၫလီၫ.- ထီး နီၪလဖၧၫ့, ယ့ၫရှူၬစံၭအဝ့ၫၥံၪ, ထီးၥၭမဲၪၥၭဖျဲၩ့လဂ့ၩ, လ့ၩလီၩဘၪယထၧၫ့ဖုဝဲၥံၪဘဲၫအမိလ့ၩလၧဂၫလ လံၫအၥိၭနီၪဆံၭ. အဝ့ၫၥံၪမိဒၪဘၪယၧၩထီးနီၪလီၫ.",
			"11": "<sup>11</sup> အဝ့ၫၥံၪထဲၩ့ဝ့ၫအဘိၩ့ဘၭတၭ, ယိခွါ, ၦခိၭဆၧၥံၪ လနၩ့နၩ့ထဲၩ့ထဲၩ့ လၧဒိၩ့ဖၧၩ့တၭ, လီၩဘၪၦလုဆၧ",
			"12": "<sup>12</sup> အဒိၪၥံၪ လၧကယဲဆၧမၩအၥၭထီးအလူၬလီၫ- ထီး အဝ့ၫၥံၪအီၪကီၪ့ လၧၦၥုၪ့က့ၭၥၭၡါၥံၪ အၥိၭနီၪ,ကိၪ့ ထၪ့လိၬအၥၭဂီၩ့တၭ, ဖ့ၪလၫ့ၦၥုၭဖိၪလဖၪနီၪ လၧစ့ၩ",
			"13": "<sup>13</sup> အၪအၪလ့ၬ,- စံၭဝ့ၫဒၪ, စံၭနၥံၪဝ့ၫလၧအထံၩအဖျဲၥံၪ ဂဲၫလၧမုနၩလခီၫတၭ,အၪ့ဂူၪန့ဝ့ၫလၧၦမံၫမၪအ",
			"14": "<sup>14</sup> ဘိၩ့ဘၭနီၪဆံၭ.- ၦဒိၪဖၭဒိၪအ့ၪနါဂၧၫ့ဆၧနီၪ, ၦမိ အၪ့လွ့ၫဒၪအဝ့ၫတၭ, မၩဖီၩ့ဖျ့ၭနၥံၪလီၫ.-",
			"15": "<sup>15</sup> အဝ့ၫၥံၪ မၩန့စ့ၩတၭ,မၩဝ့ၫဘဲၫ ဆၧၥီၪ့လိၪဝ့ၫအၥိၭနီၪလီၫ. တၭအဆၧချဲၩ့ယီၩ ဂၧၫ့ထၪ့ၥၩလၩ့ဝ့ၫလၧ ၦယုဒၫဖိၪ အကျၩ ခီးမုလနံၩယီၩ နီၪလီၫ.",
			"16": "<sup>16</sup> အထံၩအဖျဲဆံၫလဂၩၥံၪလ့ၩလၧဂၫလလံၫအ",
			"17": "<sup>17</sup> ခိၪလီၩ့ လၧယ့ၫရှူၬဖၭဝဲၩအလးလီၫ.- အဝ့ၫၥံၪဒၪဘၪ ဝ့ၫတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫဒၪလီၫ. မွဲလါနၫ့ဘိၩ လနၩ့နၩ့အၥၭဂံၩ့ဂၩ့ဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ယ့ၫရှူၬဂဲၫစိၩဝ့ၫ, ချဲၩ့ဆၧလၧအဝ့ၫၥံၪတၭ, စံၭဝ့ၫ ဒၪ,ဆၧဖ့ၪလၫ့ယူၭယၧၩ လၧကယဲဆၧအစီၩ့အမၩ့လၧ မူၭခိၪအဖၧၩ့, ဒဲလၧဂၪ့ခိၪချိၫ့ယီၩထီးအလူၬလီၫ.",
			"19": "<sup>19</sup> အခိးမွဲဘဲၫနီၪတၭ, လ့ၩဘီၪ,ဒုၭကဲၪထၪ့ၦကိၭ ဆၨၩဒ့ၭၥံၪလၧဆၧအထံၩအဖျဲဆံၭ.ဘၭတံၫဇၫ့အ ဝ့ၫၥံၪလၧဖါ,ဒဲဖိၪခွၫ,ဒဲၥၭမုဆံၫ့ဎံၪအမံၩ့အဖၧၩ့ဆံၭ.",
			"20": "<sup>20</sup> ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫၥံၪဘဲၫၥိၭအမိထီးန့ ကယဲ ဆၧလၧယမၪလူၬဝဲၩ နၥံၪထီးအလူၬနီၪဆံၭ. ယိခွါ, ယအီၪလၧနၥံၪအၥိၭ ကိၭမုနံၩမုနၩဒ့ၭထီးဂၪ့ခိၪ ယီၩအထုၬလီၫ. အၩမံၩ့."
		}
	}
};
module.exports = book;